$.abo=H.b(["Adana, T\xfcrkiye'nin bir ili ve en kalabal\u0131k alt\u0131nc\u0131 \u015fehridir. 2019 y\u0131l\u0131 verilerine g\xf6re 2.258.718 n\xfcfusa sahiptir. \u0130lin y\xfcz \xf6l\xe7\xfcm\xfc 13.844 km2'dir. \u0130lde km2'ye 160 ki\u015fi d\xfc\u015fmektedir. (Bu say\u0131 en \xe7ok Seyhan il\xe7esinde 1787 ki\u015fidir.)01.02.2018 T\xdc\u0130K verilerine g\xf6re 5'i merkez il\xe7e (Seyhan, Y\xfcre\u011fir, \xc7ukurova, Sar\u0131\xe7am, Karaisal\u0131) olmak \xfczere toplam 15 \u0130l\xe7esi ve belediyesi vard\u0131r. Bu il\xe7elerde 831 mahalle bulunmaktad\u0131r.T\xfcrkiye'deki alt\u0131nc\u0131 b\xfcy\xfck metropolitan alan olup \xfclkenin \xf6nde gelen bir tar\u0131m, ticaret ve k\xfclt\xfcr merkezidir. T\xfcrkiye'deki maden zengini 4. b\xf6lge olan Adana; krom, demir, manganez, kur\u015fun ve \xe7inko yataklar\u0131 a\xe7\u0131s\u0131ndan \xf6nem ta\u015f\u0131maktad\u0131r.Adana'n\u0131n merkezi; Mersin, Adana, Osmaniye ve Hatay illerini kapsayan co\u011frafi, ekonomik ve k\xfclt\xfcrel bir b\xf6lge olan \xc7ukurova'n\u0131n merkezinde bulunur. Yakla\u015f\u0131k 6,33 milyon insana ev sahipli\u011fi yapan b\xf6lgenin b\xfcy\xfck bir b\xf6l\xfcm\xfc, tar\u0131ma olduk\xe7a elveri\u015fli, geni\u015f ve d\xfcz bir arazidir.","Ad\u0131yaman, T\xfcrkiye'nin G\xfcneydo\u011fu Anadolu B\xf6lgesinde bulunan bir ilidir. \u0130dari merkezi Ad\u0131yaman \u015fehridir.\u0130l n\xfcfusu T\xfcrkiye \u0130statistik Kurumu 2021 verilerine g\xf6re 632.459'dur. Bu n\xfcfusun %86,51'i \u015fehirlerde ya\u015famaktad\u0131r. \u0130l s\u0131n\u0131rlar\u0131 i\xe7erisinde 1 \xfcniversite bulunmaktad\u0131r; Ad\u0131yaman \xdcniversitesi. \u0130lin y\xfcz\xf6l\xe7\xfcm\xfc 7337 m\xb2'dir. \u0130lde km\xb2'ye 85 ki\u015fi d\xfc\u015fmektedir. (Bu say\u0131 merkez il\xe7ede 168'dir.) \u0130l merkezinin denizden y\xfcksekli\u011fi: 701 m.'dir.2020 y\u0131l\u0131nda T\xdc\u0130K verilerine g\xf6re merkez il\xe7eyle beraber 9 \u0130l\xe7e, 23 belediye, bu belediyelerde 173 mahalle ve ayr\u0131ca 453 k\xf6y\xfc vard\u0131r.","Afyonkarahisar, eski ve halk aras\u0131ndaki ismiyle Afyon, ayn\u0131 isimli ilin merkezidir. Mermercilik ve g\u0131da sekt\xf6r\xfcnde T\xfcrkiye i\xe7inde ve d\u0131\u015f\u0131nda isim yapm\u0131\u015ft\u0131r. \u015eehrin Afyon olan ismi, 2005 y\u0131l\u0131nda Afyonkarahisar olarak de\u011fi\u015ftirilmi\u015ftir.","A\u011fr\u0131 (eski ismi: Karak\xf6se), T\xfcrkiye'nin Do\u011fu Anadolu B\xf6lgesi'nde bulunan \u015fehir ve A\u011fr\u0131 ilinin merkez il\xe7esi. Ayr\u0131ca tarihte birden fazla isim de\u011fi\u015fikli\u011fi ya\u015fam\u0131\u015ft\u0131r. Karakilise, Ararat, Karak\xf6se ve son olarak A\u011fr\u0131 Da\u011f\u0131'ndan esinlenilerek A\u011fr\u0131 ismi verilmi\u015ftir. Bu \u015fehrin rak\u0131m\u0131 1.632 m'dir. A\u011fr\u0131 Ovas\u0131'n\u0131n kuzeyinde kurulmu\u015ftur. \xc7ok so\u011fuk bir iklimi olup ormanl\u0131k alan\u0131 azd\u0131r. Halk\u0131n b\xfcy\xfck \xe7o\u011funlu\u011fu tar\u0131m ve hayvanc\u0131l\u0131kla u\u011fra\u015fmaktad\u0131r. 15 Nisan \u0130\u015fgalden Kurtulu\u015f G\xfcn\xfc olarak kutlan\u0131r","Amasya, Karadeniz B\xf6lgesi'nde Amasya ilinin merkez il\xe7esidir. 2019 itibar\u0131yla Amasya (merkez il\xe7e) 150.828 n\xfcfusa sahiptir. Orta Karadeniz B\xf6l\xfcm\xfc'nde yer al\u0131r. Anadolu'nun eski yerle\u015fim alanlar\u0131ndan biridir. Hititlerden ba\u015flayarak \xe7e\u015fitli uygarl\u0131klar\u0131n merkezi olmu\u015ftur. Kentin bilinen en eski ad\u0131, s\xf6ylendi\u011fi bi\xe7imi ile g\xfcn\xfcm\xfcze kadar hi\xe7bir de\u011fi\u015fikli\u011fe u\u011framadan gelen Amasya\u2019d\u0131r. Eski kay\u0131tlarda ve buluntularda Amesseia - Amacia - Amaccia ismi okunmaktad\u0131r. Amasya isminin a\xe7\u0131k bir \u015fekilde okundu\u011fu, Pers, Pontos ve Roma \u0130mparatorlu\u011fu d\xf6nemlerinde ticarette kullan\u0131lan g\xfcm\xfc\u015f ve bronz sikkeler (paralar) \xfczerinde g\xf6rmek m\xfcmk\xfcnd\xfcr.Baz\u0131 sikkeler \xfczerinde Amaccia veya Amacia isimlerine rastlan\u0131lmaktad\u0131r. Amasya\u2019n\u0131n fethinden \xf6nce ve sonras\u0131nda da T\xfcrkler, Amasseia\u2019y\u0131 veya Amaccia, Amacia T\xfcrk\xe7ede s\xf6ylendi\u011fi gibi Amasya yapm\u0131\u015flard\u0131r.[kaynak belirtilmeli]Tahminen M\xd6 60 ve MS 19. y\u0131llarda Amasya'da do\u011fdu\u011fu bilinen ve Co\u011frafya ilminin mucidi olarak tan\u0131nan Strabon, yazd\u0131\u011f\u0131 \xfcnl\xfc co\u011frafya kitab\u0131nda Amasya\u2019dan Amasseia olarak s\xf6z etmektedir.","Ankara, T\xfcrkiye'nin ba\u015fkenti ve en kalabal\u0131k ikinci ilidir.[6] N\xfcfusu 2020 itibar\u0131yla 5.663.322 ki\u015fidir. Bu n\xfcfus; 25 il\xe7e ve bu il\xe7elere ba\u011fl\u0131 1425 mahallede ya\u015famaktad\u0131r. \u0130l genelinde n\xfcfus yo\u011funlu\u011fu 215'tir. N\xfcfuslar\u0131na g\xf6re \u015fehirler listesinde belediye s\u0131n\u0131rlar\u0131 g\xf6z \xf6n\xfcne al\u0131narak yap\u0131lan s\u0131ralamaya g\xf6re d\xfcnyada ise elli yedinci s\u0131rada yer almaktad\u0131r. Co\u011frafi olarak T\xfcrkiye'nin merkezine yak\u0131n bir konumda bulunur ve Bat\u0131 Karadeniz B\xf6lgesi'nde kalan kuzey kesimleri hari\xe7, b\xfcy\xfck b\xf6l\xfcm\xfc \u0130\xe7 Anadolu B\xf6lgesi'nde yer al\u0131r. Y\xfcz \xf6l\xe7\xfcm\xfc olarak \xfclkenin \xfc\xe7\xfcnc\xfc b\xfcy\xfck ilidir. Bolu, \xc7ank\u0131r\u0131, K\u0131r\u0131kkale, K\u0131r\u015fehir, Aksaray, Konya ve Eski\u015fehir illeri ile \xe7evrilidir.","Antalya, T\xfcrkiye'nin bir ili ve en kalabal\u0131k be\u015finci \u015fehridir. 2020 sonu itibar\u0131yla il n\xfcfusu 2.548.308'd\u0131r. T\xfcrkiye'de turizmin ba\u015fkenti olarak g\xf6r\xfclmektedir. \u015eehrin y\xfcz \xf6l\xe7\xfcm\xfc 20.177 km2dir. \u0130lde km2ye 115 ki\u015fi d\xfc\u015fmektedir. En kalabal\u0131k il\xe7esi 2019 y\u0131l\u0131 itibar\u0131yla 556.033 ki\u015fiyle Kepez il\xe7esidir. N\xfcfus yo\u011funlu\u011funun en fazla oldu\u011fu il\xe7e ise km2 ba\u015f\u0131na 5067 ki\u015fi ile Muratpa\u015fa'd\u0131r. 19 il\xe7e ve belediye, bu belediyelerde toplam 910 mahalle bulunmaktad\u0131r.Tamam\u0131 Akdeniz B\xf6lgesi'nin bat\u0131s\u0131nda yer al\u0131r ve Antalya K\xf6rfezi'yle Bat\u0131 Toroslar\u0131n aras\u0131nda kurulmu\u015ftur. Y\xfcz \xf6l\xe7\xfcm\xfc bak\u0131m\u0131ndan T\xfcrkiye'nin be\u015finci b\xfcy\xfck ilidir. G\xfcneyinde Akdeniz, bat\u0131s\u0131nda Mu\u011fla, kuzeyinde Burdur ve Isparta, kuzeydo\u011fusunda Konya, do\u011fusunda ise Karaman ve Mersin illeri vard\u0131r.Antalya \u015fehri, 1980 y\u0131l\u0131ndan sonra uygun iklim ko\u015fullar\u0131 ve turizm etkinlikleri nedeniyle h\u0131zla geli\u015fmi\u015f ve buna paralel olarak il de g\xfcn\xfcm\xfczde T\xfcrkiye'nin en kalabal\u0131k be\u015finci ili olmu\u015ftur. Antalya'da ekonomik hayat b\xfcy\xfck oranda ticaret, tar\u0131m ve turizme dayal\u0131d\u0131r.Antalya ilinin kapsad\u0131\u011f\u0131 b\xf6lge tarih \xf6ncesinden g\xfcn\xfcm\xfcze dek pek \xe7ok medeniyeti bar\u0131nd\u0131rm\u0131\u015ft\u0131r ve T\xfcrkiye'de en \xe7ok antik kent bulunan ildir. S\u0131ras\u0131yla Likyal\u0131lar, Lidyal\u0131lar, Pamfilyal\u0131lar, Bergamal\u0131lar, Romal\u0131lar, Bizansl\u0131lar, Sel\xe7uklular, Osmanl\u0131lar ve son olarak da T\xfcrkiye Cumhuriyeti hakimiyetinde bulunan Antalya bu medeniyetlerin hi\xe7birine ba\u015fkentlik yapmam\u0131\u015ft\u0131r,\u0130lin tamam\u0131 Akdeniz B\xf6lgesi'nin Antalya B\xf6l\xfcm\xfc'nde yer al\u0131r ve Akdeniz ikliminin etki sahas\u0131ndad\u0131r. Yerle\u015fim yerleri haricindeki il topraklar\u0131n\u0131n b\xfcy\xfck k\u0131sm\u0131 tah\u0131l tarlalar\u0131yla kapl\u0131 platolardan olu\u015fur.T\xfcrk Silahl\u0131 Kuvvetleri Kara Kuvvetleri Komutanl\u0131\u011f\u0131na ba\u011fl\u0131 3. Piyade E\u011fitim Tugay\u0131 Komutanl\u0131\u011f\u0131 ve Hava Kuvvetleri Komutanl\u0131\u011f\u0131na ba\u011fl\u0131 Hava Meydan Komutanl\u0131\u011f\u0131 Antalya'da bulunmaktad\u0131r.Antalya 2015 y\u0131l\u0131 G20 Zirvesi'nin ve Expo 2016'n\u0131n ev sahibidir.","T\xfcrkiye'nin Karadeniz B\xf6lgesi'nin do\u011fu ucunda bulunan bir \u015fehirdir ve Artvin ilinin merkezidir.Artvin, Orta \xc7a\u011f'da G\xfcrcistan'\u0131n b\xf6lgelerinden biri olan Klarceti'deki yerle\u015fmelerden biriydi. \xd6nemli yollar\u0131n ge\xe7ti\u011fi bir kav\u015fakta yer al\u0131yordu. Bir yandan Erzurum, Bayburt, Ardahan ve Ardanu\xe7'a, di\u011fer yandan Batum ve Hopa'ya a\xe7\u0131l\u0131yordu. \u015eehir ayr\u0131ca \xc7oruh Havzas\u0131'nda Artvin ile Batum aras\u0131ndaki su yoluyla ta\u015f\u0131mac\u0131l\u0131\u011f\u0131n iskelelerinden biriydi.","Ayd\u0131n, T\xfcrkiye'nin bir ili ve en kalabal\u0131k yirminci \u015fehridir. Ege B\xf6lgesi'nde yer alan, turizm ve tar\u0131m a\xe7\u0131s\u0131ndan en geli\u015fmi\u015f illerdendir. Kuzeyinde \u0130zmir, kuzeydo\u011fusunda Manisa, do\u011fusunda Denizli, g\xfcneyinde Mu\u011fla illeri, bat\u0131s\u0131nda Ege Denizi bulunmaktad\u0131r. 2019 itibar\u0131yla 1.110.972 ki\u015filik n\xfcfusuyla Ege B\xf6lgesi'nin \xfc\xe7\xfcnc\xfc b\xfcy\xfck ilidir. On yedi il\xe7esi vard\u0131r.","Bal\u0131kesir, T\xfcrkiye'nin bir ili ve en kalabal\u0131k on yedinci \u015fehri. Marmara B\xf6lgesi'nin G\xfcney Marmara B\xf6l\xfcm\xfc'nde, topraklar\u0131n\u0131n bir k\u0131sm\u0131 ise Ege B\xf6lgesi'nde yer alan ilin hem Marmara hem de Ege Denizi'ne k\u0131y\u0131s\u0131 bulunur. T\xfcrkiye genelinde ise iki deniz ile kom\u015fu olan sadece 6 il vard\u0131r.[4] \u0130l, Kuzeybat\u0131 Anadolu'da bulunmaktad\u0131r. Do\u011fusunda Bursa ve K\xfctahya illeri, g\xfcneyinde Manisa ve \u0130zmir illeri ve bat\u0131s\u0131nda \xc7anakkale ili vard\u0131r.[5] Ayval\u0131k il\xe7esinden de Yunanistan'\u0131n Midilli Adas\u0131'na kom\u015fudur.[6]2019 Y\u0131l\u0131 verilerine g\xf6re n\xfcfusu 1.228.620\u2019dir.[7] \u0130lin y\xfcz \xf6l\xe7\xfcm\xfc 14.583 m\xb2'dir. \u0130lde km\xb2'ye 82 ki\u015fi d\xfc\u015fmektedir. Yo\u011funlu\u011fun en fazla oldu\u011fu il\xe7e, 254 ki\u015fi ile Karesi'dir. \u0130lin denizden y\xfcksekli\u011fi 145 metredir. 2016 y\u0131l\u0131nda T\xdc\u0130K verilerine g\xf6re 20 il\xe7e ve belediye, bu belediyelerde toplam 1129 mahalle bulunmaktad\u0131r.Tarihte genellikle Misya ve Karesi adlar\u0131yla bilinen Bal\u0131kesir y\xf6resi, zamanla Roma, Bizans, Anadolu Sel\xe7uklu, Karesi Beyli\u011fi ve Osmanl\u0131 egemenli\u011finde kalm\u0131\u015ft\u0131r. Temel ge\xe7im kayna\u011f\u0131 tar\u0131m ve hayvanc\u0131l\u0131k olup bamya, b\xf6r\xfclce, kavun, zeytin, zeytinya\u011f\u0131, kelle peyniri gibi zirai \xfcr\xfcnleri ile ayr\u0131ca daha \xe7ok yerli turizmde \xf6ne \xe7\u0131kan sahil kasabalar\u0131yla me\u015fhurdur. Ya\u011fc\u0131bedir hal\u0131s\u0131, kolonyas\u0131, kaymakl\u0131s\u0131, kozak \xfcz\xfcm\xfc, ayval\u0131k tostu, susurluk ayran\u0131, sa\xe7akl\u0131 mant\u0131s\u0131 ve h\xf6\u015fmerimi di\u011fer bilinen y\xf6resel \xfcr\xfcnleridir.T\xfcrk Silahl\u0131 Kuvvetleri Hava Kuvvetleri Komutanl\u0131\u011f\u0131'n\u0131n ilk jet \xfcss\xfc olan 9. Ana Jet \xdcs Komutanl\u0131\u011f\u0131 ile 6. Ana Jet \xdcs Komutanl\u0131\u011f\u0131 Bal\u0131kesir'de bulunmaktad\u0131r.","Bilecik, Bilecik ilinin merkezi olan il\xe7edir. T\xfcrkiye'nin Marmara B\xf6lgesi'nin G\xfcney Marmara B\xf6l\xfcm\xfc'nde kalmaktad\u0131r.","Bing\xf6l ismi Erzurum - Mu\u015f s\u0131n\u0131r\u0131nda Varto il\xe7esinde yer alan Bing\xf6l Da\u011f\u0131'ndan gelmektedir. 1944'e kadar \xc7apak\xe7ur ismi resmi olarak kullan\u0131lm\u0131\u015ft\u0131r. \xc7apak\xe7ur Kalesi sarp ve da\u011fl\u0131k m\u0131nt\u0131kada oldu\u011fundan, kent merkezi belirsiz bir tarihte dere yata\u011f\u0131ndaki \xc7olig veya \xc7ewlig mevkine ta\u015f\u0131nd\u0131. 16. y\xfczy\u0131ldan beri T\xfcrk\xe7e bi\xe7imiyle kaydedilmi\u015f olan Bing\xf6l Da\u011f\u0131'n\u0131n ad\u0131 4 Ocak 1936'da kurulan Bing\xf6l iline, 13 Aral\u0131k 1944'te ise il merkezi olan \xc7olik (\xc7apak\xe7ur) kasabas\u0131na verildi.","Bitlis ilinin merkezi olan \u015fehirdir. Merkez il\xe7eye ba\u011fl\u0131 \xfc\xe7 bucak vard\u0131r. Do\u011fu Anadolu B\xf6lgesi'nde yer alan Bitlis'i, g\xfcneyden Siirt, bat\u0131dan Mu\u015f, kuzeyden A\u011fr\u0131 illeri ve do\u011fudan Van G\xf6l\xfc \xe7evreler. Bitlis, Kaleleri ve \u0130slam eserleriyle \xf6nemli bir ildir.","T\xfcrkiye y\xfcz\xf6l\xe7\xfcm\xfcn\xfcn %1,015'lik b\xf6l\xfcm\xfcn\xfc kaplayan Bolu \u0130li, 8,276 km\xb2 (827,600 ha) y\xfcz\xf6l\xe7\xfcm\xfc ile Karadeniz B\xf6lgesi\u2019nin Bat\u0131 Karadeniz b\xf6l\xfcm\xfcnde yer al\u0131r. \u0130l arazisinin yakla\u015f\u0131k %18\u2019ini tar\u0131m alanlar\u0131 olu\u015fturmaktad\u0131r. Orman alanlar\u0131 ise %64\u2019l\xfck bir oran ile T\xfcrkiye ormanlar\u0131 i\xe7inde %2,55\u2019lik paya sahiptir. \xc7ay\u0131r ve meralar\u0131n kaplad\u0131\u011f\u0131 alan yakla\u015f\u0131k %15\u2019tir. Geriye kalan %8 dolay\u0131nda alan ise tar\u0131m d\u0131\u015f\u0131 alanlard\u0131r.Ortalama rak\u0131m 1000 m, merkez il\xe7e rak\u0131m\u0131 ise 725 m civar\u0131ndad\u0131r. Matematiksel konum a\xe7\u0131s\u0131ndan 30 derece 32 dakika - 32 derece 36 dakika Do\u011fu boylamlar\u0131 ile 40 derece 06 dakika - 41 derece 01 dakika Kuzey enlemleri aras\u0131ndad\u0131r.","Burdur, Burdur ilinin merkez il\xe7esidir. Burdur ili merkez il\xe7esi alt\u0131 mahalleden olu\u015fmaktad\u0131r. Akdeniz B\xf6lgesi \u015fehridir.","Bursa, T\xfcrkiye'nin bir ili ve en kalabal\u0131k d\xf6rd\xfcnc\xfc \u015fehri. 2020 itibar\u0131yla 3.101.833 n\xfcfusa sahiptir. 2016 D\xfcnya Ya\u015fanabilir \u015eehirler s\u0131ralamas\u0131nda D\xfcnya'da 28[3]. T\xfcrkiye'de 1. s\u0131rada yer almaktad\u0131r. Marmara B\xf6lgesinin G\xfcney Marmara b\xf6l\xfcm\xfcnde, 40\xb0 bat\u0131 boylam ve 29\xb0 kuzey enlem daireleri aras\u0131nda yer al\u0131r. Eski ad\u0131 H\xfcdavendig\xe2r'd\u0131r. Kuzeyinde Marmara Denizi ve Yalova, kuzeydo\u011fuda Kocaeli ve Sakarya, do\u011fuda Bilecik, g\xfcneyde K\xfctahya ve bat\u0131da Bal\u0131kesir illeri ile \xe7evrilidir.Ekonomik a\xe7\u0131dan T\xfcrkiye'nin en geli\u015fmi\u015f kentlerinden biri olan Bursa do\u011fal ve tarihsel zenginlikleriyle de \xf6nem ta\u015f\u0131r. Bursa'da en \xe7ok Osmanl\u0131 \u0130mparatorlu\u011fu'nun kurulu\u015f d\xf6nemine ait tarih\xee eserlerin bulunmas\u0131n\u0131n sebebi ise, Bursa'n\u0131n Osmanl\u0131 Devleti'nin ilk ba\u015fkenti olmas\u0131d\u0131r. Bursa al\u0131\u015fveri\u015f merkezleri, parklar\u0131, m\xfczeleri ve \xe7ar\u015f\u0131s\u0131yla b\xf6lgede \xf6ne \xe7\u0131kar. Ayr\u0131ca Bursa Marmara b\xf6lgesinin \u0130stanbul'dan sonra gelen ikinci b\xfcy\xfck \u015fehridir. T\xfcrkiye'nin en \xf6nemli birka\xe7 sanayi kentinden biridir. \u015eehir \u0130stanbul'dan sonra en b\xfcy\xfck ikinci ihracat\u0131 ger\xe7ekle\u015ftirmektedir. \u015eehrin futbol tak\u0131m\u0131 Bursaspor 2009-10 sezonunda S\xfcper Lig \u015fampiyonudur.Bursa, sanayi istatistiklerine g\xf6re T\xfcrkiye'nin en b\xfcy\xfck sanayi kenti ve otomotiv \xfcretim merkezidir. CNN International taraf\u0131ndan T\xfcrkiye'nin Detroit'i yak\u0131\u015ft\u0131rmas\u0131 yap\u0131lm\u0131\u015ft\u0131r. Tofa\u015f-Fiat, Renault, Bosch, Peugeot, Karsan Otomotiv, binek otomobil ve ticari ara\xe7lar ile Cobra G\xfclery\xfcz otob\xfcs fabrikalar\u0131 Bursa'da bulunmaktad\u0131r. Bursa'n\u0131n otomotiv sanayinin T\xfcrkiye'de merkezi olmas\u0131ndan dolay\u0131 kurulan Bursa Otomobil M\xfczesi yine bu \u015fehirde bulunmaktad\u0131r.","\xc7anakkale'nin \u015fu anki bulundu\u011fu yerin ad\u0131 19. y\xfczy\u0131lda Kale-i Sultaniye olarak ge\xe7mektedir ve bu isim 1890 y\u0131l\u0131nda \u015fehrin resm\xee ad\u0131 olarak kay\u0131tlara ge\xe7mi\u015ftir.[2] \xc7anakkale Osmanl\u0131 zaman\u0131nda \xf6nemli bir kale i\u015flevi g\xf6rm\xfc\u015f olup, Kale-i Sultaniye (Osmanl\u0131 T\xfcrk\xe7esi: \u0642\u0644\u0639\u0629 \u0633\u0644\u0637\u0627\u0646\u064a\u0647 ) ya da g\xfcn\xfcm\xfcz T\xfcrk\xe7esi ile Sultaniye Kalesi ismi bu i\u015flevin bir kan\u0131t\u0131d\u0131r. 17. y\xfczy\u0131l\u0131n sonlar\u0131ndan itibaren geli\u015fen \xe7\xf6mlek yap\u0131m\u0131, \u015fehrin bu konuda \xfcn yapmas\u0131n\u0131 sa\u011flam\u0131\u015ft\u0131r. Hatta yine bu zamanlarda bir seyyah\u0131n yap\u0131lan serami\u011fin kalitesinden etkilenip, bunu Hollanda'n\u0131n Delft \u015fehrinde yap\u0131lan seramiklerle kar\u015f\u0131la\u015ft\u0131rmas\u0131 \u015fehre \xc7anak kalesi ismini vermi\u015ftir. \xc7anakkale isminin Yunanca's\u0131 \u0394\u03b1\u03c1\u03b4\u03b1\u03bd\u03ad\u03bb\u03bb\u03b9\u03b1 veya Dardanellia[3], ki bu isim de sonradan Dardanelles olarak \u0130ngilizceye \xe7evrilmi\u015ftir.[4] 1920'lerden itibaren \u0130ngilizler \xc7anakkale'ye Chanak veya Kale Sultanie demeye ba\u015flad\u0131lar.","Orta Anadolu'nun kuzeyinde, K\u0131z\u0131l\u0131rmak ile Bat\u0131 Karadeniz ana havzalar\u0131 aras\u0131nda yer alan \xc7ank\u0131r\u0131, 40\xb0 30' ve 41\xba kuzey enlemleri ile 32\xb0 30' ve 34\xba do\u011fu boylamlar\u0131 aras\u0131nda yer almaktad\u0131r. \u0130lin kom\u015fular\u0131 bat\u0131da Bolu, kuzeybat\u0131da Karab\xfck, kuzeyde Kastamonu, do\u011fuda \xc7orum ve g\xfcneyde Ankara ile K\u0131r\u0131kkale'dir. Denizden y\xfcksekli\u011fi 730 metre olup, \xfclke topraklar\u0131n\u0131n %0,94'l\xfck b\xf6l\xfcm\xfcn\xfc olu\u015fturan toplam 7.388 Km\xb2'lik bir alana sahiptir.","\xc7orum, \u0130\xe7 Orta Karadeniz B\xf6lgesi'nde \xc7orum ilinin merkezi ve ayn\u0131 isim ile merkez il\xe7esi olan \u015fehir. 2019 y\u0131l\u0131 itibar\u0131yla 294.807 ki\u015filik n\xfcfusa sahiptir.[1] Yerli halk\u0131n \xf6nemli bir b\xf6l\xfcm\xfcn\xfc T\xfcrkmen/\xc7epniler olu\u015fturur.[2] Toprak sanayi ve makine imalat sanayi \xe7ok geli\u015fmi\u015ftir. Orta Karadeniz B\xf6l\xfcm\xfc'n\xfcn i\xe7 k\u0131sm\u0131nda yer almaktad\u0131r. Do\u011fuda Amasya, g\xfcneyde Yozgat, bat\u0131da \xc7ank\u0131r\u0131, kuzeyde Sinop, kuzeydo\u011fuda Samsun, g\xfcneybat\u0131da K\u0131r\u0131kkale ile \xe7evrilidir.","Denizli, T\xfcrkiye'nin bir ilidir [4] Sanayi, ticaret, tar\u0131m, turizm, e\u011fitim, k\xfclt\xfcr ve sanat alanlar\u0131nda \xfclkenin en geli\u015fmi\u015f illerinden biridir. \u0130l n\xfcfusu 2020 y\u0131l\u0131 itibar\u0131yla 1.040.915'tir.[2] Tekstil \xfcr\xfcnleri ve y\xf6reye has Denizli horozu ile me\u015fhurdur. Anadolu Yar\u0131madas\u0131'n\u0131n g\xfcneybat\u0131, Ege B\xf6lgesi'nin g\xfcneydo\u011fusunda yer almaktad\u0131r. Ege ve Akdeniz B\xf6lgeleri aras\u0131nda bir ge\xe7it durumundad\u0131r. Denizli ilinin her iki b\xf6lge \xfczerinde de topraklar\u0131 vard\u0131r. Denizli ili 28\xb0 38' - 30\xb0 05' do\u011fu meridyenleri (do\u011fu u\xe7 noktas\u0131; \xc7ivril il\xe7esi G\xfcm\xfc\u015fsu - G\xf6kg\xf6l K\xf6y\xfc, Dinar s\u0131n\u0131r\u0131nda Efekli Tepe, bat\u0131 u\xe7 Ayd\u0131n, Manisa; g\xfcneyde Mu\u011fla; kuzeyde U\u015fak illeri ile kom\u015fudur.) Y\xfcz\xf6l\xe7\xfcm\xfc 12.134 km\xb2,[3] denizden y\xfcksekli\u011fi ise 219 m'dir.Bir sanayi, ihracat ve ticaret merkezi olan Denizli, ayn\u0131 zamanda altm\u0131\u015f be\u015f bine yakla\u015fan \xfcniversite \xf6\u011frencisine ev sahipli\u011fi yapmaktad\u0131r. Bir y\u0131lda milyonlarca yerli ve yabanc\u0131 turisti a\u011f\u0131rlayan il, bir turizm kenti olmas\u0131n\u0131n yan\u0131 s\u0131ra d\xfczenlenen yerel, ulusal ve uluslararas\u0131 etkinliklerle e\u011fitim, kongre, k\xfclt\xfcr ve sanat merkezi \xf6zelli\u011findedir. GEKA (G\xfcney Ege Kalk\u0131nma Ajans\u0131) merkezi Denizli'dedir.Akda\u011f'\u0131n (Babada\u011f) kuzey yama\xe7lar\u0131 eteklerinde, B\xfcy\xfck Menderes'in kolu olan Aksu \xe7ay\u0131na kavu\u015fan derelerle hafif\xe7e yar\u0131lm\u0131\u015f bir plato \xfczerinde yer alan Denizli, yeni bir kenttir. As\u0131l kent buradan 6-7 kilometre kadar kuzeydeki Laodikya (Laodicaea) idi. Sel\xe7uklular ve Bizansl\u0131lar aras\u0131ndaki sava\u015flar sonucu y\u0131k\u0131ma u\u011frayan ve \xf6zellikle suyollar\u0131 bozulan Laodikeia zamanla terk edilmeye ba\u015flanm\u0131\u015f ve yerle\u015fme 11. y\xfczy\u0131ldan ba\u015flayarak bol su kaynaklar\u0131n\u0131n bulundu\u011fu Denizli, Ladik'e do\u011fru yer de\u011fi\u015ftirmeye ba\u015flam\u0131\u015ft\u0131r. Kent, 1702-1703'teki bir deprem s\u0131ras\u0131nda b\xfcy\xfck zarara u\u011fram\u0131\u015f ve daha sonra yeniden kurulmu\u015ftur. Ege k\u0131y\u0131lar\u0131ndan i\xe7 kesimlere sokulan do\u011fal bir yol \xfczerinde bulunan Denizli, \xf6zellikle 1950'li y\u0131llarda karayollar\u0131n\u0131n d\xfczelmesinden sonra, bu konumunun ve \xe7evresindeki tar\u0131m etkinliklerinin geli\u015fmesi sonucu h\u0131zla kalabal\u0131kla\u015fm\u0131\u015f ve 1950'de 22.000 olan n\xfcfusu, aradan ge\xe7en 60 y\u0131l i\xe7inde yakla\u015f\u0131k 25 kat artm\u0131\u015ft\u0131r. Sanayisi, turizmi, ticareti ve hizmet sekt\xf6r\xfc \xe7ok geli\u015fmi\u015f olan Denizli, T\xfcrkiye'nin en kalk\u0131nm\u0131\u015f kentlerinden biridir. Anadolu Kaplanlar\u0131'n\u0131n ba\u015f\u0131d\u0131r. D\xfcnya'da tekstilin en \xf6nemli ba\u015fkentleri aras\u0131ndad\u0131r. Ayr\u0131ca Serinhisar il\xe7esi de T\xfcrkiye'nin leblebi ve leblebi \xfcr\xfcnleri ihtiyac\u0131n\u0131n %85 civar\u0131n\u0131 kar\u015f\u0131lamaktad\u0131r. Denizli, T\xfcrkiye'nin en b\xfcy\xfck 10 ekonomisi aras\u0131ndad\u0131r. Kent, havlu, bornoz ve ev tekstilinde ABD ve AB pazar\u0131nda iyi bir prestije sahiptir. Havas\u0131 ve do\u011fas\u0131 Ege B\xf6lgesi'nin ortalamalar\u0131n\u0131 yans\u0131t\u0131r. \u015eehrin birka\xe7 noktas\u0131nda horoz heykeli bulunur. D\xfcnyaca bilinen do\u011fa harikas\u0131 Pamukkale de \u015fehrin simgelerinden biridir. Pamukkale, Unesco'nun d\xfcnya k\xfclt\xfcr miras\u0131 listesindedir. Karahay\u0131t da uluslararas\u0131 termal bir merkezdir. Ayr\u0131ca en y\xfcksek da\u011f\u0131 Honaz Da\u011f\u0131 ayn\u0131 zamanda Ege B\xf6lgesi'nin en y\xfcksek da\u011f\u0131d\u0131r (2532 m). \u015eehirde UNESCO'ya giren Hierapolis, Laodikeia, Tripolis vb. bir\xe7ok antik kent bulunmaktad\u0131r.","T\xfcrkiye'nin bir ili ve en kalabal\u0131k on ikinci \u015fehri. T\xdc\u0130K ADNKS verilerine g\xf6re 2020 sonu itibar\u0131yla 1.783.431 ki\u015filik n\xfcfusa sahiptir.[1] \u0130lin y\xfcz \xf6l\xe7\xfcm\xfc 15.272 km2'dir. Valili\u011fin denizden y\xfcksekli\u011fi 674 m'dir. Diyarbak\u0131r kent merkezi yakla\u015f\u0131k 9000 y\u0131ll\u0131k bir ge\xe7mi\u015fe sahiptir.","Edirne, T\xfcrkiye'nin Edirne ilinde yer alan \u015fehir ve ayn\u0131 ilin merkez il\xe7esi. Marmara B\xf6lgesi'nin Trakya kesiminde, Yunanistan ve Bulgaristan s\u0131n\u0131r\u0131nda yer almaktad\u0131r. 2018 say\u0131m\u0131na g\xf6re toplam n\xfcfusu 180.327'dir.","T\xfcrkiye'nin El\xe2z\u0131\u011f ilinin merkezi olan \u015fehir. 2020 itibar\u0131yla 589.267 ki\u015filik merkez n\xfcfusuna sahiptir.[2] Do\u011fu Anadolu B\xf6lgesi'nin Yukar\u0131 F\u0131rat B\xf6l\xfcm\xfc'nde yer almaktad\u0131r. B\xf6lgenin en geli\u015fmi\u015f illerinden biri olarak kabul edilir."," Erzincan, T\xfcrkiye'de Do\u011fu Anadolu B\xf6lgesi'nde Erzincan ilinin merkez il\xe7esidir.\u015eehir tarihte Meng\xfcceklilere ba\u015fkentlik yapm\u0131\u015ft\u0131r.[1] Do\u011fusunda \xc7ay\u0131rl\u0131 ve \xdcz\xfcml\xfc, bat\u0131s\u0131nda Kemah, kuzeybat\u0131s\u0131nda Refahiye il\xe7eleri, kuzeyinde G\xfcm\xfc\u015fhane, g\xfcneyinde Tunceli illeriyle kom\u015fudur.","Erzurum, T\xfcrkiye'de yer alan \u015fehir ve \xfclkenin 81 ilinden biridir.[3] Erzurum ovas\u0131n\u0131n g\xfcneydo\u011fu kenar\u0131nda, bu ova ile Paland\xf6ken da\u011f\u0131n\u0131n temas sahas\u0131nda kurulmu\u015f olan Erzurum \u015fehri, 758.279 [2] n\xfcfusu ile Do\u011fu Anadolu B\xf6lgesi'nin en b\xfcy\xfck \xfc\xe7\xfcnc\xfc ilidir. Denizden y\xfcksekli\u011fi yakla\u015f\u0131k 1900 m olan Erzurum, tarihin ilk d\xf6nemlerinden beri yerle\u015fim yeridir. \u015eehir, tarih\xee eserleri ve k\u0131\u015f sporlar\u0131 tesisleriyle de tan\u0131n\u0131r. Y\xfcz \xf6l\xe7\xfcm\xfc bak\u0131m\u0131ndan T\xfcrkiye'nin en b\xfcy\xfck d\xf6rd\xfcnc\xfc ili olan Erzurum'da, temel ge\xe7im kayna\u011f\u0131 tar\u0131m ve hayvanc\u0131l\u0131k olup \u015fehir son y\u0131llarda k\u0131\u015f turizmiyle de \xf6ne \xe7\u0131kmaktad\u0131r. So\u011fuk iklimi sebebiyle sanayisi geli\u015fmemi\u015ftir. 25.005 km\xb2 y\xfcz \xf6l\xe7\xfcm\xfcne sahip il arazisinin %15,17'si tar\u0131msal ama\xe7l\u0131 olarak kullan\u0131labilir konumdad\u0131r.","Eski\u015fehir, T\xfcrkiye'nin bir ili ve en kalabal\u0131k yirmi be\u015finci \u015fehridir. 1993 y\u0131l\u0131nda \xe7\u0131kar\u0131lan kanunla B\xfcy\xfck\u015fehir Belediyesi olmu\u015ftur. N\xfcfusu 2020 y\u0131l\u0131 T\xdc\u0130K istatistiklerine g\xf6re 888.828'dir[2]. Ortas\u0131ndan Porsuk \xc7ay\u0131 ge\xe7en \u015fehir, i\xe7erisinde Osmangazi \xdcniversitesi, Eski\u015fehir Teknik \xdcniversitesi ve Anadolu \xdcniversitesinin bulunmas\u0131 nedeniyle bir \xf6\u011frenci kenti g\xf6r\xfcn\xfcm\xfcndedir.Met helvas\u0131, nuga helvas\u0131, ha\u015fha\u015fl\u0131 \xe7\xf6rek, kalabak suyu, \xe7ib\xf6rek ve l\xfcleta\u015f\u0131 ile me\u015fhurdur. Ayr\u0131ca balaban kebab\u0131 da Eski\u015fehir mutfa\u011f\u0131nda \xf6nemli bir yer almaktad\u0131r. \u0130\u015flenebilir l\xfcleta\u015f\u0131, T\xfcrkiye'de yaln\u0131zca Eski\u015fehir'de \xe7\u0131kar\u0131ld\u0131\u011f\u0131 i\xe7in Eski\u015fehir ta\u015f\u0131 olarak bilinir.[3] T\xfcrkiye'de Eski\u015fehir ve Sivrihisar dolaylar\u0131nda yeti\u015fen bir \xe7oban k\xf6pe\u011fi olan akba\u015f da \u015fehre ait \xf6nemli de\u011ferlerdendir.[4] Sanat kurumlar\u0131 ve tesisleri ile k\xfclt\xfcr ve sanatta geli\u015fmi\u015f bir \u015fehirdir. Anadolu \xdcniversitesi ve b\xfcy\xfck\u015fehir belediyesi b\xfcnyesinde iki adet senfoni orkestras\u0131 bulunmaktad\u0131r. Ayr\u0131ca her y\u0131l d\xfczenlenen Uluslararas\u0131 Eski\u015fehir Festivali ile \u015fehirde m\xfczik, tiyatro, resim ve sinema dallar\u0131nda sergiler ve g\xf6steriler yap\u0131lmaktad\u0131r.","Gaziantep ya da eski ve halk aras\u0131ndaki ad\u0131yla Antep, T\xfcrkiye'nin bir ili ve en kalabal\u0131k dokuzuncu[3], \u015fehir merkez n\xfcfusuyla en kalabal\u0131k 6. \u015fehri. 2020 sonu itibar\u0131yla 2.101.157 n\xfcfusa sahiptir.[2] Akdeniz ile G\xfcneydo\u011fu Anadolu B\xf6lgesi'nin kesi\u015fme noktas\u0131nda bulunan T\xfcrkiye'nin \xf6nemli \u015fehirlerinden Gaziantep sanayi ve geli\u015fmi\u015flik bak\u0131m\u0131ndan ilk s\u0131ralarda yer alir. E\u011fitim, ticaret ve sanayi \u015fehridir. H\xe2l\xe2 ya\u015fan\u0131lan en eski kentlerinden biridir.[4] Bunlar\u0131n yan\u0131nda Gaziantep, T\xfcrkiye sanayisi ve ticaretinde de \xe7ok \xf6nemli bir yer tutar. Bunun sebepleri aras\u0131nda Gaziantep'in Anadolu ile Orta Do\u011fu aras\u0131nda bir konumda bulunmas\u0131 ve liman kentlerine yak\u0131nl\u0131\u011f\u0131 say\u0131labilir. Gaziantep'in simgeleri aras\u0131nda Gaziantep Kalesi say\u0131labilir.Gaziantep'te \xe7ok say\u0131da p\u0131nar bulunmas\u0131na kar\u015f\u0131n hi\xe7 do\u011fal g\xf6l bulunmamaktad\u0131r. Bu y\xfczden \u015fehrin bir\xe7ok yerine yapay g\xf6ller ve barajlar in\u015fa edilmi\u015ftir. \u0130lin en \xf6nemli akarsuyu F\u0131rat Nehri ve kollar\u0131d\u0131r. Gaziantep ilinde \xe7ok az do\u011fal orman bulunmaktad\u0131r. \u0130ldeki topraklar\u0131n sadece %14'\xfc ormanl\u0131k alanlarla kapl\u0131d\u0131r. Bu ormanlarda \xf6zellikle me\u015fe ve k\u0131z\u0131l\xe7am a\u011fa\xe7lar\u0131 h\xe2kimdir. Me\u015fe ormanlar\u0131n\u0131n hepsi bozuk olup koruma alt\u0131ndad\u0131rlar. K\u0131z\u0131l\xe7am ormanlar\u0131n\u0131n \xe7o\u011funlu\u011fu yapay ormand\u0131r. Gaziantep ilinin bat\u0131 ve kuzey \xe7evreleri ormanl\u0131k, bozk\u0131r ve meralarla \xe7evrilidir. \u0130lin topraklar\u0131n\u0131n y\xfczde 60'\u0131 tar\u0131ma elveri\u015flidir. Bu k\u0131s\u0131m, tarlalar, zeytin, Antep f\u0131st\u0131\u011f\u0131, meyve ve sebze bah\xe7eleri ile ba\u011flarla kapl\u0131d\u0131r.[5]\u0130ldeki ba\u015fl\u0131ca da\u011flar, ilin bat\u0131s\u0131ndaki Nur Da\u011flar\u0131 ile Sof Da\u011flar\u0131'd\u0131r. Nur ve Sof Da\u011flar\u0131 aras\u0131ndaki b\xf6lge levha hareketleri sonucu olu\u015fmu\u015f bir \xe7\xf6k\xfcnt\xfcd\xfcr. \u0130ldeki en y\xfcksek da\u011f ise 1496 metre y\xfcksekli\u011fi ile B\xfcy\xfck Sof Da\u011f\u0131'd\u0131r. \u0130ldeki ba\u015fl\u0131ca ovalar ise \u0130slahiye, Barak ve Tilba\u015far ovalar\u0131d\u0131r. Gaziantep ilinde Nurda\u011f\u0131 ve \u0130slahiye 1. derece, Yavuzeli ve Araban 2. derece, O\u011fuzeli, Nizip ve Karkam\u0131\u015f ise 3. derece deprem b\xf6lgesidir.","Bat\u0131s\u0131nda Bulancak, g\xfcney ve g\xfcneydo\u011fusunda Dereli ve do\u011fusunda Ke\u015fap ile \xe7evrilidir. \u0130l merkezi, Aksu ve Batlama vadileri aras\u0131nda denize do\u011fru uzanan bir yar\u0131mada \xfczerinde kurulmu\u015f olup, bu yar\u0131madan\u0131n do\u011fusunda ve 2 km a\xe7\u0131\u011f\u0131nda Do\u011fu Karadeniz\u2019in tek adas\u0131 olan Giresun Adas\u0131 bulunmaktad\u0131r","T\xfcrk\xe7e: g\xfcm\xfc\u015f ve Fars\xe7a: \u062e\u0627\u0646\u0647 hane=khane kelimelerinin birle\u015fmesi ile olu\u015fmu\u015ftur. \u015eehir ismini yak\u0131nlar\u0131ndaki g\xfcm\xfc\u015f madenlerinden alm\u0131\u015ft\u0131r. Bizans d\xf6neminde \u015fehrin bulundu\u011fu b\xf6lge Haldia (Chaldia) isimleri ile bilinmektedir. 1850'lerde Helen Revivalizmi'nin b\xf6lgede de etkinle\u015fmesi ile birlikte e\u011fitimli Rumlar taraf\u0131ndan \u015fehre Yunanca, G\xfcm\xfc\u015f kenti anlam\u0131na gelen Argyropolis (Yunanca: \u0391\u03c1\u03b3\u03c5\u03c1\u03bf\u03cd\u03c0\u03bf\u03bb\u03b9\u03c2. \u03ac\u03c1\u03b3\u03c5\u03c1\u03bf\u03c2 argyros g\xfcm\xfc\u015f + \u03c0\u03cc\u03bb\u03b9\u03c2 (polis) kent) denmeye ba\u015flanm\u0131\u015ft\u0131r.[kaynak belirtilmeli] G\xfcn\xfcm\xfczde Yunanistan'da Atina'n\u0131n g\xfcneyinde ve Girit'te ayn\u0131 isimli kentler bulunmaktad\u0131r.","Hakk\xe2ri, eski ismi \xc7\xf6lemerik[1] (K\xfcrt\xe7e: Colem\xearg, S\xfcryanice: \u0710\u0730\u071f\u0741\u0733\u072a\u0733\u0710 Aqqare), Hakk\xe2ri ilinin merkezi olan \u015fehirdir. T\xfcrkiye'nin en g\xfcney do\u011fusundad\u0131r.Hakk\xe2ri Merkez, Y\xfcksekova, \u015eemdinli, Derecik ve \xc7ukurca il\xe7elerine ba\u011fl\u0131 4 belde, 122 K\xf6y, 368 mezra; bu yerle\u015fim birimlerinde de \u015fehir merkezlerinde 239.455, k\u0131rsal kesimde 97.126 toplam 336.581 n\xfcfus bulunmaktad\u0131r. Y\xf6renin %87,6 s\u0131 da\u011fl\u0131k %10,3 \xfc platoluk %2,1 oval\u0131kt\u0131r.Hakk\xe2ri konumu ve co\u011frafi yap\u0131s\u0131 itibar\u0131yla pek \xe7ok medeniyete ev sahipligi yapm\u0131\u015ft\u0131r. Hakk\xe2ri; Med, Pers, Selevkos, Abb\xe2si, Sel\xe7uklu, Mo\u011fol, Karakoyunlu, Akkoyunlu ve Osmanl\u0131 h\xe2kimiyetini g\xf6rm\xfc\u015ft\xfcr. Unesco taraf\u0131ndan d\xfcnya mir\xe2s\u0131 i\xe7ine al\u0131nm\u0131\u015ft\u0131r. Ters lalesi ile \xfcnl\xfcd\xfcr. Hakk\xe2ri ili balc\u0131l\u0131k alan\u0131nda \xfclke geneline katk\u0131 sa\u011flamaktad\u0131r. Ayr\u0131ca \u015fehir merkezine yak\u0131n mesafede kayak merkezi bulunmaktad\u0131r. \u015eehrin belediye ba\u015fkanlar\u0131 14 A\u011fustos 2015'te \xf6zy\xf6netim ilan\u0131 gerek\xe7e g\xf6sterilerek tutuklanan ve yarg\u0131lama sonucunda 15'er y\u0131l hapis cezas\u0131na \xe7arpt\u0131r\u0131lan (davalar\u0131 Yarg\u0131tay`da temyiz s\xfcrecindedir) Dilek Hatipo\u011flu ve Nurullah \xc7ift\xe7i'dir.","Hatay, T\xfcrkiye'nin bir ili ve en kalabal\u0131k on \xfc\xe7\xfcnc\xfc \u015fehridir. 2020 y\u0131l\u0131 itibar\u0131yla 1.659.320 n\xfcfusa sahiptir.[2] Akdeniz'in do\u011fu \u015feridinde 35\xb0 52' - 37\xb0 4' kuzey enlemleri ile 35\xb0 40' - 36\xb0 35' boylamlar\u0131 aras\u0131nda yer alan Hatay'\u0131n do\u011fusunda ve g\xfcneyinde Suriye, bat\u0131s\u0131nda Akdeniz, kuzeybat\u0131s\u0131nda Adana, kuzeyinde Osmaniye ve kuzeydo\u011fusunda Gaziantep bulunur.","Isparta, Isparta ilinin merkez il\xe7esidir. \u015eehir, y\xf6reye \xf6zg\xfc el dokumas\u0131 hal\u0131lar\u0131yla ve g\xfcl yeti\u015ftiricili\u011fiyle tan\u0131nmaktad\u0131r. T\xdc\u0130K'in yay\u0131nlad\u0131\u011f\u0131 2018 Y\u0131l\u0131 ADNKS verilerine g\xf6re; il\xe7e merkez belediye s\u0131n\u0131rlar\u0131 i\xe7erisinde 236.749 ki\u015fi, merkez il\xe7eye ba\u011fl\u0131 belde ve k\xf6ylerde 21.626 ki\u015fi olmak \xfczere merkez il\xe7enin genelinde 258.375 ki\u015fi ya\u015famaktad\u0131r.","Mersin, eski ad\u0131yla \u0130\xe7el, T\xfcrkiye'nin bir ili ve bu ilin merkezidir. D\xf6rd\xfc merkez il\xe7e olmak \xfczere 13 il\xe7esi vard\u0131r. Mersin T\xfcrkiye'nin Akdeniz B\xf6lgesinde bulunan bir liman kentidir. Mersin Liman\u0131 T\xfcrkiye'nin en b\xfcy\xfck limanlar\u0131 aras\u0131ndad\u0131r. \u015eehirde Turizm, Sanayi, Denizcilik, Geli\u015fmi\u015ftir. \xdclkenin en kalabal\u0131k onbirinci ili olan Mersin, 2020 itibar\u0131yla 1.868.757[1] ki\u015filik n\xfcfusa sahiptir.Merkezdeki il\xe7eleri Akdeniz, Mezitli, Yeni\u015fehir, Toroslar; di\u011fer il\xe7eleri ise Anamur, Ayd\u0131nc\u0131k, Bozyaz\u0131, Silifke, Tarsus, \xc7aml\u0131yayla, Erdemli, G\xfclnar ve Mut'tur. Toplam on \xfc\xe7 il\xe7esi bulunmaktad\u0131r.[2] B\xfcy\xfck\u015fehir belediyesi stat\xfcs\xfc bulunmaktad\u0131r. T\xfcrkiye'nin g\xfcneyinde bulunan bir liman kentidir. Mersin Liman\u0131 T\xfcrkiye'nin en b\xfcy\xfck limanlar\u0131 aras\u0131ndad\u0131r.","\u0130stanbul (T\xfcrk\xe7e telaffuz: [is\u02c8tanbu\u026b]), T\xfcrkiye'de Marmara B\xf6lgesi'nde yer alan \u015fehir ve T\xfcrkiye Cumhuriyeti Devletinin 81 ilinden biridir. \xdclkenin n\xfcfus bak\u0131m\u0131ndan en \xe7ok g\xf6\xe7 alan ve en kalabal\u0131k ilidir. Ekonomik, tarihi ve sosyo-k\xfclt\xfcrel a\xe7\u0131dan \xf6nde gelen \u015fehirlerden biridir.[6][7][8] \u015eehir, iktisadi b\xfcy\xfckl\xfck a\xe7\u0131s\u0131ndan d\xfcnyada 34. s\u0131rada yer al\u0131r. N\xfcfuslar\u0131na g\xf6re \u015fehirler listesinde belediye s\u0131n\u0131rlar\u0131 g\xf6z \xf6n\xfcne al\u0131narak yap\u0131lan s\u0131ralamaya g\xf6re Avrupa'da birinci, d\xfcnyada ise alt\u0131nc\u0131 s\u0131rada yer almaktad\u0131r.\u0130stanbul T\xfcrkiye'nin kuzeybat\u0131s\u0131nda, Marmara k\u0131y\u0131s\u0131 ve Bo\u011fazi\xe7i boyunca, Hali\xe7'i de \xe7evreleyecek \u015fekilde kurulmu\u015ftur. \u0130stanbul k\u0131talararas\u0131 bir \u015fehir olup, Avrupa'daki b\xf6l\xfcm\xfcne Avrupa Yakas\u0131 veya Rumeli Yakas\u0131, Asya'daki b\xf6l\xfcm\xfcne ise Anadolu Yakas\u0131 veya Asya Yakas\u0131 denir. Tarihte ilk olarak \xfc\xe7 taraf\u0131 Marmara Denizi, Bo\u011fazi\xe7i ve Hali\xe7'in sard\u0131\u011f\u0131 bir yar\u0131mada \xfczerinde kurulan \u0130stanbul'un bat\u0131daki s\u0131n\u0131r\u0131n\u0131 \u0130stanbul Surlar\u0131 olu\u015fturmaktayd\u0131. Geli\u015fme ve b\xfcy\xfcme s\xfcrecinde surlar\u0131n her seferinde daha bat\u0131ya ilerletilerek in\u015fa edilmesiyle 4 defa geni\u015fletilen \u015fehrin[11] 39 il\xe7esi vard\u0131r. S\u0131n\u0131rlar\u0131 i\xe7erisinde ise b\xfcy\xfck\u015fehir belediyesi ile birlikte toplam 40 belediye bulunmaktad\u0131r.","\u0130zmir, T\xfcrkiye'nin bir ili ve en kalabal\u0131k \xfc\xe7\xfcnc\xfc \u015fehridir. N\xfcfusu 2020 itibar\u0131yla 4.394.694 ki\u015fidir. Bu n\xfcfus; 30 il\xe7e ve bu il\xe7elere ba\u011fl\u0131 1.297 mahallede ya\u015famaktad\u0131r.[6] \u0130l genelinde n\xfcfus yo\u011funlu\u011fu 369,5'tir. Co\u011frafi olarak T\xfcrkiye'nin bat\u0131s\u0131nda bulunur ve ilin tamam\u0131 Ege B\xf6lgesi'nde yer al\u0131r. Y\xfcz \xf6l\xe7\xfcm\xfc olarak \xfclkenin yirmi \xfc\xe7\xfcnc\xfc b\xfcy\xfck ilidir.[7] Etraf\u0131 Ayd\u0131n, Bal\u0131kesir, Manisa illeri ve Ege Denizi ve Ege Adalar\u0131 ile \xe7evrilidir.\u0130zmir K\xf6rfezi \xe7evresinde bulunan \u015fehir, her y\u0131l \u0130zmir Enternasyonal Fuar\u0131'n\u0131 d\xfczenleyen \xf6nemli bir fuar merkezi ve liman kentidir.\u0130zmir'in bat\u0131s\u0131nda denizi, plajlar\u0131 ve termal merkezleriyle Urla Yar\u0131madas\u0131 uzan\u0131r. Antik \xc7a\u011f'\u0131n en \xfcnl\xfc kentleri aras\u0131nda yer alan Efes, Roma'n\u0131n imparatorluk devrinde d\xfcnyan\u0131n en b\xfcy\xfck kentlerinden biriydi. T\xfcm \u0130yon k\xfclt\xfcr\xfcn\xfcn zenginliklerini b\xfcnyesinde bar\u0131nd\u0131ran Efes, yo\u011fun sanatsal etkinliklerle de ad\u0131n\u0131 duyuruyordu. Bu maksatla da bu \u015fehre G\xfczel \u0130zmir, Eski \u0130zmir ve la Perle de l'Ionie (\u0130yonya'n\u0131n \u0130ncisi) deniyordu.\u0130zmir, yatlar ve gemilerle \xe7evrilmi\u015f uzun ve dar bir k\xf6rfezin ba\u015f\u0131nda yer almaktad\u0131r. Sahil boyunca palmiye, hurma a\u011fa\xe7lar\u0131 ve geni\u015f caddeler bulunmaktad\u0131r. \u0130zmir Liman\u0131, T\xfcrkiye'nin en b\xfcy\xfck yedinci liman\u0131d\u0131r.","Kars; T\xfcrkiye'nin rak\u0131m\u0131 en y\xfcksek il merkezlerinden biri olan, k\xf6yleri ile birlikte n\xfcfusu 100 bini a\u015fan (\u015eehir merkezi: 102.001, toplam: 129.458[1]) \u015fehirlerinden biri. Merkez il\xe7eye ba\u011fl\u0131, yirmi \xfc\xe7 mahalle ve yetmi\u015f k\xf6y bulunmaktad\u0131r. \xc7e\u015fitli etnisitelerin birlikte ya\u015fad\u0131\u011f\u0131 il merkezinde k\xfclt\xfcrel farkl\u0131l\u0131klardan ve zenginliklerden bahsetmek m\xfcmk\xfcn olup kozmopolit bir yap\u0131 s\xf6z konusudur.[2] Kars, K\xfclt\xfcr ve Turizm Bakanl\u0131\u011f\u0131'n\u0131n 2023 y\u0131l\u0131 i\xe7in T\xfcrkiye Turizm Stratejisi 2023 ve Turizm Stratejisi Eylem Plan\u0131 kapsam\u0131na al\u0131nan 15 il merkezinden birisidir. Bu proje ile hedeflenen, il merkezlerini K\xfclt\xfcr Turizmi Geli\u015ftirilecek Marka Kentler ilan edip geli\u015fmelerini sa\u011flamakt\u0131r.","Kastamonu, T\xfcrkiye Cumhuriyeti'nin Karadeniz B\xf6lgesi'nde yer alan Kastamonu ilinin merkez \u015fehridir.G\xf6k\u0131rmak'\u0131n bir kolu olan Kara\xe7omak Deresi vadisinde kurulu bulunan \u015fehrin denizden y\xfcksekli\u011fi 774 metredir.Evliyalar \u015fehri olarak da bilinen Kastamonu Anadolu'daki en eski \u015fehirlerden biridir, antik \xe7a\u011f ve T\xfcrk-\u0130sl\xe2m d\xf6nemine ait bir\xe7ok tarihi eser vard\u0131r. Kastamonu Kalesi, Atabey Camii, \u015eeyh \u015eaban-\u0131 Veli T\xfcrbesi, Yan\u0131k Sultan T\xfcrbesi, Nasrullah Camii, saat kulesi ve buna benzer bir\xe7ok tarihi eser mevcuttur. \xc7ivisiz yap\u0131 mimari olarak yap\u0131lan Mahmut Bey Camii de buradad\u0131r. Kastamonu kent merkezinde ayr\u0131ca T\xfcrkiye'de a\xe7\u0131lan ilk Kent Tarihi M\xfczesi bulunmaktad\u0131r.Kastamonu Saat Kulesi, Sultan II. Abd\xfclhamit zaman\u0131nda, \u015fehrin do\u011fusunda bulunan yama\xe7 \xfczerine Kastamonu Valilerinden Abdurrahman Nureddin Pa\u015fa taraf\u0131ndan 1884-1885 y\u0131llar\u0131nda yapt\u0131r\u0131lm\u0131\u015ft\u0131r. Kulenin saati de Avrupa'dan getirtilmi\u015ftir.Kastamonu'da yap\u0131lan \xe7ekme helvas\u0131 t\xfcm \xfclke i\xe7inde me\u015fhurdur.","Kayseri, T\xfcrkiye'nin bir ili. Ankara ve Konya'dan sonra \u0130\xe7 Anadolu'nun \xfc\xe7\xfcnc\xfc b\xfcy\xfck kenti ve sanayi merkezidir. Akk\u0131\u015fla, B\xfcnyan, Develi, Hac\u0131lar, \u0130ncesu, Kocasinan, Melikgazi, P\u0131narba\u015f\u0131, Sar\u0131o\u011flan, Sar\u0131z, Tomarza, Yahyal\u0131, Talas, \xd6zvatan, Felahiye ve Ye\u015filhisar olmak \xfczere 16 il\xe7eden olu\u015fmaktad\u0131r.Orta K\u0131z\u0131l\u0131rmak B\xf6l\xfcm\xfcnde, Erciyes Da\u011f\u0131'n\u0131n eteklerinde bir ildir. Kuzey ve kuzeybat\u0131da Yozgat, kuzey ve kuzeydo\u011fuda Sivas, do\u011fuda Kahramanmara\u015f, g\xfcneyde Adana, g\xfcneybat\u0131da Ni\u011fde, bat\u0131da ise Nev\u015fehir illeriyle \xe7evrilidir. D\xfcnyan\u0131n en eski \u015fehirlerinden biri olan Kayseri (eski Mazaka, Kaisareia), klasik \xe7a\u011flarda Kapadokya ad\u0131 verilen b\xf6lgededir. K\u0131z\u0131l\u0131rmak'\u0131n g\xfcneyinde bulunan bu b\xf6lge, Tuz G\xf6l\xfc'nden F\u0131rat Nehri'ne kadar uzan\u0131r. \u0130pek Yolu buradan ge\xe7er. B\xf6lge, pek \xe7ok uygarl\u0131\u011f\u0131n be\u015fi\u011fi olmu\u015ftur.","K\u0131rklareli, eski ismi K\u0131rk Kilise[2] (Yunanca: \u03a3\u03b1\u03c1\u03ac\u03bd\u03c4\u03b1 \u0395\u03ba\u03ba\u03bb\u03b7\u03c3\u03b9\u03ad\u03c2 Saranta Eklesies; Bulgarca: \u041b\u043e\u0437\u0435\u043d\u0433\u0440\u0430\u0434 Lozengrad), K\u0131rklareli ilinin merkezi olan \u015fehirdir.K\u0131rklareli tarih boyunca konumu itibar\u0131yla bir\xe7ok antik yerle\u015fim merkezine sahip bir ildir. Buzul \xe7a\u011f\u0131 sonlar\u0131nda uzunca bir s\xfcre sular alt\u0131nda kald\u0131\u011f\u0131 anla\u015f\u0131lan K\u0131rklareli ve civar\u0131nda insana dair ilk madd\xee belgeler neolitik d\xf6nem \xf6zelliklerini vermektedir. Daha sonra bilinen ilk yerle\u015fik kabilelerden ismini alan Trakya, K\u0131rklareli de dahil olmak \xfczere Roma d\xf6nemi ortalar\u0131na kadar k\u0131smen veya tamamen ba\u011f\u0131ms\u0131zl\u0131klar\u0131n\u0131 k\xfc\xe7\xfck birer krall\u0131k veya prenslik olarak devam ettirebilmi\u015flerdir.Bir ge\xe7i\u015f b\xf6lgesi olmas\u0131 nedeniyle Roma ve Bizans d\xf6nemlerinde pek \xe7ok istilalara u\u011frayan K\u0131rklareli ilk defa I. Murat zaman\u0131nda 1363 y\u0131l\u0131nda Osmanl\u0131lar\u0131n eline ge\xe7mi\u015ftir. Bu tarihten itibaren uzunca bir bar\u0131\u015f s\xfcreci ya\u015fayan K\u0131rklareli Balkan Sava\u015f\u0131 ve I. D\xfcnya Sava\u015f\u0131 s\u0131ralar\u0131nda Bulgar ve Yunan i\u015fgaline maruz kalarak b\xfcy\xfck eziyet ve s\u0131k\u0131nt\u0131lar ya\u015fad\u0131ktan sonra 10 Kas\u0131m 1922\u2019de nihai \xf6zg\xfcrl\xfc\u011f\xfcne kavu\u015fmu\u015ftur.","K\u0131r\u015fehir, K\u0131r\u015fehir ilinin merkezidir. 1941 y\u0131l\u0131nda Ankara'da toplanan l. Co\u011frafya Kongresi'nde bu b\xf6lgeye ve b\xf6lgenin Orta K\u0131z\u0131l\u0131rmak B\xf6l\xfcm\xfc'ne al\u0131nd\u0131. 2019 y\u0131l\u0131 T\xdc\u0130K verilerine g\xf6re toplam il n\xfcfusu 242.938'dir. \xd6zellikle son y\u0131llarda k\xf6ylerin g\xf6\xe7 vermesiyle n\xfcfus Merkez il\xe7ede yo\u011funla\u015fm\u0131\u015ft\u0131r. 1927'de 13.000 olan 1990'da 73.538'e, 2000'de 88.105'e \xe7\u0131km\u0131\u015ft\u0131. 2010'da 110.000 olan merkez il\xe7e n\xfcfusu 2019 itibar\u0131yla 157.635'dir.K\u0131r\u015fehir do\u011fu ve g\xfcneydo\u011fuda Nev\u015fehir, g\xfcneyde Aksaray, kuzeybat\u0131da K\u0131r\u0131kkale, kuzeydo\u011fu ve do\u011fuda Yozgat, bat\u0131da Ankara ile \xe7evrilidir. Kabaca bir paralel kenar\u0131 and\u0131ran il topraklar\u0131n\u0131 g\xfcney ve g\xfcneybat\u0131da K\u0131z\u0131l\u0131rmak, bat\u0131 da ve kuzeybat\u0131da K\u0131l\u0131\xe7\xf6z\xfc Deresi, kuzey ve kuzeydo\u011fuda Delice\u0131rmak s\u0131n\u0131rlar. \u0130l topraklar\u0131n\u0131n geni\u015fli\u011fi \xfclke topraklar\u0131n\u0131n binde 8'i, \u0130\xe7 Anadolu topraklar\u0131n\u0131n y\xfczde 2,9'u kadard\u0131r.","Kocaeli, T\xfcrkiye'nin bir ili ve en kalabal\u0131k onuncu \u015fehridir. \u015eehir, \xfclkenin en b\xfcy\xfck sanayi ve ticaret kentlerinden biridir. Kocaeli; SEGE-2011 s\u0131ralamas\u0131na g\xf6re \u0130stanbul, Ankara ve \u0130zmir'den sonra en geli\u015fmi\u015f \u015fehirdir. 2021 itibar\u0131yla 1.997.258 ki\u015filik n\xfcfusa sahiptir.[3] Ad\u0131n\u0131 1320 y\u0131l\u0131nda \u0130zmit y\xf6resini fetheden Ak\xe7a Koca'dan almaktad\u0131r. \u0130stanbul, Bursa, Sakarya, Yalova illeriyle kom\u015fudur.","Konya, T\xfcrkiye'nin y\xfcz \xf6l\xe7\xfcm\xfc bak\u0131m\u0131ndan en b\xfcy\xfck ili ve en kalabal\u0131k yedinci \u015fehridir. 31 il\xe7eden olu\u015fur. Konya \u0130l N\xfcfusu: 2.250.020'dir. (2020) [1] Trafik plaka numaras\u0131 42'dir.[3] 1875'te kurulan Konya Belediyesi, 1987'de \xe7\u0131kar\u0131lan 3399 say\u0131l\u0131 yasa gere\u011fince b\xfcy\xfck\u015fehir stat\xfcs\xfcne kavu\u015fmu\u015f olup 1989'dan beri belediye hizmetleri bu stat\xfcye g\xf6re y\xfcr\xfct\xfclmektedir. 2014'te 6360 say\u0131l\u0131 kanun ile b\xfcy\xfck\u015fehir belediyesinin s\u0131n\u0131rlar\u0131 il m\xfclki s\u0131n\u0131rlar\u0131 oldu.Ekonomik a\xe7\u0131dan T\xfcrkiye'nin geli\u015fmi\u015f kentlerinden biri olan Konya do\u011fal ve tarihsel zenginlikleriyle de \xf6nem ta\u015f\u0131r. D\xfcnyan\u0131n en eski yerle\u015fimlerinden biri olan \xc7atalh\xf6y\xfck, 2012 y\u0131l\u0131nda UNESCO D\xfcnya Miras Listesi'ne al\u0131nm\u0131\u015ft\u0131r. \u015eehir Anadolu Sel\xe7uklular\u0131\u2019n\u0131n ve Karamano\u011fullar\u0131\u2019n\u0131n ba\u015fkentli\u011fini yapm\u0131\u015ft\u0131r. T\xfcrkiye'nin en \xf6nemli sanayi kentlerinden birisidir. Anadolu Kaplanlar\u0131'ndand\u0131r. \u015eehrin futbol tak\u0131m\u0131 Konyaspor'dur. Y\xf6resel yemekleri Etliekmek, Bamya \xc7orbas\u0131, Mevlana b\xf6re\u011fi, Ya\u011f Somunu, Tirit, Konya Pilav\u0131, Sac aras\u0131 ve f\u0131r\u0131n kepab\u0131'd\u0131r. Konya\u2019n\u0131n simgeleri Mevlana M\xfczesi (Kubbe-i Hadr\xe2), \xe7ift ba\u015fl\u0131 kartal'd\u0131r.","K\xfctahya (Latince: Cotyaeum), Ege B\xf6lgesi'nde yer alan 2020 n\xfcfusu 305.700[1] K\xfctahya ilinin merkezi \u015fehirdir. K\xfctahya b\xf6lgesi, kuzey ve bat\u0131daki y\xfcksek da\u011f s\u0131rtlar\u0131nda doru\u011fa ula\u015fan tar\u0131m arazileri ile geni\u015f bir yama\xe7 alan\u0131na sahiptir. Kentin Yunanca ad\u0131 Kotyaion, Roma d\xf6nemindeki ad\u0131 ise Cotyaeum'dur.Eski kaynaklara, sikke ve yaz\u0131tlara g\xf6re K\xfctahya\u2019n\u0131n antik d\xf6nemdeki ad\u0131 \u201cKotiaeion\u201d (Cotiaeion)'dur[3]. \xdcnl\xfc Antik \xc7a\u011f co\u011frafyac\u0131s\u0131 Strabon bu ad\u0131n, \u201cKotys\u2019in Kenti\u201d anlam\u0131na geldi\u011fini belirtmektedir. Kotys, Trakya\u2019da ya\u015fayan Odrisler\u2019den olup, Romal\u0131lar\u2019\u0131n MS 38'de Anadolu\u2019ya g\xf6nderdi\u011fi bir komutan\u0131n ad\u0131d\u0131r. K\xfctahya Arkeoloji M\xfczesi\u2019nde bulunan bir sikkede bu ad \u201cKoti\u201d olarak ge\xe7mektedir. K\xfctahya ad\u0131, eskisine benzetilerek T\xfcrkler taraf\u0131ndan verilmi\u015ftir[4]. \u015eehrin n\xfcfusu 2013 y\u0131l\u0131na g\xf6re 249.558'dir.1927'de 17.000 olan n\xfcfusu, 1990'da 131.000'e, 2000'de 167.000'e, 2008'de 213.000'e 2010'da 235.000'e \xe7\u0131km\u0131\u015f, 2014'te 228.000'e d\xfc\u015fm\xfc\u015ft\xfcr. Kent'in g\xfcn\xfcm\xfczdeki belli ba\u015fl\u0131 g\xf6r\xfclmesi gerekli yerleri K\xfctahya Kalesi, Cumhuriyet Caddesi (Yeni ad\u0131 Sevgi Yolu) kentin merkezinde bulunan simgesi haline gelmi\u015f \xe7iniden yap\u0131lm\u0131\u015f olan Vazo ve tarihi Germiyan Soka\u011f\u0131, Saat Kulesi, Zafertepe An\u0131t\u0131, Tarihi H\xfck\xfbmet Kona\u011f\u0131 (\u015fu an Adliye olarak kullan\u0131lmaktad\u0131r), Frig Vadileridir.","Malatya, T\xfcrkiye'nin b\xfcy\xfck\u015fehir stat\xfcs\xfcndeki[3] otuz ilinden biridir. Do\u011fu Anadolu B\xf6lgesi'ndeki Yukar\u0131 F\u0131rat B\xf6l\xfcm\xfc'nde yer al\u0131r. On \xfc\xe7 il\xe7esi ve 718 mahallesi bulunan[4] Malatya, 806.156 ki\u015filik n\xfcfusuyla T\xfcrkiye'nin yirmi sekizinci en y\xfcksek n\xfcfuslu ilidir.[5] Do\u011fusu Elaz\u0131\u011f ve Diyarbak\u0131r, g\xfcneyi Ad\u0131yaman ve Kahramanmara\u015f, bat\u0131s\u0131 \xc7orum ve Sinop, kuzeyi ise Sivas ve Erzincan ile \xe7evrilidir. \u0130lk olarak Hitit d\xf6neminde kurulmu\u015ftur. O g\xfcnden bug\xfcne el de\u011fi\u015ftirerek y\u0131k\u0131l\u0131p yeniden yap\u0131larak g\xfcn\xfcm\xfcze kadar gelmi\u015ftir.Malatya, kay\u0131s\u0131 diyar\u0131 olarak bilinir. \u0130lde yeti\u015fen kay\u0131s\u0131lar, d\xfcnya genelinde \xfcnl\xfcd\xfcr ve kuru kay\u0131s\u0131 \xfcretiminin %80'ini Malatya Ovas\u0131\u2019nda bulunan kay\u0131s\u0131 bah\xe7eleri sa\u011flar.[7] B\xfcy\xfck\u015fehir yasas\u0131 ile 2014 yerel se\xe7imlerinin ard\u0131ndan b\xfcy\xfck\u015fehir stat\xfcs\xfcne kavu\u015fmu\u015ftur. Ayn\u0131 zamanda Malatya 2 Cumhurba\u015fkan\u0131 \xe7\u0131karm\u0131\u015f tek \u015fehirdir, bu ki\u015filer, \u0130smet \u0130n\xf6n\xfc ve Turgut \xd6zal'd\u0131r.","Manisa, T\xfcrkiye'nin bir ili ve en kalabal\u0131k on d\xf6rd\xfcnc\xfc \u015fehridir. 2020 T\xdc\u0130K verilerine g\xf6re n\xfcfusu 1.450.616 ki\u015fidir.[3] Anadolu Yar\u0131madas\u0131'n\u0131n bat\u0131s\u0131nda, Ege B\xf6lgesi'nin ortas\u0131nda yer al\u0131r. Do\u011fudan U\u015fak ve K\xfctahya, g\xfcneyden Ayd\u0131n ve Denizli, kuzeyden Bal\u0131kesir ve bat\u0131dan \u0130zmir ile kom\u015fudur. 27\xb008\u2019 ve 29\xb005\u2019 do\u011fu boylamlar\u0131 ile 38\xb004\u2019 ve 39\xb058\u2019 kuzey enlemleri aras\u0131nda yer al\u0131r. 17 il\xe7esi bulunur. Toplam n\xfcfus bak\u0131m\u0131ndan \u0130zmir'den sonra Ege B\xf6lgesi'nin 2. b\xfcy\xfck ili ve ticaret merkezidir. 2012 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 6360 say\u0131l\u0131 kanun ile b\xfcy\xfck\u015fehir olmu\u015ftur.[7]. \u015eehzadeler \u015eehri olarak da adland\u0131r\u0131lan yerle\u015fim, mesir macunu, sultaniye \xfcz\xfcm\xfc ve Manisa Tarzan\u0131 ile tan\u0131n\u0131r. Antik \xe7a\u011f'da Magnesia, Roma \u0130mparatorlu\u011fu d\xf6neminde tam ismiyle Magnesia ad Sipylum olarak an\u0131lm\u0131\u015ft\u0131r. \u015eehir, Spil Da\u011f\u0131'n\u0131n eteklerinde kurulmu\u015ftur. Gediz Nehri'nin b\xfcy\xfck bir b\xf6l\xfcm\xfc il s\u0131n\u0131rlar\u0131 i\xe7erisinden ge\xe7mektedir.","Kahramanmara\u015f, eski ve halk aras\u0131ndaki ad\u0131yla Mara\u015f, T\xfcrkiye'nin Akdeniz B\xf6lgesinde bulunan bir ili ve en kalabal\u0131k on sekizinci kentidir. Kurtulu\u015f Sava\u015f\u0131'nda i\u015fgale direni\u015fi nedeniyle TBMM taraf\u0131ndan 5 Nisan 1925'te \u015fehre \u0130stiklal Madalyas\u0131 verilmi\u015ftir. Mara\u015f olan ad\u0131, 7 \u015eubat 1973'te Kahramanmara\u015f olarak de\u011fi\u015ftirilmi\u015ftir.Ge\xe7 Hitit \u015fehri olan Gurgum\u2019un bulundu\u011fu yerde kurulmu\u015ftur. Sistematik bir kaz\u0131 yap\u0131lmam\u0131\u015f olmas\u0131na ra\u011fmen bir\xe7ok Hitit an\u0131t\u0131 bulunmu\u015ftur.Osmanl\u0131 seyyah\u0131 Evliya \xc7elebi, seyahatnamesinde Mara\u015f halk\u0131 i\xe7in, kelimatlar\u0131 lisan-\u0131 T\xfcrkidir ve ekseriya halk\u0131 T\xfcrkmendir der.[4] Mara\u015f ve \xe7evresi ba\u015fta O\u011fuzlar\u0131n Av\u015far, Bayat ve Beydili boylar\u0131 \xe7o\u011funlukta olmakla birlikte hemen hemen 24 O\u011fuz boyunun tamam\u0131 mevcuttur.2012'de \xe7\u0131kar\u0131lan 6360 say\u0131l\u0131 kanun ile b\xfcy\xfck\u015fehir olmu\u015ftur. Ayn\u0131 zamanda il s\u0131n\u0131rlar\u0131 i\xe7erisinde bulunan Af\u015fin - Elbistan A, B, C termik santralleri sayesinde Kahramanmara\u015f, T\xfcrkiye'nin elektrik ihtiyac\u0131n\u0131n %14'\xfcn\xfc kar\u015f\u0131lamaktad\u0131r.D\xf6vme dondurmas\u0131, tarhanas\u0131 ve biberi \u015fehrin \xf6nemli tescilli g\u0131dalar\u0131d\u0131r. 2020 sonu itibar\u0131yla 1.168.163 n\xfcfusa sahiptir.","Mardin (Arap\xe7a: \u0645\u0627\u0631\u062f\u064a\u0646, K\xfcrt\xe7e: M\xeard\xeen, S\xfcryanice: \u0721\u072a\u0715\u0710), T\xfcrkiye'nin b\xfcy\xfck\u015fehir stat\xfcs\xfcne giren bir ili ve en kalabal\u0131k yirmi alt\u0131nc\u0131 \u015fehridir. 2020 Y\u0131l\u0131 TU\u0130K verilerine g\xf6re n\xfcfusu 854.716\u2019dir.[1] G\xfcneydo\u011fu Anadolu B\xf6lgesi'nin Dicle B\xf6l\xfcm\xfc'nde yer al\u0131r. Suriye ile s\u0131n\u0131r kom\u015fusudur.\u015eehirde uluslararas\u0131 kurulu\u015flarca k\xfclt\xfcr miras\u0131 kabul edilmi\u015f, koruma alt\u0131na al\u0131nm\u0131\u015f tarihi yap\u0131lar mevcuttur. Mardin farkl\u0131 dini inan\u0131\u015flar paralelinde, sanatsal a\xe7\u0131dan da tarihi de\u011feri olan camiler, t\xfcrbeler, kiliseler, manast\u0131r ve benzeri dini eserler bar\u0131nd\u0131rmaktad\u0131r. Mardin, \u0130pek Yolu g\xfczerg\xe2h\u0131nda olup, ilde be\u015f han ve bir kervansaray mevcuttur.","Mu\u011fla, T\xfcrkiye'nin bir ili ve en kalabal\u0131k yirmi d\xf6rd\xfcnc\xfc \u015fehri. 2020 itibar\u0131yla 1.000.773[2] n\xfcfusa sahiptir. Ege B\xf6lgesi'nde, topraklar\u0131n\u0131n k\xfc\xe7\xfck bir k\u0131sm\u0131 Akdeniz B\xf6lgesi i\xe7ine giren, Ortaca, Dalaman, K\xf6yce\u011fiz, Fethiye, Marmaris, Milas, Dat\xe7a ve Bodrum gibi tatil y\xf6releri ile \xfcnl\xfc bir yerle\u015fim yeridir. \u0130lde 13 il\xe7e bulunur.","Mu\u015f, Mu\u015f ilinin merkezi olan ve ile ismini veren \u015fehirdir. Ayr\u0131ca Mu\u015f ilinin merkez il\xe7esidir.Mu\u015f \u015fehri, Mu\u015f ilinin bat\u0131s\u0131nda yer almaktad\u0131r. \xc7avu\u015f Da\u011f\u0131'n\u0131n kuzeydo\u011fu eteklerinde kurulmu\u015f olan kentin tarihsel \xe7ekirde\u011fi kalenin \xe7evresidir. \u0130stasyonun yer ald\u0131\u011f\u0131 Mu\u015f Ovas\u0131'na do\u011fru sekiler halinde geli\u015fen kentin eski ve yeni k\u0131s\u0131mlar\u0131 aras\u0131nda 200 metre y\xfckseklik fark\u0131 vard\u0131r.Mu\u015f ovas\u0131'n\u0131n kenar\u0131nda kurulan bu Do\u011fu Anadolu B\xf6lgesi \u015fehri, lalesi ve \xfcz\xfcm\xfc ile tan\u0131n\u0131r. Kent ve daha \xe7ok il Sel\xe7uklu d\xf6nemi eserleri; Malazgirt Sava\u015f\u0131 ve Alparslan ile \xf6zde\u015fle\u015fmi\u015ftir.Mu\u015f \u015fehri, 1929 y\u0131l\u0131nda Bitlis vilayetinden ayr\u0131larak m\xfcstakil bir il olarak, il merkezi konumu haline gelmi\u015ftir. 2008 y\u0131l\u0131 itibar\u0131yla merkez n\xfcfusu 70 bin dolaylar\u0131ndad\u0131r. Co\u011frafi a\xe7\u0131dan, Do\u011fu Anadolu B\xf6lgesi'nin Yukar\u0131 Murat-Van B\xf6l\xfcm\xfc i\xe7erisinde yer al\u0131r. Mu\u015f ili ve \u015fehri ayr\u0131ca Do\u011fu Anadolu B\xf6lgesi Kalk\u0131nma Projesi i\xe7inde yer almaktad\u0131r.Mu\u015f merkez il\xe7esi, kuzeyden Varto; do\u011fudan Bulan\u0131k, Hask\xf6y ve Korkut ile kom\u015fudur. Malazgirt il\xe7esi ile s\u0131n\u0131r\u0131 yoktur. Solhan ve Kulp ile de s\u0131n\u0131rda\u015ft\u0131r.","Nev\u015fehir, Nev\u015fehir ilinin merkezi olan \u015fehirdir. Antik \u0130smi Nissa'd\u0131r. Sel\xe7uklu d\xf6neminde fethedilip ismi Mu\u015fkara Olmu\u015ftur. Lale Devri'nin \xfcnl\xfc sadrazam\u0131 Damat \u0130brahim Pa\u015fa burada do\u011fmu\u015f ve d\xf6neminde \u015fehri imar edip hanlar, camiler, hamamlar gibi yap\u0131lar\u0131n in\u015fas\u0131na \xf6nc\xfcl\xfck ederek b\xf6lgenin kalk\u0131nmas\u0131nda \xf6nemli bir etkide bulunmu\u015ftur. Ad\u0131n\u0131 de\u011fi\u015ftirerek Fars\xe7ada Yeni \u015eehir anlam\u0131na gelen Nev\u015fehir ad\u0131n\u0131 vermi\u015ftir.","Ni\u011fde; do\u011fal g\xfczellikleri, k\xfclt\xfcrel varl\u0131klar\u0131 ve termal kaynaklar\u0131 ile turizm a\xe7\u0131s\u0131ndan \xf6nemli cazibelere sahiptir. G\xfcn\xfcm\xfczden itibaren 10 bin y\u0131ll\u0131k kesintisiz bir yerle\u015fim merkezi olan Ni\u011fde'de bu s\xfcre\xe7 i\xe7inde Roma, Bizans, Sel\xe7uklu ve Osmanl\u0131 d\xf6neminden g\xfcn\xfcm\xfcze ula\u015fm\u0131\u015f bir\xe7ok tarihi eser mevcuttur.Roma d\xf6neminden g\xfcn\xfcm\xfcze ula\u015fan en \xf6nemli tarihi eserler Roma havuzu ve o havuzun suyunu eski kent merkezi olan Kemerhisar\u2019a (Tyana) ta\u015f\u0131yan su kemerleridir.Bizans d\xf6neminden g\xfcn\xfcm\xfcze ula\u015fan en \xf6nemli k\xfclt\xfcr varl\u0131\u011f\u0131 G\xfcm\xfc\u015fler Manast\u0131r\u0131d\u0131r. Sel\xe7uklu d\xf6neminden ise g\xfcn\xfcm\xfcze ula\u015fan en \xf6zenli tarihi eserler aras\u0131nda Al\xe2eddin Camii, Sungurbey Camii, Ak Medrese ve H\xfcdavent Hatun t\xfcrbesini sayabiliriz. Osmanl\u0131 d\xf6nemi eserleri aras\u0131nda en \xf6nemli k\xfclt\xfcr varl\u0131\u011f\u0131 b\xfcy\xfck T\xfcrk \u015fairi Faruk Nafiz \xc7aml\u0131bel\u2019in \u201cHan Duvarlar\u0131\u201d \u015fiirinin esin kayna\u011f\u0131 Uluk\u0131\u015fla \xd6k\xfcz Mehmet Pa\u015fa kervansaray\u0131d\u0131r.","Ordu, T\xfcrkiye'nin bir ili ve en kalabal\u0131k otuzuncu \u015fehridir. 2020 Y\u0131l\u0131 verilerine g\xf6re n\xfcfusu 761400[2]'d\xfcr. Karadeniz B\xf6lgesinde, Orta ve Do\u011fu Karadeniz b\xf6l\xfcm\xfcnde yer almaktad\u0131r. Ancak yeni olu\u015fturulan ve b\xf6lgesel kar\u0131\u015f\u0131kl\u0131klar\u0131 ortadan kald\u0131rmak i\xe7in d\xfczenlenen yeni b\xf6lgesel istatistiki d\xfczenlemelerde Ordu ilinin tamam\u0131 Do\u011fu Karadeniz topraklar\u0131nda kald\u0131. \u0130lin kuzeyinde Karadeniz, g\xfcneyinde Tokat ve Sivas illeri, bat\u0131s\u0131nda Samsun, do\u011fusunda Giresun ili vard\u0131r. B\xfcy\xfck\u015fehir stat\xfcs\xfcnde olan Ordu, 19 il\xe7eden olu\u015fmaktad\u0131r. Y\xfcz \xf6l\xe7\xfcm\xfc bak\u0131m\u0131ndan en b\xfcy\xfck 57'nci ildir.","Rize (Antik Yunanca: \u03a1\u03b9\u03b6\u03b1\u03af\u03bf\u03bd (Rizeon), Yunanca: \u03a1\u03b9\u03b6\u03bf\u03cd\u03bd\u03c4\u03b1 (Rizunda) Lazca: \u10e0\u10d8\u10d6\u10d8\u10dc\u10d8 Rizini), Karadeniz B\xf6lgesi'nin Do\u011fu Karadeniz b\xf6l\xfcm\xfcnde yer alan bir \u015fehirdir. Tarihi Pontus b\xf6lgesinin do\u011fusunda kalan Rize, Osmanl\u0131 d\xf6neminde Lazistan Sanca\u011f\u0131'nda yer alm\u0131\u015ft\u0131r. G\xfcn\xfcm\xfczde T\xfcrkiye'ye ba\u011fl\u0131d\u0131r.Do\u011fuda \xc7ayeli ve G\xfcneysu ile, g\xfcneyde \u0130kizdere, bat\u0131da Derepazar\u0131 ve Kalkandere, kuzeyde Karadeniz ile \xe7evrilidir. \u015eehrin n\xfcfusu 2009 y\u0131l\u0131na g\xf6re 96.503'tir. 1927'de 14.000 olan n\xfcfusu 1990'da 52.743'e, 2000'de 78.144'e, 2007'de 94.800'e \xe7\u0131km\u0131\u015ft\u0131r. 2020 verilerine g\xf6re ise n\xfcfus 348.608'dir.","2020 y\u0131l\u0131 sonu T\xdc\u0130K verilerine g\xf6re \u0130l N\xfcfusu: 1.042.649 d\xfcr. 16 \u0130l\xe7e ve belediye, bu belediyelerde toplam 668 mahalle bulunmaktad\u0131r.Sakarya'n\u0131n kuzeyinde Karadeniz, bat\u0131s\u0131nda Kocaeli, Bursa, do\u011fusunda D\xfczce ve g\xfcneyinde de Bolu ile Bilecik bulunmaktad\u0131r. Sakarya Nehri, Sakarya'n\u0131n Karasu il\xe7esinde Karadeniz'e d\xf6k\xfcl\xfcr.Sakarya'da ekonomisinde tar\u0131m\u0131n \xf6nemli bir yeri vard\u0131r. Hendek, Karasu ve Kocaali il\xe7elerinde f\u0131nd\u0131k yeti\u015ftiricili\u011fi mevcuttur.[3] Ayr\u0131ca m\u0131s\u0131r tar\u0131m\u0131 da yap\u0131lmaktad\u0131r. Sakarya'da sanayi son zamanlarda geli\u015fmeye ba\u015flam\u0131\u015ft\u0131r. Son y\u0131llarda kurulan sanayi kurulu\u015flar\u0131 bu sanayile\u015fmeyi daha da art\u0131rm\u0131\u015ft\u0131r. Sakarya, bir milyona yakla\u015fan toplam n\xfcfusuyla \u0130stanbul, Bursa, Kocaeli ve Bal\u0131kesir'in ard\u0131ndan Marmara B\xf6lgesi'nin en b\xfcy\xfck be\u015finci \u015fehridir.","Samsun, T\xfcrkiye'nin b\xfcy\xfck\u015fehir stat\xfcs\xfcndeki otuz ilinden biridir. Karadeniz B\xf6lgesi'ndeki Orta Karadeniz B\xf6l\xfcm\xfc'nde, T\xfcrkiye co\u011frafyas\u0131n\u0131n en kuzeyinde merkez\xee bir noktada yer al\u0131r. On yedi il\xe7esi ve 1.247 mahallesi bulunan Samsun, 1.356.079 ki\u015filik n\xfcfusuyla b\xf6lgenin en y\xfcksek, T\xfcrkiye'nin ise on alt\u0131nc\u0131 en y\xfcksek n\xfcfuslu ilidir. Do\u011fusunda Ordu, g\xfcneyinde Tokat ve Amasya, bat\u0131s\u0131nda ise \xc7orum ve Sinop illeri ile \xe7evrili olup kuzeyinde Karadeniz bulunur. Karadeniz B\xf6lgesi'nin e\u011fitim, sa\u011fl\u0131k, sanayi, ticaret, ula\u015f\u0131m ve ekonomi a\xe7\u0131lar\u0131ndan en geli\u015fmi\u015f \u015fehri olan Samsun kalk\u0131nmada birinci derecede \xf6ncelikli y\xf6relerden biridir.Yerle\u015fim ge\xe7mi\u015fi M\xd6 60.000 y\u0131l\u0131na dek uzanan Samsun'da varl\u0131\u011f\u0131 bilinen en eski halk M\xd6 12. y\xfczy\u0131la kadar burada bulunan Ka\u015fkalard\u0131r. Ka\u015fkalar\u0131n ard\u0131ndan Hitit d\xf6nemini ya\u015fayan \u015fehir, M\xd6 1182 ile M\xd6 546 y\u0131llar\u0131 aras\u0131nda birka\xe7 kez el de\u011fi\u015ftirmi\u015f ve devam\u0131nda Pers h\xe2kimiyetine girmi\u015ftir. Perslerin ard\u0131ndan Makedonya, Pontus, Roma, Bizans egemenli\u011fi g\xf6ren Samsun, bunlar\u0131n ard\u0131ndan bir Ceneviz kolonisi h\xe2line gelmi\u015ftir. Bu d\xf6nemde D\xe2ni\u015fmendliler Beyli\u011fi taraf\u0131ndan ku\u015fat\u0131lan \u015fehir al\u0131namam\u0131\u015f ve \u015fehrin hemen yan\u0131na M\xfcsl\xfcman Samsun ad\u0131yla bilinen yeni bir \u015fehir kurulmu\u015ftur. I. Mehmed d\xf6nemine dek iki Samsun \u015fehri de varl\u0131\u011f\u0131n\u0131 s\xfcrd\xfcrm\xfc\u015f, bu d\xf6nemde her iki \u015fehir de Osmanl\u0131 Devleti topraklar\u0131na kat\u0131larak birle\u015ftirilmi\u015ftir. 1422-1428 y\u0131llar\u0131 aras\u0131nda Kubado\u011fullar\u0131 eline ge\xe7en Samsun, 1923 y\u0131l\u0131nda T\xfcrkiye Cumhuriyeti'nin il\xe2n\u0131na dek Osmanl\u0131 hakimiyetinde kalm\u0131\u015ft\u0131r. T\xfcrkiye'nin kurulmas\u0131na dek uzanan 19 May\u0131s 1919'da Mustafa Kemal'in Samsun'a \xe7\u0131k\u0131\u015f\u0131yla ba\u015flayan s\xfcrecin ba\u015flang\u0131\xe7 dura\u011f\u0131 olmas\u0131 nedeniyle \xf6zel bir konumu bulunan Samsun 19 May\u0131s Atat\xfcrk'\xfc Anma, Gen\xe7lik ve Spor Bayram\u0131'na ev sahipli\u011fi yapmaktad\u0131r. Buna izafeten resm\xee mahiyete sahip G\xfcne\u015fin Do\u011fdu\u011fu \u015eehir slogan\u0131yla tan\u0131t\u0131lmakta, Samsun 19 May\u0131s Mar\u015f\u0131 ise Samsun'un resm\xee mar\u015f\u0131 mahiyeti ta\u015f\u0131maktad\u0131r. \xd6te yandan Karadeniz'in Ba\u015fkenti ve Atat\xfcrk'\xfcn \u015eehri olarak da an\u0131lmaktad\u0131r.","Co\u011fraf\xee konum olarak Anadolu ve Mezopotamya'n\u0131n kesi\u015fti\u011fi b\xf6lgenin y\xfcksek k\u0131s\u0131mlar\u0131nda kurulan Siirt'te 1963 y\u0131l\u0131nda Halet \xc7aml\u0131bel ve R.J. Braidwood ba\u015fkanl\u0131\u011f\u0131nda kurulan G\xfcneydo\u011fu Anadolu Tarih \xd6ncesi Ara\u015ft\u0131rmalar\u0131 Karma Projesi kapsam\u0131nda Siirt ilinde yap\u0131lan y\xfczey ara\u015ft\u0131rmalar\u0131nda Cilal\u0131 Ta\u015f, Bak\u0131r, Tun\xe7 ve Hellenistik, Roma, Bizans ve \u0130sl\xe2m d\xf6nemlerinden Yak\u0131n \xc7a\u011f'a uzanan d\xf6nemlere ait buluntular ortaya \xe7\u0131kar\u0131lm\u0131\u015ft\u0131r. 3500 y\u0131l \xf6ncesine dayand\u0131\u011f\u0131 iddia edilen Akabe Yolu da bu kenttedir.","Sinop (Hitit\xe7e: Sinuwa, Yunanca: \u03a3\u03b9\u03bd\u03ce\u03c0\u03b7/Sinope), T\xfcrkiye'nin Karadeniz B\xf6lgesi'nin orta kesiminde bulunan Sinop ili'nin merkezi olan \u015fehirdir. Karadeniz k\u0131y\u0131s\u0131nda, Boztepe Burnu'nun karayla birle\u015fme noktas\u0131nda yer al\u0131r. Sinop Kalesi, tarihi ve turizm a\xe7\u0131s\u0131ndan kentin en ilgin\xe7 yeridir. \u015eehrin merkez n\xfcfusu yakla\u015f\u0131k 49.400'd\xfcr.","Sivas, T\xfcrkiye'nin Sivas ilinin merkezi olan \u015fehirdir. \u0130\xe7 Anadolu B\xf6lgesi'nin en eski ve \xf6nemli kentlerinden biridir. Do\u011fusunda Hafik, g\xfcneyinde Ula\u015f ve Alt\u0131nyayla, g\xfcneybat\u0131s\u0131nda \u015eark\u0131\u015fla, bat\u0131s\u0131nda Y\u0131ld\u0131zeli il\xe7eleri, kuzeyinde Tokat ili ile \xe7evrilidir.Sivas'\u0131n n\xfcfusu 2020 istatistiklerine g\xf6re 935,889 ki\u015fidir ve kilometrekareye 32 ki\u015fi d\xfc\u015fmektedir.","Tekirda\u011f, T\xfcrkiye'nin bir ili ve en kalabal\u0131k yirmi ikinci \u015fehridir. Tekirda\u011f n\xfcfusu 2020 y\u0131l\u0131na g\xf6re 1.081.065'dir.[1] Marmara B\xf6lgesi'nin Trakya yakas\u0131nda bulunur; do\u011fuda \u0130stanbul, g\xfcneyde Marmara Denizi ve \xc7anakkale, bat\u0131da Edirne, kuzeyde K\u0131rklareli ve kuzeydo\u011fuda Karadeniz ile \xe7evrilidir. 2012 y\u0131l\u0131nda n\xfcfusu 750.000'i ge\xe7en 14 adet il TBMM'de kabul edilen kanun ile b\xfcy\xfck\u015fehir stat\xfcs\xfc kazand\u0131\u011f\u0131 i\xe7in T\xfcrkiye'nin 30 b\xfcy\xfck\u015fehrinden biridir. 30 Mart 2014'te yap\u0131lan yerel se\xe7imlerin ard\u0131ndan resmen b\xfcy\xfck\u015fehir belediyecili\u011fi ile y\xf6netilmeye ba\u015flam\u0131\u015ft\u0131r, hizmet sahas\u0131 6.190 kilometrekare olarak t\xfcm il s\u0131n\u0131rlar\u0131d\u0131r. Bu kanunla \xfc\xe7 yeni il\xe7e kurulmu\u015ftur. Bunlar, S\xfcleymanpa\u015fa, Kapakl\u0131 ve Ergene'dir. Bu il\xe7elerle birlikte toplam il\xe7e say\u0131s\u0131 on birdir.","Tokat eski ad\u0131yla Bizans d\xf6nemi ad\u0131yla Komana, \u0130ran d\xf6nemi ad\u0131yla Kah-Cun, Sel\xe7uklu Devleti d\xf6neminde Dar \xdcn-Nusret, Mo\u011follar d\xf6neminde Sobaru adlar\u0131yla da bilinen T\xfcrkiye'nin Karadeniz B\xf6lgesi'nde yer alan ili. Kuzeyde Samsun, kuzeydo\u011fuda Ordu, do\u011fu ve g\xfcneyde Sivas, g\xfcneybat\u0131da Yozgat ve bat\u0131da Amasya illeriyle kom\u015fudur. \u0130l\xe7elerinden Ye\u015filyurt ve Sulusaray \u0130\xe7 Anadolu B\xf6lgesi'nde kal\u0131r.1943 y\u0131l\u0131nda Erbaa, 1944'te Artova ve Turhal, 1954 y\u0131l\u0131nda Almus, 1987 y\u0131l\u0131nda Pazar ve Ye\u015filyurt, 1990 y\u0131l\u0131nda ise Sulusaray ve Ba\u015f\xe7iftlik il\xe7eleri kurulmu\u015ftur.\u015eubat 2021 T\xdc\u0130K verilerine g\xf6re merkez il\xe7eyle beraber 12 il\xe7e, 37 belediye ile bu belediyelerde 315 mahalle ve ayr\u0131ca 613 k\xf6y vard\u0131r.[2] \u0130l merkezinin denizden y\xfcksekli\u011fi 630 m.'dir.","Trabzon, T\xfcrkiye'nin bir ili ve en kalabal\u0131k yirmi yedinci \u015fehridir. T\xdc\u0130K verilerine g\xf6re ise Trabzon\u2019un 2020 n\xfcfusu 811.901 oldu. Erkeklerin n\xfcfusu 402 Bin 224, kad\u0131nlar\u0131n n\xfcfusu ise 409 Bin 677 oldu.[2] Karadeniz B\xf6lgesi'nin Do\u011fu Karadeniz B\xf6l\xfcm\xfc'nde yer alan ilin Karadeniz'e k\u0131y\u0131s\u0131 bulunur. Karadeniz sahili ile Do\u011fu Karadeniz Da\u011flar\u0131 aras\u0131nda yer almakta olup y\xfcz\xf6l\xe7\xfcm\xfc a\xe7\u0131s\u0131ndan az bir alan kaplar. Bat\u0131s\u0131nda Giresun'a ba\u011fl\u0131 Eynesil il\xe7esi, g\xfcneyinde G\xfcm\xfc\u015fhane'ye ba\u011fl\u0131 Torul il\xe7esi ve Bayburt, do\u011fusunda da Rize'ye ba\u011fl\u0131 \u0130kizdere ve Kalkandere il\xe7eleri bulunur.7 Eyl\xfcl 2010 tarih ve 27695 say\u0131l\u0131 resmi gazetede yay\u0131mlanan karar ile birlikte 7 belde ve 29 k\xf6y t\xfczel ki\u015filikleri kald\u0131r\u0131larak belediye s\u0131n\u0131rlar\u0131na dahil edilmi\u015ftir.[3] Bu son d\xfczenleme ile birlikte belediye n\xfcfusu 402.166'ya \xe7\u0131km\u0131\u015ft\u0131r.","Tunceli iklimi sert karasal iklimine sahiptir. Da\u011flar\u0131n konumundan dolay\u0131 k\u0131\u015flar\u0131 \xe7ok so\u011fuk ve kar ya\u011f\u0131\u015fl\u0131 ge\xe7er. 6 veya 7 ay kar alt\u0131nda kalabilir. Yaz\u0131n ise 35-40 dereceye yakla\u015fan kuru s\u0131caklar olabilir. Tunceli' de ya\u015fayan yabani hayvanlar k\u0131rm\u0131z\u0131 benekli alabal\u0131k, boz ay\u0131, kurt, yaban domuzu, geyik, karaca, da\u011f ke\xe7isi, su samuru, va\u015fak, tilki, vah\u015fi kedi, tav\u015fan, kartal,a\u011fa\xe7kakan, yarasa, atmaca, \u015fahin, leylek, ala karga, sakall\u0131 akbaba ve 1950-60'l\u0131 y\u0131llarda Hazar kaplan\u0131, Anadolu pars\u0131 ve \xc7izgili s\u0131rtlan da g\xf6r\xfclm\xfc\u015ft\xfcr.Ters lalesiyle \xfcnl\xfcd\xfcr. Tunceli'nin en \xf6nemli da\u011flar\u0131 Munzur Da\u011flar\u0131,Buyer Baba Da\u011f\u0131, S\xfclb\xfcs Da\u011f\u0131, Ba\u011f\u0131r Da\u011f\u0131, Zel da\u011f\u0131d\u0131r.En \xf6nemli b\xf6lgeler ise Zage, Ali Bo\u011faz\u0131, Munzur Vadisi, Kutudere, P\xfcl\xfcm\xfcr Vadisi b\xf6lgeleridir. Yap\u0131lan barajlar\u0131n etkisi ile \xf6zellikle y\xfcksek olmayan yerlerde kar ya\u011f\u0131\u015f\u0131 azd\u0131r. Kar\u0131n toprakta kalma s\xfcresi azd\u0131r. Sert so\u011fuk fazla g\xf6r\xfclmez.","\u015eanl\u0131urfa( Arap\xe7a : \u0627\u0644\u0631\u0647\u0627 Ruha ; K\xfcrt\xe7e : Riha ; S\xfcryanice : \u0710\u0718\u072a\u0717\u071d \u016arh\u0101i, eski \xe7a\u011flarda bilinen ad\u0131yla Edessa), veya halk aras\u0131ndaki k\u0131sa ad\u0131yla Urfa, T\xfcrkiye'nin bir ili ve en kalabal\u0131k sekizinci \u015fehri.[3] 2020 Y\u0131l\u0131 verilerine g\xf6re n\xfcfusu 2.115.256\u2019dir.[2] Do\u011fuda Mardin, bat\u0131da Gaziantep, kuzeyde Ad\u0131yaman, kuzeydo\u011fuda Diyarbak\u0131r illeri ve g\xfcneyde Suriye ile s\u0131n\u0131r\u0131 vard\u0131r. \u015eanl\u0131urfa'n\u0131n 13 il\xe7esi vard\u0131r. Ortalama y\xfckseltisi 518 metre olan \u015eanl\u0131urfa, 19.451 km2'lik y\xfcz \xf6l\xe7\xfcm\xfc ile T\xfcrkiye'nin en b\xfcy\xfck yedinci ilidir.Halk hik\xe2yelerinde \u0130brahim peygamber ve Nemrud hik\xe2yelerine konu olmu\u015f, peygamberler \u015fehri ve kutsal \u015fehir gibi tan\u0131mlamalarla an\u0131lm\u0131\u015f olan \u015fehrin Nemrud taraf\u0131ndan kuruldu\u011funa inan\u0131lm\u0131\u015ft\u0131r. Milattan \xf6nce I. binden ba\u015flayarak Asurlular, Medler, Persler, Makedonyal\u0131lar, \u0130skender'in varisleri olan Selevkoslar ile Osroene krall\u0131klar\u0131n\u0131n ard\u0131ndan Roma ve Bizans \u0130mparatorluklar\u0131n\u0131n hakimiyeti alt\u0131nda kalan \u015fehir Hristiyanl\u0131k tarihi a\xe7\u0131s\u0131ndan \xf6nemli bir yere sahip olup S\xfcryani k\xfclt\xfcr\xfcn\xfcn merkezi konumundayd\u0131. Urfa, 7. y\xfczy\u0131lda M\xfcsl\xfcman Araplar taraf\u0131ndan fethedildikten sonra bu \xf6zelli\u011fini yava\u015f yava\u015f kaybetse de ciddi bir S\xfcryani ve Ermeni n\xfcfus \u015fehirde 20. y\xfczy\u0131l\u0131n ba\u015flar\u0131na kadar varl\u0131\u011f\u0131n\u0131 korumu\u015ftur. 1516'da Osmanl\u0131 padi\u015fah\u0131 Yavuz Sultan Selim'in Meml\xfckleri Mercid\xe2b\u0131k Sava\u015f\u0131nda yenmesiyle Osmanl\u0131 hakimiyeti alt\u0131na giren \u015fehir 1919 y\u0131l\u0131nda \xf6nce \u0130ngilizler ve ard\u0131ndan Frans\u0131zlar taraf\u0131ndan i\u015fgal edilene kadar kesintisiz 400 sene Osmanl\u0131 idaresinde kald\u0131. \u015eehir 11 Nisan 1920'de i\u015fgalden kurtar\u0131ld\u0131 ve 20 Ekim 1921'de TBMM ve Frans\u0131z H\xfck\xfbmeti aras\u0131nda imzalanan Ankara Antla\u015fmas\u0131 ile T\xfcrkiye'ye b\u0131rak\u0131ld\u0131. Cumhuriyet sonras\u0131nda 1924 y\u0131l\u0131nda il haline getirildi. Urfa milletvekili Osman Do\u011fan ve 17 arkada\u015f\u0131n\u0131n, Kurtulu\u015f Sava\u015f\u0131'nda g\xf6sterdi\u011fi kahramanl\u0131ktan dolay\u0131 Urfa ilinin ad\u0131n\u0131n \u015eanl\u0131urfa olarak de\u011fi\u015ftirilmesine ili\u015fkin kanun teklifinin TBMM taraf\u0131ndan 12 Haziran 1984 tarihinde kabul edilmesiyle \u015fehre \u015eanl\u0131 unvan\u0131 verilmi\u015ftir. 2016 y\u0131l\u0131nda ise \u015eanl\u0131urfa halk\u0131n\u0131n T\xfcrk Kurtulu\u015f Sava\u015f\u0131'nda g\xf6sterdi\u011fi kahramanl\u0131ktan dolay\u0131 TBMM taraf\u0131ndan bu kente \u0130stiklal Madalyas\u0131 verilmi\u015ftir.T\xfcrkiye \u0130statistik Kurumu\u2019nun (T\xdc\u0130K) a\xe7\u0131klad\u0131\u011f\u0131 2011 y\u0131l\u0131na ili\u015fkin Adrese Dayal\u0131 N\xfcfus Kay\u0131t Sistemi Sonu\xe7lar\u0131 dikkate al\u0131narak \u015eanl\u0131urfa, 12 Kas\u0131m 2012 tarihli ve 6360 say\u0131l\u0131 kanun ile b\xfcy\xfck\u015fehir oldu.","U\u015fak, \u0130\xe7 Anadolu ve Ege B\xf6lgesi aras\u0131nda bir ge\xe7i\u015f b\xf6l\xfcm\xfcn\xfc te\u015fkil eden \u0130\xe7 Bat\u0131 Anadolu e\u015fi\u011fi \xfczerinde yer alan U\u015fak ilinin merkez \u015fehridir.","Van (Ermenice: \u054e\u0561\u0576; K\xfcrt\xe7e: Wan;[3] Osmanl\u0131ca: \u0641\u0627\u0646), T\xfcrkiye'nin bir ili ve en kalabal\u0131k on dokuzuncu \u015fehri. Do\u011fu Anadolu B\xf6lgesinde yer al\u0131r. Van ili n\xfcfus bak\u0131m\u0131ndan bu b\xf6lgenin en b\xfcy\xfck ilidir. 2020 sonu itibar\u0131yla n\xfcfusu 1.149.342 ki\u015fidir.[1] Kuzeyden A\u011fr\u0131, bat\u0131dan Bitlis, g\xfcneybat\u0131dan Siirt, g\xfcneyden Hakk\xe2ri illeriyle, do\u011fudan da \u0130ran'la s\u0131n\u0131rl\u0131d\u0131r. Anadolu'nun en b\xfcy\xfck kapal\u0131 havzas\u0131 olan Van G\xf6l\xfc k\u0131y\u0131s\u0131nda topraklar\u0131 verimli, akarsular\u0131 bol, iklim ko\u015fullar\u0131 olduk\xe7a elveri\u015fli bir yerle\u015fim merkezidir. D\xfcnya'n\u0131n h\xe2l\xe2 ya\u015fan\u0131lan en eski kentlerinden biridir.","Yozgat, Yozgat ilinin merkezidir. Yozgat \u0130\xe7 Anadolu'nun merkezinde bulunan ba\u015fkent Ankara'ya 217 kilometre uzakl\u0131kta bulunan bir ildir. Yozgat'\u0131n merkez il\xe7esinin 2018 y\u0131l\u0131 itibar\u0131yla n\xfcfusu 90.163't\xfcr.","Zonguldak, Zonguldak ilinin merkez il\xe7esi ve ayn\u0131 isme sahip \u015fehri. Karadeniz k\u0131y\u0131s\u0131nda bulunan \u015fehir, \xf6zellikle liman\u0131yla T\xfcrkiye'nin Karadeniz \xfclkeleriyle aras\u0131ndaki deniz ticaretinde \xf6nemli bir yere sahiptir. Ayr\u0131ca T\xfcrkiye'nin en zengin ta\u015fk\xf6m\xfcr\xfc madenlerini bar\u0131nd\u0131r\u0131r.","Aksaray, T\xfcrkiye'nin \u0130\xe7 Anadolu B\xf6lgesi\u2019nde, k\u0131smen Konya Havzas\u0131'nda ve k\u0131smen Kapadokya'da yer alan, merkezi Aksaray kenti olan ildir. 15 Haziran 1989 tarihinde kabul edilen 3578 say\u0131l\u0131 kanun ile Ni\u011fde'den ayr\u0131larak il stat\xfcs\xfc kazanm\u0131\u015ft\u0131r. Ni\u011fde'nin kuzeybat\u0131s\u0131nda, Konya'n\u0131n do\u011fusunda, Ankara'n\u0131n g\xfcneydo\u011fusunda yer almaktad\u0131r. 423.011 n\xfcfusa (2020)[3] ve 7.659 km\xb2 y\xfcz \xf6l\xe7\xfcm\xfcne sahiptir.","\u0130l n\xfcfusu: 81.910'dur. Bu n\xfcfusun % 67,7'i \u015fehirlerde ya\u015famaktad\u0131r (2020 sonu). \u0130lin y\xfcz\xf6l\xe7\xfcm\xfc 3.746  km2'dir. \u0130lde  km2'ye 22 ki\u015fi d\xfc\u015fmektedir. (Bu say\u0131 merkez il\xe7ede 25\u2019dir.)[3] \u0130l merkezinin denizden y\xfcksekli\u011fi: 1555 m'dir.","Karaman, T\xfcrkiye'nin \u0130\xe7 Anadolu B\xf6lgesi'nde yer alan ayn\u0131 adl\u0131 ilin merkez il\xe7esi. \xd6nemli bir ticaret, k\xfclt\xfcr ve sanat merkezidir. M\xd6 8000'lerden itibaren isk\xe2n edilen Karaman ve y\xf6resi; yer alt\u0131 \u015fehirleri, ma\u011faralar ve inan\xe7 merkezlerine sahiptir.","K\u0131r\u0131kkale, K\u0131r\u0131kkale ilinin merkezi olan il\xe7edir. 1941 y\u0131l\u0131nda belediye stat\xfcs\xfcne kavu\u015fmu\u015ftur. K\u0131r\u0131k k\xf6y\xfc arazileri \xfczerine kurulmu\u015f, geli\u015fmi\u015f ve b\xfcy\xfcm\xfc\u015ft\xfcr. 1920'lerde M\xfchimmat Fabrikas\u0131n\u0131n temellerinin at\u0131lmas\u0131, DDY buradan ge\xe7mesi gibi unsurlar \u015fehrin olu\u015fmas\u0131nda \xf6nemli rol oynam\u0131\u015ft\u0131r. M\xfchimmat Fabrikas\u0131n\u0131n \xfcretime ge\xe7mesiyle \u015fehir g\xf6\xe7 almaya ba\u015flam\u0131\u015f ve 12 hanelik K\u0131r\u0131k k\xf6y\xfc, 1929 y\u0131l\u0131nda bucak yap\u0131larak \u201cK\u0131r\u0131kkale\u201d bi\xe7iminde kullan\u0131lm\u0131\u015ft\u0131r.K\u0131r\u0131kkale 1929'da 3000 n\xfcfusa sahip tipik bir Anadolu kasabas\u0131d\u0131r. \u0130lk yerle\u015fimler TCDD g\xfczergah\u0131nda; bug\xfcn ayn\u0131 ad\u0131 ta\u015f\u0131yan Fabrikalar Mahallesi, Ovac\u0131k Mahallesi, Kurtulu\u015f ve H\xfcseyin Kahya Mahallelerinde olu\u015fmaya ba\u015flam\u0131\u015ft\u0131r.\u015eehrin kurulmas\u0131nda ve geli\u015fmesinde bir planl\u0131l\u0131k g\xf6r\xfclmez. 1935 Genel N\xfcfus Say\u0131m\u0131nda \u015eehrin n\xfcfusu 4599\u2019a y\xfckselir. MKEK Fabrikalar\u0131nda \xe7al\u0131\u015fmak \xfczere \xe7evre illerden insanlar buraya g\xf6\xe7 etmeye ba\u015flar. Cumhuriyetin ilk y\u0131llar\u0131 olmas\u0131 nedeniyle \u201csanayi\u201d \u015fehrin b\xfcy\xfcmesine \xf6nc\xfcl\xfck yapar. K\u0131r\u0131kkale\u2019ye yerle\u015fen insanlar\u0131m\u0131z geli\u015fig\xfczel yerle\u015ferek ev ve i\u015fyerlerini kurma gayreti i\xe7erisinde olurlar. Bu plans\u0131z geli\u015fme bug\xfcn bile \u0130li olumsuz etkilemektedir.","\u0130l N\xfcfusu: 620.278'dur. Bu n\xfcfusun %84,27'i \u015fehirlerde ya\u015famaktad\u0131r \u0130lde km\xb2'ye 139 ki\u015fi d\xfc\u015fmektedir. (Bu say\u0131 merkez il\xe7ede 722'd\u0131r.(2020).[3] \u0130lin y\xfcz\xf6l\xe7\xfcm\xfc 4.477 km\xb2'dir.[4] \u0130l merkezinin denizden y\xfcksekli\u011fi: 570 m.'dir.Dicle'nin akt\u0131\u011f\u0131 topraklarda zengin tarihi ge\xe7mi\u015fi koruyan Batman ve antik kenti Hasankeyf; \xfc\xe7 bini a\u015fk\u0131n ma\u011faras\u0131, orta \xe7a\u011fdan kalma tarihi k\xf6pr\xfcs\xfc, eski \xe7ar\u015f\u0131s\u0131, camii minareleri ve tarihsel an\u0131tlar\u0131yla bir do\u011fa harikas\u0131d\u0131r. D\xfcnyaca \xfcnl\xfc sanat tarih\xe7i Tahsin Acet Batmanl\u0131d\u0131r. 1990 y\u0131l\u0131na kadar \xe7ok h\u0131zl\u0131 bir geli\u015fme ya\u015fayan Batman, 16 May\u0131s 1990 tarih ve 3647 say\u0131l\u0131 kanunla Be\u015firi, Kozluk ve Sason il\xe7eleri Siirt'ten, Hasankeyf ve Gerc\xfc\u015f il\xe7eleri Mardin'den al\u0131n\u0131p Merkez'e ba\u011flanarak T\xfcrkiye'nin 72. ili olmu\u015ftur.","\u015e\u0131rnak, eski ad\u0131yla \u015eehr-i Nuh , Do\u011fu Anadolu B\xf6lgesi'nde \u015e\u0131rnak ilinin ve merkez il\xe7esinin y\xf6netim merkezi olan \u015fehirdir.\u015e\u0131rnak, tarihsel olarak \xe7ok eski bir ge\xe7mi\u015fe sahiptir. \u015eehrin ge\xe7mi\u015fi K\xe2tip \xc7elebi\u2019nin 17. y\xfczy\u0131lda yazd\u0131\u011f\u0131 'Seyahatn\xe2me' ve tarih\xee rivayetlere g\xf6re Nuh Tufan\u0131 \xf6ncesine dayan\u0131r. Bu rivayetlere g\xf6re Cizre, tufandan sonra ikinci kez Nuh ve o\u011fullar\u0131 taraf\u0131ndan in\u015fa edilirken Cizre\u2019nin k\u0131zg\u0131n s\u0131ca\u011f\u0131ndan korunmak i\xe7in \u015e\u0131rnak, yazl\u0131k ve yaylak olarak in\u015fa edilmi\u015ftir.\u015e\u0131rnak, Nuh'un gemisi kal\u0131nt\u0131lar\u0131n\u0131n oldu\u011fu \xf6ne s\xfcr\xfclen C\xfbdi Da\u011f\u0131\u2019n\u0131n kuzeyinde '\u015eehr-i N\xfbh' ad\u0131yla kurulmu\u015f, \xf6nceleri \u015eerneh, daha sonraki y\u0131llarda ise K\xfcrdara \u015e\u0131rnak ad\u0131n\u0131 alm\u0131\u015ft\u0131r. \u015e\u0131rnak, tarihte bir\xe7ok \xf6nemli devletin ba\u015fkentini kendi topraklar\u0131nda bar\u0131nd\u0131rm\u0131\u015ft\u0131r. Ayn\u0131 zamanda Guti (Qurtie) imparatorlu\u011funun ba\u015fkenti olan Bajarkard, Silopi il\xe7esi topraklar\u0131ndad\u0131r. \u0130l s\u0131n\u0131rlar\u0131 i\xe7inde bulunan C\xfbdi Da\u011f\u0131\u2019n\u0131n isminin Gutilerden geldi\u011fi d\xfc\u015f\xfcn\xfclmektedir.","Bart\u0131n, Karadeniz B\xf6lgesi'nin bat\u0131 b\xf6l\xfcm\xfcnde yer alan ilin merkezidir. \u015eehirden ge\xe7en Bart\u0131n \xc7ay\u0131'ndan denize gemiyle gidilebilir. T\xfcrkiye'de deniz trafi\u011fine uygun tek deredir.","Ardahan (G\xfcrc\xfcce: \u10d0\u10e0\u10e2\u10d0\u10d0\u10dc\u10d8 (Artaani); Ermenice: \u0533\u0578\u0582\u0563\u0561\u0580\u0584 (Gugark); K\xfcrt\xe7e: Erd\xeaxan), T\xfcrkiye'nin kuzeydo\u011fu k\u0131sm\u0131nda, G\xfcrcistan s\u0131n\u0131r\u0131 yak\u0131nda yer alan bir kenttir. 1992'den bu yana T\xfcrkiye'nin ile Karadeniz ikliminin Kafkaslar \xfczerinde hakim oldu\u011fu Ardahan ilinin merkezidir. 2012 y\u0131l\u0131 itibar\u0131yla 19.075 olan n\xfcfusuyla T\xfcrkiye'deki en k\xfc\xe7\xfck il merkezidir. Ardahan Merkez il\xe7esinin g\xfcneyinde G\xf6le, kuzeyinde Hanak, do\u011fusunda \xc7\u0131ld\u0131r ve bat\u0131s\u0131nda Artvin'in \u015eav\u015fat il\xe7esi yer almaktad\u0131r.","I\u011fd\u0131r, I\u011fd\u0131r ilinin merkezi olan \u015fehirdir. T\xfcrkiye'nin Do\u011fu Anadolu B\xf6lgesi'nin Erzurum - Kars B\xf6l\xfcm\xfc'nde yer almaktad\u0131r. \u0130l merkezi 3 beldeden ve 49 k\xf6yden olu\u015fur. I\u011fd\u0131r merkez il\xe7e n\xfcfusu 2020 ADNKS say\u0131m\u0131 itibar\u0131yla 96.887 olup, k\xf6y ve belde n\xfcf\xfcslar\u0131yla birlikte 142.559'dur.T\xfcrkiye'nin en y\xfcksek da\u011f\u0131 olan A\u011fr\u0131 Da\u011f\u0131'n\u0131n y\xfcz\xf6l\xe7\xfcm\xfcn\xfcn \xfc\xe7te ikisi, il merkezine ba\u011fl\u0131 Suveren k\xf6y\xfc'n\xfcn s\u0131n\u0131rlar\u0131 i\xe7indedir.\xd6nemli bir k\xfclt\xfcr kav\u015fa\u011f\u0131nda bulunan I\u011fd\u0131r, Ermenistan ile de kom\u015fudur. T\xfcrkiye'nin Ermenistan ile s\u0131n\u0131r\u0131n\u0131 belirleyen Aras Nehri, Arpa\xe7ay ile birle\u015ftikten sonra I\u011fd\u0131r s\u0131n\u0131rlar\u0131 boyunca akar. Bu nehir I\u011fd\u0131rl\u0131lar\u0131n bir nevi hayat damar\u0131d\u0131r.","Yalova, Yalova ilinin merkezi olan il\xe7edir. 6 Haziran 1995 tarihinde kurulan Yalova ilinin merkez il\xe7esi olmu\u015ftur.Armutlu Yar\u0131madas\u0131'n\u0131n kuzey k\u0131y\u0131s\u0131 ile Samanl\u0131 Da\u011flar\u0131'n\u0131n kuzey eteklerine kurulmu\u015f olan Yalova, T\xfcrkiye'nin kuzeybat\u0131s\u0131nda, Marmara b\xf6lgesinin g\xfcneydo\u011fu kesiminde yer almaktad\u0131r. \u0130lin kuzeyinde ve bat\u0131s\u0131nda Marmara denizi, do\u011fusunda Kocaeli, g\xfcneyinde Bursa (Orhangazi-Gemlik ve \u0130znik il\xe7eleri) ve Gemlik k\xf6rfezi yer almaktad\u0131r. Yalova ilinin kuzeyinden g\xfcneybat\u0131s\u0131na kadar olan s\u0131n\u0131rlar\u0131 Marmara Denizi ile \xe7evrilmi\u015ftir.K\u0131y\u0131lar, girintili \xe7\u0131k\u0131nt\u0131l\u0131 bir \xf6zellik g\xf6stermez. Yalova'n\u0131n 39-40\xba kuzey enlemi, 29-61\xba do\u011fu boylamlar\u0131 aras\u0131nda denizden y\xfcksekli\u011fi 2 metre, en y\xfcksek noktas\u0131 926 metredir. 839 kilometrekarelik alan\u0131 ile \xfclke y\xfcz\xf6l\xe7\xfcm\xfcn\xfcn %0,11'lik b\xf6l\xfcm\xfcn\xfc kapsamaktad\u0131r.Yalova, y\xfcz\xf6l\xe7\xfcm\xfc itibar\u0131yla T\xfcrkiye'nin en k\xfc\xe7\xfck ilidir ve 105 km ile denize en uzun k\u0131y\u0131s\u0131 olan turistik illerinden de birisidir.","Karab\xfck merkez olmas\u0131na ra\u011fmen, Safranbolu il\xe7esi tarihsel evleri sebebiyle ismini daha \xe7ok duyurmu\u015ftur. Bunun yan\u0131nda T\xfcrkiye'nin ilk demir \xe7elik fabrikas\u0131n\u0131n bulundu\u011fu Karab\xfck merkezinde, bu fabrika sayesinde geni\u015f bir i\u015f sahas\u0131 olu\u015fturularak Karab\xfck'\xfcn geli\u015fimi sa\u011flanm\u0131\u015ft\u0131r. Karab\xfck, kurulan demir \xe7elik fabrikas\u0131 ve yan sanayilerle h\u0131zla geli\u015fmi\u015f ve b\xfcy\xfck bir kalk\u0131nma \xf6rne\u011fi yaratm\u0131\u015ft\u0131r. Ayr\u0131ca il genelinde tekstil sanayi \xf6zellikle haz\u0131r giyim sekt\xf6r\xfcnde geli\u015fmi\u015ftir.","\u0130lin do\u011fu, bat\u0131 ve kuzeyinde Gaziantep, g\xfcneyinde ise Suriye yer almaktad\u0131r. Gaziantep'e 58 km uzakl\u0131kta olan Kilis, Suriye s\u0131n\u0131r\u0131na ise 10 km uzakl\u0131ktad\u0131r. Kilis'ten ge\xe7en yol T\xfcrkiye s\u0131n\u0131rlar\u0131n\u0131n \xf6tesinde Azez'den ge\xe7tikten sonra Suriye'nin Halep \u015fehrine ula\u015f\u0131r. \u0130l merkezi do\u011fudan bat\u0131ya do\u011fru uzanan Resul Osman da\u011f\u0131 eteklerinde kurulu olup g\xfcneye do\u011fru inildik\xe7e d\xfcz arazilere inen fazla engebeli olmayan bir sahada yer almaktad\u0131r. \u0130lin kuzeyinde yer alan ve do\u011fudan bat\u0131ya uzanan da\u011flar aras\u0131nda kuru dereler ve birka\xe7 k\xfc\xe7\xfck akarsu bulunmaktad\u0131r. Genellikle k\u0131ra\xe7 arazilerin yer ald\u0131\u011f\u0131 bu da\u011flar\u0131n etekleri ve \xfcst k\u0131s\u0131mlar\u0131nda tar\u0131ma elveri\u015fli araziler bulunmaktad\u0131r.\u0130lin g\xfcneydo\u011fu ve s\u0131n\u0131r \u015feridi boylar\u0131nda \xf6zellikle ba\u011fc\u0131l\u0131k ve zeytincilik \xe7ok geli\u015fmi\u015f ve tar\u0131ma elveri\u015fli araziler bulunmaktad\u0131r. K\u0131rsal kesiminde ya\u015fayan insanlar ge\xe7imini tar\u0131ma dayal\u0131 olarak sa\u011flamaktad\u0131r.","Osmaniye, T\xfcrkiye Cumhuriyeti\u2019nin 80. ilidir. 1933'e kadar il olan Osmaniye'nin eski ad\u0131 Cebelibereket'tir. O tarihte Adana iline ba\u011flanm\u0131\u015f, 24 Ekim 1996 tarihinde yap\u0131lan yasal d\xfczenlemeyle tekrar il olmu\u015ftur. Akdeniz B\xf6lgesi\u2019nde, \xc7ukurova\u2019n\u0131n en do\u011fusunda yer al\u0131r. 3.767 kilometrekarelik y\xfcz\xf6l\xe7\xfcm\xfcne sahip Osmaniye topraklar\u0131n\u0131n %42\u2019si ormanl\u0131k alan,% 39\u2019si ekili dikili tar\u0131m alan\u0131, %17\u2019si tar\u0131ma elveri\u015fsiz arazi ve %2\u2019si di\u011fer arazilerden olu\u015fmaktad\u0131r. 2020 sonu itibar\u0131yla n\xfcfusu 548.556'tir.","D\xfczce, T\xfcrkiye Cumhuriyeti'nin Karadeniz B\xf6lgesi'nin Bat\u0131 Karadeniz B\xf6l\xfcm\xfc'nde yer alan ildir. D\xfczce ili n\xfcfusu: 395.679'd\xfcr. Bu n\xfcfusun % 68,8 si \u015fehirlerde ya\u015famaktad\u0131r (2020 sonu). \u0130lin y\xfcz\xf6l\xe7\xfcm\xfc 2.492  km2'dir. \u0130lde  km2'ye 159 ki\u015fi d\xfc\u015fmektedir. (Bu say\u0131 Merkez il\xe7ede 352\u2019dir.)04 \u015eubat 2021 T\xdc\u0130K verilerine g\xf6re  merkez il\xe7eyle beraber 8 \u0130l\xe7e, 10 belediye, bu belediyelerde 115 mahalle, ayr\u0131ca 278 k\xf6y bulunmaktad\u0131r."],t.s)
$.abp=H.b(["Adana'n\u0131n tarih\xe7esi 3.000 y\u0131l kadar \xf6ncesine dayanmaktad\u0131r; b\xf6lgedeki arkeolojik bulgular Paleolitik \xc7a\u011f'a de\u011fin uzanan insan yerle\u015fkelerini g\xfcn y\xfcz\xfcne \xe7\u0131karm\u0131\u015ft\u0131r. Arkeologlar\u0131n ta\u015f bir duvar ve bir \u015fehir merkezi bulduklar\u0131 Tepeba\u011f H\xf6y\xfc\u011f\xfc Neolitik \xc7a\u011f'da in\u015fa edilmi\u015ftir ve \xc7ukurova b\xf6lgesindeki en eski \u015fehir olarak d\xfc\u015f\xfcn\xfclmektedir. Adana isminde bir yer S\xfcmer destanlar\u0131ndan biri olan G\u0131lgam\u0131\u015f Destan\u0131'nda s\xf6z edilmektedir; ancak bu \xe7al\u0131\u015fman\u0131n co\u011frafyas\u0131 s\xf6z\xfc ge\xe7en yerin konumunu belirlemek i\xe7in \xe7ok mu\u011flakt\u0131r.Hattu\u015fa\u015f (Bo\u011fazkale)'de bulunan Hitit Kava yaz\u0131tlar\u0131na g\xf6re Kizzuwatna, M\xd6 1335 dolaylar\u0131nda Hititlilerin korumas\u0131 alt\u0131nda Adana'y\u0131 y\xf6neten ilk krall\u0131kt\u0131. Ayn\u0131 zamanda \u015fehir Uru Adaniya ve sakinleri ise Danuna olarak an\u0131l\u0131rd\u0131. M\xd6 1191-1189'a rastlayan y\u0131llarda Hitit \u0130mparatorlu\u011fu'nun \xe7\xf6k\xfc\u015f\xfcyle ba\u015flayan bat\u0131 kaynakl\u0131 ak\u0131nlar ovan\u0131n denetiminin \xe7ok say\u0131da k\xfc\xe7\xfck \xe7apl\u0131 krall\u0131klara ge\xe7mesine neden olmu\u015ftur, akabininde de Asurlular, M\xd6 9. y\xfczy\u0131l; Persler, M\xd6 6. y\xfczy\u0131lda M\xd6 333'te B\xfcy\xfck \u0130skender; Selevkoslar; Kilikya korsanlar\u0131; Romal\u0131 devletadam\u0131 Pompey; ve Kilikya Ermeni Krall\u0131\u011f\u0131 (Kilikya Krall\u0131\u011f\u0131) b\xf6lgenin denetiminde s\xf6z sahibi olmu\u015flard\u0131r.Adana'n\u0131n tarih\xe7esi \xf6z\xfc itibar\u0131yla Tarsus'un tarih\xe7esiyle bir ba\u011flant\u0131s\u0131 vard\u0131r; Seyhan Nehri'ne kom\u015fu olan bu iki \u015fehrin konumu nehir taraf\u0131ndan de\u011fi\u015ftirildi\u011finden bu \u015fehirler s\u0131kl\u0131kla ayn\u0131 kent olarak an\u0131l\u0131r ve ismi de as\u0131rlar\u0131n seyrine g\xf6re de\u011fi\u015fmi\u015ftir. Romal\u0131lar d\xf6neminde Adana'n\u0131n g\xf6receli olarak az bir \xf6nem arz etmekteydi ve bu s\u0131ralarda b\xf6lgenin metropol\xfc konumunda Tarsus bulunmaktayd\u0131. Gnaeus Pompeius Magnus devrinde ise \u015fehir Kilikya korsanlar\u0131 i\xe7in bir hapishane olarak kullan\u0131lm\u0131\u015ft\u0131r. Birka\xe7 y\xfczy\u0131l sonra \u015fehirde do\u011fuya giden Roma askeri yolu \xfczerinde yerel bir istasyon kurulmu\u015ftur. MS 395'te Roma \u0130mparatorlu\u011fu'nun kesin \xe7\xf6k\xfc\u015f\xfcn\xfcn ard\u0131ndan b\xf6lge Bizans \u0130mparatorlu\u011fu'nun bir par\xe7as\u0131 haline gelmi\u015f ve muhtemelen Julianus'un h\xfck\xfcmdarl\u0131\u011f\u0131 zaman\u0131nda geli\u015fmi\u015fti. B\xfcy\xfck k\xf6pr\xfclerin, yollar\u0131n, h\xfck\xfbmet binalar\u0131n\u0131n, sulama ve fidanl\u0131klar\u0131n in\u015fas\u0131yla beraber Adana ve Kilikya b\xf6lgenin en \xf6nemli ve geli\u015fkin ticaret merkezi haline gelmi\u015ftir. \xd6zellikle Kilikyal\u0131lar devrinde Ayas (bug\xfcnk\xfc ad\u0131yla Yumurtal\u0131k) ve Kozan (eski ad\u0131yla Sis) b\xf6lgedeki di\u011fer b\xfcy\xfck \u015fehir ve y\xf6netim merkezleriydi.Adana tarih boyunca s\u0131ras\u0131yla Luvi Krall\u0131\u011f\u0131 (M\xd6 1900), Arzava Krall\u0131\u011f\u0131 (M\xd6 1500-1333), Hitit \u0130mparatorlu\u011fu (M\xd6 1900-1200), Asurlular (713-663 BC), Pers \u0130mparatorlu\u011fu (M\xd6 550-333), Helen Antik Yunan Uygarl\u0131\u011f\u0131 (M\xd6 333-323), Selevkos \u0130mparatorlu\u011fu (M\xd6 312-133), Kilikya Prensli\u011fi (178-112), Romal\u0131lar (M\xd6 112 -395), Bizans \u0130mparatorlu\u011fu (395-638; 964-1071), Abbasiler, B\xfcy\xfck Sel\xe7uklu \u0130mparatorlu\u011fu, Meml\xfckler, Ramazano\u011flu Beyli\u011fi, Osmanl\u0131 \u0130mparatorlu\u011fu ve T\xfcrkiye'nin egemenli\u011fi alt\u0131na girmi\u015ftir.","Uzun y\u0131llar boyunca H\u0131sn\u0131mans\xfbr ad\u0131yla an\u0131lan \u015fehrin i\xe7inde oldu\u011fu b\xf6lgede yerle\u015fimin tarihi olduk\xe7a eski d\xf6nemlere kadar uzanmaktad\u0131r. B\xf6lgede tarih boyunca Hitit, Hurri, Mitanni, Kummuh, Asur, Pers, Seleukos, Kommagene Krall\u0131\u011f\u0131 ile Roma ve Bizans hakimiyeti g\xf6r\xfclm\xfc\u015ft\xfcr. 7. y\xfczy\u0131ldan itibaren \u0130sl\xe2m ak\u0131nlar\u0131 b\xf6lgede g\xf6r\xfclmeye ba\u015flam\u0131\u015f ve 670 y\u0131l\u0131nda yerle\u015fiminde i\xe7erisinde oldu\u011fu b\xf6lge Emev\xee hakimiyetine ge\xe7mi\u015ftir. Emev\xee kumandanlar\u0131ndan Mans\xfbr bin Ca'vene taraf\u0131ndan bug\xfcnk\xfc kale in\u015fa ettirildi. 758'de Abb\xe2s\xee egemenli\u011fine ge\xe7en H\u0131sn\u0131mans\xfbr, 926-958 y\u0131llar\u0131 aras\u0131ndaki Hamdaniler d\xf6neminden sonra yeniden Bizans hakimiyetine ge\xe7ti. 11. y\xfczy\u0131lda T\xfcrk ak\u0131nlar\u0131na u\u011frayan yerle\u015fim, ilk defa 1066\u2019da Sel\xe7uklu kumandan\u0131 G\xfcm\xfc\u015ftekin taraf\u0131ndan al\u0131nd\u0131. Artuklu, Eyy\xfbb\xee ve Sel\xe7uklu, \u0130lhanl\u0131, Akkoyunlu, Dulkadiro\u011fullar\u0131 ve Meml\xfckl\xfc hakimiyetinden sonra 1515 y\u0131l\u0131nda Osmanl\u0131 egemenli\u011fine ge\xe7ti. Osmanl\u0131 idaresinde 1519'da Mara\u015f eyaletine ba\u011fl\u0131 sancak olan yerle\u015fim, 1531 y\u0131l\u0131nda Elbistan sanca\u011f\u0131na ba\u011fl\u0131 bir kaza haline getirildi. 1519 y\u0131l\u0131nda yerle\u015fimin ilk tahririnde 1000 civar\u0131nda M\xfcsl\xfcman n\xfcfusun yan\u0131nda yerle\u015fimde 400 civar\u0131nda da Gayrim\xfcslim n\xfcfus bulunmaktayd\u0131. H\u0131sn\u0131mans\xfbr, 1563'te yeniden Mara\u015f\u2019a ba\u011fland\u0131 ve uzunca y\u0131llar bu konumda kald\u0131. Tanzimattan sonraki d\xfczenlemede 1841'de kaza olan yerle\u015fim, 1849'da Diyarbekir vilayetine ba\u011fl\u0131 bir sancak durumuna getirildi. 1859'da Malatya sanca\u011f\u0131na, 1883\u2019te de Mamuret-\xfcl-Aziz Vilayetine ba\u011fland\u0131. Cumhuriyet d\xf6neminde H\u0131sn\u0131mans\xfbr, 1923'ten 1954 y\u0131l\u0131na kadar Malatya\u2019n\u0131n il\xe7esi olarak kald\u0131. 22 Haziran 1954'te Ad\u0131yaman ilinin kurulmas\u0131yla merkez il\xe7e oldu.","Kentin tarihi M.\xd6. 3000 y\u0131l\u0131na kadar uzanmaktad\u0131r. M.\xd6. 2000 ilk d\xf6nemlerinde Hattiler'in egemenli\u011finde bulunan yerle\u015fim, M.\xd6. 2. bin y\u0131l\u0131n ortalar\u0131nda Hititler'in denetimine ge\xe7mi\u015ftir. Hitit devleti y\u0131k\u0131l\u0131nca M.\xd6. 1000 y\u0131l\u0131 dolaylar\u0131nda yerle\u015fim Frigler'in egemenli\u011fi alt\u0131na girdi. Frigler d\xf6neminde kale i\xe7ine 'Akronium' ismi verilmi\u015f daha sonra bu isim \u015fehir i\xe7inde kullan\u0131lmaya ba\u015flanm\u0131\u015ft\u0131r. M.\xd6. 6. y\xfczy\u0131l\u0131n sonlar\u0131na do\u011fru Frigler'in egemenli\u011fi bitmi\u015f ve yerle\u015fim Pers hakimiyetine ge\xe7mi\u015ftir. Pers egemenli\u011fi, M.\xd6. 333 y\u0131l\u0131nda Makedon Kral\u0131 III. Aleksandros'la yap\u0131lan \u0130ssos Sava\u015f\u0131'nda al\u0131nan yenilgiyle son bulmu\u015ftur. M.\xd6. 30 y\u0131llar\u0131ndan itibaren yerle\u015fiminde i\xe7inde oldu\u011fu b\xf6lge Roma \u0130mparatorlu\u011fu egemenli\u011fine girmi\u015ftir. Romal\u0131lar d\xf6neminde yerle\u015fim 'Akroenos' ad\u0131n\u0131 alm\u0131\u015ft\u0131r. Roma \u0130mparatorlu\u011fu'nun M.S. 395 y\u0131l\u0131nda b\xf6l\xfcnmesiyle yerle\u015fim Bizans \u0130mparatorlu\u011fu topraklar\u0131nda kalm\u0131\u015f ve yerle\u015fime 'Akronion' ismi verilmi\u015ftir.12. y\xfczy\u0131l sonlar\u0131na do\u011fru yerle\u015fim T\xfcrk egemenli\u011fine ge\xe7mi\u015ftir. Anadolu Sel\xe7uklu Devleti'nin K\xf6seda\u011f Muharebesi'nde ald\u0131\u011f\u0131 yenilgi sonucunda Afyon'un da i\xe7erisinde oldu\u011fu b\xf6lge vezir S\xe2hib Ata Fahreddin Ali denetimine verilmi\u015f ve 1275 y\u0131l\u0131nda Afyonkarahisar'\u0131n ba\u015f\u015fehri oldu\u011fu S\xe2hib Atao\u011fullar\u0131 Beyli\u011fi kurulmu\u015ftur. 1341 y\u0131l\u0131nda Germiyano\u011fullar\u0131 Beyli\u011fi topraklar\u0131na kat\u0131lan yerle\u015fim 1390 y\u0131l\u0131nda Osmanl\u0131 egemenli\u011fine ge\xe7mi\u015ftir. 1402 Ankara Sava\u015f\u0131 sonucunda Afyonkarahisar yeniden Germiyano\u011fullar\u0131'n\u0131n eline ge\xe7mi\u015ftir. II. Yakub Bey'in vasiyeti \xfczerine yerle\u015fim 1429 y\u0131l\u0131nda yeniden Osmanl\u0131 egemenli\u011fine kat\u0131lm\u0131\u015ft\u0131r.Osmanl\u0131 d\xf6neminde ilk \xf6nceleri 'Karahisar-\u0131 Devle', 'Karahisar' ve 'Karahisar-\u0131 Sahib' ad\u0131yla sancak merkezi olarak an\u0131lan yerle\u015fim, 1684 y\u0131l\u0131ndaki belgelerde ise 'Afyonkarahisar' ad\u0131yla da an\u0131lmaya ba\u015flam\u0131\u015ft\u0131r. Yerle\u015fim 1833 y\u0131l\u0131nda Kavalal\u0131 \u0130brahim Pa\u015fa kuvvetlerince ele ge\xe7irilmi\u015f, ancak ayn\u0131 y\u0131l i\xe7erisinde tekrar Osmanl\u0131 egemenli\u011fine ge\xe7mi\u015ftir.","Osmanl\u0131 d\xf6neminde bu b\xf6lgedeki \u015fehirle\u015fme 1860 y\u0131l\u0131nda Pakrevand (\xdc\xe7kilise) piskoposu Hovhannes \xf6nderli\u011findeki Bitlisli Ermeni ticaret gruplar\u0131n\u0131n Karakilisa (Kara Kilise) ad\u0131n\u0131 verilerek ba\u015flam\u0131\u015ft\u0131r. Bir m\xfclkte 10-15 d\xfckkan kurularak ba\u015flat\u0131lan \u015fehirle\u015fme sonras\u0131 Milli M\xfccadele\u2019nin ard\u0131ndan kent ad\u0131 Karak\xf6se ad\u0131yla de\u011fi\u015ftirilmi\u015ftir. 1946 y\u0131l\u0131nda ise ad\u0131 A\u011fr\u0131 yap\u0131lm\u0131\u015ft\u0131r.","Amasya \u015fehrinin kurulu\u015f tarihi kesin olarak bilinmemekle birlikte yerle\u015fimin Hitit d\xf6nemine kadar uzad\u0131\u011f\u0131 tahmin edilmektedir. Seloukoslar d\xf6neminde \xf6nemli bir konuma sahip olan yerle\u015fim daha sonra M.\xd6 281 y\u0131l\u0131nda kurulan Pontus Krall\u0131\u011f\u0131'na bir s\xfcre ba\u015fkentlik yapt\u0131. M.\xd6 70 y\u0131l\u0131nda general Lucius Licinius Lucullus taraf\u0131ndan Roma topraklar\u0131na kat\u0131ld\u0131. Diocletianus sonra M.S 3. y\xfczy\u0131lda geli\u015fen yerle\u015fim \xf6nemli bir dini merkez konumuna y\xfckseldi. 4. y\xfczy\u0131l\u0131n ikinci yar\u0131s\u0131nda Roma \u0130mparatorlu\u011fu' nun ikiye b\xf6l\xfcnmesiyle yerle\u015fim Do\u011fu Roma \u0130mparatorlu\u011fu topraklar\u0131na kat\u0131ld\u0131. 712 y\u0131l\u0131nda Arap ordular\u0131nca ele ge\xe7irilen yerle\u015fim k\u0131sa s\xfcre sonra III. Leon taraf\u0131ndan yeniden Bizans topraklar\u0131na kat\u0131ld\u0131. Yerle\u015fim bu tarihten 11. y\xfczy\u0131l sonlar\u0131na kadar Bizans hakimiyetinde kald\u0131.1071 y\u0131l\u0131nda ya\u015fanan Malazgirt Meydan Muharebesi sonras\u0131nda Anadolu'nun bir\xe7ok \u015fehri gibi Amasya'da 11. y\xfczy\u0131l i\xe7inde T\xfcrkler'in egemenli\u011fine ge\xe7ti. Artuk Bey taraf\u0131ndan ele ge\xe7irilen yerle\u015fim daha sonra Dani\u015fmend Gazi 'nin denetimine b\u0131rak\u0131ld\u0131. 1080 y\u0131l\u0131nda da yeni kurulan Dani\u015fmendliler Beyli\u011fi topraklar\u0131na kat\u0131ld\u0131. \u015eehir II. K\u0131l\u0131\xe7 Arslan taraf\u0131ndan 1175 y\u0131l\u0131nda Anadolu Sel\xe7uklu Devleti topraklar\u0131na kat\u0131ld\u0131. K\u0131l\u0131\xe7arslan taraf\u0131ndan o\u011flu Niz\xe2meddin Argun\u015fah'a b\u0131rak\u0131lan yerle\u015fim 1193 y\u0131l\u0131nda K\u0131l\u0131\xe7arslan'\u0131n di\u011fer bir o\u011flu olan R\xfckneddin S\xfcleyman taraf\u0131ndan ele ge\xe7irildi. 1237 y\u0131l\u0131nda ba\u015flayan Babai Ayaklanmas\u0131'nda isyanc\u0131lar\u0131n denetimine giren yerle\u015fim 1240 y\u0131l\u0131nda Sel\xe7uklu kuvvetlerince yeniden ele ge\xe7irilmi\u015f, isyan\u0131n ele ba\u015flar\u0131ndan Baba \u0130shak'da yakalanarak Amasya Kalesinde idam edilmi\u015ftir. Babai Ayaklanmas\u0131 ile iyice g\xfc\xe7s\xfczle\u015fen Sel\xe7uklular 1243 y\u0131l\u0131nda meydana gelen K\xf6seda\u011f Muharebesi ile Anadolu'da g\xfc\xe7 kaybetmeye ba\u015flam\u0131\u015f, 14. y\xfczy\u0131l ba\u015flar\u0131nda da Amasya \u015fehri Mo\u011fol valilerce y\xf6netilmeye ba\u015flanm\u0131\u015ft\u0131r. K\u0131sa s\xfcreli\u011fine II. G\u0131yaseddin Mesud'un o\u011flu T\xe2ceddin Alt\u0131nba\u015f taraf\u0131ndan ele ge\xe7irilen yerle\u015fim sonras\u0131nda Eretna Beyli\u011fi topraklar\u0131na kat\u0131ld\u0131. 14. y\xfczy\u0131l\u0131n ikinci yar\u0131s\u0131nda yerle\u015fim Em\xeer Hac\u0131 \u015eadgeldi taraf\u0131ndan ele ge\xe7irildi. \u015eadgeldi\u2019nin \xf6l\xfcm\xfcnden sonra o\u011flu Ahmed, Osmanl\u0131 h\xfck\xfcmdar\u0131 I. Bayezid'tan destek istemi\u015f ve \u015fehri Kad\u0131 Burh\xe2neddin\u2019e kar\u015f\u0131 savunmu\u015ftur. Osmanl\u0131-Kad\u0131 Burhaneddin m\xfccadelesi sonras\u0131nda Amasya 1393 y\u0131l\u0131nda Osmanl\u0131 topraklar\u0131na kat\u0131ld\u0131. \u015eehrin idaresine de \u015fehzade \xc7elebi Mehmed getirildi.1402 y\u0131l\u0131nda ger\xe7ekle\u015fen Ankara Sava\u015f\u0131 sonras\u0131nda \xc7elebi Mehmed Amasya'ya \xe7ekildi. Fetret Devri olarak adland\u0131r\u0131lan d\xf6nemde karde\u015fleriyle ve di\u011fer beyliklerle m\xfccadelesini 1413 y\u0131l\u0131na kadar Amasya'dan s\xfcrd\xfcrd\xfc. Osmanl\u0131 \u0130mparatorlu\u011fu d\xf6neminde bir\xe7ok padi\u015fah Amasya'da d\xfcnyaya gelmi\u015f ve \u015fehzadelik yapm\u0131\u015ft\u0131r. Bu sebeple Amasya'n\u0131n Osmanl\u0131 tarihi a\xe7\u0131s\u0131ndan da b\xfcy\xfck \xf6neme sahiptir. I. Mehmet, II. Murat, Fatih Sultan Mehmet, Yavuz Sultan Selim gibi padi\u015fahlar Amasya'da \u015fehzadelik yapm\u0131\u015flard\u0131r.[2] 15. y\xfczy\u0131lda bir s\xfcre Rum Eyaleti merkez \u015fehri konumunda bulundu. Ayr\u0131ca Amasya 16. y\xfczy\u0131l sonlar\u0131na kadar Osmanl\u0131lar'\u0131n do\u011fu s\u0131n\u0131r\u0131nda stratejik bir \xf6neme sahip olmu\u015ftur. 1520 y\u0131l\u0131 tahririnde Amasya 48'i M\xfcsl\xfcman, 4'\xfc gayrim\xfcslim olmak \xfczere toplam 52 mahalleden olu\u015fan bir \u015fehir konumundayd\u0131[3]. 1555 y\u0131l\u0131nda Amasya Antla\u015fmas\u0131 burada imzalanm\u0131\u015ft\u0131r. \u015eehir, Celali isyanlar\u0131 s\u0131ras\u0131nda 17. y\xfczy\u0131l ba\u015flar\u0131nda tahribata u\u011frad\u0131. Bundan sonra \xf6nemli bir olay\u0131n ya\u015fanmad\u0131\u011f\u0131 bir sancak merkezi olarak sakin bir d\xf6nem ge\xe7irdi.19 May\u0131s 1919 tarihinde Samsun'da ba\u015flayan Kurtulu\u015f Sava\u015f\u0131'n\u0131n (Mill\xee M\xfccadele)'nin ilk ad\u0131m\u0131, 12 Haziran 1919 tarihinde Mustafa Kemal'in Amasya'ya gelmesiyle at\u0131lm\u0131\u015ft\u0131r.Kurtulu\u015f m\xfccadelesinin planlar\u0131 haz\u0131rlanm\u0131\u015f, Erzurum Kongresi ve Sivas Kongresi'nin toplanmas\u0131na burada karar verilmi\u015f, 22 Haziran 1919 tarihinde yay\u0131nlanan Amasya Genelgesi ile Milletin \u0130stikl\xe2lini Yine Milletin Azim ve Karar\u0131 Kurtaracakt\u0131r denilerek Mill\xee M\xfccadele burada fiiliyata ge\xe7irilmi\u015ftir. Bu itibarla, Amasya, T\xfcrkiye Cumhuriyeti'nin kurulu\u015funda da ilk \xf6nemli ad\u0131m\u0131n at\u0131ld\u0131\u011f\u0131 yer olmu\u015ftur.1923 y\u0131l\u0131nda yeni kurulan T\xfcrkiye Cumhuriyeti' nin idari taksimat\u0131 sonucunda Amasya ilinin merkez \u015fehri oldu.","Ankara'n\u0131n ba\u015fkent ilan edilmesinin ard\u0131ndan (13 Ekim 1923) \u015fehir h\u0131zla geli\u015fmi\u015f ve T\xfcrkiye'nin ikinci en kalabal\u0131k ili olmu\u015ftur. T\xfcrkiye Cumhuriyeti'nin ilk y\u0131llar\u0131nda ekonomisi tar\u0131m ve hayvanc\u0131l\u0131\u011fa dayanan ilin topraklar\u0131n\u0131n yar\u0131s\u0131 h\xe2l\xe2 tar\u0131m ama\xe7l\u0131 kullan\u0131lmaktad\u0131r. Ekonomik etkinlik b\xfcy\xfck oranda ticaret ve sanayiye dayal\u0131d\u0131r. Tar\u0131m ve hayvanc\u0131l\u0131\u011f\u0131n a\u011f\u0131rl\u0131\u011f\u0131 ise giderek azalmaktad\u0131r. Ankara ve civar\u0131ndaki gerek kamu sekt\xf6r\xfc gerek \xf6zel sekt\xf6r yat\u0131r\u0131mlar\u0131, ba\u015fka illerden b\xfcy\xfck bir n\xfcfus g\xf6\xe7\xfcn\xfc te\u015fvik etmi\u015ftir. Cumhuriyetin kurulu\u015fundan g\xfcn\xfcm\xfcze, n\xfcfusu \xfclke n\xfcfusunun iki kat\u0131 h\u0131zda artm\u0131\u015ft\u0131r. N\xfcfusun yakla\u015f\u0131k d\xf6rtte \xfc\xe7\xfc hizmet sekt\xf6r\xfc olarak tan\u0131mlanabilecek memuriyet, ula\u015f\u0131m, haberle\u015fme ve ticaret benzeri i\u015flerde, d\xf6rtte biri sanayide, %2'si ise tar\u0131m alan\u0131nda \xe7al\u0131\u015f\u0131r. Sanayi, \xf6zellikle tekstil, g\u0131da ve in\u015faat sekt\xf6rlerinde yo\u011funla\u015fm\u0131\u015ft\u0131r. G\xfcn\xfcm\xfczde ise en \xe7ok savunma, metal ve motor sekt\xf6rlerinde yat\u0131r\u0131m yap\u0131lmaktad\u0131r. T\xfcrkiye'nin en \xe7ok say\u0131da \xfcniversiteye sahip ili olan Ankara'da ayr\u0131ca, \xfcniversite diplomal\u0131 ki\u015fi oran\u0131 \xfclke ortalamas\u0131n\u0131n iki kat\u0131d\u0131r. Bu e\u011fitimli n\xfcfus, teknoloji a\u011f\u0131rl\u0131kl\u0131 yat\u0131r\u0131mlar\u0131n gereksinim duydu\u011fu i\u015f g\xfcc\xfcn\xfc olu\u015fturur. Ankara'dan otoyollar, demir yolu ve hava yoluyla T\xfcrkiye'nin di\u011fer \u015fehirlerine ula\u015f\u0131l\u0131r.Bilinen tarihi en az 10 bin y\u0131l \xf6ncesine, Eski Ta\u015f \xc7a\u011f\u0131'na ula\u015fan[7] Ankara, tarih \xf6ncesinden g\xfcn\xfcm\xfcze dek pek \xe7ok medeniyeti bar\u0131nd\u0131rm\u0131\u015ft\u0131r. Hititler, Frigyal\u0131lar, Lidyal\u0131lar, Persler, Galatlar, Romal\u0131lar, Bizansl\u0131lar, Sel\xe7uklular, Osmanl\u0131lar ve nihayet T\xfcrkiye Cumhuriyeti, il topraklar\u0131n\u0131 kontrolleri alt\u0131nda tutmu\u015ftur. Tektosaglar\u0131n ve T\xfcrkiye Cumhuriyeti'nin ba\u015fkenti olan Ankara \u015fehri ve Frigyal\u0131lar\u0131n ba\u015fkenti Gordion, il s\u0131n\u0131rlar\u0131 i\xe7inde yer al\u0131r. Y\u0131ld\u0131r\u0131m Bayezid'in Timurlenk'e yenik d\xfc\u015ft\xfc\u011f\xfc Ankara Muharebesi \xc7ubuk yak\u0131nlar\u0131nda ve T\xfcrk Kurtulu\u015f Sava\u015f\u0131'n\u0131n d\xf6n\xfcm noktas\u0131 olan Sakarya Muharebesi Polatl\u0131 yak\u0131nlar\u0131nda yap\u0131lm\u0131\u015ft\u0131r.","Anadolu'da insana ait bilinen en eski yerle\u015fim alanlar\u0131ndan bir tanesi Antalya kent merkezinden yakla\u015f\u0131k 30 km kuzeybat\u0131da Korkuteli yolu \xfczerinde Toros Da\u011flar\u0131n\u0131n Akdeniz'e bakan yama\xe7lar\u0131nda bulunan Karain Ma\u011faras\u0131'd\u0131r. Tarihlendirilmesi g\xfcn\xfcm\xfczden yakla\u015f\u0131k 500 bin y\u0131l kadar geriye, ba\u015fka bir deyi\u015fle Eski Ta\u015f \xc7a\u011f\u0131n\u0131n ilk d\xf6nemlerine rast gelmektedir.Bu d\xf6nem, g\xfcn\xfcm\xfczden 2 milyon ila 140 bin y\u0131llar\u0131 aras\u0131nda kalan evresini i\xe7erir. Karain'de ma\u011fara adamlar\u0131na (homo sapiens neandertalensis) ili\u015fkin kemik kal\u0131nt\u0131lar\u0131 da ele ge\xe7mi\u015ftir. Bunlar, t\xfcm Anadolu'da ele ge\xe7en en erken fosil kal\u0131nt\u0131lar\u0131d\u0131r.B\xf6lgenin en eski tarih \xf6ncesi d\xf6nem buluntular\u0131n\u0131 i\xe7eren Karain Ma\u011faras\u0131, Eski Ta\u015f Devri ve Cilal\u0131 Ta\u015f Devrinden, Beldibi Ma\u011faras\u0131 da Orta Ta\u015f \xc7a\u011f\u0131ndan veriler sunarken; Badema\u011fac\u0131 H\xf6y\xfc\u011f\xfc'nde yap\u0131lan kaz\u0131larda Cilal\u0131 Ta\u015f \xc7a\u011f\u0131 yerle\u015fimlerine, buluntular\u0131na ve insan\u0131n yerle\u015fik hayata ge\xe7i\u015finin ilk izlerine rastlan\u0131r. Bunlara Karata\u015f, Semah\xf6y\xfck'te yap\u0131lan kaz\u0131larla elde edilen Erken Tun\xe7 \xc7a\u011f\u0131 bulgular\u0131 da eklenince, b\xf6lgede Eski Ta\u015f \xc7a\u011f\u0131ndan zaman\u0131m\u0131za kadar kesintisiz bir uygarl\u0131k vard\u0131r. Devam\u0131 Wikipedia'da.","\xc7oruh Havzas\u0131nda bulunan Artvin, antik \xe7a\u011fda Kolheti ve \u0130beria s\u0131n\u0131rlar\u0131 i\xe7inde yer al\u0131yordu. Baz\u0131 ara\u015ft\u0131rmac\u0131lar, Yunan mitolojisinde ad\u0131 ge\xe7en Fasis Nehrinin Rioni de\u011fil, Artvin\u2019in de k\u0131y\u0131s\u0131nda yer ald\u0131\u011f\u0131 \xc7oruh oldu\u011funu ileri s\xfcrerler.[11][12] Artvin\u2019in Kolheti d\xf6neminde Tun\xe7 \xc7a\u011f\u0131 yerle\u015fmesi oldu\u011fu kabul edilir. Klasik kronolojiyle b\xf6lge tarihini aktaran kaynaklara g\xf6re, bulundu\u011fu yer itibar\u0131yla Artvin, \u0130\xd6 8. y\xfczy\u0131lda Kimmerler, \u0130\xd6 7. y\xfczy\u0131lda \u0130skitler taraf\u0131ndan istila edildi. \u0130\xd6 200 y\u0131l\u0131nda \u0130beria Krall\u0131\u011f\u0131'n\u0131n, \u0130\xd6 119'da Pontus'un, \u0130\xd6 65 y\u0131l\u0131nda Roma'n\u0131n egemenli\u011fine girdi.[13] 1944 y\u0131l\u0131nda K\u0131l\u0131\xe7 K\xf6kten'in yapt\u0131\u011f\u0131 kaz\u0131larda il \xe7evresinde M\xd6 3500-2200 y\u0131llar\u0131na tarihlenen Kura-Aras (Erken Trans-Kafkasya K\xfclt\xfcr\xfc) ile ili\u015fkilendirilen yerle\u015fim izlerine rastlanm\u0131\u015ft\u0131r.Artvin, erken Orta \xc7a\u011f'da G\xfcrc\xfclerin \xf6nemli merkezi olan Tao-Klarceti b\xf6lgesinde, 8-9. y\xfczy\u0131llarda kurapalatilerin y\xf6netti\u011fi bir yerdi. Sonra birle\u015fik G\xfcrcistan krall\u0131\u011f\u0131 i\xe7inde yer ald\u0131. Birle\u015fik G\xfcrcistan krall\u0131\u011f\u0131n\u0131 par\xe7alanmas\u0131ndan ve Moo\u011fol istilas\u0131ndan sonra 13. y\xfczy\u0131lda G\xfcrc\xfc atabeglerin y\xf6netimine girdi. 16. y\xfczy\u0131lda, G\xfcrc\xfc arabeglerini gerileten Osmanl\u0131lar\u0131n eline ge\xe7ti. Osmanl\u0131lar Tao-Klarceti\u2019yi tamamen ele ge\xe7irince bu topraklarda \xc7\u0131ld\u0131r Eyaleti\u2019ni kurdular. Artvin bu eyalet i\xe7inde Livana (Nisf-i Livana) adl\u0131 livan\u0131n (sancak) merkeziydi.[14] Uzun s\xfcre Osmanl\u0131 y\xf6netimi alt\u0131nda kalan Artvin, 1877-1878 Osmanl\u0131-Rus Sava\u015f\u0131\u2019nda Ruslar\u0131n eline ge\xe7ti.Bu sava\u015ftan sonra Artvin ve \xe7evresinden G\xfcrc\xfclerin \xf6nemli bir k\u0131sm\u0131 g\xf6\xe7 etti. Bu tarihten k\u0131sa bir s\xfcre \xf6nce, 1874\u2019te Giorgi Kazbegi'nin tespitine g\xf6re Artvin kentinde G\xfcrc\xfcce seyrek konu\u015fuluyor olmas\u0131na kar\u015f\u0131n arka mahallelerde neredeyse herkes G\xfcrc\xfcce konu\u015fuyordu. Artvin G\xfcrc\xfclerden sonra \xf6nemli bir Ermeni n\xfcfusa sahipti. \u015eehrin tamam\u0131nda 2.000 ev vard\u0131. Bunlardan 100\u2019\xfc Gregoryen Ermenilerine, 600\u2019\xfc Katolik Ermenilerine, geri kalanlar ise M\xfcsl\xfcmanlara aitti.Bu da\u011f\u0131l\u0131ma uygun olarak ahalinin be\u015f camisi, d\xf6rt Katolik ve bir Gregoryan kilisesi vard\u0131. \u015eehirde sekiz kahvehane ve 250 d\xfckk\xe2n bulunuyordu. Evler da\u011f\u0131n dik bir yamac\u0131na yan yana s\u0131ral\u0131 bir \u015fekilde kuruluydu. \u015eehrin kenar b\xf6l\xfcmlerinde zeytin bah\xe7eleri, incir a\u011fa\xe7lar\u0131 i\xe7inde k\xf6y diye adland\u0131r\u0131lan yerler vard\u0131.[15] 1874\u2019te b\xf6lgeyi gezen Giorgi Kazbegi Artvin\u2019da ticaretle sadece Ermenilerin me\u015fgul oldu\u011funu yazar. 1882 y\u0131l\u0131nda Artvin\u2019de iki Ermeni Gregoryen, \xfc\xe7 Ermeni Katolik kilisesi, \xfc\xe7 deri fabrikas\u0131, yedi okul vard\u0131. Rus y\xf6netimi s\u0131ras\u0131nda Artvin kenti ayn\u0131 adl\u0131 ilin (okrug) merkeziydi.Rus idaresinin 1886 yapt\u0131\u011f\u0131 n\xfcfus say\u0131m\u0131na g\xf6re Artvin kasabas\u0131 Batum oblast\u0131 s\u0131n\u0131rlar\u0131 i\xe7indeki Artvin sanca\u011f\u0131n\u0131n (okrug) merkeziydi. Artvin sanca\u011f\u0131n\u0131n n\xfcfusu 52.434 ki\u015fiden olu\u015fuyordu. Bu n\xfcfusun % 34,5 (17.814 ki\u015fi) G\xfcrc\xfc, % 50,3\u2019\xfc (26.395 ki\u015fi) T\xfcrk, %14,8\u2019i (7.775 ki\u015fi) Ermeni, %0,3 (154 ki\u015fi) K\xfcrt, % 0,6\u2019s\u0131 (296 ki\u015fi) \xc7ingene olarak kaydedilmi\u015fti. Artvin sanca\u011f\u0131ndaki kazalardan biri olan Artvin kazas\u0131nda (u\xe7astok) ise, 12.919 ki\u015fi ya\u015f\u0131yordu. Bu n\xfcfusun % 53,5\u2019i (6.913 ki\u015fi), % 46,5\u2019i (6.001 ki\u015fi) T\xfcrk ve % 0,1\u2019i (5 ki\u015fi) Ermenilerden olu\u015fuyordu. Artvin kasabas\u0131nda ise 6.442 ki\u015fi ya\u015f\u0131yordu.9 \u015fubat 1897 tarihinde Rusya'da yap\u0131lan genel n\xfcfus say\u0131m\u0131 esnas\u0131nda Artvin Sanca\u011f\u0131'nda da n\xfcfus say\u0131m\u0131 yap\u0131lm\u0131\u015ft\u0131r. Bu n\xfcfus say\u0131m\u0131nda cinsiyet, ya\u015f, milliyet, mezhep, toplumsal z\xfcmre, meslek, okur-yazarl\u0131k, \xf6\u011frenim, \u015fehirle\u015fme oran\u0131, ana dili, do\u011fum yeri, uyru\u011fu, medeni durumu gibi ayr\u0131nt\u0131l\u0131 sorular sorulmu\u015ftur. Kutaisi Guberniyas\u0131na ba\u011fl\u0131 Artvin Sanca\u011f\u0131'n\u0131n toplam n\xfcfusu 56.140 ki\u015fiydi. Mezhep ve din da\u011f\u0131l\u0131m\u0131nda n\xfcfusun %84'\xfc M\xfcsl\xfcman, %8,5'i Ermeni Katolik ve Protestan, %5,5'i Ortodoks Ermeni, %2'si di\u011fer Ortodoks gruplard\u0131. Anadile g\xf6re da\u011f\u0131l\u0131mda %74'\xfc T\xfcrk\xe7e, %12'si Ermenice, %10'u G\xfcrc\xfcce ve %2'si de Rus\xe7a konu\u015fuyordu.I. D\xfcnya Sava\u015f\u0131 sonlar\u0131na do\u011fru Rus ordusunun b\xf6lgeden \xe7ekilmesinin ard\u0131ndan Artvin, 1918-1921 aras\u0131nda ba\u011f\u0131ms\u0131z olan G\xfcrcistan s\u0131n\u0131rlar\u0131 i\xe7inde yer ald\u0131. 1921\u2019de K\u0131z\u0131l Ordu'nun G\xfcrcistan'\u0131 i\u015fgali s\u0131ras\u0131nda Ankara H\xfck\xfcmeti\u2019nin G\xfcrcistan h\xfck\xfcmetine 23 \u015eubat 1921\u2019de verdi\u011fi nota do\u011frultusunda G\xfcrc\xfc birlikleri b\xf6lgeden \xe7ekildi. T\xfcrk birlikleri genel bir harek\xe2tla Tao-Klarceti b\xf6lgesinin b\xfcy\xfck k\u0131sm\u0131n\u0131 (Artvin ve Ardahan) ile Batum\u2019u i\u015fgal etti.[18] Ancak T\xfcrk birlikleri Giorgi Maznia\u015fvili komutas\u0131ndaki G\xfcrc\xfc ordusu taraf\u0131ndan Batum\u2019dan \xe7\u0131kar\u0131ld\u0131 ve sadece Artvin ve Ardahan b\xf6lgeleri T\xfcrkiye s\u0131n\u0131rlar\u0131 i\xe7inde kald\u0131. 4 Ocak 1936 tarihinde yeni kurulan \xc7oruh ilinin ad\u0131, 17 \u015eubat 1956 tarihinde TBMM'inde kabul edilen 6668 say\u0131l\u0131 kanunla[19] Artvin olarak de\u011fi\u015ftirilerek bu ilin merkezi yap\u0131lm\u0131\u015ft\u0131r.","Ayd\u0131n; \xe7e\u015fitli uygarl\u0131klara ev sahipli\u011fi yapm\u0131\u015f, Antik \xc7a\u011fda Afrodisias, Milet, Didyma, Nysa, Priene, Magnesia gibi \xf6nde gelen kentlerdir. Bug\xfcnk\xfc Ayd\u0131n, Tralleis Kenti ile birlikte M\xd6 2500 y\u0131l\u0131nda Hititler zaman\u0131nda geli\u015fmi\u015f, 8. y\xfczy\u0131lda Lydia zaman\u0131nda da en parlak \xe7a\u011f\u0131n\u0131 ya\u015fam\u0131\u015ft\u0131r. Sel\xe7uklularla birlikte T\xfcrk uygarl\u0131\u011f\u0131n\u0131n k\xfclt\xfcr varl\u0131\u011f\u0131 ve eserleriyle donat\u0131lm\u0131\u015ft\u0131r.Ayd\u0131no\u011fullar\u0131 zaman\u0131nda \u015fehrin ad\u0131 Ayd\u0131n G\xfczelhisar\u0131 olmu\u015f, daha sonra Ayd\u0131n ad\u0131n\u0131 alm\u0131\u015ft\u0131r. 1811\u2019de \u0130zmir, Saruhan (Manisa), Mente\u015fe (Mu\u011fla), Antalya, Isparta sancaklar\u0131n\u0131 kapsayan eyaletin merkezi oldu. Kurtulu\u015f Sava\u015f\u0131ndan sonra 1923 y\u0131l\u0131nda Ayd\u0131n m\xfcstakil vilayet olmu\u015ftur.","Bal\u0131kesir genelindeki pek \xe7ok h\xf6y\xfck, ma\u011fara ve d\xfcz yerle\u015fim yerlerinde yap\u0131lan ara\u015ft\u0131rmalarda bu topraklara M\xd6 8000-3000 y\u0131llar\u0131 aras\u0131 yerle\u015fildi\u011fi ortaya \xe7\u0131km\u0131\u015ft\u0131r.[14] Havran'a 8 km. mesafedeki \u0130nbo\u011faz\u0131 ma\u011faralar\u0131nda Paleolitik, Neolitik ve Kalkolitik devirlerinden kalma kal\u0131nt\u0131lar bulunmu\u015ftur. Babak\xf6y (Ba\u015fp\u0131nar) kaz\u0131lar\u0131nda, Yortan mezarl\u0131\u011f\u0131nda, Ayval\u0131k Dikili yolu \xfczerindeki Kaymak Tepe'de Bak\u0131r \xc7a\u011f\u0131'na ait kal\u0131nt\u0131lar ve yerle\u015fim yerleri bulunmu\u015ftur.[15] Bu b\xf6lgede ilk defa ad\u0131 ge\xe7en \u015fehir Agiros (Achiraus)'dur.[16] Anadolu Sel\xe7uklu Devleti'nin y\u0131k\u0131lmas\u0131ndan sonra b\xf6lgede Karesi Beyli\u011fi kurulmu\u015f,[17] ard\u0131ndan b\xf6lge Osmanl\u0131 Devleti'nin eline ge\xe7mi\u015ftir.","G\xfcn\xfcm\xfcz yerle\u015fimiyle ilgili bilgiler s\u0131n\u0131rl\u0131d\u0131r. \u015eehrin 4 km g\xfcneybat\u0131s\u0131nda yerle\u015fimin M.\xd6 3000'lere kadar uzad\u0131\u011f\u0131 d\xfc\u015f\xfcn\xfclen Agrilion antik kenti bulunmaktad\u0131r. G\xfcn\xfcm\xfcz yerle\u015fimin Hamsu ve Deba\u011fhane dereleri aras\u0131ndaki kayal\u0131k \xe7\u0131k\u0131nt\u0131da Bizans d\xf6neminde Belekoma ad\u0131yla bilinen bir kale bulunmaktayd\u0131[2]. 13. y\xfczy\u0131lda Bizans'\u0131n Sel\xe7uklularla m\xfccadelesinde u\xe7 b\xf6lgesinde yer alan Bilecik, y\xfczy\u0131l\u0131n ortalar\u0131ndan itibaren tekfur idaresinde merkezden yar\u0131 ba\u011f\u0131ms\u0131z olarak y\xf6netilmekteydi. Bilecik, 1299 y\u0131l\u0131nda ani bir bask\u0131nla Osmanl\u0131 topraklar\u0131na kat\u0131ld\u0131. Bilecik'in ele ge\xe7irilmesiyle Osman Gazi burada bir mescid yapt\u0131rm\u0131\u015f, k\xfc\xe7\xfck o\u011flu Ali ve e\u015fi ile ayn\u0131 zamanda e\u015finin babas\u0131 olan \u015eeyh Edebali burada ya\u015fam\u0131\u015ft\u0131r. \u015eehir kalenin etraf\u0131nda geli\u015fim g\xf6stermekle birlikte, co\u011frafi yap\u0131dan dolay\u0131 yeterli b\xfcy\xfcme sa\u011flanamam\u0131\u015ft\u0131r. 16. y\xfczy\u0131lda 700 civar\u0131nda k\xfc\xe7\xfck bir n\xfcfusa sahip olan yerle\u015fimin onda bir kadar\u0131n\u0131 Hristiyan n\xfcfus olu\u015fturmaktayd\u0131. 1649 y\u0131l\u0131ndaki Av\xe2r\u0131z kay\u0131tlar\u0131nda Bilecik Ertu\u011frul Gazi vak\u0131flar\u0131na ait bir kasaba olarak kaydedilmi\u015ftir. Bu d\xf6nemde yerle\u015fim, dokuz M\xfcsl\xfcman ve bir Hristiyan olmak \xfczere 10 mahalleden olu\u015fmaktayd\u0131. Co\u011frafi konumu nedeniyle tar\u0131mda yap\u0131lamayan yerle\u015fim, bu tarihlerde demir madencili\u011fi ve ipek dokumac\u0131l\u0131\u011f\u0131 y\xf6n\xfcyle geli\u015fmi\u015fti. Osmanl\u0131 idaresinde uzun s\xfcre Sultan\xf6n\xfc sanca\u011f\u0131na ba\u011fl\u0131 bir kaza olarak g\xf6r\xfclen yerle\u015fim, Tanzimat\u2019tan sonra H\xfcdavendig\xe2r eyaletine ba\u011fl\u0131 bir sancak oldu. II. Abd\xfclhamid d\xf6neminde Ertu\u011frul sanca\u011f\u0131n\u0131n merkez kazas\u0131 Bilecik, Cumhuriyet\u2019in ilk y\u0131llar\u0131nda vil\xe2yet oldu[3]. 1924 y\u0131l\u0131nda vil\xe2yetin ad\u0131 Bilecik\u2019e \xe7evrildi.","1927 y\u0131l\u0131na kadar \xc7olik (\xc7apak\xe7ur) isimi ile Gen\xe7 Vilayeti'nin bir il\xe7esi idi. 4 Ocak 1936 tarihinde Bing\xf6l iline merkez olmu\u015ftur.","Tarih\xe7iler Bitlis tarihini de\u011fi\u015fik zamanlardan ba\u015flatmaktad\u0131rlar. 5000 y\u0131ll\u0131k, 7000 y\u0131ll\u0131k tarih gibi. Ger\xe7ekte Bitlis tarihi Neolotik \xc7a\u011f dedi\u011fimiz Yenita\u015f d\xf6nemine kadar uzanmaktad\u0131r. Bitlis ve y\xf6resinin yaz\u0131l\u0131 tarih \xf6ncesi olduk\xe7a karanl\u0131kt\u0131r. En \xf6nemli nedenleri y\xfczeydeki buluntular\u0131n az olmas\u0131 ve bug\xfcne kadar ger\xe7ek\xe7i bir arkeolojik \xe7al\u0131\u015fma yap\u0131lmamas\u0131d\u0131r. Bitlis ili s\u0131n\u0131rlar\u0131 i\xe7erisinde bulunan S\xfcphan ve Nemrut Da\u011f\u0131 da\u011flar\u0131ndaki obsidyen (do\u011fal cam yataklar\u0131), do\u011frudan olmasa bile dolayl\u0131 olarak bu y\xf6re tarihinin Neolitik d\xf6nemine kadar \xe7\u0131kt\u0131\u011f\u0131n\u0131 g\xf6stermektedir. Obsidyen yataklar\u0131ndan elde edilen do\u011fal cam\u0131n yontucu, kesici, kaz\u0131y\u0131c\u0131 olarak \xe7evredeki yerle\u015fim yerlerinde kullan\u0131ld\u0131\u011f\u0131 anla\u015f\u0131lmaktad\u0131r. Yine yap\u0131lan \xe7al\u0131\u015fmalar sonucunda o d\xf6neme ait ticaret yolu Van G\xf6l\xfc'n\xfcn do\u011fusundan g\xfcneye (bug\xfcnk\xfc Van ili s\u0131n\u0131rlar\u0131 i\xe7erisinde bulunan Kalkolitik \u2013 Maden D\xf6nemi \u2013 yerle\u015fme alan\u0131 olan Tilkitepe), bat\u0131da ise Diyarbak\u0131r il s\u0131n\u0131rlar\u0131na (Ergani yak\u0131n\u0131ndaki \xe7anak-\xe7\xf6mleksiz bir Neolitik yerle\u015fme yeri olan \xc7ay\xf6n\xfc) dek uzanmaktad\u0131r.","M.\xd6. 1200\u2019l\xfc y\u0131llarda b\xfct\xfcn Hitit topraklar\u0131 gibi Bolu da Friglerin elindeydi. M.\xd6. 6. as\u0131rda Persler b\xf6lgeye hakim oldular. M.\xd6. 336\u2019da B\xfcy\xfck \u0130skender Persleri yenerek Anadolu\u2019nun bir\xe7ok yeri gibi Bolu\u2019yu da ele ge\xe7irdi. B\xfcy\xfck \u0130skender\u2019in \xf6l\xfcm\xfc \xfczerine Makedonya y\u0131k\u0131l\u0131nca Bolu b\xf6lgesinde Bitinya Krall\u0131\u011f\u0131 kuruldu. Yaz\u0131l\u0131 belgeler, o d\xf6nemlerden kalan arkeolojik eserler ve tarih kaynaklar\u0131na g\xf6re, Trak g\xf6\xe7leri sonunda Sakarya ve Filyos Nehrinin yay\u0131 i\xe7ine yerle\u015fen halk Bithyn ismi ile an\u0131l\u0131yordu. Bu y\xfczden Bolu'nun da i\xe7inde bulundu\u011fu Kuzeybat\u0131 Anadolu'ya Bithynia denilmi\u015ftir. Bithynler taraf\u0131ndan Salonia Campus denilen Bolu Ovas\u0131 ve \xe7evresinin ad\u0131 Romal\u0131lar taraf\u0131ndan \u201cClaudio Polis\u201d olarak de\u011fi\u015ftirilmi\u015ftir. Bolu isminin de \u201cPolis\u201dten geldi\u011fi san\u0131lmaktad\u0131r. \xdc\xe7 tepe \xfczerinde kurulmu\u015f olan \u015fehir i\xe7te ve d\u0131\u015fta surlara sahipti. \u015eehrin kuzeyinde Hal\u0131 Hisar\u0131 b\xf6lgesinde bu surlar\u0131n kal\u0131nt\u0131lar\u0131 g\xf6r\xfclebilmektedir. 1071 Malazgirt zaferinden sonra bat\u0131ya yay\u0131lan T\xfcrkmenler 3 y\u0131l sonra Bolu\u2019ya yerle\u015ftiler. Sel\xe7uklu Devleti\u2019nin komutanlar\u0131 Artuk, Tutuk, Dani\u015fmend, Karateki ve Saltuk Beyler S\xfcleyman \u015eah\u2019\u0131n emrinde \u0130stanbul s\u0131n\u0131r\u0131na dayand\u0131lar. Bu ak\u0131nlar s\u0131ras\u0131nda Bolu, Horasanl\u0131 Aslahaddin taraf\u0131ndan fethedilmi\u015ftir. Bolu Y\xf6resine Osmanl\u0131 ak\u0131n\u0131 ilk kez Osman Gazi taraf\u0131ndan ba\u015flat\u0131lm\u0131\u015ft\u0131r. Bolu y\xf6resinin t\xfcm\xfcyle fethedilmesi ise Orhan Gazi d\xf6neminin ilk y\u0131llar\u0131na (1324 - 1326) rastlar. Bir ba\u015fka rivayete g\xf6re Osmanl\u0131lar zaman\u0131nda b\xf6lgede, bol olarak Ulu\u011f - Alim olmas\u0131 nedeniyle \xf6nceleri \u201cBol Ulu\u011f\u201d, zamanla y\xf6re \u201cBOLU\u201d olarak isimlendirilmi\u015ftir. Y\u0131ld\u0131r\u0131m Beyazid'in \xf6l\xfcm\xfc ile ba\u015flayan \u015fehzadeler sava\u015f\u0131na Bolu, bir\xe7ok kez sahne oldu. Bolu, Ankara Sava\u015f\u0131 sonras\u0131 Timur\u2019un talan etti\u011fi b\xf6lgelerin d\u0131\u015f\u0131nda kald\u0131\u011f\u0131 gibi, bu tehlike bitinceye kadar, Osmanl\u0131 Devleti\u2019nin 2. kurucusu say\u0131lan \xc7elebi Mehmet\u2019i de K\u0131z\u0131k Yaylas\u0131nda bar\u0131nd\u0131ran belde olmu\u015ftur. \xc7elebi Mehmet\u2019in Osmanl\u0131 Devleti\u2019nin birli\u011fini sa\u011flamas\u0131ndan sonra ise Bolu, d\xfczenli bir y\xf6netime kavu\u015ftu. 1324 \u2013 1692 y\u0131llar\u0131 aras\u0131nda Bolu, 36 kazas\u0131 olan bir sancak beyli\u011fi idi. XVI. Y\xfczy\u0131lda Bolu, ikinci derece \u015eehzade sancaklar\u0131ndan biri oldu. 2. Bayezit d\xf6neminde \u015eehzade S\xfcleyman (Kanuni) buraya atand\u0131. 1683-1792 y\u0131llar\u0131 aras\u0131nda Bolu, Voyvodal\u0131kla y\xf6netildi. II. Mahmut zaman\u0131nda ise Mutasarr\u0131fl\u0131\u011fa d\xf6n\xfc\u015ft\xfcr\xfcld\xfc. (1811) Tanzimat sonras\u0131 Bolu; Kastamonu eyaletine ba\u011fland\u0131 (1864). 1909 y\u0131l\u0131nda ise tekrar Mutasarr\u0131fl\u0131\u011fa d\xf6n\xfc\u015ft\xfcr\xfcld\xfc. Mondros M\xfctarekesi\u2019nin y\xfcr\xfcrl\xfc\u011fe girmesi ve \u0130zmir\u2019in i\u015fgal edilmesinin ard\u0131ndan Bolu y\xf6resinde ilk M\xfcdafa-i Hukuk Cemiyeti Gerede\u2019de \xf6rg\xfctlendi. Bolu 1. D\xfcnya Sava\u015f\u0131\u2019nda ve sonras\u0131nda d\xfc\u015fman i\u015fgaline u\u011framad\u0131 fakat maddi zarar g\xf6rd\xfc. Mustafa Kemal Pa\u015fa \xf6nderli\u011finde yap\u0131lan milli m\xfccadele d\xf6nemlerinin sonunda Bolu, 10 Ekim 1923'te Mutasarr\u0131fl\u0131k devrini tamamlad\u0131 ve vilayet haline getirildi.","A\u011flasun il\xe7esinde yer alan Helenistik d\xf6nemden antik kent Sagalassos bulunmaktad\u0131r. Tarihi k\xfct\xfcphane, tiyatro sahnesi gibi eserler bulunmaktad\u0131r. Kaz\u0131 \xe7al\u0131\u015fmalar\u0131 ve ara\u015ft\u0131rmalar h\xe2len devam etmektedir.","Bursa'da \u015fimdilik bilinen en eski arkeolojik kal\u0131nt\u0131lar Yeni\u015fehir yak\u0131nlar\u0131ndaki Mente\u015fe H\xf6y\xfc\u011f\xfc ve Orhangazi yak\u0131nlar\u0131ndaki Il\u0131p\u0131nar'dan bilinmektedir. Bu arkeolojik buluntu yerlerinin en eski tabakalar\u0131 yakla\u015f\u0131k 7 bin y\u0131ll\u0131kt\u0131r. Bu tabakalardaki k\xfclt\xfcr, \xe7anak \xe7\xf6mle\u011fin geli\u015fmi\u015f olarak ortaya \xe7\u0131kt\u0131\u011f\u0131, mimarinin d\xf6rtgen planl\u0131, bol miktarda ah\u015fap destekli kerpi\xe7 kullan\u0131larak in\u015fa edilmi\u015f yap\u0131lardan olu\u015ftu\u011fu tabakalard\u0131r. Bursa'da David French, Mehmet \xd6zdo\u011fan ve Jacop Roodenberg'in arkeoloji ile ilgili \xe7al\u0131\u015fmalar\u0131 tarih \xf6ncesiyle ilgili pek \xe7ok yeni bilgi ortaya koymu\u015ftur.[Bursa ve civar\u0131nda M\xd6 4000'li y\u0131llardan itibaren \xe7e\u015fitli yerle\u015fimlerin oldu\u011fu saptanm\u0131\u015ft\u0131r; fakat y\xf6reye ait kesin bilgiler M\xd6 700'lere dayanmaktad\u0131r. Homeros, b\xf6lgeden Mysia[4] olarak s\xf6z etmektedir. G\xfcn\xfcm\xfczde Bursa y\xf6resinde Mysia yerle\u015fmelerini an\u0131msatan iki k\xf6y bulunmaktad\u0131r: Misi (G\xfcm\xfc\u015ftepe) ve Misebolu. Ayr\u0131ca Prof. Dr. Semavi Eyice, belgesel y\xf6netmeni Tekin G\xfcn yapt\u0131\u011f\u0131 y\xfczey \xe7al\u0131\u015fmalar\u0131 s\u0131ras\u0131nda Kentin 14 km bat\u0131s\u0131nda, \xc7ay\u0131rk\xf6y\xfc\u2019n\xfcn 1 km g\xfcneybat\u0131s\u0131ndaki \u201c\xc7ay\u0131rk\xf6y H\xf6y\xfc\u011f\xfc\u2019n\xfcn\u201d boyutlar\u0131 da Demirta\u015f H\xf6y\xfc\u011f\xfc ile ayn\u0131d\u0131r. Burada bulunan seramik par\xe7alar\u0131nda gri, k\u0131rm\u0131z\u0131, kahverengi ve siyah renkler hakimdir. Bulunan seramik par\xe7alar\u0131n\u0131n \xf6nemli k\u0131sm\u0131 elde yap\u0131lm\u0131\u015f, \xe7ok az\u0131 ise \xe7arkta yap\u0131lm\u0131\u015ft\u0131r. H\xf6y\xfc\u011f\xfcn en eski buluntusu M\xd6. 2700-2500 y\u0131l\u0131na erken Bronz \xc7a\u011f\u0131'na i\u015faret etmektedir.Bursa, 1204-1261 y\u0131llar\u0131 aras\u0131nda \u0130znik'e ba\u011fl\u0131d\u0131r, genelde kale i\xe7inde kalm\u0131\u015f, fazla b\xfcy\xfcyememi\u015ftir.Anadolu Sel\xe7uklu Devleti'nin zay\u0131flay\u0131p da\u011f\u0131lmaya ba\u015flamas\u0131yla kurulan Anadolu Beylikleri i\xe7inde zamanla geli\u015fen Osmanl\u0131 Beyli\u011fi, \xe7evredeki tekfurlar\u0131n arazilerini de alarak g\xfc\xe7lenmi\u015ftir. Bursa, 1307 y\u0131l\u0131nda Osman Bey taraf\u0131ndan ku\u015fat\u0131lm\u0131\u015f, uzun s\xfcren ku\u015fatmadan sonra 6 Nisan 1326'da Osman Bey'in o\u011flu Orhan Bey taraf\u0131ndan al\u0131nm\u0131\u015ft\u0131r. 1335 y\u0131l\u0131nda ba\u015fkent Bursa'ya ta\u015f\u0131nm\u0131\u015f ve kentte b\xfcy\xfck imar hareketleri ya\u015fanm\u0131\u015ft\u0131r.Osmanl\u0131lar Bursa'y\u0131 ald\u0131klar\u0131nda kent sadece hisar i\xe7inden ibaretken, Orhan Gazi \u015fehri hisar\u0131n d\u0131\u015f\u0131na \xe7\u0131kararak Orhan Gazi K\xfclliyesini kurdurtmu\u015ftur. Surlar d\u0131\u015f\u0131nda mevcut yerle\u015fmeye yak\u0131n, hakim noktalarda cami, hamam, imarethane, dar\xfc\u015f\u015fifa, medrese gibi kamu yap\u0131lar\u0131 in\u015fa edilerek bu k\xfclliyelerin \xe7evrelerinde konut alanlar\u0131 yarat\u0131lm\u0131\u015f ve b\xf6ylece bir yerle\u015fme gelene\u011fi ba\u015flam\u0131\u015ft\u0131r. Ba\u015fkent, 1363 y\u0131l\u0131nda (I. Murad H\xfcdavendig\xe2r d\xf6neminde) Edirne'ye ta\u015f\u0131nm\u0131\u015ft\u0131r. Fatih Sultan Mehmed'in \u0130stanbul'u fethetmesinden sonra ise Bursa'n\u0131n faal rol\xfc son bulmu\u015f ve y\xf6netim merkezi niteli\u011fini kaybetmi\u015ftir.Bursa'da Osmanl\u0131 Devleti hakimiyetinde, 1922 y\u0131l\u0131na kadar, M\xfcsl\xfcman, Rum, Ermeni ve Yahudiler birlikte ya\u015fam\u0131\u015flard\u0131r.Tanzimat sonras\u0131 d\xf6nemde H\xfcdavendigar Vilayeti merkezli\u011fi yapan Bursa'ya 1900'l\xfc y\u0131llar\u0131n ba\u015f\u0131nda Biga (merkezi \xc7anakkale), Bilecik, K\xfctahya, Karesi (Bal\u0131kesir), Karahisar (Afyon) sancaklar\u0131 ba\u011fl\u0131 bulunmaktayd\u0131.Mill\xee m\xfccadele d\xf6nemlerinde \xe7e\u015fitli ayaklanmalar\u0131n ya\u015fand\u0131\u011f\u0131 Bursa, 8 Temmuz 1920 de Yunanlarca i\u015fgal edilmi\u015f; Ba\u015fkomutanl\u0131k Meydan Muharebesi'nden sonra 11 Eyl\xfcl 1922'de T\xfcrk birliklerince geri al\u0131nm\u0131\u015ft\u0131r.Bursa, 1987 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 3391 say\u0131l\u0131 kanun[6] ile b\xfcy\xfck\u015fehir unvan\u0131 kazand\u0131. Ba\u015flang\u0131\xe7ta \xfc\xe7 il\xe7e (Nil\xfcfer, Osmangazi ve Y\u0131ld\u0131r\u0131m) Bursa B\xfcy\xfck\u015fehir Belediyesi'nin s\u0131n\u0131rlar\u0131na dahil edildi. 2004 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 5216 say\u0131l\u0131 kanun ile b\xfcy\xfck\u015fehir belediyesinin s\u0131n\u0131rlar\u0131 valilik binas\u0131 merkez kabul edilerek yar\u0131\xe7ap\u0131 30 kilometre olan dairenin s\u0131n\u0131rlar\u0131na geni\u015fletildi.[7] Bu s\u0131n\u0131rlar i\xe7inde kalan 7 il\xe7e, b\xfcy\xfck\u015fehir il\xe7e belediyeleri h\xe2line geldi.[7] 2012 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 6360 say\u0131l\u0131 kanun ile 2014 T\xfcrkiye yerel se\xe7imlerinin ard\u0131ndan b\xfcy\xfck\u015fehir belediyesinin s\u0131n\u0131rlar\u0131 il m\xfclki s\u0131n\u0131rlar\u0131 oldu.21 Ekim 2014 tarihinde, Bursa Valili\u011fi ve Bursa K\xfclt\xfcr Tan\u0131tma Birli\u011fi taraf\u0131ndan Bursa \u015fehir logosu tan\u0131t\u0131lm\u0131\u015ft\u0131r. Logo Bursa \u015fehrinin markala\u015ft\u0131r\u0131lmas\u0131 amac\u0131yla tasarlanm\u0131\u015ft\u0131r. Logoda T\xfcrk \u0130slam sanat\u0131n\u0131n bilinen motiflerinden olan \xe7intemani desende lale motifi yer almaktad\u0131r.","Antik \xe7a\u011fdan kalan Troya kal\u0131nt\u0131lar\u0131 il s\u0131n\u0131rlar\u0131 i\xe7erisindedir. B\xf6lgede ilk yerle\u015fim yakla\u015f\u0131k 6000 y\u0131l \xf6ncesindeki Bak\u0131r \xc7a\u011f\u0131'na dayan\u0131r.[6] Fakat bu d\xf6nemde \u015fehrin kimli\u011fi ve ya\u015fayan insanlar\u0131n \xf6zellikleri hakk\u0131nda pek bir \u015fey bilinmemektedir. Yap\u0131lan kaz\u0131 \xe7al\u0131\u015fmalar\u0131 ve \xe7e\u015fitli ara\u015ft\u0131rmalara g\xf6re, b\xf6lgedeki ilk kal\u0131c\u0131 yerle\u015fim izi Kumtepe civar\u0131nda bulunmu\u015ftur. M\xd6 4.800 - 4.000 aras\u0131na tarihlenen Kumtepe h\xf6y\xfc\u011f\xfc, bu tarihten sonra da \xe7e\u015fitli yerle\u015fim izleri i\xe7eren tabakalara sahiptir.[7] B\xf6lgedeki kaz\u0131lar ilk olarak 1934 y\u0131l\u0131nda Cincinnati \xdcniversitesi'nden  J.L. Caskey ve J. Sperling taraf\u0131ndan yap\u0131lm\u0131\u015ft\u0131r. M\xd6 3000 y\u0131l\u0131nda kurulan Troia ge\xe7irdi\u011fi bir deprem sonucu M\xd6 2500 y\u0131l\u0131nda y\u0131k\u0131lm\u0131\u015ft\u0131r.[8] Sonraki y\xfcz y\u0131llarda \xe7e\u015fitli g\xf6\xe7lerle kavim dengesi de\u011fi\u015fen \xc7anakkale b\xf6lgesi, M\xd6 7. y\xfczy\u0131lda Lidyal\u0131lar'\u0131n hakimiyetine girmi\u015ftir.[8] M\xd6. 6. y\xfczy\u0131l\u0131n ortalar\u0131nda b\xf6lgede Pers egemenli\u011fi ba\u015flam\u0131\u015ft\u0131r.[9] Perslerin \xf6nemli imparatorlar\u0131ndan Darius ve Xerxes b\xf6lgeyi stratejik bir nokta olarak g\xf6r\xfcp, buray\u0131 ellerinde tutmay\u0131 ama\xe7lam\u0131\u015flard\u0131r. Yunan tarih\xe7i Herodot'a g\xf6re \xc7anakkale Bo\u011faz\u0131 \xfczerinde Avrupa'ya ge\xe7mek i\xe7in ilk k\xf6pr\xfcy\xfc yapan Xerxes'tir.[8][9] M\xd6 386'da Spartal\u0131lar ile Persler aras\u0131nda yap\u0131lan Kral Bar\u0131\u015f\u0131 sonucu Persler b\xf6lgede hakimiyetini g\xfc\xe7lendirdi.[10] M\xd6 334 y\u0131l\u0131nda Makedonya Kral\u0131 B\xfcy\xfck \u0130skender bu b\xf6lgeyi Perslerin elinden almak istiyordu. Bu ama\xe7la \xc7anakkale Bo\u011faz\u0131'n\u0131 ge\xe7erek bug\xfcnk\xfc Karabiga yak\u0131nlar\u0131ndaki Kocaba\u015f \xc7ay\u0131 (Granikos)'nda iki ordu birbiri ile kar\u015f\u0131la\u015ft\u0131 ve ald\u0131klar\u0131 b\xfcy\xfck bozgun kar\u015f\u0131s\u0131nda Persler b\xf6lgeyi B\xfcy\xfck \u0130skender'in hakimiyetine b\u0131rakarak b\xf6lgeden \xe7ekilmek zorunda kald\u0131lar.[9] Ancak \u0130skender'in ani \xf6l\xfcm\xfc \xfczerine b\xf6lgeyi \xfcnl\xfc komutanlar\u0131ndan Antigonos y\xf6netmeye ba\u015flam\u0131\u015ft\u0131r. O da uzun s\xfcre y\xf6netemeden, Balkanlardan gelen Kelt k\xf6kenli Galatlar, b\xf6lgeye yerle\u015fmi\u015flerdir.[9] M\xd6 133'te Bergama Kral\u0131 III. Attalos'un vasiyeti \xfczerine Roma hakimiyetine giren \xc7anakkale, sonras\u0131nda Asia eyaletine ba\u011flanm\u0131\u015ft\u0131r.[11] Roma \u0130mparatorlu\u011fu'nun 395'te Do\u011fu ve Bat\u0131 diye ikiye ayr\u0131lmas\u0131ndan sonra, b\xf6lge daha sonradan Bizans ad\u0131yla an\u0131lacak olan Do\u011fu Roma \u0130mparatorlu\u011fu'nun hakimiyetine girmi\u015ftir.[11] \u0130mparator Justinian modern Eceabat yak\u0131nlar\u0131ndaki Sestos b\xf6lgesinde bo\u011faz\u0131n kontrol\xfcn\xfc sa\u011flamak amac\u0131yla kale in\u015fa ettirmi\u015ftir. B\xf6lgede ilk T\xfcrk hakimiyeti 11. y\xfczy\u0131l sonlar\u0131nda \xfcnl\xfc deniz komutan\u0131 \xc7aka Bey'in seferleri ile ba\u015flam\u0131\u015ft\u0131r. Sonras\u0131nda Karesi Beyli\u011fi ile devam eden T\xfcrk hakimiyeti, 1361 y\u0131l\u0131nda beyli\u011fin sava\u015fs\u0131z bir \u015fekilde Osmanl\u0131 \u0130mparatorlu\u011fu'na kat\u0131lmas\u0131 ile b\xf6lgede yakla\u015f\u0131k 6 as\u0131r s\xfcrecek bir Osmanl\u0131 d\xf6nemi ba\u015flam\u0131\u015f oldu.","\xc7ank\u0131r\u0131, T\xfcrkiye'nin \u0130\xe7 Anadolu B\xf6lgesi'nde yer alan ayn\u0131 adl\u0131 ilin merkezidir. \xc7ank\u0131r\u0131'n\u0131n ad\u0131, Bat\u0131l\u0131 kimi gezginler taraf\u0131ndan \xc7ang\u0131r\u0131 ya da \xc7engiri bi\xe7iminde yaz\u0131lm\u0131\u015ft\u0131r. Kent eski Gangra adl\u0131 kentin yerinde kurulmu\u015ftur. \xd6nceleri Paphlagonia'ya ba\u011fl\u0131yd\u0131. Sonra Pontus devletine, ard\u0131ndan da Galatia'ya ba\u011fland\u0131. Galatia h\xfck\xfcmdar\u0131 Deiotarus, Gangra'y\u0131 merkez yapt\u0131. M\xd6 25'te Roma imparatorlu\u011funun topraklar\u0131na kat\u0131lan y\xf6re, Bizansl\u0131lar zaman\u0131nda bir ara s\xfcrg\xfcn yeri idi. Kimi kaynaklarda an\u0131lan Germanikopolis kentinin Gangra oldu\u011fu san\u0131l\u0131yor. Emeviler zaman\u0131nda \u0130slam ordular\u0131 birka\xe7 kez sald\u0131rd\u0131larsa da bu kaleyi ele ge\xe7iremediler.\xc7ank\u0131r\u0131 ve \xe7evresi, 1071 Malazgirt zaferinden sonra Dan\u0131\u015fmendo\u011fullar\u0131nca ele ge\xe7irildi.Sel\xe7uklular\u0131n Malatya'da tutsak edilip Niksar kalesine kapatt\u0131klar\u0131 Antakya h\xfck\xfcmdar\u0131 Bohemond'u kurtarmak i\xe7in 1101'de \u0130stanbul'dan yola \xe7\u0131kan Raymond de Toulouse komutas\u0131ndaki Ha\xe7l\u0131 Ordusu Ankara'y\u0131 ald\u0131ktan sonra \xc7ank\u0131r\u0131'ya y\xf6neldiyse de kaleye giremediler. Amasya yak\u0131nlar\u0131nda Sel\xe7uklu ordusuyla kar\u015f\u0131 kar\u015f\u0131ya gelen Ha\xe7l\u0131 Ordusu, bozguna u\u011frad\u0131. 1134'te Bizans \u0130mparatoru Ioannes Komnenos \u015fiddetli \xe7arp\u0131\u015fmalardan sonra kaleyi ele ge\xe7irebildiyse de, o d\xf6nd\xfckten sonra Dan\u0131\u015fmendliler kenti geri ald\u0131lar. Daha sonra y\xf6reye Sel\xe7uklular egemen oldular. I. Murad zaman\u0131nda \xc7ank\u0131r\u0131 ve \xe7evresi Osmanl\u0131 topraklar\u0131na kat\u0131ld\u0131. Timur, 1402'de \xc7ank\u0131r\u0131'y\u0131 eski sahiplerine verdiyse de, 1439'da I. Mehmet geri ald\u0131.Osmanl\u0131 d\xf6neminde y\xf6netim bak\u0131m\u0131ndan anadolu eyaletine ba\u011fl\u0131 bir Livan\u0131n merkezi olan \xc7ank\u0131r\u0131, Cumhuriyetin ilan\u0131ndan \xf6nce Kastamonu vilayetine ba\u011fl\u0131 bir sanca\u011f\u0131n merkezi idi. T\xfcrk Kurtulu\u015f Sava\u015f\u0131 s\u0131ras\u0131nda \u0130nebolu \xfczerinden \u0130stanbul'dan Ankara'ya yap\u0131lan malzeme ve insan naklinde \xc7ank\u0131r\u0131 \xf6nemli bir arac\u0131 merkez rol\xfcn\xfc oynam\u0131\u015ft\u0131r. Cumhuriyet d\xf6neminde il merkezi haline getirilmi\u015ftir.19. y\xfczy\u0131l\u0131n sonunda yakla\u015f\u0131k 16 bin oldu\u011fu tahmin edilen n\xfcfusunu, T\xfcrkiye Cumhuriyeti'nin ilk y\u0131llar\u0131nda 10 binin alt\u0131na d\xfc\u015ft\xfc\u011f\xfc g\xf6r\xfcld\xfc. (1927'de 8.847). Ancak 1940'ta 10 bini yeniden a\u015fabilen (10.235) n\xfcfus 1970'te 25 bini ge\xe7ti (26.124). 1990'da da 45.496'ya ula\u015ft\u0131.(Keng\u0131r\u0131) kelimesinin (\xc7ank\u0131r\u0131) suretinde yaz\u0131lmas\u0131 11/ 4/ 1341 (1925 Miladi) tarihinde \xc7ank\u0131r\u0131 Milletvekili A.Talat ONAY'\u0131n \xf6nc\xfcl\xfc\u011f\xfcnde TBMM'ye verilen bir teklifle de\u011fi\u015ftirilmi\u015ftir.\u0130lin merkezi olan \xc7ank\u0131r\u0131 kenti, K\u0131z\u0131l\u0131rmak'\u0131n kollar\u0131 Ac\u0131\xe7ay ile Tatl\u0131\xe7ay'\u0131n birle\u015fti\u011fi yerde kurulmu\u015ftur. Deniz y\xfczeyinden 700\u2013800 m. y\xfcksekliktedir. \xc7ank\u0131r\u0131 \xe7ok eskiden bir kale kentiydi. Kent, sonralar\u0131 s\u0131rt\u0131n\u0131 kaleye dayayarak, g\xfcneye do\u011fru yay\u0131ld\u0131. G\xfcn\xfcm\xfczde, Tatl\u0131\xe7ay'\u0131n her iki yakas\u0131na serpilmi\u015f durumdad\u0131r. Kalenin eteklerindeki mahalleler, kentin \xe7ekirde\u011fini olu\u015fturur. Bu mahalleler dar sokakl\u0131d\u0131r. Kentin yeni kesimleri ise, daha modern g\xf6r\xfcn\xfc\u015fl\xfcd\xfcr.","Yontma ta\u015f \xe7a\u011f\u0131 (Paleolitik) Cilal\u0131 Ta\u015f Devrinde (Neolitik) kalkolitik d\xf6nemin 4. a\u015famas\u0131nda \xc7orum b\xf6lgesinde insan yerle\u015fimlerinin bulundu\u011funu ortaya \xe7\u0131karm\u0131\u015ft\u0131r. Bu devir eserlerine Alacah\xf6y\xfck, B\xfcy\xfck G\xfcll\xfccek, Bo\u011fazk\xf6y, Eskiyapar, Ku\u015fsaray h\xf6y\xfcklerinde de rastlanm\u0131\u015ft\u0131r. Yerle\u015fimler bu d\xf6nemden itibaren devaml\u0131l\u0131k g\xf6stermi\u015ftir. \xc7orum ve \xe7evresi daha sonra Hitit, Frigler, Kimmer, Medler, Pers, Galat, Roma, Bizans, Sel\xe7uklu, Dani\u015fmendliler Beyli\u011fi, Mo\u011fol, Eretna Beyli\u011fi, Kad\u0131 Burhaneddin Ahmed Devleti ve son olarak Osmanl\u0131 egemenli\u011fine girmi\u015ftir.","Denizli \u015fehri ilk defa, bug\xfcnk\xfc \u015fehrin 6 km kuzeyinde, Eskihisar K\xf6y\xfc civar\u0131nda, Milattan \xf6nce 261 - 245 y\u0131llar\u0131 aras\u0131nda, Suriye Kral\u0131 ikinci Antiokhos taraf\u0131ndan kurulmu\u015ftur. II. Antiokhos kente kar\u0131s\u0131 Laodikeia'nin ad\u0131n\u0131 vermi\u015ftir. Laodike'nin kenti anlam\u0131na gelen Laodikeia ad\u0131n\u0131 alan kent, M. S. 7. y\xfczy\u0131lda b\xfcy\xfck bir depremle y\u0131k\u0131l\u0131nca, kent bug\xfcnk\xfc Kalei\xe7i mevkiine ta\u015f\u0131nm\u0131\u015ft\u0131r. T\xfcrkler Denizli havalisini zapt ettikten sonra, kenti Ladik ad\u0131yla anm\u0131\u015flard\u0131r.Denizli ad\u0131na, tarihi kaynaklarda ba\u015fka ba\u015fka isimler olarak rastlamaktay\u0131z. Sel\xe7uklu kay\u0131tlar\u0131 ve Denizli mahkemesi \u015fer\u2018iyye sicilleri Ladik ismini vermektedir. \u0130bni Batuta'n\u0131n seyahatnamesinde Tunguzlu denilmektedir. Mesalikullebsar'da da Tunguzlu olarak kaydedilmi\u015ftir.Timurlenk'in zafernamesini yazan, \u015eerafettin Zemdi Tenguzlug ve Tonguzlug gibi iki isimden bahsetmektedir. Tengiz kelimesi eski T\xfcrk\xe7ede Deniz demektir. Tunguzlu ise bug\xfcnk\xfc imlas\u0131yla Denizli demektir. Netice olarak Denizli ad\u0131, Tenguzlu ve Tunguzlu kelimelerinin zamanla a\u011f\u0131zdan a\u011fza, Denizli kelimesi haline gelmesinden bug\xfcnk\xfc \u015feklini alm\u0131\u015ft\u0131r.Denizlili ara\u015ft\u0131rmac\u0131 M\xfcmtaz Ba\u015fkaya, konu ile ilgili yazd\u0131\u011f\u0131 kitab\u0131nda, Denizli ad\u0131n\u0131n k\xf6keninin Tengiz oldu\u011funu ve bir boy ad\u0131 olarak Orta Asya'dan Anadolu'ya geldi\u011fini ileri s\xfcrmektedir. Ayr\u0131ca ad\u0131 ge\xe7en bu kitab\u0131nda Denizli ad\u0131n\u0131n kentte bulunan sular\u0131n \xe7oklu\u011fu ile ilgisinin bulunmad\u0131\u011f\u0131n\u0131 da \xe7ok ger\xe7ek\xe7i bi\xe7imde a\xe7\u0131klam\u0131\u015ft\u0131r. Bu yer ad\u0131n\u0131n ba\u015fka yerle\u015fimlerin de ad\u0131 oldu\u011funu, T\xfcrkiye'de ba\u015fka yerlerde de Denizli ve benzer t\xfcrdeki adlar\u0131n oldu\u011funu g\xf6stererek bu konuya ger\xe7ek\xe7i bir a\xe7\u0131klama getirmi\u015f olmaktad\u0131r.","B\xfcy\xfck Dikran taraf\u0131ndan kurulan Silvan \u015fehirin, Ermenistan Krall\u0131\u011f\u0131n M\xd6 70. y\xfczy\u0131lda ba\u015fkenti Tigranakert olarak oldu\u011fu savunulursa da bu bilgi spek\xfclatif niteliktedir.[10] Mezopotamya ile Anadolu medeniyetlerinin ge\xe7i\u015f b\xf6lgesinde olan Diyarbak\u0131r\u2019\u0131n tarihi \xe7ok eski devirlere dayanmaktad\u0131r. Yontma ta\u015f ve Mezolitik devirlerde Diyarbak\u0131r ve \xe7evresinde var olan ma\u011faralardan burada yerle\u015fim oldu\u011fu yap\u0131lan arkeolojik ara\u015ft\u0131rmalar ile anla\u015f\u0131lm\u0131\u015ft\u0131r. E\u011fil-Silvan yak\u0131nlar\u0131ndaki Hassun Dicle Nehri ve kollar\u0131 \xfczerinde Ergani yak\u0131nlar\u0131nda Hilar ma\u011faralar\u0131nda bu \xe7a\u011fdan kalma kal\u0131nt\u0131lar tespit edilmi\u015ftir.[11] \u015eehrin 65 kilometre kuzeybat\u0131s\u0131nda Ergani il\xe7esi yak\u0131nlar\u0131nda yer alan \xc7ay\xf6n\xfc Tepesi kaz\u0131lar\u0131nda, d\xfcnyan\u0131n en eski k\xf6y\xfc bulunmu\u015ftur.[12] \xc7ay\xf6n\xfc'ndeki insanlar zamanla g\xf6\xe7ebelikten yerle\u015fik k\xf6y ya\u015fama, avc\u0131l\u0131k ve toplay\u0131c\u0131l\u0131ktan besin \xfcretimine ge\xe7mi\u015ftir.\u015eehrin kent merkezinde, M\xd6 3000 Hitit ve Hurri-Mittani egemenli\u011fi ya\u015fanm\u0131\u015ft\u0131r. M\xd6 1260 y\u0131l\u0131na kadar egemenliklerini s\xfcrd\xfcren Hurri-Mitaniler'den sonra s\u0131ras\u0131yla Asurlular, Aramiler, Urartular, \u0130skitler, Medler, Persler, Makedonyal\u0131lar, Selevkoslar, Partlar, Ermeniler, Romal\u0131lar, Sasaniler, Bizansl\u0131lar, Emeviler, Abbasiler, Hamdaniler, Mervaniler, Sel\xe7uklular, \u0130nalo\u011fullar\u0131, Artuklular, Eyy\xfcbiler, Mo\u011follar, Akkoyunlular, Safeviler ve Osmanl\u0131lar Diyarbak\u0131r'a egemen olmu\u015flard\u0131r.","Edirne civar\u0131na bilinen ilk yerle\u015fimciler, Trak kabilelerinden Odrisler ve Bettegerilerdir.[1] Yayg\u0131n g\xf6r\xfc\u015fe g\xf6re g\xfcn\xfcm\xfczde Edirne'nin bulundu\u011fu Meri\xe7 ile Tunca nehirlerinin birle\u015fti\u011fi yere Odrisler taraf\u0131ndan, Odris veya Odrisia ad\u0131 verilen a\xe7\u0131k bir \u015fehir veya pazar yeri kurulmu\u015ftu.[1] M\xd6 1400-1200 y\u0131llar\u0131 aras\u0131nda b\xf6lge Akalar\u0131n eline ge\xe7ti ve bu d\xf6nemden sonra polis h\xe2line getirildi. Ahameni\u015f \u0130mparatoru I. Darius'un M\xd6 510'larda y\u0131llar\u0131nda \u0130skitler \xfczerine d\xfczenledi\u011fi sefer s\u0131ras\u0131nda b\xf6lge Pers hakimiyetine girdi.[1] M\xd6 460 y\u0131l\u0131nda I. Teres h\xfck\xfcmdarl\u0131\u011f\u0131nda ba\u011f\u0131ms\u0131zl\u0131\u011f\u0131n\u0131 ilan eden Odrisler, tekrar b\xf6lgenin hakimi oldu.[2] M\xd6 340 y\u0131l\u0131nda II. Filip h\xfck\xfcmdarl\u0131\u011f\u0131ndaki Makedonlar\u0131n eline ge\xe7en yerle\u015fim yeri, bu d\xf6nemde Orestia ad\u0131yla an\u0131lmaya ba\u015fland\u0131.[1] B\xf6lge, daha sonralar\u0131 Kelt istilalar\u0131na da u\u011frad\u0131.[1] Makedonlar\u0131n kontrol\xfcndeki Orestia, M\xd6 168'de Romal\u0131lar\u0131n eline ge\xe7ti.[1] Roma \u0130mparatoru Hadrianus'un M\xd6 123-124 y\u0131llar\u0131 aras\u0131nda ger\xe7ekle\u015ftirdi\u011fi do\u011fu seyahati s\u0131ras\u0131nda ad\u0131 Hadrianapolis olarak de\u011fi\u015ftirilen Orestia'ya \u015fehir stat\xfcs\xfc verildi.[3] Roma \u0130mparatorlu\u011fu'nun 395 y\u0131l\u0131nda ikiye ayr\u0131lmas\u0131n\u0131n ard\u0131ndan Bizans \u0130mparatorlu\u011fu'nun kontrol\xfcnde kalan Hadrianapolis, bu d\xf6nemde Got, Hun, Pe\xe7enek, Avar ve Bulgar sald\u0131r\u0131lar\u0131na maruz kald\u0131.813 y\u0131l\u0131nda Bulgaristan Han\u0131 Krum taraf\u0131ndan ele ge\xe7irilen \u015fehir,[4] Krum'un \xf6l\xfcm\xfc sonras\u0131nda tahta ge\xe7en Omurtag'\u0131n Bizans \u0130mparatoru V. Leon aras\u0131nda 815 y\u0131l\u0131nda yap\u0131lan antla\u015fmayla birlikte iki devlet aras\u0131nda otuz y\u0131ll\u0131k bar\u0131\u015f sa\u011flan\u0131rken \u015fehrin kontrol\xfc Bizans \u0130mparatorlu\u011fu'na b\u0131rak\u0131ld\u0131.1000'li y\u0131llarda \u015fehir, birka\xe7 defa Pe\xe7enek ve Kuman sald\u0131r\u0131s\u0131na u\u011frasa da Bizans \u0130mparatorlu\u011fu kontrol\xfcnde kald\u0131.[6] Ha\xe7l\u0131 Seferleri s\u0131ras\u0131nda \xe7e\u015fitli sald\u0131r\u0131lara u\u011frarken, Latin \u0130mparatorlu\u011fu kontrol\xfcne giren \u015fehirde Bulgarlarla 1205'te yap\u0131lan muharebede Latinler ma\u011flup oldu. Latin \u0130mparatorlu\u011fu'nun 1261 y\u0131l\u0131nda y\u0131k\u0131lmas\u0131 sonras\u0131nda Hadrianapolis Bulgarlar\u0131n y\xf6netimine girdi. Farkl\u0131 kaynaklara g\xf6re 1361-1371 y\u0131llar\u0131 aras\u0131nda de\u011fi\u015fiklik g\xf6steren s\xfcre\xe7te \u015fehir Osmanl\u0131 \u0130mparatorlu\u011fu topraklar\u0131na kat\u0131ld\u0131.[7] T\xfcrklerin eline ge\xe7ince ad\u0131 Edirne olarak de\u011fi\u015fen ve daha sonradan Osmanl\u0131 \u0130mparatorlu\u011fu'na ba\u015fkentlik yapan \u015fehir, 1453'te \u0130stanbul'un ba\u015fkent olmas\u0131ndan sonra da \xf6nemini k\u0131smen yitirse de, padi\u015fahlar\u0131n g\xf6zde yerlerinden biri ve canl\u0131 bir ticari ve idari merkez olarak kalm\u0131\u015ft\u0131r. 18. y\xfczy\u0131lda yang\u0131nlar ve depremle sars\u0131lan kentin geli\u015fimine en b\xfcy\xfck darbeyi, bir zamanlar avantaj te\u015fkil eden Balkanlara a\xe7\u0131lan kap\u0131 olma niteli\u011finin Osmanl\u0131 \u0130mparatorlu\u011fu'nun gerilemeye ba\u015flamas\u0131yla dezavantaja d\xf6n\xfc\u015fmesi vurmu\u015ftur. Yabanc\u0131 i\u015fgalini ilk olarak 1828-29 y\u0131l\u0131ndaki Osmanl\u0131-Rus harbinde ya\u015fayan \u015fehir, 93 Harbi'nde (1877-1878) tekrar Ruslar taraf\u0131ndan i\u015fgal edilmi\u015ftir. Devam\u0131 wikipedia'da.","Harput ve y\xf6resi, Anadolu\u2019nun en eski yerle\u015fme birimlerinden biridir. Yerle\u015fme, tarih \xf6ncesi d\xf6nemlere kadar uzan\u0131r. Nitekim ilin F\u0131rat \u0131rma\u011f\u0131n\u0131n \xe7izdi\u011fi b\xfcy\xfck yay i\xe7inde, sulak ve verimli bir ova \xfczerinde bulunmas\u0131, do\u011fal kaya s\u0131\u011f\u0131naklar\u0131, kara ve su hayvanlar\u0131n\u0131n bollu\u011fu nedeniyle y\xf6re, Paleolotik (Yontma Ta\u015f Devri M.\xd6. 10.000) D\xf6nemden beri, yerle\u015fme alan\u0131d\u0131r. Y\xf6rede yap\u0131lan arkeolojik kaz\u0131 ve y\xfczey ara\u015ft\u0131rmalarda; Paleolotik d\xf6nemle ilgili olarak, Keban il\xe7esi yak\u0131n\u0131ndaki Enerli, Acuzlu K\xf6y\xfc Karap\u0131nar Mevkii, A\u011f\u0131n y\xf6resinde Pa\u011fnik (Ka\u015fp\u0131nar), \xc7\u0131ld\u0131r\u0131n H\xf6y\xfckleri ve Yeniyapan  (Hastek) K\xf6y\xfc yak\u0131n\u0131nda Gedikler Mevkii (K\xfcll\xfcn\xfcnini)\u2019nde; ta\u015ftan ve obsideyn (do\u011fal cam)\u2019den yap\u0131lm\u0131\u015f \xe7e\u015fitli kaz\u0131y\u0131c\u0131lar ve aletler tespit edilmi\u015ftir. Ayr\u0131ca s\xf6z konusu ara\u015ft\u0131rmalarda, Paleolitik \xc7a\u011f\u0131 izleyen k\xfclt\xfcrler hakk\u0131nda da bir \xe7ok bilgi elde edilmi\u015ftir. Nitekim Alt\u0131nova b\xf6lgesinde Tepecikte ve Kovanc\u0131lar il\xe7esi yak\u0131nlar\u0131nda \xc7\u0131naz H\xf6y\xfck gibi, tarihi yerle\u015fim alanlar\u0131nda, ilk yerle\u015fik hayat\u0131n ba\u015flad\u0131\u011f\u0131 d\xf6nem olan, Neolitik (Cilal\u0131 Ta\u015f Devri M.\xd6. 7.000) d\xf6nem kal\u0131nt\u0131lar\u0131na rastlanm\u0131\u015ft\u0131r. Yine Alt\u0131nova b\xf6lgesinde: K\xf6rtepe, Korucutepe, Tepecik, T\xfclintepe, Nor\u015funtepe; A\u011f\u0131n y\xf6resinde: Kalayc\u0131k, Han \u0130brahim \u015eah; Baskil y\xf6resinde: Kamikli, Gemiba\u015f\u0131 Maltepe, Habibu\u015fa\u011f\u0131, \xdcy\xfccektepe, \u0130miku\u015fa\u011f\u0131, \u015eemsiyetepe gibi tarihi yerle\u015fim alanlarda da Kalkolitik (Ta\u015f-Maden Devri M.\xd6 5.000) d\xf6nem ile ilgili yerle\u015fmelerin  bulundu\u011fu tespit edilmi\u015ftir. M.\xd6 3.000 y\u0131l\u0131na tarihlenen ilk Tun\xe7 \xc7a\u011f\u0131 d\xf6nemi ile ilgili olarak, Alt\u0131nova b\xf6lgesinde Nor\u015funtepe, Tepecik ve Korucutepe h\xf6y\xfcklerinde k\xfclt\xfcr katlar\u0131n\u0131n varl\u0131\u011f\u0131 ortaya \xe7\u0131kart\u0131lm\u0131\u015ft\u0131r. \u0130lk Tun\xe7 \xc7a\u011f\u0131\u2019n\u0131n en karakteristik serami\u011fi \u201cKaraz\u201d ad\u0131 verilen seramiktir. Bu serami\u011fin yay\u0131l\u0131\u015f\u0131 bir kavimler hareketiyle ilgili olup, M.\xd6. IV. ve III. Binde at\u0131 sava\u015f arabalar\u0131nda kullanmakla me\u015fhur olan, Hurriler\u2019in bu b\xf6lgede yerle\u015fmi\u015f olabileceklerini akla getirmektedir. Ayr\u0131ca y\xf6rede M.\xd6. 1700-1500 tarihleri aras\u0131na tarihlenen Asur Ticaret  Kolonileri D\xf6nemi ile ilgili buluntular Baskil y\xf6resinde \u0130miku\u015fa\u011f\u0131 kaz\u0131 merkezinde ortaya \xe7\u0131kar\u0131lm\u0131\u015ft\u0131r.Elaz\u0131\u011f ve y\xf6resinin yaz\u0131l\u0131 tarihine gelince, bunun Hitit tabletlerindeki bilgilerle ayd\u0131nlat\u0131ld\u0131\u011f\u0131 g\xf6r\xfclmektedir. M.\xd6. 2000\u2019lerde y\xf6renin \u0130\u015fuva ad\u0131yla an\u0131ld\u0131\u011f\u0131 belirlenmi\u015ftir. \u0130\u015fuva, M.\xd6. 1375-1335  I. \u015euppiluliuma d\xf6neminde Hitit egemenli\u011fi alt\u0131na girmi\u015fti. Bu tarihi bilgilerin yan\u0131 s\u0131ra, Elaz\u0131\u011f y\xf6resinde yap\u0131lan arkeolojik kaz\u0131 \xe7al\u0131\u015fmalar\u0131nda, Hititlerin y\xf6redeki egemenli\u011fi bir kez daha ispatlanm\u0131\u015f, daha \xf6nceleri, Hitit \xfclkesi s\u0131n\u0131r\u0131n\u0131n do\u011fuda F\u0131rat Irma\u011f\u0131nda son buldu\u011fu tezi \xe7\xfcr\xfct\xfclm\xfc\u015ft\xfcr.Devam\u0131 Elaz\u0131\u011f Belediyesi web sitesinde.","Erzincan'\u0131n ilk\xe7a\u011f tarihi hakk\u0131nda kesin bir bilgiye hen\xfcz sahip olunmamakla birlikte tarih\xe7iler ikinci bin y\u0131l da, bu b\xf6lgede Hurriler'in ya\u015fad\u0131\u011f\u0131n\u0131, ikinci bin y\u0131l\u0131n ilk yar\u0131s\u0131 ba\u015flar\u0131nda da Hayasl\u0131lar ve Azzilerin h\xfck\xfcm s\xfcrd\xfc\u011f\xfcn\xfc kaydetmektedir. Anadolu'da M\xd6 1600 ile 1180 tarihleri aras\u0131nda Hattu\u015fa\u015f'\u0131 merkez yaparak b\xfcy\xfck bir imparatorluk kuran Hititler yak\u0131n do\u011fuyu egemenlikleri alt\u0131na alm\u0131\u015flar ve Erzincan'da Hititlerin y\xf6netimi alt\u0131ndayd\u0131. Anadolu'nun \xe7e\u015fitli yerlerinde yap\u0131lan kaz\u0131larda Hititlere ait \xe7e\u015fitli eserler ortaya \xe7\u0131kar\u0131lm\u0131\u015ft\u0131r. Erzincan ve y\xf6resinde Hititlere ait bir yerle\u015fim merkezine rastlanmam\u0131\u015fsa da, bu y\xf6renin Hitit egemenli\u011fi alt\u0131nda kald\u0131\u011f\u0131 d\xfc\u015f\xfcn\xfclmektedir.Do\u011fu Anadolu'da kurulan ilk\xe7a\u011f devletlerinden biri de Urartular olmu\u015ftur. M\xd6 900 y\u0131llar\u0131nda kurulan bu devlet Tu\u015fpa'y\u0131 (Van) ba\u015fkent yapm\u0131\u015f, s\u0131n\u0131rlar\u0131n\u0131 Hazar Denizi'nden Malatya'ya, kuzeyde Erzurum ile Erzincan'dan g\xfcneyde Halep ve Musul'a kadar geni\u015fletmi\u015ftir. Yine Erzincan yak\u0131nlar\u0131nda Alt\u0131ntepe'de 1953'te yap\u0131lan kaz\u0131larda[3] Urartular'a ait bir\xe7ok eser \xe7\u0131kar\u0131lm\u0131\u015f, bu y\xf6renin Urartu egemenli\u011fi alt\u0131nda kald\u0131\u011f\u0131 kan\u0131tlanm\u0131\u015ft\u0131r. \xc7e\u015fitli sald\u0131r\u0131lara maruz kalan Urartu \u015fehirleri teker teker tahrip edilirken Medler'in Anadolu'yu istilas\u0131 s\u0131ras\u0131nda M\xd6 600 y\u0131llar\u0131nda tamamen ortadan kald\u0131r\u0131lm\u0131\u015ft\u0131r. Erzincan ve y\xf6resi, Urartular'\u0131 yenerek Anadolu'yu istilaya ba\u015flayan Med'lerin (M\xd6 612) eline ge\xe7ti. Med \u0130mparatorlu\u011fu'nun Kyaksar d\xf6neminde Lidyal\u0131lar'la yap\u0131lan sava\u015flar, muhtemelen Erzincan ve civar\u0131nda meydana geldi\u011fi d\xfc\u015f\xfcn\xfcl\xfcr. Bu y\xf6reler M.\xd6. 550 tarihlerinde Persler'in eline ge\xe7mi\u015ftir.Hititler'in Anadolu'yu istila ettikleri s\u0131rada, \u0130ran yaylas\u0131n\u0131 da Persler ele ge\xe7irdiler. Persler'in y\xfckseli\u015fi daha \xe7ok Ciroz (550-530) ve Kampis (530-520) d\xf6nemlerine rastlar. Bu d\xf6nemde Erzincan ve \xe7evresi de Persler'in eline ge\xe7er. Persler'den sonra Anadolu Makendonyal\u0131lar'\u0131n eline ge\xe7mi\u015ftir. Roma ordusu M\xd6 70 tarihinde Do\u011fu Anadolu B\xf6lgesi'ni ele ge\xe7irmeye ba\u015fl\u0131yarak Elaz\u0131\u011f y\xf6resindeki Harput Krall\u0131\u011f\u0131'n\u0131 y\u0131kt\u0131ktan sonra, Tigran Ordusunu da yenilgiye u\u011fratm\u0131\u015ft\u0131r. Bu s\u0131rada (M\xd6 68) Pontuslular da Erzincan y\xf6relerinde Roma \xfcst\xfcnl\xfc\u011f\xfcne son vermi\u015flerdir. \u0130ran ile Bizans aras\u0131nda s\xfcrekli sava\u015flara sahne olan Erzincan ve y\xf6resi en son Bizans imparatoru Herakleios taraf\u0131ndan 629 tarihinde yenilgiye u\u011frat\u0131lan \u0130ran'dan geri al\u0131nd\u0131.Devam\u0131 Wikipedia'da","abiat \u015fartlar\u0131n\u0131n ve co\u011frafi konumunun uygun ve elveri\u015fli olmas\u0131 yan\u0131 s\u0131ra, \xf6nemli uygarl\u0131k ve medeniyet merkezi olarak bilinen yerlere yak\u0131nl\u0131\u011f\u0131, Erzurum'un Anadolu'da en eski yerle\u015fim merkezlerinden birisi olmas\u0131n\u0131 sa\u011flam\u0131\u015ft\u0131r. G\xfcn\xfcm\xfcze kadar yap\u0131lan kaz\u0131lar sonucu bulunan baz\u0131 ta\u015f ara\xe7lar Erzurum ve y\xf6resindeki yerle\u015fimin ge\xe7mi\u015fini 'yontma ta\u015f devri' ne kadar g\xf6t\xfcrmektedir. Ayr\u0131ca Karaz, Pulur, G\xfczelova H\xf6y\xfck ve Sos H\xf6y\xfck buluntular\u0131, Erzurum'un \u0130lk Tun\xe7 \xc7a\u011f\u0131'\u0131nda Karaz K\xfclt\xfcr\xfcn\xfcn merkezi konumunda oldu\u011funu g\xf6stermektedir.Erzurum'u da i\xe7ine alan b\xf6lgede tarih boyunca Hurriler, Asurlar, Kimmerler, \u0130skitler (Sakalar) hakimiyet kurmu\u015flard\u0131. Persler taraf\u0131ndan M\xd6 6. y\xfczy\u0131lda istil\xe2 edilmi\u015ftir. Ancak M\xd6 4. y\xfczy\u0131lda Persleri ma\u011flup eden Makedonya Kral\u0131 \u0130skender b\xf6lgeye hakim ol\xf6u\u015ftur. Daha sonra \u0130skender'in \xf6l\xfcm\xfc \xfczerine \xf6nce Selevkoslar ard\u0131ndan Romal\u0131'lar\u0131n eline ge\xe7mi\u015ftir. Roma \u0130mparatorlu\u011funun b\xf6l\xfcnmesi sebebiyle b\xf6lge MS 395 y\u0131l\u0131nda, Do\u011fu Roma \u0130mparatorlu\u011funun (Bizansl\u0131lar) s\u0131n\u0131rlar\u0131 i\xe7erisinde kalm\u0131\u015ft\u0131r. Erzurum, Do\u011fu Roma \u0130mparatoru II. Theodosios\u2019a (408-450) izafe edilerek Anadolu\u2019ya y\xf6nelik \u0130ran sald\u0131r\u0131lar\u0131na kar\u015f\u0131 muhtemelen 415-422 y\u0131llar\u0131nda Theodosiopolis ad\u0131yla kurulmu\u015ftur. Theodosiopolis, M\xfcsl\xfcman Komutan \xd6mer bin Hattab'\u0131n komutas\u0131ndaki \u0130slam Ordular\u0131 taraf\u0131ndan 633 y\u0131l\u0131nda fethedildi. M\xfcsl\xfcmanlar\u0131n eline ge\xe7en b\xf6lgenin n\xfcfusu \xe7ok s\xfcrede h\u0131zla artt\u0131 ve 200 bin oldu. O d\xf6nemde d\xfcnyan\u0131n en b\xfcy\xfck \u015fehirleri aras\u0131nda olan Erzurum daha sonra \u0130sl\xe2m devletlerinin birbiriyle \xe7eki\u015fip i\xe7 m\xfccadeleye ba\u015flamalar\u0131 ve sonu\xe7 itibar\u0131yla zay\u0131f d\xfc\u015fmeleri neticesinde Bizansl\u0131lar di\u011fer \u015fehirleri ve Erzurum'u geri ald\u0131lar.[8] 1048 y\u0131l\u0131nda Sel\xe7uklular Pasinler meydan muharebesinde Bizansl\u0131lar\u0131 ma\u011flup ettiler. B\xf6ylece 1071 Malazgirt meydan muharebesinden 22 y\u0131l \xf6nce Erzurum'u; Tu\u011frul Bey, karde\u015fi \xc7a\u011fr\u0131 Bey ve S\xfcleyman \u015eah'\u0131n babas\u0131 \u015eahzade Kutalm\u0131\u015f Bey feth etmi\u015f oldular. Bu s\xfcre\xe7te Bizansla yap\u0131lan anla\u015fma \xfczerine Erzurum Bizans'a geri iade edildi. Sel\xe7uklu Sultan\u0131 Alparslan'a ba\u011fl\u0131 komutanlardan Ebul Kas\u0131m, 1071 Malazgirt zaferinden sonra Bizans'\u0131 ma\u011flup ederek Erzurum'u fethetti.Anadolu'da ilk T\xfcrk Beylerbeyli\u011fi olan Salt\u0131k (Saltuk)o\u011fullar\u0131 Saltuklular Beyli\u011fi kuruldu. Erzurum 1202 y\u0131l\u0131na kadar Saltuklular Beyli\u011finin ba\u015f\u015fehri olmu\u015ftur. Erzurum 1202 y\u0131l\u0131nda Konya 'da bulunan Anadolu Sel\xe7uklular\u0131na tabi bir vil\xe2yet oldu. 1242 y\u0131l\u0131nda Mo\u011follar taraf\u0131ndan istil\xe2 edildi. Bu istil\xe2n\u0131n ard\u0131ndan Erzurum ve y\xf6resini \u0130lhanl\u0131lar ele ge\xe7irmi\u015f oldular. 1202-1335 y\u0131llar\u0131nda Erzurum'da h\xfck\xfcm s\xfcren \u0130lhanl\u0131lar'dan sonra b\xf6lge Eretna Beyli\u011finin himayesine girdi. 1300'l\xfc y\u0131llar\u0131n sonunda Erzurum'u \xf6nce Karakoyunlular sonra da Timur ku\u015fatt\u0131. Karakoyunlular b\xf6lgede 15. asr\u0131n ortalar\u0131na kadar h\xfck\xfcm s\xfcrd\xfcler. 1467'de Akkoyunlular'\u0131n \xf6nderi Uzun Hasan'\u0131n ger\xe7ekle\u015ftirdi\u011fi ani bir bask\u0131n sonucu Cihan \u015eah'\u0131n \xf6l\xfcm\xfcyle Karakoyunlu devleti y\u0131k\u0131ld\u0131, Erzurum Akkoyunlular '\u0131n eline ge\xe7ti. Akkoyunlu Devleti, Safevi h\xfck\xfcmdar\u0131 T\xfcrk as\u0131ll\u0131 \u015eah \u0130smail taraf\u0131ndan 1508'de tamamen ortadan kald\u0131r\u0131ld\u0131. Safevilerin eline ge\xe7en Erzurum, Safeviler d\xf6neminde \xe7ok geriledi. 1514 y\u0131l\u0131nda Osmanl\u0131 Sultan\u0131 Yavuz Sultan Selim Erzurum'u fethetti. Safeviler Erzurum'u geri ald\u0131lar. Daha sonra Kanuni Sultan S\xfcleyman Erzurum'u kesin olarak Osmanl\u0131 topraklar\u0131na katm\u0131\u015ft\u0131r. Erzurum Osmanl\u0131 \u0130mparatorlu\u011fu d\xf6neminde bir ey\xe2let merkezi olarak \xe7ok geli\u015fti. Trabzon - Tebriz ticaret yolu \xfczerinde olmas\u0131 ve kalesinden dolay\u0131 serhat \u015fehri stat\xfcs\xfcne sahip olu\u015fu, Erzurum'u, Osmanl\u0131lar\u0131n \u0130ran'a yapt\u0131\u011f\u0131 seferlerin askeri \xfcss\xfc konumuna getirmi\u015fti. G\xfcnden g\xfcne geli\u015ferek; ticaret, k\xfclt\xfcr, san'at, sanayi ve askeri merkez haline geldi. Osmanl\u0131lar taraf\u0131ndan Erzurum merkezli kurulan eyaletin s\u0131n\u0131rlar\u0131 dahilinde; Erzurum, G\xfcm\xfc\u015fhane, Erzincan illeri ve Mu\u015f'un Malazgirt, Bing\xf6l\xfcn Ki\u011f\u0131 il\xe7eleri yer al\u0131yordu. 1600'l\xfc y\u0131llar\u0131n ortalar\u0131nda Erzurum eyaleti 49.324 km\xb2 y\xfcz \xf6l\xe7\xfcm\xfcne sahipti.Devam\u0131 Wikipedia'da","M\xd6 14. y\xfczy\u0131lda Hititler Eski\u015fehir merkezli b\xfcy\xfck bir devlet kurmu\u015flard\u0131r.[9] Eski\u015fehir'in \xf6nemi ve yeri dolay\u0131s\u0131yla Hititler d\xf6neminde Eti\u2018lik (Beylik) oldu\u011fu g\xf6r\xfclmektedir.[10] M\xd6 12. y\xfczy\u0131lda Anadolu\u2019ya giren Frigler Anadolu'ya yay\u0131lm\u0131\u015f ve Dorylaion ad\u0131 ile b\xf6lgeye yerle\u015fmi\u015ftir.[10] Friglerden sonra b\xf6lgeye Lidyal\u0131lar daha sonra da Persler hakimiyeti alt\u0131na alm\u0131\u015ft\u0131r. M\xd6 4. y\xfczy\u0131lda Makedon kral \u0130skender'in eline ge\xe7en Eski\u015fehir, \u0130skender'in \xf6l\xfcm tarihi olan M\xd6 323 y\u0131l\u0131na kadar \u0130skender'in \u0130mparatorlu\u011fu alt\u0131nda kalm\u0131\u015ft\u0131r. M\xd6 2. y\xfczy\u0131lda Roma \u0130mparatorlu\u011fu kontrol\xfcne ge\xe7en b\xf6lge, Roma\u2019n\u0131n ikiye ayr\u0131lmas\u0131na kadar Roma \u0130mparatorlu\u011fu\u2019nun ayr\u0131ld\u0131ktan sonra da Bizans hakimiyetinde kalm\u0131\u015ft\u0131r.Yeniden Bizans egemenli\u011fine giren Dorylaion 1074'te Sel\xe7uklular\u0131n eline ge\xe7ti. \u015eehir Anadolu Sel\xe7uklular\u0131 zaman\u0131nda, Sel\xe7uklular ile Ha\xe7l\u0131lar aras\u0131nda yap\u0131lan sava\u015flara sahne olmu\u015ftur. Bu zamanda \u015fehrin ad\u0131 Sultan\xf6n\xfc olarak an\u0131lmaktad\u0131r. \u015eehir i\xe7inde Sel\xe7uklulara ait pek \xe7ok eser vard\u0131r.Arap co\u011frafyac\u0131 \u0130bn Said (\u0639\u0644\u064a \u0628\u0646 \u0645\u0648\u0633\u0649 \u0627\u0644\u0645\u063a\u0631\u0628\u064a \u0628\u0646 \u0633\u0639\u064a\u062f, 'Ali ibn Musa ibn Sa'id al-Maghribi); Antalya - Marki (Fethiye) K\xf6rfezi aras\u0131ndaki Cib\xe2lu\u2019t T\xfcrkm\xe2n (T\xfcrkmen Da\u011flar\u0131) ad\u0131 verilen da\u011fl\u0131k b\xf6lgede 200.000, Kastamonu y\xf6resinde 100.000, Sultan \xd6n\xfc - K\xfctahya - Emirda\u011f - Karahisar-\u0131 Sahip - Sivrihisar y\xf6relerinde 200.000 ve Ankara'n\u0131n kuzeyindeki Karabuli denilen da\u011fl\u0131k b\xf6lgede 30.000 \xe7ad\u0131rl\u0131k T\xfcrkmen kitlelerinin y\u0131\u011f\u0131ld\u0131\u011f\u0131n\u0131 kaydetmektedir.1289'da Anadolu Sel\xe7uklular\u0131 Eski\u015fehir'i Osman Gazi'ye verdi. Orhan Gazi d\xf6neminde Karamanl\u0131lar\u0131n eline ge\xe7en Eski\u015fehir'i, I. Murad yeniden Osmanl\u0131 topraklar\u0131na katt\u0131.Fatih'in ilk zamanlar\u0131na kadar \u015fehir Ankara Beyli\u011fi'ne ba\u011fl\u0131 olarak kalm\u0131\u015ft\u0131r. 1451 y\u0131l\u0131ndan sonra K\xfctahya'n\u0131n Beylerbeylik haline gelmesi \xfczerine Anadolu \u0130dari Te\u015fkilat\u0131nda de\u011fi\u015fiklik olmu\u015f, bu arada Ankara'ya ba\u011fl\u0131 bulunan Eski\u015fehir, K\xfctahya Beylerbeyli\u011fi'ne ba\u011flanm\u0131\u015ft\u0131r.[Kent 1601'de bir s\xfcre Celali Deli Hasan ve yanda\u015flar\u0131n\u0131n eline ge\xe7ti. H\xfcdavendig\xe2r (Bursa) Vilayetinin K\xfctahya Sanca\u011f\u0131na ba\u011fl\u0131 bir kaza olan Eski\u015fehir'e demiryolu 1890'l\u0131 y\u0131llarda ula\u015ft\u0131.Demiryolu'nun Eski\u015fehir'e gelmesi ile \u015fehirde ticaret canland\u0131.[9] 19. y\xfczy\u0131l boyunca y\xf6reye Kafkasya, K\u0131r\u0131m, Romanya ve Bulgaristan'dan gelen g\xf6\xe7menler yerle\u015ftirildi.[11] \u015eehir 1877-1878 Osmanl\u0131-Rus harbinden sonra muhacirlerin yerle\u015ftirilmeye ba\u015flamas\u0131yla beraber geli\u015fmeye ba\u015flam\u0131\u015ft\u0131r.[10] Mondros Ate\u015fkesi'nin maddelerinden biri olan \u0130tilaf Devletleri'nin Osmanl\u0131 \u0130mparatorlu\u011fu s\u0131n\u0131rlar\u0131 i\xe7indeki \xf6nemli noktalar\u0131 g\xfcvenlik gerek\xe7esiyle i\u015fgal edebilecekleri maddesine dayanarak 13 Kas\u0131m 1918 tarihinde \u0130stanbul'a \xe7\u0131kan \u0130ngiliz kuvvetleri, \u0130stanbul-Ba\u011fdat demiryolu hatt\u0131 boyunca \xf6nemli g\xf6rd\xfckleri yerleri i\u015fgal etmeye ba\u015flad\u0131lar, bu i\u015fgalden 2,5 ay sonra, 1919 y\u0131l\u0131n\u0131n Ocak ay\u0131 sonlar\u0131nda Eski\u015fehir \u0130stasyonu \xe7evresinde kararg\xe2hlar\u0131n\u0131 kurdu.","G\xfcn\xfcm\xfczdeki Gaziantep'in yak\u0131nlar\u0131nda bulunan D\xfcl\xfck (Dolikhe ya da Doliche) bu y\xf6redeki en eski kenttir. Arkeolojik kaz\u0131lar\u0131ndan bu kentte Paleolitik d\xf6nemden beri insanlar\u0131n ya\u015fad\u0131\u011f\u0131 bilinmektedir.[7][8] Ancak, D\xfcl\xfck Erken Tun\xe7 \xc7a\u011f\u0131'ndan sonra bir s\xfcrekli yerle\u015fim yeri h\xe2line gelebilmi\u015ftir.[9] Bu kent, \u0130pek Yolu \xfczerinde bulundu\u011fu i\xe7in \xe7ok geli\u015fmi\u015ftir.\u0130lk kuruldu\u011funda Babil y\xf6netimi alt\u0131nda kalan kent, M\xd6 1700'l\xfc y\u0131llarda Hititler'in eline ge\xe7ti. Hititler'den sonra M\u0131s\u0131r y\xf6netimine ge\xe7en kent,[10] M\xd6 700-MS 546 aras\u0131nda ise kronolojik s\u0131rayla Medler, Asurlular ve Persler taraf\u0131ndan y\xf6netilir. M\xd6 6. y\xfczy\u0131lda ise kent s\u0131ras\u0131 ile Makedonya, Selevkos ve Komagene uygarl\u0131klar\u0131n\u0131n y\xf6netimi ba\u015flar. De\u011fi\u015fik medeniyetlere ev sahipli\u011fi yapan Antep, 1516 y\u0131l\u0131nda Osmanl\u0131lar\u0131n eline ge\xe7mesiyle ilk d\xf6nemlerde Arap ve Halep Eyaleti\u2019ne ba\u011fl\u0131 bir konumda iken, 1531 y\u0131l\u0131nda Dulkadir Eyaleti\u2019nin te\u015fekk\xfcl etmesi sonucu, bu eyaletin s\u0131n\u0131rlar\u0131 aras\u0131nda yer alarak 1818 senesine kadar bu konumunu muhafaza etmi\u015ftir. Bu tarihten itibaren yeniden Halep eyaletine sancak olarak ba\u011flanm\u0131\u015ft\u0131r. \u015eehir, Osmanl\u0131 kent k\xfclt\xfcr\xfcnde \xf6nemli bir yer alm\u0131\u015ft\u0131r.Romal\u0131lar, D\xfcl\xfck yak\u0131nlar\u0131na Antiochia ad Taurum ad\u0131nda yeni bir kent kurar. Bu kent \u0130sa'n\u0131n havarilerinden Yuhanna'n\u0131n Hristiyanl\u0131k'\u0131 yaymak i\xe7in se\xe7ti\u011fi merkezlerden biri olmu\u015ftur. Kent, MS 395 y\u0131l\u0131nda Bizans \u0130mparatorlu\u011fu'nun eline ge\xe7er.[7] MS 636 y\u0131l\u0131nda halife \xd6mer bin Hattab, \u0130slamiyet'i yaymak i\xe7in Ay\u0131ntap ve Hatay y\xf6resini Bizansl\u0131lar\u0131n elinden al\u0131r. Bu \u015fekilde Ay\u0131ntap halk\u0131 \u0130slamiyet'i kabul eder. Bu arada D\xfcl\xfck, h\u0131zla eski \xf6nemini yitirmektedir.1071 y\u0131l\u0131nda Alp Arslan'\u0131n Malazgirt Sava\u015f\u0131'ndaki zaferinden sonra kent Sel\xe7uklu y\xf6netimine ge\xe7er. Bir d\xf6nem Eyy\xfcbilerin eline ge\xe7en kent,[10] 1270 y\u0131l\u0131nda Mo\u011follar\u0131n Ay\u0131ntap'a sald\u0131rmas\u0131yla, 1389 y\u0131l\u0131nda Dulkadiro\u011fullar\u0131'n\u0131n ve 1471 y\u0131l\u0131nda Meml\xfck Devleti'nin egemenli\u011fine ge\xe7mi\u015ftir.1516 y\u0131l\u0131nda Yavuz Sultan Selim'in Mercidab\u0131k Muharebesi'ndeki zaferinden sonra Ay\u0131ntap, Osmanl\u0131 y\xf6netimine ge\xe7er. Osmanl\u0131lar d\xf6neminde kente \xe7ok say\u0131da cami, medrese, han ve hamam in\u015fa edilmi\u015ftir. 1516-1596 y\u0131llar\u0131 aras\u0131nda kent, \xfcretim, ticaret ve el sanatlar\u0131 y\xf6n\xfcnden de \xe7ok geli\u015fmi\u015ftir. 1641 ve 1671 y\u0131llar\u0131nda iki defa kenti ziyaret eden Evliya \xc7elebi, kentte 22 mahalle, 8 bin ev, 100 kadar cami, medrese, han, hamam ve bir de kapal\u0131 \xe7ar\u015f\u0131 oldu\u011funu yazar ve seyahatnamesinde aynen D\xfcnya y\xfcz\xfcnden geni\u015f bir ili, g\xf6z al\u0131c\u0131 b\xfcy\xfck yap\u0131lar\u0131 her yerden aranan e\u015fyas\u0131, bir\xe7ok mezralar\u0131, bolluk ve verimlili\u011fi, bitimsiz yiyecek ve i\xe7ecek p\u0131narlar\u0131 ve \u0131rmaklar\u0131yla buras\u0131 '\u015eehr-i Ay\u0131ntab-\u0131 Cihan'd\u0131r der.[11] Osmanl\u0131 d\xf6neminde Ay\u0131ntap, asla kendi eyaletinde olmay\u0131p, \xf6nce Mara\u015f (bug\xfcnk\xfc Kahramanmara\u015f), sonra Halep eyaletinde yer alm\u0131\u015ft\u0131r. Buna ra\u011fmen Ay\u0131ntap'\u0131n k\xfclt\xfcr\xfc Arap k\xfclt\xfcr\xfcnden fazla etkilenmemi\u015ftir.","unan kolonizasyonu \xf6ncesinde b\xf6lgede Karadeniz'in yerli kabilelerinin varl\u0131\u011f\u0131 bilinmekte olup Hitit kaynaklar\u0131nda Ka\u015fka ad\u0131yla ge\xe7en kendir ziraati yapan sava\u015f\xe7\u0131 bir halk\u0131n bahsi ge\xe7mektedir. M\xd6 7. y\xfczy\u0131lda Kolkhis \xfclkesinde Miletli koloniciler taraf\u0131ndan kurulan kent merkezinin \xe7evresinde Kolh (Tzan/Laz) halk\u0131na ait k\xf6yler bulunmaktayd\u0131.[1] M\xd6 6. y\xfczy\u0131lda Pers \u0130mparatorlu\u011fu'nun eline ge\xe7en b\xf6lge, B\xfcy\xfck \u0130skender'in Pers \u0130mparatorlu\u011fu'nu y\u0131kmas\u0131n\u0131n ard\u0131ndan \xf6zg\xfcrl\xfc\u011f\xfcne kavu\u015fmu\u015ftur. Sonras\u0131nda Pontus Krall\u0131\u011f\u0131 taraf\u0131ndan ilhak edilen y\xf6re, Zela Sava\u015f\u0131'n\u0131n ard\u0131ndan di\u011fer Do\u011fu Karadeniz \u015fehirleri gibi Roma \u0130mparatorlu\u011fu taraf\u0131ndan i\u015fgal edilmi\u015f 1300 y\u0131l s\xfcrecek Romal\u0131la\u015fma (Rumla\u015fma) s\xfcrecine girmi\u015ftir.Eski ad\u0131 Yunanca: Kerasounta (\u039a\u03b5\u03c1\u03b1\u03c3\u03bf\u03cd\u03bd\u03c4\u03b1), Pharnacia,Choerades olan \u015fehrin ad\u0131 daha sonralar\u0131 Roma ve Bizans y\xf6netiminde Kerasous veya Cerasus olarak de\u011fi\u015ftirilmi\u015ftir. Kerasus, Yunanca boynuz demektir ve yar\u0131maday\u0131 tasvir etmek i\xe7in kullan\u0131lm\u0131\u015ft\u0131r, ounta son eki ile birlikte Kerasous olan \u015fehrin ad\u0131 zamanla Kerasunt olarak s\xf6ylenilmi\u015ftir[2]. Pontus Devleti'nin y\u0131k\u0131l\u0131p Roma hakimiyetinin ba\u015flamas\u0131ndan sonra Giresun y\xf6resinin yerli kabileleri s\xfcratle asimile olarak tarih sahnesinden \xe7ekilmi\u015ftir. Bununla birlikte Roma ve Bizans kaynaklar\u0131nda b\xf6lge halk\u0131 Can [3] (Tzan) olarak adland\u0131r\u0131lmaya devam etmi\u015ftir. Roma d\xf6neminde Giresun Karadeniz'in olduk\xe7a \xf6nemli bir \u015fehri durumundayd\u0131. Bu d\xf6nemde \u015fehir kendi ad\u0131na para basma yetkisine sahip olacak kadar geli\u015fmi\u015ftir.Giresun 1397 y\u0131l\u0131nda T\xfcrkmen Beyi Emir o\u011flu S\xfcleymen Bey taraf\u0131ndan fethedilmi\u015f olup o zamandan bu yana i\u015fgal g\xf6rmemi\u015ftir. Daha sonraki y\u0131llarda Osmanl\u0131lar\u0131n Trabzon \u0130mparatorlu\u011fu'nu 1461 y\u0131l\u0131nda fethi ile Giresun da Osmanl\u0131 Devleti'nin hakimiyetine ge\xe7mi\u015ftir. 1500'li y\u0131llardaki tahrir defterlerinde Giresun ve civar\u0131n\u0131n (Koyulhisar/B\xfcy\xfckliman/Vakf\u0131kebir) aras\u0131 Vilayeti \xc7epni olarak g\xf6r\xfcn\xfcyor ve \xf6zel bir y\xf6netimle idare ediliyordu. Beylikler d\xf6neminden sonra (1461) Osmanl\u0131 \u0130mparatorlu\u011fu'nun Trabzon Vilayeti'ne ba\u011flanm\u0131\u015f olan Giresun, 1920'de Ordu, Tirebolu ve G\xf6rele kazalar\u0131yla birle\u015ftirilerek Giresun Sanca\u011f\u0131 kurulmu\u015ftur. 1923'te il olmu\u015ftur."," B\xf6lgede yap\u0131lan arkeolojik \xe7al\u0131\u015fmalarda M\xd6 3.500 tarihlerinde b\xf6lgede insan yerle\u015fimine ve M\xd6 3.000 tarihlerinde tar\u0131m yap\u0131ld\u0131\u011f\u0131na dair izler bulunmu\u015ftur. Asurlular d\xf6neminde Hayasa-Azzi \xfclkesi olarak adland\u0131r\u0131lan b\xf6lgede Hitit d\xf6neminde Karadeniz B\xf6lgesinin otokton halk\u0131 Ka\u015fkalar\u0131n ya\u015fad\u0131\u011f\u0131 san\u0131lmaktad\u0131r. M\xd6 9. y\xfczy\u0131lda Urartu hakimiyetine giren, Kimmer ve \u0130skit sald\u0131r\u0131lar\u0131ndan sonra Pontus, Roma, Bizans ve Trabzon \u0130mparatorlu\u011fu taraf\u0131ndan y\xf6netilmi\u015ftir. Bu y\xf6netimler aras\u0131nda k\u0131sa s\xfcreli Arap, Ermeni, T\xfcrkmen hakimiyetleri g\xf6ren kent Trabzon \u0130mparatorlu\u011fu'nun y\u0131k\u0131lmas\u0131n\u0131n ard\u0131ndan da 1514 y\u0131l\u0131nda temelli Osmanl\u0131 hakimiyetine girene dek Akkoyunlu ve Safeviler taraf\u0131ndan y\xf6netilmi\u015ftir. I. D\xfcnya Sava\u015f\u0131 s\u0131ras\u0131nda 1916\u2019dan 1918'e dek Rus ordular\u0131 taraf\u0131ndan i\u015fgal edilen b\xf6lgenin Hristiyan halklar\u0131ndan Ermeniler 1915 tehciriyle, Rumlar 1923 m\xfcbadelesi ile Anadolu d\u0131\u015f\u0131na g\xf6nderilmi\u015flerdir.B\xf6lgede yap\u0131lan arkeoloji ara\u015ft\u0131rmalar\u0131nda ele ge\xe7en buluntular, buradaki yerle\u015fimin M\xd6 3000 y\u0131llar\u0131na kadar uzand\u0131\u011f\u0131n\u0131 g\xf6stermektedir. M\xd6 2000'in ortalar\u0131nda Azzi ve Hayasalar buraya yerle\u015fmi\u015ftir. Bu nedenle de, G\xfcm\xfc\u015fhane\u2019yi de i\xe7ine alan b\xf6lgeye Hayasa-Azzi \xfclkesi denilmi\u015ftir. Mezopotamya\u2019dan gelen Asurlu t\xfcccarlar\u0131n, G\xfcm\xfc\u015fhane ve y\xf6resinde bulunan maden yataklar\u0131 nedeniyle b\xf6lgeye ilgi duymu\u015flard\u0131r. Hitit \u0130mparatorluk d\xf6neminde G\xfcm\xfc\u015fhane \xe7evresindeki g\xfcm\xfc\u015f yataklar\u0131n\u0131n i\u015fletilmi\u015ftir. Hitit \u0130mparatorlu\u011fu\u2019nun y\u0131k\u0131lmas\u0131ndan sonra b\xf6lgeye Urartular hakim olmu\u015f, M\xd6 8. y\xfczy\u0131l sonlar\u0131na do\u011fru Kimmer-\u0130skit ak\u0131nlar\u0131 ba\u015flam\u0131\u015ft\u0131r. Daha sonra y\xf6reye Medler, Persler ve Pontos Krall\u0131\u011f\u0131 egemen olmu\u015ftur. M\xd6 1. y\xfczy\u0131lda b\xf6lgede Romal\u0131lar\u0131n hakimiyeti g\xf6r\xfclmektedir. MS 395\u2019te Bizans \u0130mparatorlu\u011fu topraklar\u0131 i\xe7erisinde kalan G\xfcm\xfc\u015fhane, MS 7. y\xfczy\u0131lda Bizans-Hazar askeri i\u015fbirli\u011fine konu olan topraklar aras\u0131ndayd\u0131. Roma ve Bizans d\xf6nemlerinde y\xf6rede kurulu kente Argyropolis (Yunanca argyros: \u201cg\xfcm\xfc\u015f\u201d ve polis: kent demektir.) ad\u0131 verilmi\u015ftir. Bu d\xf6nemde y\xf6renin \xf6nem kazanmas\u0131n\u0131n nedenleri, ticaret yollar\u0131 \xfczerinde bulunu\u015fu ve g\xfcm\xfc\u015f madenlerinden \xf6t\xfcr\xfcd\xfcr.Merkez il\xe7eye ba\u011fl\u0131 k\xf6y olan Ak\xe7akale K\xf6y\xfc'n\xfcn referandum sonucunda %80'lik bir oranla merkez il\xe7eye mahalle olarak ba\u011flanmay\u0131 kabul etmesi \xfczerine, 2018 y\u0131l\u0131nda Ak\xe7akale mahalle oldu.","Hakkari ad\u0131, eskiden Van g\xf6l\xfcn\xfcn g\xfcneyinde ve bir b\xf6l\xfcm\xfc de \u0130ran\u2019a do\u011fru uzanan y\xf6relere yerle\u015fmi\u015f \u201cHakkar\u201d kabilesinin isminden gelmektedir. Arap dili, co\u011frafyas\u0131 ve tarihlerinde b\xf6lge ad\u0131 \u201cHakkariye\u201d olarak ge\xe7mekte olup, \u201cHakkarlar\u2019\u0131n \u015eehri\u201d anlam\u0131na gelmektedir. Y\xf6rede yap\u0131lan ara\u015ft\u0131rmalarda ele ge\xe7en belgelerden ve \xe7evrede bulunan kaya isimlerinden b\xf6lgenin tarih \xf6ncesi \xe7a\u011flarda yerle\u015fim yeri oldu\u011fu, s\u0131rayla S\xfcmerler, Akadlar, Urartular ve Asurlular\u0131n uzun s\xfcre ya\u015fad\u0131klar\u0131 tespit olunmu\u015ftur.\u0130lk \xe7a\u011flarda m\xfcstahkem bir kale g\xf6z\xfcyle bak\u0131lan ve bu y\xfczden uzun sava\u015flara sahne olan Hakkari 1514\u2019de \xc7ald\u0131ran zaferinden sonra Osmanl\u0131 topraklar\u0131na kat\u0131lm\u0131\u015ft\u0131r. Birinci d\xfcnya sava\u015f\u0131 sonras\u0131nda 24.04.1915\u2019de Ruslar\u0131n i\u015fgaline u\u011frayan Hakkari 22.04.1918. tarihinde kurtar\u0131lm\u0131\u015ft\u0131r. 1926 y\u0131l\u0131nda yap\u0131lan Ankara Antla\u015fmas\u0131 ile Musul dahil be\u015f b\xf6lgesi ulusal hududlar d\u0131\u015f\u0131nda kalan Hakkari ayn\u0131 y\u0131l il stat\xfcs\xfc kazanm\u0131\u015ft\u0131r. 1933 y\u0131l\u0131nda Van \u0130line ba\u011flanm\u0131\u015f, 1936 y\u0131l\u0131nda yeniden il stat\xfcs\xfc kazanm\u0131\u015ft\u0131r.","Hatay T\xfcrkiye'nin en \xf6nemli eski yerle\u015fim yerlerinden biridir. Yap\u0131lan arkeolojik ara\u015ft\u0131rmalarda milattan \xf6nce 100.000 ile 40.000 y\u0131llar\u0131 aras\u0131na tarihlenen bulgulara ula\u015f\u0131lm\u0131\u015ft\u0131r. \u0130l topraklar\u0131 ilk Tun\xe7 \xc7a\u011f\u0131ndan itibaren Akat Beyli\u011fi ve M.\xd6. 1800-1600 y\u0131llar\u0131 aras\u0131nda Yamhad Krall\u0131\u011f\u0131na ba\u011fl\u0131 bir beyli\u011fin s\u0131n\u0131rlar\u0131 i\xe7erisinde yer alm\u0131\u015ft\u0131r. Daha sonra M\xd6 17. y\xfczy\u0131l sonlar\u0131nda Hititlerin ve M\xd6 1490 y\u0131llar\u0131nda M\u0131s\u0131r'\u0131n egemenli\u011fine girmi\u015ftir. Ard\u0131ndan Urartular, Asurlular ve Persler'in egemenli\u011fine girdi.M\xd6 300 y\u0131l\u0131nda Antakya kurulmu\u015f ve kent h\u0131zla geli\u015fmi\u015ftir. Kent M\xd6 64 y\u0131l\u0131nda Roma \u0130mparatorlu\u011fu'na kat\u0131lm\u0131\u015f ve \u0130mparatorlu\u011fun Suriye eyaletinin ba\u015fkenti olmu\u015ftur. \u0130slam ordusu taraf\u0131ndan fethedilmi\u015f, Emevi ve Abbasi egemenli\u011finde kalm\u0131\u015ft\u0131r. Daha sonra 877'de Toluno\u011fullar\u0131'n\u0131n fethetti\u011fi topraklar s\u0131rayla; Ih\u015fitler ve Sel\xe7uklular taraf\u0131ndan y\u0131k\u0131lan Halep merkezli Hamdano\u011fullar\u0131 (Beni Hamdan/Hamd\xe2n\xeeler) egemenli\u011fine girdi. 969 y\u0131l\u0131nda Bizans \u0130mparatorlu\u011funun topraklar\u0131na kat\u0131lan \u0130l, 11-12.y\xfczy\u0131llarda Ha\xe7l\u0131 Seferleri s\u0131ras\u0131nda da \xf6nemli rol oynam\u0131\u015ft\u0131r. Antakya Meml\xfbk Devleti taraf\u0131ndan Ha\xe7l\u0131lar\u0131n elinden al\u0131nm\u0131\u015ft\u0131r. (18 May\u0131s 1268) Devam\u0131 Wikipedia'da","Isparta ve \xe7evresindeki yerle\u015fim tarihi Paleolitik d\xf6neme kadar uzanmaktad\u0131r. Isparta' n\u0131n da \xf6nemli yerle\u015fim merkezlerinden biri oldu\u011fu Pisidia b\xf6lgesine M.\xd6. 2000\u2019lerde Luvi ve Arzava topluluklar\u0131 yerle\u015fmi\u015ftir. Daha sonra b\xf6lgeye M.\xd6. 1200'lerden itibaren Frigler, Lidyal\u0131lar, Persler ve Makedonyal\u0131lar egemen olmu\u015ftur. M.\xd6. 323\u2019te B\xfcy\xfck \u0130skender\u2019in \xf6l\xfcm\xfcyle beraber s\u0131ras\u0131yla Seleukos, Bergama Krall\u0131\u011f\u0131 ve sonras\u0131nda Roma hakimiyetine girmi\u015ftir. Roma \u0130mparatorlu\u011fu d\xf6neminde \xf6nemli bir geli\u015fme g\xf6steren Isparta \xf6nemli bir piskoposluk ve ticaret merkezi oldu.[1] Roma \u0130mparatorlu\u011funun b\xf6l\xfcnmesiyle Do\u011fu Roma ve sonras\u0131nda Bizans topraklar\u0131nda bulunan b\xf6lge 1204 y\u0131l\u0131nda Anadolu Sel\xe7uklu Devleti topraklar\u0131na kat\u0131lm\u0131\u015ft\u0131r. 1300 y\u0131l\u0131nda Hamito\u011fullar\u0131 Beyli\u011fi ve 1391 y\u0131l\u0131ndan sonra da Osmanl\u0131 topraklar\u0131na kat\u0131lm\u0131\u015ft\u0131r. II. Murad d\xf6neminde kesin olarak Osmanl\u0131 egemenli\u011fine girmi\u015ftir. 16. y\xfczy\u0131lda g\xfcneybat\u0131 Anadolu\u2019daki \xf6nemli pazarlardan biri olmu\u015ftur.\u0130lk Yunan muhacirleri Anadolu'ya \xe7\u0131kt\u0131klar\u0131 zaman buran\u0131n g\xfczelli\u011fini i\u015fitmi\u015fler ve Isparta anlam\u0131na olarak (\u0130s-Barid) demi\u015fler. Bu kelime zamanla (Sparta - Isparta) \u015feklini alm\u0131\u015ft\u0131r.","Mersin y\xf6resinin bilinen en eski ismi Kizzuvatna olup bu ad Hitit devrinde Kue, klasik devirde de Kilikya olmu\u015ftur.[4] Bu b\xf6lgede yap\u0131lan kaz\u0131 ve ara\u015ft\u0131rmalar, ilk yerle\u015fim izlerinin Cilal\u0131 Ta\u015f Devri ve Bak\u0131r \xc7a\u011f\u0131'nda g\xf6r\xfcld\xfc\u011f\xfcn\xfc ortaya koymu\u015ftur. G\xf6zl\xfckule H\xf6y\xfc\u011f\xfc ve Yumuktepe'deki kaz\u0131 ara\u015ft\u0131rmalar\u0131 ayr\u0131ca y\xf6renin tarihte \xe7ok \xf6nemli bir merkez oldu\u011funu g\xf6stermi\u015ftir. Nitekim, G\xf6zl\xfckule \u0130slam uygarl\u0131klar\u0131ndan Yeni Ta\u015f \xc7a\u011f\u0131'na kadar 33 katmanda olu\u015fmaktad\u0131r. \xc7ift\xe7i ve \xe7oban toplumunun ya\u015fad\u0131\u011f\u0131 ilk katmanlarda toprak s\u0131val\u0131 mek\xe2n zeminlerinin ortaya \xe7\u0131k\u0131\u015f\u0131 ve daha \xfcst katmanlarda ele ge\xe7irilen \xe7e\u015fitli tar\u0131msal aletler ve \xe7anak \xe7\xf6mlekler, \xfcretim ekonomisinin ve toplumsal bilincin geli\u015fimini g\xf6stermektedir. M\xd6 6. y\xfczy\u0131la kadar y\xf6renin yaz\u0131l\u0131 tarihi Hurri, Luvi, Arzava, Kizzuvatna gibi yerel krall\u0131klar ve bunlar\u0131n k\xfclt\xfcrleriyle, buraya daha sonralar\u0131 egemen olan Hitit, Asur ve Babil krall\u0131klar\u0131n\u0131n tarihleri i\xe7 i\xe7edir.III. katmanda bulunan Alacah\xf6y\xfck tipindeki bronz han\xe7er ve Hitit yap\u0131 kal\u0131nt\u0131lar\u0131, y\xf6redeki Hitit varl\u0131\u011f\u0131n\u0131n \xf6nemli belgeleridir. Belli bir d\xf6nem Hitit egemenli\u011finde kalan b\xf6lge daha sonra Asur Kral\u0131 III. Selomossa'n\u0131n, M\xd6 528 y\u0131l\u0131nda ise Perslerin eline ge\xe7mi\u015ftir.[4] M\xd6 527'de Yunanlar y\xf6reyi ve K\u0131br\u0131s'\u0131, M\xd6 334'te ise Mersin'i Makedonlar ele ge\xe7irmi\u015ftir.","\u0130stanbul, yerle\u015fim tarihi son yap\u0131lan Yenikap\u0131'daki kaz\u0131larla bulunan liman do\u011frultusunda 8500 y\u0131l, kentsel tarihi yakla\u015f\u0131k 3.000, ba\u015fkentlik tarihi 1600 y\u0131la kadar uzanan Avrupa ile Asya k\u0131talar\u0131n\u0131n kesi\u015fti\u011fi noktada bulunan bir d\xfcnya kentidir.[44] \u0130stanbul Roma, Bizans ve Osmanl\u0131 d\xf6neminde ba\u015fkent olarak kullan\u0131lm\u0131\u015ft\u0131r.[45] \u015eehir \xe7a\u011flar boyunca farkl\u0131 uygarl\u0131k ve k\xfclt\xfcrlere ev sahipli\u011fi yapm\u0131\u015f, y\xfczy\u0131llar boyu \xe7e\u015fitli din, dil ve \u0131rktan insanlar\u0131n bir arada ya\u015fad\u0131\u011f\u0131 kozmopolit ve metropolit yap\u0131s\u0131n\u0131 korumu\u015f ve tarihsel s\xfcre\xe7te e\u015fsiz bir mozaik h\xe2lini alm\u0131\u015ft\u0131r. Uzun zaman dilimleri boyunca her alanda merkez olmay\u0131 ve iktidarda kalmay\u0131 ba\u015faran d\xfcnyadaki ender yerle\u015fim yerlerinden biri olan \u0130stanbul ge\xe7mi\u015ften g\xfcn\xfcm\xfcze bir d\xfcnya ba\u015fkentidir.stanbul'un tarihi \xfc\xe7 y\xfcz bin y\u0131l \xf6nceye kadar uzanmaktad\u0131r. K\xfc\xe7\xfck\xe7ekmece G\xf6l\xfc kenar\u0131nda bulunan Yar\u0131mburgaz Ma\u011faras\u0131nda yap\u0131lan kaz\u0131larda insan k\xfclt\xfcr\xfcne ait ilk izlere rastland\u0131.[46] Bu d\xf6nemde g\xf6l\xfcn \xe7evresinde Neolitik ve Kalkolitik insanlar\u0131n ya\u015fad\u0131\u011f\u0131 san\u0131lmaktad\u0131r. \xc7e\u015fitli d\xf6nemlerde yap\u0131lan kaz\u0131larda, Dudullu yak\u0131nlar\u0131nda Alt Paleolitik \xc7a\u011f'a, A\u011fa\xe7l\u0131 yak\u0131nlar\u0131nda ise, Orta Paleolitik \xc7a\u011f ile \xdcst Paleolitik \xc7a\u011f'a \xf6zg\xfc aletlere rastland\u0131.2008 y\u0131l\u0131nda \u0130stanbul metrosu i\xe7in yap\u0131lan Marmaray t\xfcp ge\xe7idi kaz\u0131lar\u0131 s\u0131ras\u0131nda Cilal\u0131 Ta\u015f Devri'nin s\xfcrd\xfc\u011f\xfc M\xd6 6500'l\xfc y\u0131llara ait kal\u0131nt\u0131lara rastlanan \u015fehrin,[48][49][50] Anadolu Yakas\u0131'ndaki Fikirtepe'de yap\u0131lan kaz\u0131larda ise Bak\u0131r \xc7a\u011f\u0131'n\u0131n s\xfcrd\xfc\u011f\xfc M\xd6 5500-3500 y\u0131llar\u0131na ait kal\u0131nt\u0131lar bulundu.[51] Bunun yan\u0131nda Kad\u0131k\xf6y'de Fenikelilere ait kal\u0131nt\u0131lar bulundu. Traklar, kentin yak\u0131nlar\u0131na M\xd6 13. y\xfczy\u0131l ve 11. y\xfczy\u0131llarda Semistra kentini kurdu.[52] Kral Lygos zaman\u0131nda Sarayburnu'na, bug\xfcnk\xfc Topkap\u0131 Saray\u0131'n\u0131n bulundu\u011fu yerde bir Akropolis kuruldu. M\xd6 685'te Megara'dan gelen Yunanlar burada bir koloni kurdu, Kral Byzas'\u0131n h\xfck\xfcm s\xfcrd\xfc\u011f\xfc M\xd6 667 y\u0131l\u0131nda ise Byzantion kuruldu.[53] Kente Roma \u0130mparatorlu\u011fu hakim olunca, kentin ad\u0131 Septimius Severus taraf\u0131ndan k\u0131sa s\xfcreli\u011fine o\u011flunun ad\u0131 Augusta Antonina kondu,[54] ard\u0131ndan \u0130mparator I. Konstantin zaman\u0131nda kent Roma \u0130mparatorlu\u011fu'nun ba\u015fkenti ilan edildi. Bu s\u0131rada Nova Roma olarak de\u011fi\u015ftirilen kentin ad\u0131 benimsendi ve 337 y\u0131l\u0131nda \u0130mparator I. Konstantin'in \xf6l\xfcm\xfcyle Konstantinopolis'e \xe7evrildi.Devam\u0131 Wikipedia'da","Eski \u0130zmir (Smyrna) kenti, k\xf6rfezin kuzeydo\u011fusunda yer alan ve y\xfcz \xf6l\xe7\xfcm\xfc yakla\u015f\u0131k y\xfcz d\xf6n\xfcm olan bir yar\u0131m adac\u0131k \xfczerinde kurulmu\u015ftu. Sonraki y\xfczy\u0131llar boyunca Meles \xc7ay\u0131'n\u0131n ve bug\xfcnk\xfc Yamanlar Da\u011f\u0131'ndan gelen sellerin getirdikleri mil ile bug\xfcnk\xfc Bornova ovas\u0131 olu\u015ftu ve yar\u0131m adac\u0131k, bir tepe h\xe2line d\xf6n\xfc\u015ft\xfc. \u0130zmir'deki ilk yerle\u015fim yeri olarak tespit edilen Bayrakl\u0131/Tepekule H\xf6y\xfc\u011f\xfc'n\xfcn \xe7evresindeki yerle\u015fim her ne kadar M\xd6 3000 y\u0131l\u0131ndan \xe7ok daha geriye uzanmakta ise de yap\u0131lan son kaz\u0131larda hen\xfcz M\xd6 3000 y\u0131llar\u0131na kadar gidilebilmi\u015ftir. Kaz\u0131larda elde edilen bilgiler \u0131\u015f\u0131\u011f\u0131nda, Erken Tun\xe7 \xc7a\u011f\u0131nda ilk \u0130zmir yerle\u015fikleri evlerini h\xf6y\xfc\u011f\xfcn en \xfcst d\xfczeyinde denizden 3 ile 5 metre yukar\u0131daki kayalar \xfczerine oturtmu\u015flard\u0131r. Bulunan \xe7anak ve \xe7\xf6mlekler Troya/Truva d\xf6nemi (M\xd6 3000-2500) k\xfclt\xfcr\xfcyle benzerlikler g\xf6stermektedir. [9][10] Ancak 2005 y\u0131l\u0131nda yap\u0131lan kaz\u0131larda ke\u015ffedilmi\u015f olan Bornova il\xe7esindeki Ye\u015filova H\xf6y\xfc\u011f\xfc'nden elde edilen bulgularla kentin tarihinin M\xd6 6500 y\u0131l\u0131na kadar uzand\u0131\u011f\u0131 ke\u015ffedilmi\u015ftir. Bu h\xf6y\xfckteki buluntular \u0130zmir'deki ilk yerle\u015fimin Neolitik \xc7a\u011fda Bornova Ovas\u0131'nda ba\u015flad\u0131\u011f\u0131n\u0131, yerle\u015fim say\u0131s\u0131n\u0131n Kalkolitik ve Tun\xe7 \xc7a\u011flar s\xfcresince artarak devam etti\u011fini g\xf6stermi\u015ftir.Hitit d\xf6neminde (M\xd6 1800-1200) Anadolu'da yaz\u0131 kullan\u0131l\u0131yordu ve bundan \xf6t\xfcr\xfc o d\xf6nemde tarih \xe7a\u011f\u0131na ula\u015f\u0131lm\u0131\u015f bulunuluyordu. Ancak M\xd6 1200'lerde Troya VII'nin ve Hititler ba\u015fkenti Hattu\u015fa\u015f'\u0131n Balkanlar'dan gelen kavimlerce y\u0131k\u0131lmas\u0131ndan sonra Orta ve Bat\u0131 Anadolu yeniden yaz\u0131s\u0131z ve karanl\u0131k bir \xe7a\u011fa, Demir \xc7a\u011f\u0131'na girdi. Demir \xc7a\u011f\u0131, Anadolu'da yaz\u0131n\u0131n yeniden kullan\u0131lmas\u0131 ile Frigya Krall\u0131\u011f\u0131'nda M\xd6 730, geri kalan Orta ve Bat\u0131 Anadolu'da ise M\xd6 650 y\u0131llar\u0131na kadar s\xfcrm\xfc\u015ft\xfcr.Devam\u0131 Wikipedia'da","Kars y\xf6resinde Alt Paleolitik D\xf6nemin hareketli oldu\u011fu kaz\u0131larda ele ge\xe7en buluntulardan saptanm\u0131\u015ft\u0131r. Tombultepe'de bu d\xf6neme ait \u015f\xf6lyen-a\u015f\xf6lyen tipte i\u015flenmi\u015f el baltalar\u0131 ve b\xfcy\xfck yongalar bulunmu\u015ftur. Merkez il\xe7enin yakla\u015f\u0131k 18 kilometre[31] uzakl\u0131\u011f\u0131nda bulunan Borluk Vadisi'nde musteryen tipte ara\xe7; A\u011fz\u0131ac\u0131k Suyu'nun bat\u0131s\u0131nda ise bazalttan yap\u0131lm\u0131\u015f ve \xe7ok a\u015f\u0131nm\u0131\u015f bir u\xe7 bulunmu\u015ftur. Bu \xf6rnekler Orta Paleolitik D\xf6nemden kalm\u0131\u015ft\u0131r. \xdcst Paleolitik D\xf6nemde y\xf6re insanlar\u0131n\u0131n avc\u0131l\u0131k ve toplay\u0131c\u0131l\u0131k ile ilgilendiklerine dair bilgi, yap\u0131lan kaz\u0131lar sonucunda elde edilen ara\xe7-gere\xe7lerden tespit edilmi\u015ftir. Ayr\u0131ca bu d\xf6nemde Cam\u0131\u015fl\u0131 K\xf6y\xfc'nde da\u011f ke\xe7ileri ve geyiklerinin resmedildi\u011fi duvarlar bulunmu\u015ftur.Paleolitik D\xf6nemin hemen ard\u0131ndan gelen Mezolitik D\xf6nemde mikrolit ad\u0131 verilen k\xfc\xe7\xfck ara\xe7 ve gere\xe7lere rastlanm\u0131\u015ft\u0131r.Neolitik D\xf6nemde y\xf6rede hen\xfcz do\u011fru anlamda yerle\u015fmelerden s\xf6z etmek m\xfcmk\xfcn de\u011fildir. \xc7\u0131ld\u0131r G\xf6l\xfc \xfczerinde bulunan Ak\xe7akale Adas\u0131'nda bu d\xf6neme ait ta\u015f an\u0131tlar ve duvar resimleri bulunmu\u015ftur. Burada o d\xf6nem menhirlerine, dolmenlerine ve kromleklerine rastlanm\u0131\u015ft\u0131r. Avrupa k\xfclt\xfcr\xfcne has bu dolmenler do\u011fuda ilk kez Kars'ta g\xf6r\xfclm\xfc\u015ft\xfcr.Azat K\xf6y\xfc'nde, bak\u0131r madeninin kullan\u0131lmaya ba\u015fland\u0131\u011f\u0131 Kalkolitik D\xf6nemde, yap\u0131lan ara\xe7-gere\xe7lere ait buluntular elde edilmi\u015ftir. Bunun d\u0131\u015f\u0131nda bak\u0131r ve kalay madenlerinin ilk kez kar\u0131\u015ft\u0131r\u0131ld\u0131\u011f\u0131 Tun\xe7 D\xf6nemine ait \xe7anak, \xe7\xf6mlek ve de\u011fi\u015fik gere\xe7ler de bulunmu\u015ftur. Kars Kalesi mevkiinde bu d\xf6neme ait bir a\xe7k\u0131 ta\u015f\u0131, el de\u011firmeni ta\u015flar\u0131, bir \xe7eki\xe7, delinmi\u015f \xfcst\xfc \xe7izgili ve s\xfcsl\xfc hayvan, k\xfc\xe7\xfck bir ta\u015f hayvan, el yap\u0131m\u0131 \xe7anak-\xe7\xf6mlekler ve yap\u0131 kal\u0131nt\u0131lar\u0131 oldu\u011fu d\xfc\u015f\xfcn\xfclen iri ta\u015f y\u0131k\u0131nt\u0131lar\u0131 bulunmu\u015ftur.Devam\u0131 Wikipedia'da","1947 ve 1948 y\u0131llar\u0131 aras\u0131nda Kastamonu'da yap\u0131lan ara\u015ft\u0131rmalar sonucu G\xf6lk\xf6y Enstit\xfcs\xfc \xe7evresinde \xe7akmak ta\u015f\u0131ndan yap\u0131lma bir alet bulunmu\u015f, bu aletin Orta Paleolitik d\xf6nemden kald\u0131\u011f\u0131 \xf6\u011frenilmi\u015fti.1951 Y\u0131l\u0131nda yap\u0131lan ara\u015ft\u0131rmalar sonucu da Tahta ve Malak k\xf6yleri etraf\u0131nda Abevilyen (Chell\xe9en), Mikokiyen (Micoquien) \xe7a\u011f\u0131ndan kalma el baltalar\u0131yla; Musteryen (Mousterian) ve \u015f\xfcpheli olarak da \xdcst Paleolitik'e ait tarihi bulgular ele ge\xe7irilmi\u015ftir.Yine ayn\u0131 y\u0131llarda \u0130smail K\u0131l\u0131\xe7 K\xf6kten'in yapt\u0131\u011f\u0131 geziler sonucu Devrekani'nin Eksen b\xf6lgesinde (\u015eimdiki Kulaks\u0131zlar Baraj\u0131 civar\u0131) Dikilita\u015flar ile kar\u015f\u0131la\u015fm\u0131\u015f, ancak tarihlendirme yap\u0131labilecek e\u015fya kal\u0131nt\u0131s\u0131 bulamam\u0131\u015ft\u0131r. Fakat b\xf6lgenin kuzeybat\u0131s\u0131nda Bak\u0131r \xc7a\u011f\u0131na ait \xe7anak \xe7\xf6mlekler bulunmu\u015ftur. Devam\u0131 Wikipedia'da","Kayseri, M\xd6 4000 ile MS 2000 olmak \xfczere 6000 y\u0131ll\u0131k bir tarihe sahiptir. M\xd6 2000 y\u0131llar\u0131nda Anadolu\u2019ya gelen Hititler, Kayseri\u2019ye 22 km uzakl\u0131kta bulunan K\xfcltepe (Kani\u015f) \u015fehrini kurmu\u015flard\u0131r. K\xfcltepe, Kayseri ovas\u0131n\u0131n en b\xfcy\xfck \u015fehri ve Anadolu\u2019nun en b\xfcy\xfck h\xf6y\xfcklerinden biridir. K\xfcltepe\u2019nin hemen yan\u0131nda yer alan Karum\u2019da (Pazar\u015fehir) yap\u0131lan kaz\u0131larda bu d\xf6neme ait \xe7ivi yaz\u0131s\u0131 ile \xe7e\u015fitli yaz\u0131l\u0131 tabletler bulunmu\u015f ve bu tabletlerden Asurlu t\xfcccarlarla Hititli yerliler aras\u0131ndaki ticari ili\u015fkilere ait bilgiler elde edilmi\u015ftir. K\xfcltepe, M\xd6 4000 y\u0131l\u0131ndan Roma devri sonuna kadar devaml\u0131 olarak yerle\u015fme g\xf6rm\xfc\u015ft\xfcr.M.S. 395\u2019te Roma \u0130mparatorlu\u011fu ikiye b\xf6l\xfcn\xfcnce bu b\xf6lge (Kapadokya) Anadolu\u2019nun di\u011fer b\xf6lgeleri gibi Do\u011fu Roma(Bizans)'n\u0131n pay\u0131na d\xfc\u015fm\xfc\u015ft\xfcr. Hristiyanl\u0131k yay\u0131l\u0131rken Kayseri bu dinin en b\xfcy\xfck merkezlerinden biriydi.M.S. 6. as\u0131rda \u0130mparator Justinianus, Kayseri\u2019yi surlarla \xe7evirdi ve b\xe2z\u0131 \xeem\xe2r faaliyetlerinde bulundu. Emev\xeeler zaman\u0131nda 690, 726, 729 ve 732\u2019de \u0130sl\xe2m ordular\u0131 Halife Abd\xfclmelik, Mesleme, Said ibni Hi\u015fam ve S\xfcleyman ibni Hi\u015fam Kayseri\u2019yi d\xf6rt defa fethettiler. Fakat yeniden Bizans\u2019\u0131n eline ge\xe7ti.Sel\xe7uklular Kayseri\u2019yi Malazgirt Zaferi'nden birka\xe7 y\u0131l \xf6nce ele ge\xe7irmi\u015fler, fakat tam olarak 1071 zaferinden sonra h\xe2kimiyet kurmu\u015flard\u0131r. Sel\xe7uklular devrinde Kayseri, Konya\u2019dan sonra ikinci ba\u015fkent oldu. Sel\xe7uklu Sultan\u0131 Al\xe2eddin Keykub\xe2t zaman\u0131nda Kayseri\u2019nin durumu Bizans devrini gerilerde b\u0131rakt\u0131. En parlak devrini ya\u015fad\u0131. Sel\xe7uklu T\xfcrkiye\u2019sinin Konya\u2019dan sonra en \xf6nemli \u015fehri Kayseri\u2019ydi. D\xfcny\xe2n\u0131n en g\xfczel beldelerinden biri h\xe2line geldi. \u015eehir birbirinden g\xfczel eserlerle s\xfcslendi. Bug\xfcn Kayseri\u2019deki eski eserlerin \xe7o\u011fu ve en de\u011ferlileri Sel\xe7uklu devrinden kalm\u0131\u015f olanlard\u0131r. Sel\xe7uklulardan sonra \u0130lhanl\u0131lar bu b\xf6lgeye h\xe2kim oldular. 1277\u2019de M\u0131s\u0131r-Suriye T\xfcrk Meml\xfbk Sultan\u0131 Baybars Kayseri\u2019ye geldi, fakat \u0130lhanl\u0131lar\u2019dan Kayseri\u2019yi geri alamad\u0131.On d\xf6rd\xfcnc\xfc as\u0131rda Alaeddin Eretna \u0130lhanl\u0131lar\u0131n Anadolu genel v\xe2lisi olarak Kayseri\u2019ye geldi. \u0130lhanl\u0131 \u0130mparatorlu\u011fu y\u0131k\u0131l\u0131nca Eratnao\u011fullar\u0131 Beyli\u011fi kuruldu ve bu beyli\u011fin Sivas\u2019tan sonra ikinci ba\u015fkentiydi.Eretnao\u011fullar\u0131\u2019n\u0131n yerine ge\xe7en Kad\u0131 Burhaneddin\u2019in h\xe2kimiyeti uzun s\xfcrmedi. \u015eehir 1398\u2019de Sultan Y\u0131ld\u0131r\u0131m B\xe2yez\xeet taraf\u0131ndan fethedilip, Osmanl\u0131 Devleti'ne kat\u0131ld\u0131. Fakat d\xf6rt sene sonra 1402\u2019de Timur ile yap\u0131lan Ankara Sava\u015f\u0131ndan sonra Kayseri\u2019yi Karamano\u011fullar\u0131 ele ge\xe7irdi. Bir m\xfcddet sonra Kayseri\u2019yi Mara\u015f\u2019ta bulunan Dulkadiro\u011fullar\u0131 T\xfcrk Beyli\u011fi'ne b\u0131rakt\u0131. Karamano\u011fullar\u0131, Kayseri\u2019yi Dulkadiro\u011fullar\u0131 T\xfcrk Beyli\u011finden geri al\u0131nca, Sultan 2. Murad H\xe2n 1436\u2019da Kayseri\u2019yi yeniden alarak Dulkadiro\u011fullar\u0131 Beyli\u011fi'ne verdi. (\u0130kinci Mur\xe2d\u2019\u0131n anas\u0131 Dulkadiro\u011fullar\u0131 Beyi\u2019nin k\u0131z\u0131 idi.) Bir m\xfcddet sonra Karamano\u011fullar\u0131 Beyli\u011fi Kayseri\u2019yi yeniden ele ge\xe7irdi. Meml\xfbklar bir ara Kayseri\u2019yi ku\u015fatt\u0131lar fakat alamad\u0131lar. 1508\u2019de \u015eah \u0130smail Kayseri\u2019ye geldi fakat k\u0131sa bir m\xfcddet sonra geri \xe7ekildi.Karamano\u011fullar\u0131 Beyli\u011fi Osmanl\u0131 Devleti'ne kat\u0131ld\u0131\u011f\u0131 i\xe7in Kayseri, Dulkadiro\u011fullar\u0131 Beyli\u011fi'nin id\xe2resindeydi.Yavuz Sultan Selim Han 1515\u2019te Kayseri\u2019yi Osmanl\u0131 Devleti'ne kat\u0131nca Karaman (Konya) ey\xe2letinin (beylerbeyli\u011finin) yedi sanca\u011f\u0131ndan (vil\xe2yetinden) birinin merkezi oldu. 1825\u2019te Kayseri\u2019nin \u015fehir n\xfcf\xfbsu 100.000 idi. Tanzimattan sonra Ankara eyaletinin (vilayetinin) be\u015f sanca\u011f\u0131ndan biri oldu, \xfc\xe7 kazas\u0131 vard\u0131. Cumhuriyet devrinde b\xfct\xfcn sancaklara (mutasarr\u0131fl\u0131klara) \u201cvilayet-il\u201d denilince Kayseri vil\xe2yet oldu. \u201cKaysar\xeeye\u201d ismi (Kayseri)ye \xe7evrildi.Kayseri, 1988 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 3508 say\u0131l\u0131 Kanun[4] ile b\xfcy\xfck\u015fehir unvan\u0131 kazand\u0131. Ba\u015flang\u0131\xe7ta iki il\xe7e (Kocasinan ve Melikgazi) Kayseri B\xfcy\xfck\u015fehir Belediyesinin s\u0131n\u0131rlar\u0131na d\xe2hil edildi. 2004 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 5216 say\u0131l\u0131 Kanun ile b\xfcy\xfck\u015fehir belediyesinin s\u0131n\u0131rlar\u0131, valilik binas\u0131 merkez kabul edilerek yar\u0131\xe7ap\u0131 20 kilometre olan dairenin s\u0131n\u0131rlar\u0131na geni\u015fletildi.[5] Bu s\u0131n\u0131rlar i\xe7inde kalan 5 il\xe7e, b\xfcy\xfck\u015fehir il\xe7e belediyeleri h\xe2line geldi.[5] 2012 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 6360 say\u0131l\u0131 Kanun ile 2014 T\xfcrkiye yerel se\xe7imlerinin ard\u0131ndan b\xfcy\xfck\u015fehir belediyesinin s\u0131n\u0131rlar\u0131 il m\xfclki s\u0131n\u0131rlar\u0131 oldu."," \u0130nsanlar\u0131n Trakya'ya ilk olarak yakla\u015f\u0131k 1.000.000 y\u0131l \xf6nce geldi\u011fi d\xfc\u015f\xfcn\xfclmektedir. G\xfcn\xfcm\xfczden 14.000 y\u0131l \xf6ncesine kadar s\xfcregeldi\u011fi kabul edilen[kaynak belirtilmeli] ve k\xfclt\xfcr tarihinin en uzun d\xf6nemi olan bu s\xfcre\xe7 Eski Ta\u015f \xc7a\u011f\u0131 ya da Avc\u0131l\u0131k ve Toplay\u0131c\u0131l\u0131k D\xf6nemi olarak adland\u0131r\u0131lmaktad\u0131r. Bu d\xf6nem boyunca av ve yenebilir bitki, yemi\u015f toplay\u0131c\u0131l\u0131\u011f\u0131na dayal\u0131 bir beslenme d\xfczeni ve g\xf6\xe7ebe bir ya\u015fam bi\xe7imi hakim olmu\u015f, kal\u0131c\u0131 bar\u0131naklar yap\u0131lmam\u0131\u015ft\u0131r. Olduk\xe7a uzun olan bu s\xfcre\xe7 i\xe7erisinde, d\xfcnya iklimi ile birlikte Trakya'n\u0131n ikliminde de \xf6nemli de\u011fi\u015fiklikler olmu\u015f, birbiri ard\u0131na kuru so\u011fuklardan ya\u011f\u0131\u015fl\u0131 s\u0131ca\u011fa kadar de\u011fi\u015fen iklim d\xf6nemleri, on binlerce y\u0131l b\xf6lgeye hakim olmu\u015ftur. Bu d\xf6nemde, insanlar\u0131n el becerilerinde \xf6nemli geli\u015fmeler olmu\u015f, aletlerin b\xfcy\xfck b\xf6l\xfcm\xfc \xe7akmak ta\u015f\u0131ndan ya da a\u011fa\xe7 ve kemiklerden yap\u0131lm\u0131\u015ft\u0131r. Bu d\xf6neme ait, Trakya'da bilinen en eski ve \xf6nemli buluntular, \u0130stanbul yak\u0131nlar\u0131ndaki Yar\u0131mburgaz Ma\u011faras\u0131, Eskice S\u0131rt\u0131 ile A\u011fa\xe7l\u0131 Kumlu\u011fu'ndan gelmektedir. Yap\u0131lan arkeolojik kaz\u0131lardan, Balkanlar ve Yak\u0131n Do\u011fu'nun en uzun ve s\xfcreli tabakala\u015fmas\u0131n\u0131n burada oldu\u011fu saptanm\u0131\u015ft\u0131r. Yar\u0131mburgaz Ma\u011faras\u0131'nda, Marmara B\xf6lgesi'nin do\u011fal \xe7evre de\u011fi\u015fimini \xe7ok a\xe7\u0131k bir \u015fekilde sergileyen jeolojik katmanlar ile birlikte, yakla\u015f\u0131k 600.000 y\u0131l \xf6ncesine ait k\xfclt\xfcr katlar\u0131 da \xe7ok iyi korunmu\u015f olarak bulunmu\u015ftur.D\xfcnya ikliminin g\xfcn\xfcm\xfcz ko\u015fullar\u0131na yak\u0131n bir duruma gelmesi ile birlikte, yakla\u015f\u0131k 8000 y\u0131l \xf6nce Trakya'n\u0131n do\u011fal \xe7evre ortam\u0131 ve bitki \xf6rt\xfcs\xfc de bug\xfcnk\xfcne benzer \xf6zellikler kazanm\u0131\u015f, insanlar de\u011fi\u015fen \xe7evre ko\u015fullar\u0131na, geli\u015fen teknolojileri ile uyum sa\u011flam\u0131\u015flard\u0131r. Bu de\u011fi\u015fim, Anadolu'da 10 - 12 bin y\u0131l kadar \xf6nce ba\u015flam\u0131\u015ft\u0131r. \u0130nsanlar ilk kez bu\u011fday, arpa, mercimek gibi tah\u0131llar\u0131 tar\u0131ma al\u0131p koyun, ke\xe7i, s\u0131\u011f\u0131r ve domuz gibi hayvanlar\u0131 evcille\u015ftirerek \xe7ift\xe7ili\u011fe ba\u015flam\u0131\u015f; ah\u015fap, kerpi\xe7 ve ta\u015ftan ilk kal\u0131c\u0131 konutlar\u0131 yapm\u0131\u015flard\u0131r. Ancak bu geli\u015fmelerin, \xe7ok zengin do\u011fal \xe7evre olanaklar\u0131na sahip olan Trakya'da Anadolu'dan daha sonra, yakla\u015f\u0131k olarak g\xfcn\xfcm\xfczden 7000 y\u0131l \xf6nce ba\u015flad\u0131\u011f\u0131 g\xf6r\xfclmektedir. D\xf6nemin ba\u015flar\u0131ndan itibaren beslenmede su \xfcr\xfcnleri, avc\u0131l\u0131k ve yaban yemi\u015f toplay\u0131c\u0131l\u0131\u011f\u0131 da \xe7ift\xe7ili\u011fin yan\u0131nda devam etmi\u015ftir. B\xf6lgede bilinen en eski \xe7ift\xe7i yerle\u015fmeleri Enez yak\u0131nlar\u0131ndaki Hoca \xc7e\u015fme ile \u0130stanbul yak\u0131nlar\u0131ndaki Fikirtepe'dir. Hoca \xc7e\u015fme'de yap\u0131lan arkeolojik kaz\u0131lar, M\xd6 6200 y\u0131llar\u0131nda tarihlenen ve t\xfcm\xfc ile Orta Anadolu \xf6zellikleri g\xf6steren, tar\u0131m ve hayvanc\u0131l\u0131k yapan bir toplulu\u011fun ilk olarak burada yerle\u015fti\u011fini, daha sonra bunlar\u0131n yerel ko\u015fullara uyum sa\u011flayarak, Bulgaristan'da bilinen k\xfclt\xfcrleri olu\u015fturdu\u011funu ortaya koymu\u015ftur. Hoca \xc7e\u015fme'nin en eski katmanlar\u0131, Balkanlar'da \u015fimdiye dek bilinen en eski neolitik k\xfclt\xfcr\xfc olu\u015fturmaktad\u0131r. Devam\u0131 Wikipedia'da","K\u0131r\u015fehir ve \xe7evresinde yap\u0131lan arkeolojik kaz\u0131larda K\u0131r\u015fehir'in tarih \xf6ncesi \xe7a\u011fda,\xf6zellikle Tun\xe7 \xe7a\u011f\u0131 d\xf6neminin etkisi alt\u0131nda kald\u0131\u011f\u0131 g\xf6r\xfcl\xfcyor. 1943'te Hash\xf6y\xfck kaz\u0131lar\u0131nda ilk Tun\xe7 \xe7a\u011f\u0131'na ait be\u015f-alt\u0131 tabaka tespit edilmi\u015ftir. Bu tabakalarda ta\u015f ve kerpi\xe7 yap\u0131 temelleri, siyah renkli seramik par\xe7alar\u0131, \xe7\xf6mlek ve \xe7anaklar bulunmu\u015ftur. Bu ka\xadl\u0131nt\u0131lar b\xf6lgede ilk Tun\xe7 \xe7a\u011f\u0131 d\xf6neminin (M\xd6. 3500-2000) ya\u015fand\u0131\u011f\u0131n\u0131 a\xe7\u0131klar. Hash\xf6y\xfck ve \u015fehir merkezindeki Kale'de ba\u015flayan kaz\u0131 \xe7al\u0131\u015fmalar\u0131 ile Kaman'a ba\u011fl\u0131 \xc7a\u011f\u0131rkan kasabas\u0131nda yap\u0131lan kaz\u0131lardan yeni bilgiler de elde edilebilir.\xc7a\u011f\u0131rkan kasabas\u0131 yak\u0131n\u0131nda bulunan Kaleh\xf6y\xfck'\xfcn tarihinin M\xd6.. 1750-600 y\u0131l\xadlar\u0131na kadar uzand\u0131\u011f\u0131 san\u0131lmaktad\u0131r. Kaz\u0131lar sonunda 25 metre y\xfcksekli\u011findeki h\xf6y\xfck ve buradan \xe7\u0131kar\u0131lan iki b\xfcy\xfck k\xfcp ve di\u011fer buluntular, y\xf6renin tarih \xf6ncesi d\xf6nemini ayd\u0131nlat\u0131r. K\u0131r\u015fehir'in kurulu\u015funu, ilk \xe7a\u011flarda Anadolu'yu kuzey-bat\u0131dan, g\xfcney-do\u011fudan bir ba\u015ftan bir ba\u015fa kesen eski ve i\u015flek bir anayolun ortas\u0131nda bir durak ve yerle\u015fme yeri olmas\u0131nda, Asya'dan Avrupa'ya giden \xf6nemli karayollar\u0131 \xfczerinde bulunuyor olmas\u0131nda, ayr\u0131ca Kapadokya b\xf6lgesine de yak\u0131n olmas\u0131nda arayan bilim adamlar\u0131 olmu\u015ftur.K\u0131r\u015fehir Hititlerin yerle\u015fim yeri olan K\u0131z\u0131l\u0131rmak yay\u0131 i\xe7inde oldu\u011fundan, Hititler d\xf6neminin K\u0131r\u015fehir'de yayg\u0131n bir \u015fekilde ya\u015fand\u0131\u011f\u0131 kesindir. Kale h\xf6y\xfck'te yap\u0131lan kaz\u0131larda yerle\u015fim alan\u0131n\u0131n en alt tabakas\u0131n\u0131 Hitit d\xf6neminin te\u015fkil etti\u011fi ortaya \xe7\u0131km\u0131\u015ft\u0131r. Bu kaz\u0131lar s\u0131ras\u0131nda erken ve ge\xe7 Hitit \xe7a\u011flar\u0131na ait kal\u0131nt\u0131 ve eserler g\xfcn \u0131\u015f\u0131\u011f\u0131na \xe7\u0131kar\u0131lm\u0131\u015ft\u0131r. Resmi veya saray yap\u0131lar\u0131na ait oldu\u011fu ,san\u0131lan duvar temelleri ile m\xfch\xfcrler, tak\u0131lar, seramik mutfak e\u015fyalar\u0131 ve Hitit \xe7ap\u0131na ait \xe7ivi yaz\u0131l\u0131 bir tablet par\xe7as\u0131 da bulunmu\u015ftur. Devam\u0131 K\u0131r\u015fehir Belediyesi web sitesinde.","Kocaeli, ilk \xe7a\u011flarda Bitinya ad\u0131 verilen b\xf6lgede yer almaktad\u0131r. Megara ve Atinal\u0131lar k\xf6rfezde bug\xfcn Ba\u015fiskele il\xe7esinin bulundu\u011fu b\xf6lgede M\xd6 712'de Astakus adl\u0131 bir yerle\u015fim kurmu\u015f kent daha sonra Skylax kenti ve k\xf6rfezi Olbia olarak anm\u0131\u015ft\u0131r. Pausanias, Astakus'u Trakyal\u0131 bir soylunun ad\u0131 olarak anarken Yunan mitolojisinde deniz tanr\u0131s\u0131 Poseidon ile su perisi Olbia\u2019n\u0131n o\u011flunun ayn\u0131 ad\u0131 ta\u015f\u0131d\u0131\u011f\u0131 bilinmektedir.[6] Astokus halk\u0131 M\xd6 262 y\u0131l\u0131nda bug\xfcnk\xfc \u0130zmit il\xe7esinin yer ald\u0131\u011f\u0131 b\xf6lgeye yerle\u015fmi\u015ftir. I. Nikomidis taraf\u0131ndan kuruldu\u011fu i\xe7in bu \u015fehre Nicomedia ad\u0131 verilmi\u015ftir. Bitinya Krall\u0131\u011f\u0131 y\u0131k\u0131l\u0131ncaya kadar \xfclkenin ba\u015fkenti olarak kalm\u0131\u015ft\u0131r.\u0130mparator Diocletian, 284 y\u0131l\u0131nda Nicomedia'y\u0131 fethederek buray\u0131 imparatorlu\u011fun ba\u015fkenti yapt\u0131. Ancak \u0130mparator Konstantin d\xf6neminde \u0130stanbul ba\u015fkent yap\u0131ld\u0131 ve \u015fehir eski \xf6nemini yitirdi.[7] 11. y\xfczy\u0131l\u0131n sonlar\u0131nda Kocaeli, Sel\xe7uklu egemenli\u011fine girmi\u015ftir. Ancak Ha\xe7l\u0131 Seferleri s\u0131ras\u0131nda b\xf6lge Aleksios Komnenos taraf\u0131ndan ele ge\xe7irilmi\u015ftir.[7] Kocaeli, Orhan Bey d\xf6neminde bir u\xe7 beyi olan Ak\xe7akoca taraf\u0131ndan fethedilmi\u015ftir. Osmanl\u0131 d\xf6neminde Nikomedya \u015fehri \xf6nce \u0130znikmid daha sonra \u0130zmid (\u0130zmit) ad\u0131n\u0131 alm\u0131\u015ft\u0131r. 19. y\xfczy\u0131lda demiryolunun kente ula\u015fmas\u0131nda sonra Kocaeli'de ticari ve toplumsal ya\u015fam\u0131 canlanm\u0131\u015ft\u0131r. 1888 y\u0131l\u0131nda \u0130zmit, ba\u011f\u0131ms\u0131z sancak yap\u0131lm\u0131\u015ft\u0131r.Kocaeli, \xf6nce \u0130ngilizler taraf\u0131ndan 6 Temmuz 1920'de daha sonra da Yunanlar taraf\u0131ndan 28 Nisan 1921'de i\u015fgal edilmi\u015ftir. Kurtulu\u015f Sava\u015f\u0131 s\u0131ras\u0131nda 28 Haziran 1921'de \u015fehir i\u015fgalden kurtulmu\u015ftur. Kocaeli, cumhuriyet d\xf6neminde sanayile\u015fme sayesinde en h\u0131zl\u0131 geli\u015fen iller aras\u0131na girmi\u015ftir. \u0130stanbul'a yak\u0131nl\u0131\u011f\u0131 ve ula\u015f\u0131m kolayl\u0131\u011f\u0131 b\xf6lgenin sanayile\u015fmesine etki etmi\u015ftir. 1934'te \u0130zmit'te ilk ka\u011f\u0131t fabrikas\u0131 a\xe7\u0131lm\u0131\u015ft\u0131r.Kocaeli, 2 Eyl\xfcl 1993'te \xe7\u0131kar\u0131lan 504 say\u0131l\u0131 kanun h\xfckm\xfcnde karaname[8] ile b\xfcy\xfck\u015fehir unvan\u0131 kazand\u0131. 2004 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 5216 say\u0131l\u0131 kanun ile b\xfcy\xfck\u015fehir belediyesinin s\u0131n\u0131rlar\u0131 il m\xfclki s\u0131n\u0131rlar\u0131 oldu.","Konya, T\xfcrkiye'deki en eski yerle\u015fim birimlerinden biridir. Konya'da yerle\u015fimin Prehistorik (Tarih \xf6ncesi) \xe7a\u011fdan ba\u015flad\u0131\u011f\u0131 g\xf6r\xfclmektedir. Konya'n\u0131n merkezinde yer alan ve ayn\u0131 zamanda bir h\xf6y\xfck olan, Anadolu Sel\xe7uklu sultan\u0131 II. Alaeddin Keykubad'a nispetle Al\xe2eddin Tepesi ad\u0131 verilen suni tepe ve \xe7evresinde yap\u0131lan ara\u015ft\u0131rmalar sonucu, prehistorik \xe7a\u011f i\xe7inde gerek Neolitik (Cilal\u0131 Ta\u015f Devri) ve Kalkolitik ve gerekse Erken Bronz \xc7a\u011f'lar\u0131na ait k\xfclt\xfcrel bulgulara rastlanm\u0131\u015ft\u0131r.Yine prehistorik \xe7a\u011fa ait h\xf6y\xfcklerden, merkeze 15 km mesafede yer alan ve Konya'n\u0131n bug\xfcnk\xfc merkez Harmanc\u0131k mahallesinde yer alan Karah\xf6y\xfck ve Konya Ovas\u0131 \xfczerinde, bulunmu\u015f en eski ve en geli\u015fmi\u015f Neolitik devir yerle\u015fim merkezi olan \xc7atalh\xf6y\xfck bulunmaktad\u0131r.Anadolu ve Suriye topraklar\u0131nda b\xfcy\xfck bir imparatorluk kuran Hititler Konya'ya da hakim olmu\u015flard\u0131r. Hititler'den sonra Friglerin egemenli\u011fine giren Konya (Kavania) daha sonra Lidyal\u0131lar, Persler ve B\xfcy\xfck \u0130skender'in istilalar\u0131na u\u011fram\u0131\u015ft\u0131r. Sonralar\u0131 Anadolu'da Roma hakimiyeti sa\u011flan\u0131nca Konya \u0130conium olarak varl\u0131\u011f\u0131n\u0131 korumu\u015ftur.\xd6nemini Roma ve Bizans d\xf6nemleri boyunca korumu\u015f olan \u015fehir, H\u0131ristiyanl\u0131\u011f\u0131n ilk y\u0131llar\u0131nda dini bir merkez h\xfcviyeti de kazanm\u0131\u015ft\u0131r. Aziz Paul Anadoludaki din\xee seyahatleri s\u0131ras\u0131nda Konya'ya da u\u011fram\u0131\u015ft\u0131r.\u0130slamiyetin do\u011fu\u015fuyla beraber Do\u011fu Roma \u0130mparatorlu\u011fu aleyhine b\xfcy\xfcyen \u0130slam Devleti, \u0130stanbul'u hedef alan harek\xe2tlar\u0131 s\u0131ras\u0131nda Konya \xfczerine de ak\u0131nlar d\xfczenlemi\u015flerdir. Anadolu'da ve Konya \xe7evresinde ilk \u0130slami olu\u015fumlar bu devirde ortaya \xe7\u0131km\u0131\u015ft\u0131r.1071 senesinde Malazgirt Ovas\u0131'nda yap\u0131lan Malazgirt Sava\u015f\u0131'ndan \xf6nce Anadolu \xfczerine ke\u015fif harek\xe2tlar\u0131 d\xfczenleyen T\xfcrkler ve Anadolu'yu tan\u0131yan B\xfcy\xfck Sel\xe7uklular, bu sava\u015f sonucu Anadolu'nun b\xfcy\xfck bir k\u0131sm\u0131 ile beraber Konya'y\u0131 da, ele ge\xe7irmi\u015fler ve b\xf6lgedeki uzun Bizans hakimiyetine son vermi\u015flerdir.S\xfcleyman \u015eah 1076 y\u0131l\u0131nda Konya'y\u0131 Anadolu Sel\xe7uklular\u0131'n\u0131n ba\u015fkenti yapm\u0131\u015f, bilahare ba\u015fkent 1080 y\u0131l\u0131nda \u0130znik'e nakledilmi\u015ftir. \u0130lk ha\xe7l\u0131 seferi s\u0131ras\u0131nda \u0130znik \u015fehri tekrar Bizans'\u0131n eline ge\xe7mi\u015f, sultan I. K\u0131l\u0131\xe7arslan da 1097 tarihinde ba\u015f\u015fehri tekrar Konya'ya ta\u015f\u0131m\u0131\u015ft\u0131r. Bu tarihten 1277 y\u0131l\u0131na kadar Konya aral\u0131ks\u0131z Anadolu Sel\xe7uklu Devleti'nin ba\u015fkenti olmu\u015ftur. I. Alaeddin Keykubad (1220-1237) devrinde \u015fehrin etraf\u0131na muhkem bir sur in\u015fa edilmi\u015ftir ve Konya Anadolu'nun en b\xfcy\xfck \u015fehri olmu\u015ftur.[4] Sel\xe7uklular devrinde \u015fehirde cuma namaz\u0131 k\u0131l\u0131nan yedi b\xfcy\xfck cami vard\u0131. Toplam \u015fehir n\xfcfusu 45.000-50.000 aras\u0131nda tahmin ediliyor.","Kurulu\u015f tarihi kesin olarak tespit edilememekle beraber, tarihi M\xd6 3000 y\u0131llar\u0131na uzanmaktad\u0131r. Eski kaynaklara g\xf6re, K\xfctahya'n\u0131n antik \xe7a\u011flardaki ad\u0131 Kotiaeon, Cotiaeum ve Koti \u015feklinde ge\xe7mektedir. \u0130l topraklar\u0131na yerle\u015fen en eski halk Friglerdir. M\xd6 1200'lerde Anadolu'ya gelen Frigler, Hitit \u0130mparatorlu\u011funun topraklar\u0131na girdiler ve bir devlet olarak \xf6rg\xfctlendiler. M\xd6 676'da Kimmerler, Frigya Kral\u0131 III. Midas'\u0131 bozguna u\u011fratarak K\xfctahya ve \xe7evresine egemen oldular.Alyattes'in Lidya Kral\u0131 oldu\u011fu d\xf6nemde Kimmer egemenli\u011fi yerini Lidya y\xf6netimi ald\u0131. M\xd6 546'da Persler Lidya Ordusunu yenilgiye u\u011fratarak Anadolu'yu istila etti. M\xd6 334'te Biga \xc7ay\u0131 yak\u0131nlar\u0131nda Persleri yenilgiye u\u011fratan \u0130skender y\xf6rede \xfcst\xfcnl\xfck kurdu. B\xfcy\xfck \u0130skender'in M\xd6 323'te \xf6l\xfcm\xfc ile K\xfctahya ve y\xf6resi komutanlar\u0131ndan Antigonos'a ge\xe7ti. M\xd6 133'te Roma y\xf6netimine girdi. Piskoposluk merkezi haline getirildi.1071'de Malazgirt Meydan Muharebesi'nde Alp Arslan'a yenilen Bizans \u0130mparatoru Romanus Diogenes tutsakl\u0131k d\xf6n\xfc\u015f\xfc K\xfctahya'ya getirildi ve g\xf6zleri k\xf6r edildi. 1078'de Anadolu Sel\xe7uklu Devletini kuran Kutalm\u0131\u015fo\u011flu S\xfcleyman \u015eah K\xfctahya'y\u0131 da ele ge\xe7irdi. 1097'de Ha\xe7l\u0131lar\u0131n sald\u0131r\u0131s\u0131na u\u011frad\u0131. II. K\u0131l\u0131\xe7 Arslan kaybedilen topraklarla birlikte K\xfctahya'y\u0131 geri ald\u0131. II. K\u0131l\u0131\xe7 Arslan'dan sonra taht kavgalar\u0131 nedeniyle tekrar Bizans'\u0131n eline ge\xe7en \u015fehir, son olarak I. Al\xe2eddin Keykubad zaman\u0131nda (1233) Sel\xe7uklu topraklar\u0131na dahil oldu.[5][6] 1277'de II. G\u0131yaseddin Keyh\xfcsrev K\xfctahya y\xf6resini Germiyano\u011flu S\xfcleyman \u015eah k\u0131z\u0131 Devlet Hatun'u Osmanl\u0131 Sultan\u0131 I. Murat'\u0131n o\u011flu Y\u0131ld\u0131r\u0131m Bayezid'a verdi. (1381) Germiyano\u011fullar\u0131 Beyli\u011finin topraklar\u0131 Devlet Hatun'un \xe7eyizi olarak Osmanl\u0131lara verildi. (K\xfctahya ve \xe7evresi dahil) 1402 Ankara Sava\u015f\u0131nda, Bayezid'i a\u011f\u0131r bir yenilgiye u\u011fratan Timur, K\xfctahya'y\u0131 alarak II. Yakup Bey'e geri verdi. K\xfctahya daha sonra Osmanl\u0131lara ge\xe7ti ve Sancak Merkezi oldu.","Malatya tarihi ve arkeolojisine \u0131\u015f\u0131k tutan Levent Vadisi kanyonu 65 milyon y\u0131l \xf6ncesine dayanan kaya olu\u015fumlar\u0131 28 km uzunlu\u011funda kaya formasyonlar\u0131ndan olu\u015ftu\u011funu g\xf6rmekteyiz. 2007 y\u0131l\u0131nda b\xf6lgedeki tarih \xf6ncesi kal\u0131nt\u0131lar\u0131 y\xfczeysel ara\u015ft\u0131rma yapan belgesel y\xf6netmeni Tekin G\xfcn, Malatya Paleolitik \xc7a\u011f-(Eski ta\u015f \xe7a\u011f\u0131)'ndan Tun\xe7 \xe7a\u011f\u0131'na kadar yerle\u015fim izlerinin oldu\u011funu san\u0131lmaktad\u0131r.1979 y\u0131l\u0131nda ba\u015flayan Karakaya Baraj G\xf6l\xfc Kurtarma Kaz\u0131lar\u0131 kapsam\u0131ndaki \u0130zollu mevkii Cafer H\xf6y\xfck'te yap\u0131lan kaz\u0131larda, Paleolitik d\xf6nemde ya\u015fayan toplumun ma\u011faralardan \xe7\u0131k\u0131p tar\u0131m ve hayvanc\u0131l\u0131kla u\u011fra\u015ft\u0131klar\u0131 k\xf6y yerle\u015fik d\xfczene ge\xe7tiklerini g\xf6rmekteyiz.Malatya; Do\u011fu Anadolu B\xf6lgesi'nin ve F\u0131rat Nehri'nin en stratejik konumunda yer alan bir yerle\u015fim yeridir. Bu konumu nedeniyle ilk yerle\u015fmeler M\xd6 6000'lere gitmektedir.[11] Ayr\u0131ca b\xf6lge \xf6nemli ticaret yollar\u0131 \xfczerinden oldu\u011fundan dolay\u0131 s\xfcrekli sava\u015f\u0131lm\u0131\u015f bir yerdir. S\xfcrekli iki devlet aras\u0131nda \xe7eki\u015fmelere neden olmu\u015ftur. Bu durum sonras\u0131 \u015fehir her sava\u015f sonras\u0131 ya\u011fmalanm\u0131\u015f, savunma ve istilalardan korunmak i\xe7in \u015fehir merkezi 2 kez de\u011fi\u015fim ge\xe7irmi\u015ftir. Bu gibi nedenlerden dolay\u0131 Malatya'n\u0131n tarihinin ara\u015ft\u0131r\u0131lmas\u0131 \xe7ok zordur.[12]Malatya'n\u0131n s\u0131n\u0131rlar\u0131 i\xe7erisinde bir\xe7ok h\xf6y\xfck bulunmaktad\u0131r.[13] Bunlardan en eski yerle\u015fmenin g\xf6r\xfcld\xfc\u011f\xfc yer ve ayr\u0131ca Malatya'n\u0131n ilk yerle\u015fim alan\u0131 olan Arslantepe H\xf6y\xfc\u011f\xfcd\xfcr. \u0130lk yerle\u015fim alan\u0131 suyun kenar\u0131na kurulmu\u015f bir verimli tar\u0131m alan\u0131d\u0131r. Yakla\u015f\u0131k 6000 y\u0131l kullan\u0131ld\u0131. Yakla\u015f\u0131k olarak 35250 m2'lik bir aland\u0131r. Bug\xfcn ilk yerle\u015fim yeri olan Arslantepe H\xf6y\xfc\u011f\xfc, Orduzu beldesinin Arslantepe mahallesinde bulunmaktad\u0131r.Devam\u0131 Wikipedia'da","Manisa'n\u0131n tarihi Yontma Ta\u015f Devri'ne kadar uzan\u0131r. Antik kaynaklar \u015fehrin kurucular\u0131 olarak bug\xfcnk\xfc Yunanistan\u2019\u0131n Teselya B\xf6lgesi'ndeki Pelion Da\u011f\u0131 civar\u0131nda ya\u015fayan Magnetleri i\u015faret etmektedir. Magnetler, Bat\u0131 Anadolu'ya g\xf6\xe7 ettiklerinde \xf6nce Menderes Nehri k\u0131y\u0131s\u0131ndaki Magnesia\u2019y\u0131, daha kuzeye giden bir kolu da Sipylos Da\u011f\u0131 ete\u011findeki Magnesia\u2019y\u0131 kurmu\u015flard\u0131r. Magnesia \u015fehrini Menderes Magnesia\u2019s\u0131ndan ay\u0131rt etmek i\xe7in Magnesia ad Sipylum ad\u0131n\u0131 kullanm\u0131\u015flard\u0131r.Strabon taraf\u0131ndan Katakekaumene (Yan\u0131k \xdclke), olarak an\u0131lan Kula yak\u0131nlar\u0131nda 1,1 milyon y\u0131l ile 12 bin y\u0131l aras\u0131 s\xfcre\xe7te ger\xe7ekle\u015fen volkanik patlamalar nedeniyle olu\u015fmu\u015f geni\u015f bir arazi vard\u0131r. Yap\u0131lan ara\u015ft\u0131rmalarda b\xf6lgede Yontma Ta\u015f Devri'nden kalma 15 bin ile 25 bin y\u0131l \xf6ncesine ait ayak izleri bulunmu\u015ftur.Manisa s\u0131ras\u0131yla Hititler, Frigler, \u0130yonyal\u0131lar, Lidyal\u0131lar, Persler, Romal\u0131lar, Bizansl\u0131lar, Saruhano\u011fullar\u0131 ve Osmanl\u0131lar\u0131n h\xe2kimiyetinde kalm\u0131\u015ft\u0131r.Hitit d\xf6neminde b\xf6lgenin Arzava ad\u0131yla an\u0131ld\u0131\u011f\u0131 d\xfc\u015f\xfcn\xfclmektedir. D\xf6nemin en \xf6nemli eseri Kybele Kaya An\u0131t\u0131d\u0131r. M\xd6 13. y\xfczy\u0131la ait eser, b\xf6lgeye yap\u0131lan bir Hitit seferi s\u0131ras\u0131nda yap\u0131lm\u0131\u015ft\u0131r.M\xd6 1200'lerde Trakya ve Bo\u011fazlar \xfczerinden Anadolu'ya gelen Frigler, M\xd6 8. y\xfczy\u0131l ortalar\u0131ndan itibaren g\xfcn\xfcm\xfcz Manisa topraklar\u0131n\u0131n b\xfcy\xfck b\xf6l\xfcm\xfcnde k\u0131sa s\xfcreli bir hakimiyet kurdu.Tun\xe7 \xc7a\u011f\u0131'n\u0131n sonlar\u0131ndan ba\u015flayarak M\xd6 6. y\xfczy\u0131la kadar Manisa ve Ayd\u0131n \xe7evresinde h\xfck\xfcm s\xfcren Lidya Krall\u0131\u011f\u0131'n\u0131n ba\u015fkenti, bug\xfcn Salihli il\xe7esi s\u0131n\u0131rlar\u0131nda yer alan Sardes kentidir. Tarihte paray\u0131 ilk kez basan ve kullananlar Lidyal\u0131lar'd\u0131r. Alt\u0131n-g\xfcm\xfc\u015f kar\u0131\u015f\u0131m\u0131 elektrum madeninden bas\u0131lan bu ilk sikkelerin \xfczerinde Lidya Krall\u0131\u011f\u0131'n\u0131n armas\u0131 olan aslan ba\u015f\u0131 bulunuyordu. G\xfcn\xfcm\xfczde Salihli ve Akhisar il\xe7eleri aras\u0131nda kalan Bintepeler b\xf6lgesinde Lidyal\u0131lar'a ait t\xfcm\xfcl\xfcsler ve kral mezarlar\u0131 bulunmu\u015ftur. Antik ticaret yolu olan Kral Yolu da \u0130ran ve Mezopotamya'dan ba\u015flayarak il s\u0131n\u0131rlar\u0131na girer ve Lidya Krall\u0131\u011f\u0131'n\u0131n merkezi Sardes \u015fehrinden ge\xe7erdi. Lidya Krall\u0131\u011f\u0131, M\xd6 546 y\u0131l\u0131nda Ahameni\u015f \u0130mparatorlu\u011fu ile yapt\u0131\u011f\u0131 sava\u015fta yenilmi\u015f ve krall\u0131\u011f\u0131n ba\u015fkenti Sardes ele ge\xe7irilmi\u015ftir. Bu yenilgi sonras\u0131 Lidya Krall\u0131\u011f\u0131 d\xf6nemi sona ermi\u015ftir. Devam\u0131 Wikipedia'da","Tekir Vadisi, D\xf6ngel K\xf6y\xfcndeki ma\u011faralarda yap\u0131lan ara\u015ft\u0131rmalarda ele ge\xe7en buluntular y\xf6rede insan yerle\u015fiminin \xdcst Paleolitik \xc7a\u011fda ba\u015flad\u0131\u011f\u0131n\u0131; Neolitik, Kalkolitik ve Eski Tun\xe7 \xc7a\u011flar\u0131nda da s\xfcrd\xfc\u011f\xfcn\xfc g\xf6stermektedir. 2009 y\u0131l\u0131nda Kahramanmara\u015f merkezde yap\u0131lan kaz\u0131lar esnas\u0131nda da M.S. 300-400 y\u0131llar\u0131na ait olan Germanicia Antik Kenti'ne dair birtak\u0131m mozaikler bulunmu\u015f ve \xfczerlerinde \xe7al\u0131\u015fmalara ba\u015flanm\u0131\u015ft\u0131r.Asur yaz\u0131tlar\u0131nda ad\u0131 Markasi veya Markas olarak ge\xe7en \u015fehir, bir Ge\xe7 Hitit devleti olan Gurgum Krall\u0131\u011f\u0131'n\u0131n ba\u015fkenti oldu.[10][11] M\xd6 711 y\u0131l\u0131nda Asurlular taraf\u0131ndan Gurgum Krall\u0131\u011f\u0131 ilhak edilince, Markas vilayet merkezi yap\u0131ld\u0131.[12] Daha sonra Persler, Romal\u0131lar, Bizansl\u0131lar, Araplar, Sel\xe7uklular, Memluklular, Dulkadiro\u011fullar\u0131 ve Osmanl\u0131lar \u015fehre hakim olmu\u015flard\u0131r.Mara\u015f'a Kurtulu\u015f Sava\u015f\u0131 s\u0131ras\u0131nda halk\u0131n g\xf6sterdi\u011fi direni\u015ften dolay\u0131 7 \u015eubat 1973'ten itibaren TBMM taraf\u0131ndan Kahramanl\u0131k unvan\u0131 verilerek ad\u0131 Kahramanmara\u015f olarak de\u011fi\u015ftirildi.11. y\xfczy\u0131l\u0131n sonlar\u0131nda Anadolu'ya kesin olarak yerle\u015fen T\xfcrklerin egemenli\u011finde kald\u0131. 1243'te Mo\u011fol \u0130\u015fgaline u\u011frayan Mara\u015f,II.Anadolu Beylikleri devrinde Dulkadiro\u011fullar\u0131'n\u0131n oldu.12 Haziran 1515 tarihinde Turnada\u011f Muharebesi ile Osmanl\u0131 egemenli\u011fine ge\xe7en Mara\u015f, 1515-1919 y\u0131llar\u0131 aras\u0131nda Osmanl\u0131 egemenli\u011finde kald\u0131.M\xfctareke D\xf6neminde \xf6nce \u0130ngilizler, sonra Frans\u0131zlar taraf\u0131ndan i\u015fgal edildi.","Mardin ilinde tarihin \xe7ok eski d\xf6nemine uzanan d\xf6nemlere ait bulgular yer almaktad\u0131r. Artuklu \xdcniversitesi yerle\u015fkesi i\xe7indeki H\u0131rbe Helale yerle\u015fim yerinde yap\u0131lan kaz\u0131larda ortaya \xe7\u0131kar\u0131lan ta\u015flar, Paleolitik \xc7a\u011f'a tarihlenmi\u015ftir.[4] Darge\xe7it \u0130l\xe7esi Il\u0131su civar\u0131nda yer alan Boncuklu Tarla yerle\u015fiminde Cilal\u0131 Ta\u015f Devrine ait buluntulara rastlan\u0131lm\u0131\u015ft\u0131r. Gene Derik il\xe7esindeki Kerk\xfc\u015fti H\xf6y\xfck\u2019te yap\u0131lan kaz\u0131lar sonucu Kalkolitik \xc7a\u011f d\xf6nemine ait kal\u0131nt\u0131lar bulunmu\u015ftur. Kemaliye h\xf6y\xfck ve Tilki tepe H\xf6y\xfcklerinde de Kalkolitik \xc7a\u011f d\xf6nemi seramiklere rastlanm\u0131\u015ft\u0131r. Nusaybin il\xe7esindeki Girnavaz H\xf6y\xfck'te Erken Tun\xe7 \xc7a\u011f\u0131'na tarihlenen kal\u0131nt\u0131lara rastlanm\u0131\u015ft\u0131r. Bunun yan\u0131 s\u0131ra ildeki 36 h\xf6y\xfckte Tun\xe7 \xc7a\u011f\u0131' n\u0131n \xe7e\u015fitli d\xf6nemlerine tarihlenen buluntulara rastlan\u0131lm\u0131\u015ft\u0131r. Mardin-Nusaybin yolu \xfczerindeki G\u0131rharrin H\xf6y\xfck, Mardin Da\u011flar\u0131n\u0131n g\xfcneyindeki Girnavaz ve Yukar\u0131 Dicle havzas\u0131ndaki Giricano, Kavusan H\xf6y\xfck, Siirt T\xfcrbe H\xf6y\xfck, \xdc\xe7tepe, Ziyarettepe ve Gre Dimse h\xf6y\xfcklerinde de bu \xe7a\u011fa ait bulgular g\xf6r\xfclmektedir.Girnavaz h\xf6y\xfck, Darge\xe7it il\xe7esindeki Zeviya Tivilki h\xf6y\xfck ve K\u0131z\u0131ltepe-Viran\u015fehir yolu \xfczerindeki Kerk\xfc\u015fti h\xf6y\xfck kaz\u0131lar\u0131nda Demir \xc7a\u011f\u0131'na tarihlenen kal\u0131nt\u0131lar\u0131 bulunmu\u015ftur. Nisibis, Midyat, Savur, \u0130zb\u0131rak-Zaz, Baskavak-Ahmedi ve Derei\xe7i (Killit)'de bulunan eski d\xf6nem yerle\u015fimlere tarihi kaynaklarda bahsedilmi\u015ftir. M.\xd6 2000 y\u0131l\u0131 dolaylar\u0131nda Asur egemenli\u011finde olan Mardin ve \xe7evresi daha sonra Hitit ve Urartu egemenli\u011fine ge\xe7mi\u015ftir.Mardin ad\u0131 ilk defa 4. y\xfczy\u0131l Roma tarih\xe7ilerinden Ammianus Marcellinus taraf\u0131ndan bahsedilmi\u015ftir. I. Justinianus d\xf6nemi tarih\xe7isi Prokopius, \u015fehirden Margdis ad\u0131yla ikinci derece \xf6nemde bir kale olarak bahsetmi\u015ftir. Kale, 640 y\u0131l\u0131nda \u0130y\xe2z bin Ganm komutas\u0131ndaki \u0130slam ordular\u0131nca ele ge\xe7irildi. Bu d\xf6nemde b\xf6lgeye yo\u011fun bir Arap n\xfcfusu yerle\u015fimi ba\u015flad\u0131. Emev\xee ve Abb\xe2s\xee d\xf6neminde El Cezire valili\u011finin topraklar\u0131 i\xe7erisinde yer ald\u0131. 750-751 y\u0131llar\u0131nda Mardin\u2019e h\xe2kim olan Hariciler\u2019in Har\xfbriyye koluna mensup Ben\xee Reb\xeea kabilesi reisi B\xfcreyke'nin isyan\u0131na sahne oldu. Mardin kalesi, Hamdani hanedanl\u0131\u011f\u0131n\u0131n kurucusu Hamd\xe2n bin Hamd\xfbn taraf\u0131ndan 885 y\u0131l\u0131nda ele ge\xe7irildi. Abbasi Halifesi Mutezid taraf\u0131ndan 894 y\u0131l\u0131nda geri al\u0131nd\u0131. Daha sonra yeniden Hamdani egemenli\u011fine giren b\xf6lge, 10. y\xfczy\u0131l\u0131n sonundan 11. y\xfczy\u0131l sonlar\u0131na kadar Mervaniler ile Ukayliler aras\u0131nda s\u0131kl\u0131kla el de\u011fi\u015ftirdi.1085 y\u0131l\u0131nda Mardin'in de oldu\u011fu b\xf6lge Sel\xe7uklu egemenli\u011fine ge\xe7ti. Bu tarihten itibaren b\xf6lge yo\u011fun bir T\xfcrkmen iskan\u0131na sahne oldu. 1103 y\u0131l\u0131nda Artuklu Beyli\u011fi hakimiyetine giren Mardin, daha sonra \u0130lgazi Bey liderli\u011finde kurulan ve yakla\u015f\u0131k \xfc\xe7 y\xfczy\u0131l kadar h\xfck\xfcm s\xfcren Mardin Artuklular\u0131'n\u0131n hakimiyetine ge\xe7ti. Bu d\xf6nemde olduk\xe7a geli\u015fen \u015fehir en parlak d\xf6nemlerini ya\u015fad\u0131. 1183 y\u0131l\u0131nda Selahaddin Eyyubi \u015fehre ilerlediyse de buray\u0131 ele ge\xe7iremedi. Ancak 1185'te Mardin Artuklu Beyli\u011fi, Eyyubi h\xe2kimiyetini tan\u0131d\u0131. 1198 y\u0131l\u0131nda I. Adil \u015fehri ya\u011fmalasa da kaleyi ele ge\xe7iremedi. 1203 y\u0131l\u0131ndaki Eyyubi sald\u0131r\u0131lar\u0131na da kar\u015f\u0131 konulabildi. Daha sonra yap\u0131lan antla\u015fma uyar\u0131nca Mardin Artuklular\u0131 Eyyubiler'e tabi oldu. Mardin Artuklular'\u0131, I. Al\xe2eddin Keykubad zaman\u0131nda Anadolu Sel\xe7uklular\u0131'na t\xe2bi oldu.1260 y\u0131l\u0131nda \u0130lhanl\u0131 h\xfck\xfcmdar\u0131 H\xfclag\xfb Han'\u0131n o\u011flu Ya\u015fmut taraf\u0131ndan sekiz ay ku\u015fat\u0131lan Mardin, Mardin h\xe2kimi Necmeddin Gazi Sa\xeed'in o\u011flu taraf\u0131ndan \xf6ld\xfcr\xfclmesiyle \u0130lhanl\u0131lara teslim oldu. Mardin kalesi, 1366 ve 1383 y\u0131llar\u0131ndaki Karakoyunlu sald\u0131r\u0131lar\u0131na dayand\u0131. 1394 ve 1401 y\u0131llar\u0131nda \u015fehir Timur'un kuvvetlerince tahrip edildi. 1409 y\u0131l\u0131nda Mardin Artuklular\u0131'n\u0131n y\u0131k\u0131lmas\u0131yla Mardin, Karakoyunlular'\u0131n kontrol\xfcne ge\xe7ti. 1432 y\u0131l\u0131nda Mardin kalesi Akkoyunlular'a teslim oldu. 1451 y\u0131l\u0131nda Karakoyunlular kaleyi ku\u015fatsa da, \u015fehri tahrip ederek geri \xe7ekildiler. 1507 y\u0131l\u0131nda \u015eah \u0130smail taraf\u0131ndan Mardin \u015fehri ve kalesi ele ge\xe7irildi. 1515 y\u0131l\u0131nda \u015fehir Osmanl\u0131 kuvvetlerine teslim olsa da kale ele ge\xe7irilemedi. 1516 y\u0131l\u0131nda yeniden ku\u015fat\u0131lan kale, 1517 y\u0131l\u0131nda Osmanl\u0131 kuvvetlerince ele ge\xe7irildi.Osmanl\u0131 d\xf6neminde nispeten sakin bir d\xf6nem ge\xe7iren Mardin, 19. y\xfczy\u0131ldan itibaren kar\u0131\u015f\u0131kl\u0131klara sahne oldu. Osmanl\u0131 ile M\u0131s\u0131r Hidivli\u011fi aras\u0131ndaki m\xfccadele d\xf6neminde Mardin bir s\xfcre Milli a\u015firetine ba\u011fl\u0131 isyanc\u0131lar\u0131n denetiminde kald\u0131. 1847 ve 1865 y\u0131llar\u0131nda ya\u015fanan kolera salg\u0131nlar\u0131nda \u015fehirde \xe7ok\xe7a \xf6l\xfcmlere yol a\xe7t\u0131. 1891 y\u0131l\u0131nda kapal\u0131 \xe7ar\u015f\u0131s\u0131 yand\u0131. 1895 y\u0131l\u0131nda isyanc\u0131lar\u0131n sald\u0131r\u0131s\u0131na u\u011frasa da bu durum k\u0131sa s\xfcrede bast\u0131r\u0131ld\u0131. Mondros M\xfctarekesi'nden sonra \u0130tilaf Devletleri'nin askeri yerle\u015fimi olmad\u0131.","Antik Karya b\xf6lgesinin en eski yerle\u015fimlerinden biri olan Mu\u011fla, bilinen tarihi boyunca ba\u015flang\u0131\xe7ta Anadolu'nun yerli halk\u0131 Karyal\u0131lar\u0131n, ard\u0131ndan k\u0131smen ve k\u0131sa d\xf6nemler halinde M\u0131s\u0131r, Asur ve \u0130skit i\u015fgallerinin, zamanla da \xf6zellikle k\u0131y\u0131larda Helenistik kolonizasyon hareketinin egemenli\u011fi alt\u0131nda kalm\u0131\u015ft\u0131r. \xd6nce Medler, daha sonra Persler Mu\u011fla'y\u0131 idareleri alt\u0131nda alm\u0131\u015flar ve b\xf6lgeyi bir satrap arac\u0131l\u0131\u011f\u0131yla y\xf6netmi\u015flerdir. B\xfcy\xfck \u0130skender'in ordular\u0131yla geli\u015finde Mu\u011fla b\xf6lgesi bir Karya satrap\u0131 taraf\u0131ndan y\xf6netilmekte idi.'Karya' isminin b\xf6lgeye M\xd6 3400 y\u0131llar\u0131nda gelen kavimlere \xf6nderlik etmi\u015f 'Kar' isimli bir komutandan kaynakland\u0131\u011f\u0131na ili\u015fkin tezler \xf6ne s\xfcr\xfclmektedir. B\xf6lge \xe7a\u011flar boyunca Karya olarak an\u0131lm\u0131\u015f ve kuzeyde S\xf6ke, Ayd\u0131n, Nazilli \xfczerinden ba\u015flay\u0131p g\xfcneyde Dalaman \xc7ay\u0131n\u0131n denize d\xf6k\xfcld\xfc\u011f\xfc yerde biten Karya b\xf6lgesi, kuzeyinde Lidyal\u0131lar\u0131n, g\xfcneyinde Likyal\u0131lar\u0131n ve Anadolu i\xe7lerinde de Frigyal\u0131lar\u0131n h\xfck\xfcm s\xfcrd\xfc\u011f\xfc b\xf6lgelere kom\u015fu olmu\u015ftur.Kavimleri Karya b\xf6lgesine k\u0131y\u0131lardan ba\u015flayan \xe7ok uzun bir s\xfcre\xe7te n\xfcfuz etmi\u015flerdir. Knidos (Dat\xe7a yar\u0131madas\u0131n\u0131n ucu) ve Halikarnas (Bodrum) ile ba\u015flayan Helen kolonizasyonu ile zamanla Daldala (Dalaman), Stratonikea (Yata\u011fan Eskihisar), Nakrasa (Karakuyu), Akassos (Boz\xfcy\xfck) ve Fethiye \xe7evresinde de Telmessos, Xantos (K\u0131n\u0131k), Patara (Minare) ve Tlos (E\u015fen) kentleri kurulmu\u015ftur.M\xd6 334 y\u0131l\u0131nda Karya'ya gelen B\xfcy\xfck \u0130skender, Perslerin \xe7ekilmesiyle ortaya \xe7\u0131km\u0131\u015f karde\u015fleraras\u0131 bir saltanat kavgas\u0131yla kar\u015f\u0131la\u015ft\u0131. Karde\u015flerden Ada, kocas\u0131 Hidrieus ve a\u011fabeyi ile Mausolus, kar\u0131s\u0131 Artemisia ve k\u0131z karde\u015fi, di\u011fer karde\u015f olan Piksodaros'un isyan\u0131 ile kar\u015f\u0131 kar\u015f\u0131yayd\u0131lar ve bu nedenle kuzeye Alinda'ya (Karpuzlu) \xe7ekilmi\u015flerdi. Ada Alinda'n\u0131n anahtarlar\u0131n\u0131 B\xfcy\xfck \u0130skender'e g\xf6ndererek kendisini annesi olarak kabul etmesini istedi. \u0130skender de bu iste\u011fi kabul ederek Ada'y\u0131 Karya satrapl\u0131\u011f\u0131na getirdi. Ancak ertesi y\u0131l \u0130skender'in Likya'ya ge\xe7mesiyle Piksodaros ablas\u0131 satrap Ada'y\u0131 \xf6ld\xfcrerek yerine ge\xe7ti. \u0130skender'in haznedar\u0131 Filotas'\u0131 satrapl\u0131\u011fa atamas\u0131 da asayi\u015fi sa\u011flamad\u0131 ve \u0130skender'in uzakla\u015fmas\u0131yla b\xf6lge Bergama ve Roma egemenli\u011fine kadar (yakla\u015f\u0131k iki y\xfczy\u0131l) s\xfcrecek bir anar\u015fi d\xf6neminin i\xe7ine d\xfc\u015ft\xfc. 395'te Roma \u0130mparatorlu\u011fu'nun ikiye ayr\u0131lmas\u0131yla da Karya Bizans \u0130mparatorlu\u011fu i\xe7inde kald\u0131.Mu\u011fla ili tarih\xee kal\u0131nt\u0131lar a\xe7\u0131s\u0131ndan son derece zengin olup, s\u0131n\u0131rlar\u0131 i\xe7inde 103 \xf6ren yeri bulunmaktad\u0131r. Devam\u0131 Wikipedia'da","Asur kaynaklar\u0131na g\xf6re Mu\u015f y\xf6resi M\xd6 13. y\xfczy\u0131lda Urartulara ba\u011fl\u0131 Nairi \xfclkesinin s\u0131n\u0131rlar\u0131 i\xe7erisindeydi. Daha sonraki kaynaklarda Taron ad\u0131yla ge\xe7en y\xf6re s\u0131ras\u0131yla \u0130skit, Med, Pers, Makedon, Selevkos, Roma, Part, Arsakes ve Bizans y\xf6netiminde kald\u0131. Birka\xe7 kez Romal\u0131lar ile Partlar ve Bizansl\u0131lar ile Sasaniler aras\u0131nda el de\u011fi\u015ftirdi. Daha sonra Emevilerin ve Abbasilerin egemenli\u011fine girdi. Daha sonra g\xf6\xe7ebe T\xfcrkmen topluluklar y\xf6reye yerle\u015fmeye ba\u015flad\u0131.[3] T\xfcrkmenler geldi\u011finde y\xf6rede Ermeniler vard\u0131.Malazgirt Meydan Muharebesi'nden sonra Sel\xe7uklu topra\u011f\u0131 haline gelen Mu\u015f kenti, S\xf6kmeno\u011fullar\u0131 (Ahlat\u015fahlar) daha sonra da Eyyubiler egemenli\u011fine girdi. \u015eehir 13. y\xfczy\u0131lda Anadolu Sel\xe7uklular\u0131 taraf\u0131ndan imar edildi. K\u0131sa s\xfcre sonra Mo\u011follar (\u0130lhanl\u0131lar) taraf\u0131ndan ya\u011fmalanan \u015fehir daha sonra da Timurlularca ya\u011fmaland\u0131. Karakoyunlu ve Akkoyunlu egemenli\u011finin ard\u0131ndan k\u0131sa s\xfcre Safevilere ba\u011flanan kent, Safevilerin kar\u015f\u0131s\u0131nda yer alan \u015eerefhanlar\u0131n etkisiyle 1514'te Osmanl\u0131 egemenli\u011fine girdi. 19. y\xfczy\u0131l sonlar\u0131nda Bitlis vilayetine ba\u011fland\u0131. Osmanl\u0131 d\xf6neminde n\xfcfusun nispi \xe7o\u011funlu\u011funu Ermeniler olu\u015fturuyordu.1916-1917 y\u0131l\u0131nda Ruslar\u0131n ve Ermenilerin n\xfcfuz b\xf6lgesi olan \u015fehir, Ermeni tehcirine sahne oldu. Kurtulu\u015f Sava\u015f\u0131 s\u0131ras\u0131nda 1920 y\u0131l\u0131nda y\xf6rede Hallo Ayaklanmas\u0131 ya\u015fand\u0131. Bu olaylardan sonra 1924 y\u0131l\u0131nda \u015fehir, il merkezi yap\u0131ld\u0131. Daha sonra \u015eeyh Said Ayaklanmas\u0131 ya\u015fanan y\xf6rede, k\u0131sa s\xfcreli\u011fine tekrar Bitlis'e ba\u011flanan \u015fehir, 1929'da tekrar il merkezi oldu.Daha \xf6nceleri Mu\u015f il merkezine ba\u011fl\u0131 bir k\xf6y olan Ye\u015filce, 2010 y\u0131l\u0131 sonunda mahalleye d\xf6n\xfc\u015ft\xfc.","Kent, Orta \xc7a\u011f ve Yeni \xc7a\u011f'da, Seandos; Nissa ve Mu\u015fkara ad\u0131yla an\u0131l\u0131yordu. Anadolu, B\xfcy\xfck Sel\xe7uklu Devleti'nin elindeyken eski ad\u0131 Nissa'n\u0131n yerinde Mu\u015fkara ad\u0131nda bir k\xf6y vard\u0131. Mu\u015fkara sa\u011flam yap\u0131l\u0131 anlam\u0131ndad\u0131r. 18 evlik k\xfc\xe7\xfck bir k\xf6y olan Mu\u015fkara, \xdcrg\xfcp'e ba\u011fl\u0131yd\u0131.Tarih\xe7i Charles Texier'e g\xf6re; 12. y\xfczy\u0131l sonlar\u0131na do\u011fru, yani Sel\xe7uklular zaman\u0131nda, Nissa \u015fehri halk\u0131 yava\u015f yava\u015f \u015fehirden ayr\u0131larak, ba\u015fka bir yere g\xf6\xe7 etmi\u015flerdir. \xc7evre ile ilgili bilgi veren tarih\xe7iler, bu yeni g\xf6\xe7 yerinin Mu\u015fkara oldu\u011funu yazarlar.Osmanl\u0131lar d\xf6neminde ise Mu\u015fkara yerine Nev\u015fehir kullan\u0131lmaya ba\u015fland\u0131. IV. Mehmet'in o\u011flu \u015eehzade III. Ahmet'in s\u0131r katibi, Mu\u015fkaral\u0131 \u0130brahim, Nev\u015fehirli Damat \u0130brahim Pa\u015fa olarak sadrazaml\u0131\u011fa getirildi\u011finde do\u011fdu\u011fu kent olan Mu\u015fkara'da b\xfcy\xfck bay\u0131nd\u0131rl\u0131k hareketine giri\u015fti. \u0130maretler, camiler, medreseler, hamam ve \xe7e\u015fmeler yapt\u0131rd\u0131. Mu\u015fkara ad\u0131n\u0131 de\u011fi\u015ftirerek, kente Yeni\u015fehir anlam\u0131na gelen Nev\u015fehir ad\u0131n\u0131 verdi.","Ni\u011fde \u0130li'nin en eski ad\u0131n\u0131n Nahita ya da Nakita oldu\u011fu \xf6ne s\xfcr\xfclmektedir. Bu ada ilk kez \u0130bn Bibi'de rastlanm\u0131\u015ft\u0131r.Eski CHP Ni\u011fde Milletvekili Dr. Avram Galanti ise Ni\u011fde kitab\u0131nda:\u201cNi\u011fde\u2019nin en eski ismi Anahita\u2019d\u0131r. Anahita, bir ilahenin ismidir ki, kameri ve bereketi temsil eder.\u201d demektedir.Nakida ad\u0131 kimi zaman Nekide olarak da kullan\u0131lm\u0131\u015f, 14. y\xfczy\u0131lda ayn\u0131 s\xf6zc\xfck Arap harfleriyle N\xeekde okunacak bi\xe7imde yaz\u0131lm\u0131\u015ft\u0131r. Cumhuriyet'ten sonra bu ad, Ni\u011fde'ye d\xf6n\xfc\u015ft\xfcr\xfclm\xfc\u015ft\xfcr.Yakla\u015f\u0131k 10.000 y\u0131ll\u0131k bir t\xe2rih\xee ge\xe7mi\u015fe sahip olan Ni\u011fde\u2019de yap\u0131lan arkeolojik ara\u015ft\u0131rmalar, Paleolitik \xc7a\u011f\u2019a de\u011fin uzanan buluntular vermi\u015ftir.[5] Yaz\u0131l\u0131 tarih d\xf6neminde ise Ni\u011fde\u2019de s\u0131ras\u0131yla: Asur Ticaret Kolonileri, Hititler, Tabal Ge\xe7 Hitit Devleti, Frigyal\u0131lar, Persler, Makedonya Krall\u0131\u011f\u0131, Kapadokya Krall\u0131\u011f\u0131, Romal\u0131lar, Bizans \u0130mparatorlu\u011fu, Anadolu Sel\xe7uklu Devleti, Eretna Beyli\u011fi, Karamano\u011fullar\u0131 Beyli\u011fi ve Osmanl\u0131 Devleti h\xfck\xfcm s\xfcrm\xfc\u015ft\xfcr. Ni\u011fde, Osmanl\u0131 h\xe2kimiyetine 1470 y\u0131l\u0131nda girmi\u015ftir.","Ordu ili M\xd6 400 y\u0131l\u0131ndan \xf6nce \u015fehir merkezinin 5 kilometre d\u0131\u015f\u0131nda olan halk aras\u0131nda Bozukkale olarak bilinen b\xf6lgede 'Kotyora' ad\u0131yla kurulmu\u015ftur. Kotyora, Kut Y\xf6resi anlam\u0131na gelmektedir.Ordulu yazar Mithat Ba\u015f'\u0131n ara\u015ft\u0131rma ve kaynaklar\u0131na g\xf6re; Ordu, Osmanl\u0131 ar\u015fivlerindeki belgelere g\xf6re T\xfcrkler taraf\u0131ndan kurulmu\u015f bir yerle\u015fkedir. \u0130lk \xe7a\u011f ve Orta \xe7a\u011fda bug\xfcnk\xfc Ordu\u2019nun kuruldu\u011fu yerde ayn\u0131 adla an\u0131lan antik bir kal\u0131nt\u0131 yoktur. G\xfcn\xfcm\xfczde Ordu yak\u0131nlar\u0131nda Bozukkale olarak adland\u0131r\u0131lan antik \u201cKotyora\u201dn\u0131n Ordu ile hi\xe7bir tarihi ba\u011flant\u0131s\u0131 bulunmamaktad\u0131r. Ordu ad\u0131, 1396 y\u0131l\u0131nda Hac\u0131 Emiro\u011flu S\xfcleyman Bey taraf\u0131ndan Giresun'u fethetmek i\xe7in toplanan 12 bin ki\u015filik kuvvetin, g\xfcn\xfcm\xfczdeki Eskipazar mevkiinde toplanmas\u0131 sonucu verilmi\u015ftir.Karadenizli Yazar \xd6zhan \xd6zt\xfcrk'e g\xf6re ise Kotyora ad\u0131 b\xf6lgenin eski sakinleri olan Kolhislilerden (Tzan/Lazlardan) mirast\u0131r. Kotyora kelime anlam\u0131 itibar\u0131yla Koto (Eski Lazca: \xc7anak, \xe7\xf6mlek) + uri (Lazcada aidiyet belirtir) Kotoyuri, \xe7\xf6mlek\xe7i; \xe7anak, \xe7\xf6mlek yap\u0131lan yer anlam\u0131na gelir.[5] B\xf6lgenin eski sakinleri olan Tzan/Can/Zan (Lazlar\u0131n) Antik ve Orta \xc7a\u011f kaynaklar\u0131yla sabit varl\u0131\u011f\u0131 ve b\xf6lgeye Canik (Tzanika/Zanik: Tzan/Can/Zan: Lazlar\u0131n eski ulusal isimleri + ika b\xf6lge, \xfclke, toprak = Tzan/Laz B\xf6lgesi) ismini ve ba\u015fka pek \xe7ok toponim b\u0131rakmalar\u0131 \u015fehre de Kotyora ismini verdiklerini destekler niteliktedir.Ayr\u0131ca 1831'de ise Fatsa s\u0131n\u0131rlar\u0131ndan itibaren Ordu, Ulubey, G\xf6lk\xf6y y\xf6releri tamamen Mesudiye ve Aybast\u0131 il\xe7eleri Erzurum eyaletine ba\u011fl\u0131 \u015earkikarahisar livas\u0131na, Fatsa'n\u0131n i\xe7 ve bat\u0131 k\u0131s\u0131mlar\u0131yla \xdcnye, Canik (Samsun) livas\u0131na ba\u011flanm\u0131\u015ft\u0131r.2012 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 6360 say\u0131l\u0131 kanun[7] ve akabinde 2013 y\u0131l\u0131nda \xe7\u0131kar\u0131lan 6447[8] say\u0131l\u0131 kanun ile Ordu'da s\u0131n\u0131rlar\u0131 il m\xfclki s\u0131n\u0131rlar\u0131 olan b\xfcy\xfck\u015fehir belediyesi kuruldu ve 2014 T\xfcrkiye yerel se\xe7imlerinin ard\u0131ndan b\xfcy\xfck\u015fehir belediyesi \xe7al\u0131\u015fmalar\u0131na ba\u015flad\u0131.","Eski d\xf6nemlerde burada Kolhisliler ya\u015famaktayd\u0131.Rize, 1204'te Trabzon \u0130mparatorlu\u011fu'na ba\u011flanm\u0131\u015ft\u0131r. 1470'te Fatih Sultan Mehmet taraf\u0131ndan fethedilmi\u015ftir.Spesifik olarak Rize'den bahseden kaynaklara 19. y\xfczy\u0131lda rastlanmaktad\u0131r. 18 ve daha sonraki y\xfczy\u0131llarda yaz\u0131lm\u0131\u015f kaynaklarda Rize'de derebeylik yapm\u0131\u015f Tuzcuo\u011fullar\u0131 ailesinden bahsetmektedir. II. Mahmud'a birka\xe7 kez isyan eden bu aile, 1832'de Tuzcuo\u011flu \u0130syan\u0131'n\u0131 ba\u015flatm\u0131\u015ft\u0131r. Tuzcuo\u011fullar\u0131'na vergi veremeyen k\xf6yl\xfcler, topraklar\u0131n\u0131 Tuzcuo\u011fullar\u0131'na devretmek ve onlar i\xe7in \xe7al\u0131\u015fmak zorundayd\u0131. Rize'deki bir saray bu aileye aftedilmektedir. Tuzcuo\u011fullar\u0131 ile rekabet halinde olan Trabzonlu Memi\u015fo\u011fullar\u0131, Memi\u015fo\u011flu ayaklanmas\u0131n\u0131 ba\u015flatm\u0131\u015ft\u0131r. \u0130ki aile aras\u0131ndaki kan davas\u0131nda bir\xe7ok \xfcye \xf6ld\xfckten sonra Tuzcuo\u011fullar\u0131'n\u0131n ba\u015fl\u0131ca aile \xfcyeleri teslim olmu\u015f ve Rus\xe7uk-Varna gibi \u015fehirlere s\xfcr\xfclm\xfc\u015ft\xfcr.Gezgin P. Minas Biji\u015fkyan, b\xf6lgede portakal ve limon yeti\u015ftirildi\u011fini yazm\u0131\u015ft\u0131r.Rize 19. y\xfczy\u0131l\u0131n ikinci yar\u0131s\u0131nda Batum'un Ruslara b\u0131rak\u0131lmas\u0131n\u0131n ard\u0131ndan, Trabzon Vilayetine ba\u011fl\u0131 Lazistan Sanca\u011f\u0131n\u0131n merkezi olmu\u015f, Cumhuriyet d\xf6neminde il merkezi olmu\u015ftur. I. D\xfcnya Sava\u015f\u0131'nda yakla\u015f\u0131k iki y\u0131l s\xfcren Rus i\u015fgalinin ard\u0131ndan \xf6zellikle \xe7ay ekiminin yayg\u0131nla\u015fmas\u0131 ile \xf6nemli bir geli\u015fme g\xf6stermi\u015ftir.","Anadolu birli\u011fini ilk kuran Hititlerle Sakarya'n\u0131n da tarihi ba\u015flar. \u0130\xe7 kar\u0131\u015f\u0131kl\u0131klar sonucunda b\xf6l\xfcnen Hititlerden sonra b\xf6lgede Frigler hakim olmu\u015ftur. Frigya hakimiyeti sona erdi\u011finde b\xf6lge Lidyal\u0131lar\u0131n eline ge\xe7mi\u015ftir. M\xd6 6. y\xfczy\u0131lda Pers \u0130mparatorlu\u011fu Lidya Krall\u0131\u011f\u0131'n\u0131 y\u0131karak Anadolu'ya hakim olmu\u015ftur. Makedonya Kral\u0131 B\xfcy\xfck \u0130skender M\xd6 4. y\xfczy\u0131lda Persleri yenerek Anadolu'ya hakim oldu. B\xfcy\xfck \u0130skender'in \xf6l\xfcm\xfcnden sonra Bitinya Kral\u0131\u011f\u0131 ba\u011f\u0131ms\u0131zl\u0131\u011f\u0131n\u0131 ilan ederek Sakarya'n\u0131n da bulundu\u011fu b\xf6lgede hakimiyetini ilan etti. M\xd6 1. y\xfczy\u0131lda Roma \u0130mparatorlu\u011fu Bitinya Krall\u0131\u011f\u0131'na son vererek b\xf6lgeyi topraklar\u0131na katt\u0131.Roma \u0130mparatorlu\u011fu ikiye b\xf6l\xfcnd\xfc\u011f\xfcnde (MS 365), Bitinya b\xf6lgesi Bizans \u0130mparatorlu\u011fu'na kald\u0131. \u0130stanbul'u ele ge\xe7irmek gayesiyle gelen \u0130slam ordular\u0131 b\xf6lgeyi fethetmi\u015flerdir. Bu hakimiyetler kal\u0131c\u0131 olmam\u0131\u015ft\u0131r. B\xf6lgeye zaman zaman Sasaniler de ak\u0131nlar d\xfczenlemi\u015ftir.Malazgirt Meydan Muharebesi'nden sonra Kutalm\u0131\u015fo\u011flu S\xfcleyman \u015eah Sakarya dahil t\xfcm Anadolu'yu kontrol alt\u0131na ald\u0131. \u0130znik'in ba\u015fkent oldu\u011fu T\xfcrkiye Sel\xe7uklu Devleti kuruldu. Birinci Ha\xe7l\u0131 Seferinde \u0130znik'i terk ederek ba\u015fkenti Konya'ya ta\u015f\u0131d\u0131. Sakarya ahalisi yeniden Bizans'\u0131n kontrol\xfcne girdi.Yap\u0131lan kaz\u0131lar ve bulgular\u0131n tarihi bilgileri sayesinde; b\xf6lgede M\xd6 300 ile 395 y\u0131llar\u0131 aras\u0131nda ba\u015fkenti Nikomedia (\u0130zmit) olan Romal\u0131lar\u0131n Bitinya eyaleti bulunmaktayd\u0131.[6] Kand\u0131ra, Kaynarca, Hendek, Karap\xfcr\xe7ek ve Tarakl\u0131\u2019da rastlanan baz\u0131 bulgularca da b\xf6lgenin milad\u0131n hemen \xf6ncesi ve sonras\u0131nda Bitinyal\u0131lar\u0131n egemenli\u011finde ya\u015fad\u0131\u011f\u0131 kesinle\u015fmektedir. B\xf6lgede in\u015fa edilen Seyifler, Harmantepe, Tersiye, Pa\u015falar, \xc7obankale, Mekece kaleleriyle, I. Justinianus\u2019un 562 y\u0131l\u0131nda Sakarya Nehri\u2019nin \xfczerine yapt\u0131rd\u0131\u011f\u0131 Be\u015fk\xf6pr\xfc \xf6nemli tarihi kal\u0131nt\u0131lard\u0131r. Devam\u0131 Wikipedia'da","Samsun'daki yerle\u015fim ge\xe7mi\u015fi Eski Ta\u015f \xc7a\u011f\u0131'na dek uzanmaktad\u0131r. Tekkek\xf6y Ma\u011faralar\u0131nda ke\u015ffedilen ve M\xd6 60.000 y\u0131l\u0131na dek uzand\u0131\u011f\u0131 d\xfc\u015f\xfcn\xfclen katman, \u015fimdiye dek Karadeniz B\xf6lgesi'nde ke\u015ffedilen en eski yerle\u015fimdir.[34][35][36] Ayn\u0131 zamanda T\xfcrkiye'deki en eski \xfc\xe7\xfcnc\xfc, d\xfcnyada ise sekizinci yerle\u015fim oldu\u011fu tahmin edilmektedir.[37] Ma\u011fara yerle\u015fiminde ya\u015fayan bu insanlar topluluk bilinci geli\u015fmemi\u015f ve hen\xfcz \xfcretici pozisyonuna ge\xe7memi\u015flerdi.Karanl\u0131k \xe7a\u011flar\u0131n ard\u0131ndan, M\xd6 5000-3000 y\u0131llar\u0131ndan itibaren Anadolu'da var olduklar\u0131 bilinen ve Hattilerin bir kolu oldu\u011fu d\xfc\u015f\xfcn\xfclen Ka\u015fkalar, M\xd6 3500'l\xfc y\u0131llarda Mert Irma\u011f\u0131 kenar\u0131nda, g\xfcn\xfcm\xfczde D\xfcndartepe H\xf6y\xfc\u011f\xfc'n\xfcn bulundu\u011fu yerde bir site olu\u015fturmu\u015flard\u0131r.[39][40][14][41] H\xf6y\xfc\u011f\xfcn kaz\u0131lar\u0131 s\u0131ras\u0131nda en eski yerle\u015fimin Bak\u0131r \xc7a\u011f\u0131'na ait oldu\u011fu; burada yerle\u015fik topluluklar\u0131n avc\u0131l\u0131k ve hayvanc\u0131l\u0131k yaparak ge\xe7indi\u011fi, kuma\u015f ve deri i\u015fleyebildi\u011fi; bak\u0131rdan alet, silah ve tak\u0131 yapabildikleri saptanm\u0131\u015ft\u0131r.Kent, Ka\u015fkalar\u0131n ard\u0131ndan I. Mur\u015fili taraf\u0131ndan fethedilerek Hitit Krall\u0131\u011f\u0131 topraklar\u0131na kat\u0131lm\u0131\u015ft\u0131r.[8] Hitit d\xf6neminde \xf6zel bir durumu olmayan yerle\u015fim yerinde Enetler ad\u0131 verilen halk\u0131n ya\u015fad\u0131\u011f\u0131 ve Eneti ad\u0131yla an\u0131ld\u0131\u011f\u0131 d\xfc\u015f\xfcn\xfclmektedir.[8][44] Kent, M\xd6 1182 civar\u0131nda Hitit \u0130mparatorlu\u011fu'nun \xe7\xf6k\xfc\u015f\xfcn\xfc takiben Frigler taraf\u0131ndan ele ge\xe7irilmi\u015f ve tahrip edilmi\u015ftir.[45][46] Ayn\u0131 d\xf6nemde Kimmerler de Do\u011fu Karadeniz'de yer alan kentleri yak\u0131p y\u0131km\u0131\u015flard\u0131r.[17] Lidya Kral\u0131 Gigis Kimmerleri yenilgiye u\u011frat\u0131p b\xf6lgeden kovmu\u015fsa da bu d\xf6nemde \u015fehir harabe h\xe2line d\xf6n\xfc\u015fm\xfc\u015ft\xfcr.[47] Bunun \xfczerine eski kentin g\xfcneybat\u0131s\u0131na yeni bir yerle\u015fim kurulmu\u015f, tar\u0131ma elveri\u015fli topraklar\u0131 ve artan n\xfcfus bask\u0131s\u0131 nedeniyle M\xd6 7. y\xfczy\u0131lda Fo\xe7al\u0131lar\u0131n veya Miletlilerin ilgisini \xe7eken b\xf6lge kolonile\u015ftirilmi\u015ftir. Ahameni\u015f \u0130mparatoru II. Kiros'un d\xf6nemindeyse Pers h\xe2kimiyetine girmi\u015ftir.Ahameni\u015f \u0130mparatorlu\u011fu'nu yeniden \xf6rg\xfctlemeye giri\u015fen I. Darius d\xf6neminde kent, Kapadokya satrapl\u0131\u011f\u0131n\u0131n h\xe2kimiyet b\xf6lgesi i\xe7ine al\u0131nm\u0131\u015f ve tiran unvan\u0131 ta\u015f\u0131yan asker\xee valiler taraf\u0131ndan y\xf6netilmeye ba\u015flanm\u0131\u015ft\u0131r.[49] M\xd6 331 y\u0131l\u0131nda \u0130skender'in Persleri Gaugamela Muharebesi'nde yenilgiye u\u011frat\u0131p Ahameni\u015f \u0130mparatorlu\u011fu'nu Makedonya topraklar\u0131na katmas\u0131yla birlikte Samsun da Makedon h\xe2kimiyetine girmi\u015f, b\xf6ylece kentte asker\xee temelli bir y\xf6netim anlay\u0131\u015f\u0131ndan tekrar demokratik y\xf6netime d\xf6n\xfclm\xfc\u015ft\xfcr.[51] \u0130skender'in \xf6l\xfcm\xfcyle birlikte zay\u0131flayan ve par\xe7alanan Makedonya'dan ba\u011f\u0131ms\u0131zl\u0131\u011f\u0131n\u0131 il\xe2n eden b\xf6lgelerden biri de I. Antiohos liderli\u011findeki Seleukos \u0130mparatorlu\u011fu olmu\u015f, Samsun M\xd6 315'te bu devletin idaresi alt\u0131na alt\u0131na girmi\u015fse de k\u0131sa s\xfcre sonra Ariobarzanis ya da II. Mithridatis d\xf6neminde Pontus Krall\u0131\u011f\u0131 topraklar\u0131 i\xe7erisine sokulmu\u015ftur.[52][53][51] VI. Mithridatis'in d\xf6neminde kraliyet ik\xe2metg\xe2h\u0131 olarak kullan\u0131lan Samsun'da geni\u015f bir imar hareketi ba\u015flat\u0131larak \u015fehir \xf6nemli bir geli\u015fme kaydetmi\u015ftir.Devam\u0131 Wikipedia'da","639'da Elcezire'nin fethi i\xe7in g\xf6revlendirilen \u0130lyas Bin Ganem Diyarbak\u0131r y\xf6resini \u0130slam m\xfccahidlerine a\xe7t\u0131\u011f\u0131 zaman Siirt ayn\u0131 ak\u0131bete u\u011fram\u0131\u015ft\u0131r. Diyarbak\u0131r'\u0131n zapt\u0131nda \xf6nemli hizmetleri bulunan Halit Bin Velid Hasankeyf Sava\u015f\u0131'nda muzaffer olduktan sonra Siirt'e y\xfcr\xfcm\xfc\u015f \u015fehrin o zamanki hakimi Hersolu itaatini arz ederek \u015fehri teslim etmi\u015ftir. Bundan sonra Siirt Hakimli\u011fi'ne sahabeden olan Hi\u015f\u015fam o\u011flu Hakem tayin olunmu\u015ftur.Malazgirt Sava\u015f\u0131'ndan sonra T\xfcrkler Anadolu'ya yerle\u015fmeye ba\u015flam\u0131\u015f ve B\xfcy\xfck Sel\xe7uklu Devleti'nin iste\u011fi d\u0131\u015f\u0131nda k\xfc\xe7\xfck T\xfcrk devlet\xe7ikleri kurulmu\u015ftur. Siirt y\xf6resi Hasankeyf Artuklular\u0131n y\xf6netimindeydi. Artuklulara ba\u011fl\u0131 g\xf6\xe7ebe T\xfcrkmenler y\xf6reye yerle\u015fmi\u015f, Artuklu beyleri ve askerleri kentlerde T\xfcrkle\u015fmenin \xe7ekirde\u011fini olu\u015fturmu\u015flard\u0131r. Beylerinin Alp, \u0130nan\xe7, Ya\u011fbu gibi T\xfcrk adlar\u0131n\u0131 kullanmalar\u0131; Artuklularda T\xfcrkmen gelene\u011finin g\xfc\xe7l\xfcl\xfc\u011f\xfcn\xfc g\xf6stermektedir. Ba\u011fl\u0131 oymaklara Ok g\xf6nderme bi\xe7imindeki Orta Asya gelene\u011fi de Artuklarda s\xfcrmekteydi.\u015eehrin ana eseri 1129'da, Ba\u011fdat'ta h\xfckmeden B\xfcy\xfck Sel\xe7uklu Sultan\u0131 II. Mahmut taraf\u0131ndan in\u015fa edilen Ulu Camii'dir. 1965 y\u0131l\u0131nda restore edilmi\u015ftir.Yavuz Sultan Selim'in \xc7ald\u0131ran Seferi ile Osmanl\u0131 topraklar\u0131na kat\u0131lm\u0131\u015ft\u0131r. Cumhuriyet d\xf6nemine kadar Bitlis sanca\u011f\u0131na ba\u011fl\u0131 olarak kalm\u0131\u015ft\u0131r.","Yar\u0131madan\u0131n g\xfcney y\xf6n\xfcndeki i\xe7 liman ise r\xfczg\xe2rlara kapal\u0131 konumuyla ve sakin deniziyle g\xfcney Karadeniz'in en \xf6nemli liman\u0131yd\u0131. Bu \xf6zellikleri y\xfcz\xfcnden Akdeniz ismini alm\u0131\u015ft\u0131r. Tarih boyunca i\u015flek bir liman ya\u015fant\u0131s\u0131 ve tersane faaliyeti bu limanda ger\xe7ekle\u015fmi\u015ftir. 19. y\xfczy\u0131la kadar tamamen ayakta duran surlardan ise g\xfcn\xfcm\xfcze b\xfcy\xfck bir k\u0131sm\u0131 kalm\u0131\u015ft\u0131r ve y\u0131k\u0131nt\u0131lar\u0131ndan rekonstr\xfcksiyonu yap\u0131labilir. \u015eehrin geli\u015fimi s\xfcrekli olarak do\u011fu y\xf6nde, Boztepe Burnuna do\u011fru olurken, kuzeydeki Akliman ve Anadolu y\xf6n\xfcnde birka\xe7 az\u0131nl\u0131k yerle\u015fmesinden ba\u015fka bir yerle\u015fim olmam\u0131\u015ft\u0131r. Do\u011fudaki yar\u0131mada ise gittik\xe7e sarpla\u015fmakta, H\u0131d\u0131rl\u0131k tepesinde 187 metre y\xfcksekli\u011fe ula\u015fmakta ve nihayet deniz y\xf6n\xfcnde dik yarlar ile ku\u015fat\u0131lmaktad\u0131r. Bu durumda \u015fehrin deniz y\xf6n\xfcnden ve berzahtan zaptedilmesi imk\xe2ns\u0131z olmaktad\u0131r.Antik \xe7a\u011fdan beri parlak ve yo\u011fun bir ticari ve k\xfclt\xfcrel ya\u015fant\u0131ya sahip olan Sinop, bu niteli\u011fini Do\u011fu Roma \u0130mparatorlu\u011fu, B\xfcy\xfck Sel\xe7uklu \u0130mparatorlu\u011fu, Candaro\u011fullar\u0131 ve Osmanl\u0131 \u0130mparatorlu\u011fu y\xf6netimlerinde de s\xfcrd\xfcrm\xfc\u015f, ayr\u0131ca kale ve tersanesi ile b\xf6lgenin en \xf6nemli askeri \xfcslerinden biri olmu\u015ftur. Bu durumunu Sinop Bask\u0131n\u0131'ndan sonra kaybetmeye ba\u015flayan kent, sur d\u0131\u015f\u0131na g\xfcneydo\u011fu y\xf6nde az\u0131nl\u0131k yerle\u015fmeleri ile bat\u0131ya do\u011fru ise y\xf6netim ve e\u011fitim gibi kamu hizmetleri yerle\u015fmesiyle \xe7\u0131km\u0131\u015ft\u0131r.Sinop ilinin yerle\u015fme tarihi ilk Tun\xe7 \xc7a\u011f\u0131'yla ba\u015flam\u0131\u015ft\u0131r. M\xd6 7. y\xfczy\u0131lda bir Helen Kolonisi olarak kurulan Sinop, Antik \xc7a\u011f'da Karadeniz'in en \xf6nemli kentiydi. Helenistik d\xf6nemde Anadolu'nun yerli k\xfclt\xfcrleriyle, Helenistik ve Pers k\xfclt\xfcrlerini birle\u015ftirmek isteyen Pontus Devleti'nin ba\u015fkenti Amasya'dan sonra Sinop'a ta\u015f\u0131nd\u0131. Bizans d\xf6neminde y\xf6re Ortodoks Hristiyanl\u0131\u011f\u0131n\u0131n etkisiyle dilde ve k\xfclt\xfcrde Helenle\u015fmi\u015ftir. Devam\u0131 Wikipedia'da","ski ad\u0131 (Latince: Sebastia, Grek\xe7e: \u03a3\u03b5\u03b2\u03ac\u03c3\u03c4\u03b5\u03b9\u03b1, Ermenice: \u054d\u0565\u0562\u0561\u057d\u057f\u056b\u0561) Sebastea, Sebasteia veya Samassia olan Sivas, Anadolu'nun en eski ve yerle\u015fim merkezlerinden biridir. Kaz\u0131 ve ara\u015ft\u0131rmalarda ele ge\xe7en buluntular, y\xf6rede ilk yerle\u015fimin Neolitik \xc7a\u011f'a (M\xd6 8000-5500) uzand\u0131\u011f\u0131n\u0131 g\xf6stermektedir. Kent M.\xd6. 2000'lerde de\u011fi\u015fik yerle\u015fmelere sahne olmu\u015ftur. Kaynaklarda ge\xe7en yaz\u0131l\u0131 tarihi M.\xd6. 2000 y\u0131l\u0131 ba\u015flar\u0131nda Hititlerle ba\u015flamakta olup merkez Tatl\u0131cak K\xf6y\xfc ile Uzuntepe K\xf6y\xfcndeki h\xf6y\xfckler, Divri\u011fi Maltepe K\xf6y\xfcnde bulunan h\xf6y\xfck ve G\xfcr\xfcn \u015eu\u011ful vadisindeki Hitit\xe7e yaz\u0131lar ba\u015fl\u0131ca Hitit yerle\u015fim alanlar\u0131d\u0131r.[3] Maltepe H\xf6y\xfc\u011f\xfc kaz\u0131lar\u0131, y\xf6rede ilk yerle\u015fmenin M.\xd6. 2600'lerde ba\u015flay\u0131p M.\xd6. 2000'lere kadar kesintisiz s\xfcrd\xfc\u011f\xfcn\xfc g\xf6stermektedir.[4] Co\u011frafya olarak \u0130\xe7 Anadolu'da bulunmas\u0131na ra\u011fmen \u015eebinkarahisar'\u0131n 1933 y\u0131l\u0131na kadar kazalar\u0131 olan Su\u015fehri, Ak\u0131nc\u0131lar, G\xf6lova ve Koyulhisar il\xe7eleri Do\u011fu Karadeniz B\xf6lgesi ve k\xfclt\xfcr alan\u0131nda yer almaktad\u0131r. Sivas'\u0131n il\xe7elerini Karadeniz'deki Su\u015fehri ovas\u0131na Geminbeli Ge\xe7idi ba\u011flar. Divri\u011fi ve G\xfcr\xfcn il\xe7eleri de Do\u011fu Anadolu B\xf6lgesinde yer al\u0131rken, Do\u011fan\u015far ile Zara'n\u0131n kuzeyi de Karadeniz B\xf6lgesinde yer al\u0131r. Sivas topraklar\u0131nda \u0130\xe7 Anadolu, Do\u011fu Karadeniz ve Do\u011fu Anadolu b\xf6lgelerinin k\xfclt\xfcrleri de yer al\u0131r. Sivas merkez ve \xe7evre il\xe7elerinde g\u0131rnata, zurna ve Sivas'a \xf6zg\xfc halk oyunlar\u0131 oynan\u0131rken, Karadeniz'deki il\xe7elerinde kemen\xe7e ve zurna ile horonlar oynan\u0131r. Divri\u011fi ve G\xfcr\xfcn b\xf6lgesi Do\u011fu Anadolu k\xfclt\xfcr\xfcnde yer al\u0131r. \u0130\xe7 Anadolu b\xf6lgesindeki il\xe7eleri ise k\xfclt\xfcr olarak Sivas merkez b\xf6lgesinin k\xfclt\xfcr ve \u015fivesine sahipken, Karadeniz'de kalan il\xe7eler b\xfcy\xfck \xf6l\xe7\xfcde Giresun ve Ordu ile ayn\u0131 \u015fiveyi kullan\u0131rlar. Devam\u0131 Wikipedia'da","Tekirda\u011f'da insan yerle\u015fimi ile ilgili en eski kal\u0131nt\u0131lara Karans\u0131ll\u0131 k\xf6y\xfc dolaylar\u0131ndaki Yatak, Ku\u015ftepe ve Malkara yak\u0131nlar\u0131ndaki Bal\u0131tepe adl\u0131 buluntu yerlerinde rastlanm\u0131\u015ft\u0131r. Bunlar Alt Paleolitik \xc7a\u011f'a ait aletlerin bulundu\u011fu a\xe7\u0131khava buluntu yerleridir. Tipolojik olarak bir milyon y\u0131l ile 250 bin y\u0131l \xf6nceleri aras\u0131na tarihlenebilirler. Tekirda\u011f'\u0131n hemen do\u011fusunda bulunan Menek\u015fe \xc7ata\u011f\u0131 ise Kalkolitik \xc7a\u011f'dan Helenistik D\xf6nem'e kadar yerle\u015filmi\u015f bir buluntu yeridir.Tekirda\u011f'\u0131n eski tarihi Trakya'daki di\u011fer illere paralellik g\xf6sterir; ilk olarak Traklar taraf\u0131ndan iskan edilen b\xf6lge, Makedon, Pers, Roma ve Bizans egemenli\u011finin ard\u0131ndan 1357'de I. Murat taraf\u0131ndan fethedilerek Osmanl\u0131 topraklar\u0131na kat\u0131lm\u0131\u015ft\u0131r. 1703 y\u0131l\u0131nda Avusturya \u0130mparatorlu\u011fu'na kar\u015f\u0131 ba\u011f\u0131ms\u0131zl\u0131k m\xfccadelesi veren asi Macar prensi Rakoczi'ye de ev sahipli\u011fi yapm\u0131\u015f olan Tekirda\u011f, Osmanl\u0131 d\xf6neminin sonlar\u0131nda Edirne vilayetine ba\u011fl\u0131 bir sancak merkezi idi. 93 Harbi'nde (1878) Rus, Balkan Harbi'nde (1912) Bulgar ve I. D\xfcnya Sava\u015f\u0131'ndan sonra (1920-1922) Yunan i\u015fgali ya\u015fayan il, T\xfcrk Kurtulu\u015f Sava\u015f\u0131 ile gelen zaferin ard\u0131ndan 13 Kas\u0131m 1922 tarihinde kal\u0131c\u0131 olarak T\xfcrk topraklar\u0131na kat\u0131ld\u0131. Devam\u0131 Wikipedia'da","\u0130lk \xe7a\u011flarda Togay\u0131tlar'ca kuruldu\u011funa inan\u0131lan Tokat, Hititlerin, Asurlular\u0131n, Hurriler ve Kimmerlerin egemenli\u011finde kald\u0131ktan sonra s\u0131ras\u0131yla Perslerin, B\xfcy\xfck \u0130skender d\xf6nemi Makedonyal\u0131lar\u0131n, Kapodokya Krall\u0131\u011f\u0131n\u0131n ve buraya Comana Pontica ad\u0131n\u0131 veren Pontus Krall\u0131\u011f\u0131'n\u0131n y\xf6netimine ge\xe7ti. M\xd6 65'te Romal\u0131lar\u0131n ve MS Bizans Devletinin egemenli\u011fine girmi\u015ftir. Bizans-Sasani ve Bizans-Arap sava\u015flar\u0131nda kritik \xf6neme sahip olan Tokat Kalesi, Malazgirt Zaferi'nden sonra Dani\u015fmentlilerin y\xf6netimine (1071) daha sonra ise Anadolu Sel\xe7uklular\u0131n\u0131n (1150) eline ge\xe7mi\u015f kentin g\xfcneybat\u0131s\u0131nda, 750 metre y\xfcksekli\u011findeki Hisartepe \xfczerinde bulunmaktad\u0131r. Tokat Kalesi'ne ait en eski izler 5 ya da 6. y\xfczy\u0131la ait olup kalenin bu y\u0131llarda var oldu\u011fu bilinmektedir.","B\xf6lgede \xe7e\u015fitli d\xf6nemlerde yap\u0131lan arkeolojik kaz\u0131 ve y\xfczey taramalar\u0131nda Yontma Ta\u015f (Alt Paleolitik d\xf6nem) \xc7a\u011f\u0131'na ait Acheulien ve Mousterien tipi (el baltalar\u0131, kaz\u0131y\u0131c\u0131lar, yonga aletler), Orta Ta\u015f \xc7a\u011f\u0131 (Mezolitik)'e ait ma\u011faralar Kalkolitik \xc7a\u011f'a ait yerle\u015fim izlerine rastlanm\u0131\u015ft\u0131r. Bronz \xc7a\u011f\u0131'nda Karadeniz k\u0131y\u0131s\u0131nda Ka\u015fkalar adl\u0131 domuz besleyen ve kendir eken sava\u015f\xe7\u0131 bir halk\u0131n varl\u0131\u011f\u0131 Hitit kaynaklar\u0131nda bildirilmektedir.Eusebius'a g\xf6re \u015fehrin kurulu\u015f tarihini M\xd6 756 olmakla birlikte bu iddia Trabzon'u \u0130stanbul, Roma hatta, genel kan\u0131ya g\xf6re Trabzon ve di\u011fer Do\u011fu Karadeniz kolonizasyonunu ger\xe7ekle\u015ftiren Sinop'tan daha eski bir kent yapmaktad\u0131r. Bu durum ger\xe7ekse Sinoplular var olan bir kenti M\xd6 630 tarihinden sonra yeniden kolonize etmi\u015f olmal\u0131d\u0131rlar.Anabasis'te ge\xe7en Pontos Euksenios k\u0131y\u0131s\u0131ndaki bu \u015fehir Sinope'nin Lazlar\u0131n atalar\u0131 olan Kolhis \xfclkesindeki kolonisidir ifadesi daha sonra Arrian ve Peripleus taraf\u0131ndan da onaylanm\u0131\u015ft\u0131r.Trabzon \u015fehrinden ilk defa M\xd6 400 y\u0131l\u0131nda \u015fehri g\xf6ren Atinal\u0131 Xenophon taraf\u0131ndan bahsedilmi\u015ftir[17]. Merkezinde Yunanlar\u0131n \xe7evre k\xf6ylerinde bug\xfcnk\xfc Lazlar\u0131n (Tzanlar) atalar\u0131 olan Kolhislilerin ve ya\u015fad\u0131\u011f\u0131 Trabzon, Antik \xe7a\u011f ve sonras\u0131nda Zigana ge\xe7idi \xfczerinden Ermenistan ve Euphrates civar\u0131nda \xfcretilen ticari mallar\u0131n takas edildi\u011fi ticaret merkezi ve d\u0131\u015f \xfclkelere sat\u0131ld\u0131\u011f\u0131 bir ihra\xe7 liman\u0131 \xf6zelli\u011findeydi. Pontus \u0130mparatoru Mithridates'in Roma \u0130mparatorlu\u011fu ile giri\u015fti\u011fi bir dizi sava\u015f\u0131 kaybetmesinin ard\u0131ndan Anadolu topraklar\u0131n\u0131n yan\u0131 s\u0131ra Trabzon da Roma hakimiyetine girmi\u015ftir.Devam\u0131 Wikipedia'da'","Antik Yunan tarih\xe7i ve co\u011frafyac\u0131lar\u0131n\u0131n Dersim b\xf6lgesine Daranis ve Derksene ad\u0131n\u0131 verdikleri s\xf6ylenir. 1935 y\u0131l\u0131nda kurulan ve Tunceli Kanunu'ndaki \xf6zel stat\xfcs\xfc nedeniyle El\xe2z\u0131\u011f'dan y\xf6netilen Tunceli ilinin merkezi olarak 30 Aral\u0131k 1946 tarihli ve 4993 say\u0131l\u0131 kanunla Kalan (Mamekiye) kasabas\u0131 olarak belirlenmi\u015ftir.","Son y\u0131llarda \u015eanl\u0131urfa'da birbiri ard\u0131na ortaya \xe7\u0131kart\u0131lan arkeolojik bulgularla insanl\u0131k tarihine ili\u015fkin \xf6nemli bilgiler elde edilmi\u015ftir. 1993 y\u0131l\u0131nda \u015fehir merkezinin alt\u0131nda bug\xfcnk\xfc Bal\u0131kl\u0131g\xf6l'\xfcn kuzeyinde yap\u0131lan bir ke\u015fif sonucu bulunan Urfa Adam\u0131 olarak adland\u0131r\u0131lan insan \u015feklindeki tarih \xf6ncesi heykel ile Urfa \u015fehir merkezinde insan yerle\u015fiminin tarihinin M\xd6. 9500'e Neolitik D\xf6neme kadar uzand\u0131\u011f\u0131 g\xf6r\xfclm\xfc\u015ft\xfcr. 1997\u2019de \u015eanl\u0131urfa il merkezinin yakla\u015f\u0131k olarak 22 km kuzeydo\u011fusunda, \xd6rencik k\xf6y\xfc yak\u0131nlar\u0131nda G\xf6beklitepe H\xf6y\xfc\u011f\xfc'nde yap\u0131lan kaz\u0131larda elde edilen bulgularda ise, insanl\u0131\u011f\u0131n en eski tap\u0131naklar\u0131ndan biri ortaya \xe7\u0131kar\u0131lm\u0131\u015ft\u0131r. Y\xfcksek boyda kar\u015f\u0131l\u0131kl\u0131 olarak yerle\u015ftirilmi\u015f dikilita\u015flar\u0131n \xfczerinde insan, el ve kol, \xe7e\u015fitli hayvan ve soyut semboller, kabart\u0131larak veya oyularak betimlenmi\u015ftir. Bu kompozisyonun bir \xf6yk\xfc, bir anlat\u0131m veya bir mesaj ifade etti\u011fi d\xfc\u015f\xfcn\xfclmektedir. Bir yerle\u015fim yeri de\u011fil, k\xfclt merkezi olarak tan\u0131mlanmaktad\u0131r. Buradaki k\xfclt yap\u0131lar\u0131n tar\u0131m ve hayvanc\u0131l\u0131\u011fa yak\u0131n olan son avc\u0131 gruplar\u0131 taraf\u0131ndan in\u015fa edilmi\u015f oldu\u011fu anla\u015f\u0131lmaktad\u0131r. G\xf6bekli Tepe, \xe7evredeki olduk\xe7a geli\u015fmi\u015f ve derinlik kazanm\u0131\u015f bir inan\xe7 sistemine sahip olan avc\u0131-toplay\u0131c\u0131 gruplar a\xe7\u0131s\u0131ndan \xf6nemli bir k\xfclt merkezidir.Bu durumda b\xf6lgenin en erken kullan\u0131m\u0131n\u0131n \xc7anak \xc7\xf6mleksiz Neolitik \xc7a\u011f\u2019\u0131n A evresine (M\xd6 9.600-7.300), yani g\xfcn\xfcm\xfczden en az\u0131ndan 11.600 y\u0131l \xf6ncesine dayand\u0131\u011f\u0131 ileri s\xfcr\xfclmektedir. G\xf6bekli Tepe'nin bir k\xfclt merkezi olarak kullan\u0131m\u0131n\u0131n M\xd6 8 bin dolaylar\u0131na kadar devam etti\u011fi ve bu tarihlerden sonra terk edildi\u011fi, ba\u015fka veya benzer ama\xe7larla kullan\u0131lmad\u0131\u011f\u0131 anla\u015f\u0131lmaktad\u0131r. Devam\u0131 Wikipedia'da","Antik d\xf6nemdeki ad\u0131 Temenothyrea olan U\u015fak, \u0130\xe7 Ege B\xf6lgesinde Bat\u0131 ve Orta Anadolu'yu birbirine ba\u011flayan b\xf6lgede yer almaktad\u0131r. U\u015fak ve \xe7evresinin M\xd6 4000 y\u0131l\u0131ndan itibaren yerle\u015fime a\xe7\u0131ld\u0131\u011f\u0131 anla\u015f\u0131lmaktad\u0131r. \xd6zellikle Bronz \xe7a\u011f\u0131nda yerle\u015fimin daha yayg\u0131nla\u015ft\u0131\u011f\u0131 g\xf6r\xfclmektedir. M.\xd6. 2000 de Anadolu\u2019da ilk siyasi birli\u011fi kuran Hititlerin, M.\xd6. 1000 de ise Friglerin bat\u0131 s\u0131n\u0131r\u0131n\u0131 olu\u015fturan U\u015fak ve \xe7evresi bu k\xfclt\xfcrlerden ziyade \u0130on k\xfclt\xfcr\xfcn\xfcn etkisi alt\u0131nda kalm\u0131\u015ft\u0131r. M\xd6. 7. Y\xfczy\u0131lda Kral Gyges\u2019in Lidya \u0130mparatorlu\u011funu ele ge\xe7irmesi ile topraklar\u0131n\u0131n b\xfcy\xfck k\u0131sm\u0131 Lidya\u2019da kalan U\u015fak, M\xd6. 620\u2019de tamamen Lidya\u2019n\u0131n egemenli\u011fine girmi\u015ftir. M\xd6. 546\u2019da Lidya\u2019n\u0131n tarihten silinmesi sonucu b\xf6lge Perslerin hakimiyetine girmi\u015ftir.ers egemenli\u011fi M\xd6. 334 y\u0131l\u0131na kadar devam etmi\u015ftir. Bu tarihte Makedonyal\u0131 B\xfcy\xfck \u0130skender\u2019in Anadolu seferi sonucu b\xf6lge t\xfcm Anadolu gibi B\xfcy\xfck \u0130skender\u2019in hakimiyetine girmi\u015f, \u0130skender\u2019in \xf6l\xfcm\xfcnden sonra ise b\xf6lge, B\xfcy\xfck \u0130skender\u2019in generallerinden Antigonos\u2019un pay\u0131na verilmi\u015ftir. Daha sonra bir s\xfcre Bergama krall\u0131\u011f\u0131na ba\u011flanan U\u015fak ve \xe7evresi M.\xd6. 189 y\u0131l\u0131nda Roma hakimiyetine ge\xe7mi\u015f, Roma \u0130mparatorlu\u011funun ikiye ayr\u0131lmas\u0131 neticesinde Do\u011fu Roma s\u0131n\u0131rlar\u0131 i\xe7inde kalan U\u015fak, MS. 12. y\xfczy\u0131la kadar Bizans hakimiyetinde kalm\u0131\u015ft\u0131r. Devam\u0131 Wikipedia'da","Van'da insan yerle\u015fiminin tarihi M\xd6 7000 y\u0131llar\u0131na kadar uzan\u0131r. Van Kalesi'nin 6 km g\xfcneyinde bulunan Tilkitepe ve Van G\xf6l\xfc'n\xfcn kuzeyindeki Ernis Mezarl\u0131klar\u0131nda yap\u0131lan kaz\u0131larda Kalkolitik, Tun\xe7, Demir \xe7a\u011flar\u0131na ait yerle\u015fimler bulunmu\u015ftur. Van'da 20. y\xfczy\u0131la kadar Ermeni, T\xfcrk, K\xfcrt, Arap n\xfcfus ya\u015fam\u0131\u015ft\u0131r. Gelenekleri Osmanl\u0131 ve \u0130ran etkisinde geli\u015fmi\u015ftir. Van farkl\u0131 k\xfclt\xfcrlerin ve topluluklar\u0131n bir arada ya\u015fayabildi\u011fi g\xfczide bir co\u011frafyad\u0131r.Hurriler, M\xd6 2000'lerden itibaren Van G\xf6l\xfc'nden ba\u015flayarak K\u0131z\u0131l\u0131rmak ve Ye\u015fil\u0131rmak'\u0131n Karadeniz'e d\xf6k\xfcld\xfc\u011f\xfc yerlere kadar uzanan bir b\xf6lgeye h\xe2kim olmu\u015ftur. M\xd6 13. y\xfczy\u0131lda Hurri-Mitanni siyasi te\u015fekk\xfcl\xfcn merkezi otoritesi zay\u0131flam\u0131\u015f ve beyliklere b\xf6l\xfcnm\xfc\u015ft\xfcr. Asur Krallar\u0131 bu k\xfc\xe7\xfck beyliklerini hakimiyetleri alt\u0131na almaya \xe7al\u0131\u015fm\u0131\u015f ve bu s\u0131rada Van G\xf6l\xfc \xe7evresinde Bat\u0131 \u0130ran'a kadar olan b\xf6lgede Urartular ile Asurlular aras\u0131nda m\xfccadeleler ba\u015flam\u0131\u015ft\u0131r. Urartu-Asur m\xfccadelesi M\xd6.VI. y\xfczy\u0131l\u0131n ortalar\u0131na kadar s\xfcrm\xfc\u015f, Urartular bu da\u011fl\u0131k ve zor arazi \u015fartlar\u0131na sahip b\xf6lgeyi egemenlik alt\u0131nda tutmu\u015ftur.\u015eehri ilk kuran Asur Krali\xe7esi Semiramis'tir. Urartular zaman\u0131nda \u015fehir bir imparatorluk merkezi haline gelmi\u015f ve Urartular\u0131n ba\u015fkenti o zaman Van'a verdikleri isim ile Tu\u015fpa olmu\u015ftur. Urartular'dan kalma Van Kalesi, 3000 y\u0131ld\u0131r h\xe2l\xe2 ayaktad\u0131r. Van Kalesi'nde Urartular'dan kalan kaya ve oda mezarlar\u0131, tap\u0131naklar, yaz\u0131tlar ve baz\u0131 yap\u0131lar bulunur. Urartu kral\u0131 I. Sarduri'nin kurdu\u011fu ve ba\u015fkent yapt\u0131\u011f\u0131 Tu\u015fpa, Urartu krallar\u0131n\u0131n mezralar\u0131n\u0131, uzun yaz\u0131tlar\u0131 i\xe7inde bar\u0131nd\u0131r\u0131r. Horhor Yaz\u0131t\u0131, kaledeki en uzun yaz\u0131tt\u0131r ve kral Argi\u015fti'ye ait mezar odas\u0131n\u0131n giri\u015finde bulunur. Anal\u0131 k\u0131z kutsal alan\u0131nda b\xfcy\xfck bloklara yaz\u0131lm\u0131\u015f yaz\u0131lar vard\u0131r ve buras\u0131 bir sunak alan\u0131d\u0131r. \u0130\xe7 Kale'de Urartulara ait bir tap\u0131na\u011f\u0131n temelleri bulunur. Kalenin bat\u0131s\u0131nda Mad\u0131r Burcu isimli g\xf6rkemli yap\u0131n\u0131n ne ama\xe7la yap\u0131ld\u0131\u011f\u0131 tam olarak bilinmemektedir, fakat bir liman oldu\u011fu tahmin edilmektedir.Kalenin kuzeyinde yer alan Van Kalesi H\xf6y\xfc\u011f\xfc'nde kaz\u0131lar da yap\u0131lm\u0131\u015ft\u0131r. Devam\u0131 Wikipedia'da","Anadolu\u2019nun en eski yerle\u015fim merkezlerinden biri oldu\u011fu d\xfc\u015f\xfcn\xfclen y\xf6rede Ali\u015far H\xf6y\xfc\u011f\xfc'nde yap\u0131lan kaz\u0131larda M\xd6 3000 y\u0131llar\u0131na ait eserler bulunmu\u015ftur. Hititlerin yerle\u015fim merkezlerinden de biri oldu\u011fu bilinmektedir. Devam\u0131 Wikipedia'da","B\xf6lgede \xe7e\u015fitli zaman aral\u0131klar\u0131nda tarih yazarlar\u0131n\u0131n ve arkeolojik y\xfczey incelemelerinin sonucundaki ortak g\xf6r\xfc\u015f Zonguldak, Bart\u0131n,Kastamonu illerini kapsayan b\xf6lgenin tarih \xf6ncesi ad\u0131 Paflagonya.2010 y\u0131l\u0131nda Zonguldak Filyos ve Paflagonya kentlerini ara\u015ft\u0131rma yapan belgesel y\xf6netmeni Tekin G\xfcn notlar\u0131 aras\u0131nda Tarihi izlerinin 4 bin y\u0131l \xf6ncesine kadar giden kdz.ere\u011fli ve \xe7evresinden s\xf6z eden en eski kaynak, homeros'un ilyada's\u0131d\u0131r,(iliada). homeros, troya sava\u015flar\u0131na (i.\xf6.1200'ler) kat\u0131lan paflagonyal\u0131lar\u0131n (paphlagonia) bir b\xf6l\xfcm\xfcn\xfcn pathenios (Bart\u0131n) \xe7ay\u0131 \xe7evresinde sesamos (amasra),kromna (kuruca\u015file), parthenios gibi kentler kurduklar\u0131n\u0131 anlatmaktad\u0131r.[1] Ayr\u0131ca Zonguldak Filyos'ta Tieion Antik Kent kal\u0131nt\u0131lar\u0131 bir Milet yerle\u015fiminin antik temelleri \xfczerine in\u015fa edildi\u011fini i\u015faret etmekte oldu\u011fu san\u0131lmaktad\u0131r.[2] Arkeolojik kan\u0131tlara g\xf6re M\xd6 2500'lere uzanan bir ge\xe7mi\u015fi bulunan b\xf6lgeye ilk yerle\u015fenler Hattiler, daha sonra ise Hititler olmu\u015ftur. Y\xf6renin ilk sakinleri Frig boylar\u0131ndan olu\u015fan Bitinler, Mariandin ve Migdon adl\u0131 g\xf6\xe7 topluluklar\u0131d\u0131r. M\xd6 7. y\xfczy\u0131lda ba\u015flayan Bat\u0131 Anadolu'dan Karadeniz'e Yunan kolonizasyonu s\xfcrecinde y\xf6rede de ticaret ama\xe7l\u0131 limanlar kurulmu\u015ftur. M\xd6 334'e kadar Perslerin egemenli\u011finde kalan b\xf6lge, B\xfcy\xfck \u0130skender'in Anadolu seferinin ard\u0131ndan k\u0131sa bir s\xfcre i\xe7in Makedonyal\u0131 subaylarca y\xf6netilmi\u015ftir. Pers \u015fatrap\u0131 Mithridates'in y\xf6re halk\u0131n\u0131n deste\u011fiyle Bat\u0131 Karadeniz B\xf6lgesi'nde kurdu\u011fu Pontus Devleti'nin par\xe7as\u0131 olan Zonguldak, Roma \u0130mparatorlu\u011fu'nun bu devleti MS 1. y\xfczy\u0131lda y\u0131kmas\u0131na dek s\xfcrm\xfc\u015f, Roma'n\u0131n ikiye b\xf6l\xfcnmesinin ard\u0131ndan sonra da Do\u011fu Roma topra\u011f\u0131 olmu\u015ftur. Zonguldak Ere\u011fli b\xf6lgesi Hristiyanl\u0131\u011f\u0131n ilk yay\u0131ld\u0131\u011f\u0131 yerlerden biri olma \xf6zelli\u011fi kazanm\u0131\u015f, bu d\xf6nemde \u0130sa'n\u0131n havarilerinden Adreas bug\xfcn de g\xf6r\xfclebilen Kutsal \u0130badet Ma\u011faralar\u0131'nda ilk ayinleri d\xfczenlemi\u015ftir.Y\xf6reye Anadolu Sel\xe7uklu ordusu 1084 y\u0131l\u0131nda gelmi\u015f ve y\xf6reyi fethetmi\u015ftir. Daha sonra ise y\xf6reyi Cenevizliler ele ge\xe7irmi\u015ftir, beylikler d\xf6neminde ise Candaro\u011fullar\u0131 b\xf6lgede hakimiyet kurmu\u015ftur. 1460 y\u0131l\u0131nda Fatih Sultan Mehmet\u2019in Amasra\u2019y\u0131 almas\u0131yla birlikte Zonguldak ve \xe7evresi tamamen Osmanl\u0131lar\u0131n eline ge\xe7mi\u015ftir.II. Mahmut d\xf6neminde, 1829 y\u0131l\u0131nda b\xf6lgede ilk k\xf6m\xfcr bulunmu\u015ftur. 1848'de ise ilk k\xf6m\xfcr ocaklar\u0131 a\xe7\u0131lm\u0131\u015ft\u0131r. Bu ocaklar\u0131 Bel\xe7ikal\u0131 ve Frans\u0131z \u015firketler i\u015fletmi\u015ftir.Zonguldak liman\u0131 I. D\xfcnya Sava\u015f\u0131'nda Sar\u0131kam\u0131\u015f'a gidecek malzemelere ev sahipli\u011fi yapm\u0131\u015f, T\xfcrk Kurtulu\u015f Sava\u015f\u0131'nda ise SSCB ile ili\u015fkilerde \xf6nemli bir rol oynam\u0131\u015ft\u0131r.I. D\xfcnya Sava\u015f\u0131'ndan sonra 1919 y\u0131l\u0131nda Frans\u0131z \u015firketlerinin haklar\u0131n\u0131 korumak bahanesiyle Frans\u0131z askerleri \xf6nce Zonguldak\u2019\u0131, ard\u0131ndan da Karadeniz Ere\u011fli\u2019yi i\u015fgal etmi\u015ftir; ancak Zonguldak ve \xe7evresindeki M\xfcdafaa-i Hukuk Cemiyetlerine ba\u011fl\u0131 g\xfc\xe7lerin kar\u015f\u0131 koymas\u0131yla tehlikeye d\xfc\u015fm\xfc\u015fler ve 21 Haziran 1920'de de b\xf6lgeyi terketmi\u015flerdir.","Aksaray \u015fehrinin tarihi antik d\xf6nemlere kadar uzanmaktad\u0131r. Hititler devrinde Garsaura ad\u0131yla an\u0131lan yerle\u015fim, son Kapadokya kral\u0131 Archelaos taraf\u0131ndan yeniden in\u015fa edildi. \u015eehri yeniden in\u015fa edilen krala nispetende kente Archaleis ad\u0131 verildi. Kapadokya Krall\u0131\u011f\u0131'n\u0131n son bulmas\u0131yla yerle\u015fim Roma topraklar\u0131na kat\u0131ld\u0131. Claudius d\xf6neminde Roma kolonisi olan yerle\u015fimden Colonia Archelais ad\u0131yla bahsedildi. Roma'n\u0131n ikiye ayr\u0131lmas\u0131yla Bizans idaresine ge\xe7en yerle\u015fim 1078 sonras\u0131nda civar yerle\u015fimlerle birlikte Sel\xe7uklu hakimiyetine girdi. Sel\xe7uklular taraf\u0131ndan Kutalm\u0131\u015fo\u011flu' nun idaresine verilen yerle\u015fim daha sonra yeni kurulan Anadolu Sel\xe7uklu Devleti topraklar\u0131na kat\u0131ld\u0131. Sultan II. K\u0131l\u0131\xe7 Arslan taraf\u0131ndan 1170 y\u0131l\u0131nda \u015fehir yeniden imar edilmi\u015f ve yapt\u0131rd\u0131\u011f\u0131 saray nedeniyle de yerle\u015fim Aksaray ad\u0131n\u0131 alm\u0131\u015ft\u0131r. Sultan\u0131n \xe7o\u011funlukla \u015fehirde ya\u015famas\u0131 ve sultan taraf\u0131ndan kente askeri tesisler in\u015fa edilmesi nedeniyle de D\xe2r\xfczzafer, D\xe2r\xfcrrib\xe2t ve D\xe2r\xfclcih\xe2d unvanlar\u0131 da verildi.Anadolu Sel\xe7uklu Devleti'nin zay\u0131flamas\u0131yla yerle\u015fim Karamano\u011fullar\u0131 Beyli\u011fi egemenli\u011fine ge\xe7ti. Bir s\xfcre Eretna Beyli\u011fi ve Karamano\u011fullar\u0131 aras\u0131nda el de\u011fi\u015ftirdi. 1399 y\u0131l\u0131nda Osmanl\u0131 idaresine ge\xe7en yerle\u015fim 1402 Ankara Muharebesi sonras\u0131nda yeniden Karamano\u011fullar\u0131 topraklar\u0131na kat\u0131ld\u0131. Karamano\u011flu-Osmanl\u0131 m\xfccadelesi sonras\u0131nda 1468'de kesin olarak Osmanl\u0131 hakimiyetine ge\xe7ti. Yerle\u015fim Osmanl\u0131-Karamano\u011flu m\xfccadelesinde b\xfcy\xfck tahribata u\u011frad\u0131\u011f\u0131 gibi Osmanl\u0131'n\u0131n egemen olmas\u0131yla n\xfcfusun \xf6nemli k\u0131smi \u0130stanbul'a nakledilmi\u015ftir. Zorunlu iskana tabi tutulan bu kitlelerin yerle\u015fimiyle \u0130stanbuldaki g\xfcn\xfcm\xfcz Aksaray semti kurulmu\u015ftur.1530 y\u0131l\u0131 Osmanl\u0131 kay\u0131tlar\u0131nda Karaman Eyaleti'nin Ni\u011fde Sanca\u011f\u0131na ba\u011fl\u0131 m\xfcstakil bir liva olan Aksaray'da 37 mahalle bulunmakta olup, tahminen bu tarihte yerle\u015fimde 5000-6000 aras\u0131nda n\xfcfus bulunmaktayd\u0131. Osmanl\u0131'n\u0131n ilk resmi n\xfcfus say\u0131m\u0131 sadece erkek n\xfcfusun tespit edilmesi i\xe7in yap\u0131lm\u0131\u015f olup, bu say\u0131ma g\xf6re Aksaray merkezde 2.322 erkek bulunmaktayd\u0131. 19. y\xfczy\u0131l ortalar\u0131nda yerle\u015fimden Ni\u011fde sanca\u011f\u0131na ba\u011fl\u0131 bir kaza olarak bahsedilmi\u015ftir. 1868-69 tarihli salnamede yerle\u015fimde 1020 hane bulundu\u011fu kayda ge\xe7mi\u015ftir [6]. Cumhuriyetin ilk y\u0131llar\u0131yla kurulan il te\u015fkilat\u0131n\u0131n merkez il\xe7esi oldu. 1933 y\u0131l\u0131nda Aksaray ilinin kapat\u0131lmas\u0131yla yeniden Ni\u011fde ilinin bir il\xe7esi oldu. 1989\u2019da \xe7\u0131kar\u0131lan 3578 say\u0131l\u0131 kanunla Aksaray ili yeniden kurulmas\u0131yla bu ilin merkez il\xe7esi konumuna geldi."," Bayburt \u015fehrinin ad\u0131; eski Kafkas dillerden birini konu\u015fan Urartu/Khaldiler'in b\xf6lgeye egemen oldu\u011fu d\xf6nemlerde, Khalt (Halti) halk\u0131 aras\u0131nda ger\xe7ekle\u015fen Hint-Avrupa dili Mitanni g\xf6\xe7menlerinin s\u0131zmalar\u0131 sonucunda verilmi\u015ftir.Khaltlar'\u0131n aras\u0131na yerle\u015fmek \xfczere b\xf6lgeye gelen gruplar\u0131n verdi\u011fi s\xf6yleni\u015f \u015fekliyle Bagbartu s\xf6zc\xfc\u011f\xfc Mitannice'den gelmektedir.Bayburt tarihinin bilinen ge\xe7mi\u015fi Anadolu'nun k\xf6kl\xfc kavimlerinden Azzi ve Hayasalar'la ba\u015flar. Onu Hatti, Hitit ve Urartu izler.G\xfcn\xfcm\xfczde dahi; Karadeniz halk\u0131, sahil boyunda yerle\u015fenlerine (tamamen olmasa bile) Laz, i\xe7 ve da\u011fl\u0131k kesimlerde yerle\u015fenlerine Halt demektedir. Do\u011fu Karadeniz'in i\xe7 kesimlerinde Yusufeli ile \u015eebinkarahisar aras\u0131ndaki da\u011fl\u0131k hat boyunca uzanan b\xf6lge; Urartu'nun Ba\u015f Tanr\u0131's\u0131 olan Khalt'\u0131n izinden gidenlerin yurdu anlam\u0131na Haldia olarak tarih boyunca adland\u0131r\u0131lm\u0131\u015ft\u0131r. Devam\u0131 Wikipedia'da","Karamano\u011fullar\u0131 Beyli\u011finin bir s\xfcre ba\u015fkentli\u011fini yapm\u0131\u015ft\u0131r.\u015eeyh Edebal\u0131, Kaz\u0131m Karabekir, Kemal Reis, Mevlana, \u015eair Ayni gibi pek \xe7ok T\xfcrk b\xfcy\xfc\u011f\xfcn\xfc yeti\u015ftirmi\u015f bir \u015fehirdir. Ayr\u0131ca Atat\xfcrk'\xfcn dedeleri, anne taraf\u0131ndan Sofuzade Feyzullah ve baba taraf\u0131ndan dedesi K\u0131z\u0131l Haf\u0131z Ahmet Efendi'nin Karamanl\u0131 olduklar\u0131 Yrd. Do\xe7. Dr. Ali G\xdcLER taraf\u0131ndan Hem\u015fehrimiz Atat\xfcrk adl\u0131 teze g\xf6re Mustafa Kemal Atat\xfcrk de aslen Karamanl\u0131d\u0131r.","K\u0131r\u0131kkale ili ve \xe7evresinin eski\xe7a\u011f tarihini ayd\u0131nlatacak bir arkeolojik kaz\u0131 hen\xfcz yap\u0131lmam\u0131\u015ft\u0131r. Ancak b\xf6lgenin tarihi co\u011frafyas\u0131na \u0131\u015f\u0131k tutacak baz\u0131 bilimsel \xe7abalar da yok de\u011fildir. K\u0131r\u015fehir Kaman Kaleh\xf6y\xfckte arkeolojik kaz\u0131lar yapmakta olan Japon bilim heyetinin ilimiz s\u0131n\u0131rlar\u0131 i\xe7erisinde kalan alanda yapm\u0131\u015f oldu\u011fu y\xfczey ara\u015ft\u0131rmalar\u0131 dikkate de\u011fer bulgular ortaya koymu\u015ftur.Japonlar\u0131n 1990-91 y\u0131llar\u0131 aras\u0131nda K\u0131r\u0131kkale il merkezi ve ona ba\u011fl\u0131 il\xe7e ve k\xf6yleri kapsayan y\xfczey ara\u015ft\u0131rmalar\u0131nda toplam 21 h\xf6y\xfck ve d\xfcz iskan saptanm\u0131\u015ft\u0131r. Bu merkezlerden toplanan seramik \xf6rneklerinin de\u011ferlendirilmesi sonucu b\xf6lgenin K\u0131z\u0131l\u0131rmak kavsi d\u0131\u015f\u0131nda kalan alanda Neolitik \xc7a\u011f ve sonras\u0131, K\u0131z\u0131l\u0131rmak kavsi i\xe7inde kalan alanda ise bu d\xf6nemi takip eden Kalkolitik \xc7a\u011f\u0131, Eski Tun\xe7 \xc7a\u011f\u0131, Assur Ticaret Kolonileri \xc7a\u011f\u0131 Hitit \u0130mparatorluk \xc7a\u011f\u0131 (zay\u0131f), Frig ve Hellenistik-Roma \xc7a\u011flar\u0131 ile Bizans, Sel\xe7uklu ve Osmanl\u0131 d\xf6nemlerine ait yerle\u015fim birimleri ve bu d\xf6nemlerin k\xfclt\xfcrlerini yans\u0131tan kal\u0131nt\u0131lar saptanm\u0131\u015ft\u0131r.Devam\u0131 K\u0131r\u0131kkale Belediyesi web sitesinde","Batman tarihi itibar\u0131yla yeni bir \u015fehir olmas\u0131na kar\u015f\u0131n yerle\u015fim alan\u0131nda kurulan \u015fehirlerin tarihi S\xfcmerlere kadar uzan\u0131r. \u0130luh Tepesi'nin bulundu\u011fu alanda bir S\xfcmer \u015fehir yerle\u015fiminin bulundu\u011fu, ancak batakl\u0131k bir arazi \xfczerine kurulu oldu\u011fundan \u015fehrin zaman i\xe7erisinde yeralt\u0131na g\xf6\xe7t\xfc\u011f\xfc d\xfc\u015f\xfcn\xfclmektedir. Ayr\u0131ca \u0130luh Tepesi olarak adland\u0131r\u0131lan Arazi, ara\u015ft\u0131rmalar sonucunda do\u011fal olmad\u0131\u011f\u0131 ve yapay bir tepe oldu\u011fu kan\u0131tlanm\u0131\u015ft\u0131r. Batman'\u0131n ad\u0131n\u0131 batmak teriminden bu nedenle alm\u0131\u015f olabilece\u011fi d\xfc\u015f\xfcn\xfclmektedir. 1940 y\u0131l\u0131nda Batman civar\u0131nda petrol bulunmu\u015ftur.","  \u0130l s\u0131n\u0131rlar\u0131 i\xe7erisindeki yerle\u015fimin M.\xd6 7000\u2019lere kadar uzand\u0131\u011f\u0131  bilinmektedir. \u015e\u0131rnak\u2019\u0131n ad\u0131n\u0131n kayna\u011f\u0131yla ilgili olarak kesin bir bilgiye sahip olunmamakla birlikte \xe7e\u015fitli rivayetler bulunmaktad\u0131r. ","M.\xd6.3000-2400 y\u0131llar\u0131 aras\u0131nda Akalar\u0131n Ege'de Miken Medeniyetini kurmadan \xf6nce Bat\u0131 Anadolu k\u0131y\u0131lar\u0131na (Samsun,Sinop ve Amasra) yerle\u015ferek Bak\u0131r Devri Medeniyetini yerli halka \xf6\u011frettikleri; i\xe7 kesimlerde de Gaskalar ve Hititler'in hakim oldu\u011fu savunulmaktad\u0131r.Bart\u0131n ve Karadeniz'in antik kentlerinden olan Amasra'n\u0131n; 4000 y\u0131ll\u0131k tarihinde,uzun s\xfcre ayr\u0131 d\xf6nemler ya\u015fad\u0131klar\u0131, zaman zaman da ayn\u0131 kaderi payla\u015ft\u0131klar\u0131 g\xf6r\xfclmektedir.Bart\u0131n'\u0131n ilk sahipleri, M.\xd6. 14.Yy'.da Gaskalar ve 13. Yy'.da Hititler'dir.M.\xd6. 12. yy. ba\u015flar\u0131nda Bart\u0131n Bithinya; Amasra Paphlagonya s\u0131n\u0131rlar\u0131 i\xe7inde yer alm\u0131\u015f;   12. Yy. sonlar\u0131nda ise, Bart\u0131n  Friglerin, Amasra Fenikelilerin eline ge\xe7mi\u015ftir. Devam\u0131 Bart\u0131n Belediyesi web sitesinde","Ardahan kentinin kurulu\u015fu yayg\u0131n bir efsaneye dayan\u0131r. G\xfcrc\xfc tarih\xe7i Leonti Mroveli\u2019nin Kartlis Tshovreba adl\u0131 G\xfcrc\xfc tarihinde aktard\u0131\u011f\u0131 rivayete g\xf6re Mtshetos\u2019un o\u011flu Cavahos Tsunda ve Ardahan kentlerini kurmu\u015ftur. Ancak kurulu\u015fu s\u0131ras\u0131nda Ardahan\u2019\u0131n ad\u0131 Kacta Kalaki\u2019ydi (\u015eeytan \u015eehri). Kacta Kalaki daha sonra Huri ad\u0131n\u0131 alm\u0131\u015ft\u0131.[9] G\xfcrc\xfcce kaynaklarda Artaani ad\u0131 sadece b\xf6lgeyi adland\u0131rmak i\xe7in kullan\u0131l\u0131yordu. Ba\u015flang\u0131\u015f\xe7a Kacta Kalaki, Huri olarak adland\u0131r\u0131lan yerle\u015fim birimine daha ge\xe7 tarihlerde Artaani denmi\u015ftir. 16. y\xfczy\u0131l\u0131n sonlar\u0131nda, Osmanl\u0131lar\u0131n G\xfcrc\xfclerden ele ge\xe7irdi\u011fi topraklar\u0131n erken d\xf6nem tahriri olan 1595 tarihli Defter-i Mufassal-i Vilayet-i G\xfcrcistan\u2019da da y\xf6netim merkezinin ad\u0131 Ardahan de\u011fildi. Ardahan-i B\xfcz\xfcrg (B\xfcy\xfck Ardahan) olarak kaydedilen livan\u0131n (sancak) idari merkezinin ad\u0131 Parakan (Rabat-i Kale-i Parakan; \u0631\u0628\u0627\u0637 \u0642\u0644\u0639\u0647 \u067e\u0631\u0647\u0643\u0646) idi.[10] Parakan B\xfcy\xfck Ardahan livas\u0131n\u0131n en \xf6nemli kale-kentiydi. Parakan ya da Parakani ad\u0131 \xfcnl\xfc G\xfcrc\xfc tarihi Kartlis Tshovreba\u2019da da ge\xe7mektedir. Osmanl\u0131lar 16. y\xfczy\u0131lda G\xfcrc\xfc atabegleri y\xf6netimi alt\u0131ndaki Samtshe-Saatabago kar\u015f\u0131 a\xe7t\u0131klar\u0131 sava\u015fta \xf6nce Ardanu\xe7\u2019u (Artanuci), sonra da Parakan\u2019\u0131 (Parakani) ele ge\xe7irdiler. Parakan Kalesi'nin ele ge\xe7irdikten sonra Osmanl\u0131lar b\xfct\xfcn Ardahan b\xf6lgesine h\xe2kim oldular. Parakan ad\u0131 ayr\u0131ca Evliye \xc7elebi ile K\xe2tib \xc7elebi\u2019nin eserlerinde de ge\xe7mektedir.Devam\u0131 Wikipedia'da","I\u011fd\u0131r'da yap\u0131lan arkeolojik \xe7al\u0131\u015fmalar b\xf6lgede ya\u015fam\u0131n \xe7ok \xf6ncelerde ba\u015flad\u0131\u011f\u0131n\u0131 ve b\xf6lgenin bir\xe7ok uygarl\u0131\u011fa ev sahipli\u011fi yapt\u0131\u011f\u0131n\u0131 g\xf6stermektedir.M\xd6 5000-4000 y\u0131llar\u0131nda bug\xfcnk\xfc Azerbaycan S\xfcrmeli \xc7ukuru ve Do\u011fu Anadolu'da yerle\u015fen Hurrilerden sonra; Mittaniler, Hititler, Asurlular, Kimmerler, Medler, Persler, S\xfcmerliler ve Subailer gibi kavimlerin Orta Asya'dan gelerek b\xf6lgeye yerle\u015fti\u011fi bilinmektedir.M\xd6 900-MS 600 tarihlerinde kraliyet merkezi Van'da bulunan ve t\xfcm Do\u011fu Anadolu B\xf6lgesi'ni idaresi alt\u0131nda tutan Urartu Krall\u0131\u011f\u0131'n\u0131n kendisine ba\u011fl\u0131 kurdu\u011fu k\xfc\xe7\xfck beyliklerden biri de S\xfcrmeli ad\u0131yla bilinen Karakale \u015fehridir. 149 y\u0131llar\u0131nda Bulgar T\xfcrkleri olan Arsakl\u0131 g\xf6\xe7ebeler, Sakalar'\u0131 yenip Karakale'yi bir kraliyet merkezi yapt\u0131lar. 224 y\u0131l\u0131na kadar Urartular'la s\u0131k s\u0131k el de\u011fi\u015ftirerek Arsakl\u0131lar'\u0131n egemenli\u011finde kalan b\xf6lgelerdeki Roma halklar\u0131 da Arsakl\u0131lar'\u0131n egemenli\u011fini kabul etti. I\u011fd\u0131r ve \xe7evresinde 660 y\u0131llar\u0131nda atl\u0131 g\xf6\xe7ebe halinde ya\u015fayan Saka T\xfcrkleri'nin Kafkaslar'\u0131 a\u015farak b\xf6lgeye gelmesiyle, Urartu egemenli\u011fi son buldu. 226-651 tarihlerinde bug\xfcnk\xfc \u0130ran ve Do\u011fu Anadolu'da h\xfck\xfcm s\xfcren Sasaniler, 645 y\u0131l\u0131na kadar I\u011fd\u0131r ve \xe7evresini elinde tuttular. B\xf6lge 2 y\u0131ll\u0131\u011f\u0131na Bizansl\u0131lar'\u0131n egemenli\u011fine ge\xe7tiyse de M\xfcsl\xfcmanlar b\xf6lgeyi tekrar ele ge\xe7irdiler. Devam\u0131 Wikipedia'da","B\xf6lgedeki ilk yerle\u015fimler prehistorik \xe7a\u011flarda M.\xd6. 3000 y\u0131llar\u0131ndad\u0131r. Bitinya ad\u0131yla bilinen antik b\xf6lgede M.\xd6. 2000'lerde Hititler, M\xd6 1200'lerde Frigler hakimiyet kurdular. Pers egemenli\u011fi alt\u0131nda kalan b\xf6lge de M\xd6 5. y\xfczy\u0131l\u0131n ortalar\u0131ndan itibaren Bitinyal\u0131 hanedanlar hakimiyet kurmaya ba\u015flam\u0131\u015f ve M\xd6 3. y\xfczy\u0131lda ba\u011f\u0131ms\u0131z Bitinya Krall\u0131\u011f\u0131' n\u0131 kurmu\u015flard\u0131r. Yalova' da bu krall\u0131\u011f\u0131n topraklar\u0131nda kalm\u0131\u015ft\u0131r. Yalova'n\u0131n da i\xe7erisinde oldu\u011fu b\xf6lge M\xd6 74'te Romal\u0131lar' \u0131n denetimine girdi. Roma \u0130mparatorlu\u011fu'nun 395 y\u0131l\u0131ndaki b\xf6l\xfcnmesinden sonra Yalova Bizans \u0130mparatorlu\u011fu'nun y\xf6netimine ge\xe7ti. 1302'de Yalova civar\u0131nda Bafeus Muharebesi ger\xe7ekle\u015fti. Yalova ve \xe7evresi 1326 y\u0131l\u0131nda Osmanl\u0131 \u0130mparatorlu\u011fu'nun kontrol\xfcne ge\xe7ti.16. y\xfczy\u0131l Osmanl\u0131 idari te\u015fkilatlanmas\u0131na g\xf6re Yalova, H\xfcdavendig\xe2r Eyaleti' ne ba\u011fl\u0131 bir kaza merkeziydi. Evliya \xc7elebi seyahatnamesinde Yalova'y\u0131; 700 evi, yedi camisi, \xfc\xe7 han\u0131, bir hamam\u0131, k\u0131rk-elli kadar d\xfckkan\u0131 bulunan bir yerle\u015fim olarak anlatm\u0131\u015ft\u0131r. 25 May\u0131s 1719 y\u0131l\u0131nda meydana gelen depremde yerle\u015fim b\xfcy\xfck tahribata u\u011frad\u0131. 18. y\xfczy\u0131l sonlar\u0131nda Yalova, \u0130zmit Sanca\u011f\u0131' n\u0131n Karam\xfcrsel kazas\u0131na ba\u011fl\u0131 bir nahiye konumundayd\u0131. 10 Temmuz 1894 y\u0131l\u0131 depreminde yerle\u015fimde b\xfcy\xfck tahribat ya\u015fad\u0131. 7 A\u011fustos 1920 y\u0131l\u0131nda ba\u015flayan Yunan hakimiyeti 19 Temmuz 1921 tarihine kadar s\xfcrd\xfc. 1927 y\u0131l\u0131nda belediye olan Yalova, 2 Aral\u0131k 1929 y\u0131l\u0131nda \xe7\u0131kar\u0131lan kanunla \u0130stanbul iline ba\u011fl\u0131 bir kaza merkezi oldu. 1935 y\u0131l\u0131 n\xfcfus say\u0131m\u0131nda 2635 n\xfcfusa sahip olan yerle\u015fim, kapl\u0131calar sayesinde h\u0131zl\u0131 bir geli\u015fim yakalad\u0131[3]. 6 Haziran 1995 tarihinde ayn\u0131 adla kurulan ilin merkez il\xe7esi oldu[4]. 17 A\u011fustos 1999 y\u0131l\u0131nda meydana gelen 1999 G\xf6lc\xfck depremi nde Yalova \u015fehri de b\xfcy\xfck tahribata u\u011frad\u0131.Mustafa Kemal Atat\xfcrk ya\u015fam\u0131n\u0131n son b\xf6l\xfcm\xfcnde ara s\u0131ra Yalova'y\u0131 ziyaret etmi\u015f ve Y\xfcr\xfcyen K\xf6\u015fk'te dinlenmi\u015ftir. Bir konu\u015fmas\u0131nda Yalova benim kentimdir. \u015feklinde \u015fehre olan sevgisini dile getirmi\u015ftir.","Safranbolu il\xe7esinin \xd6\u011flebeli K\xf6y\xfcne ba\u011fl\u0131 13 haneli bir  k\xf6yalt\u0131 yerle\u015fim birimi olan Karab\xfck, Ankara - Zonguldak Demiryolu \xfczerinde  k\xfc\xe7\xfck bir istasyon konumunda iken, sanayile\u015fme ile birlikte \xf6nemli bir merkez  haline gelmi\u015ftir.3 Nisan 1937\u2019de temeli at\u0131lan Karab\xfck Demir \xc7elik  Fabrikalar\u0131 6 Haziran 1939\u2019da faaliyete ge\xe7mi\u015ftir. Buna paralel olarak n\xfcfus  yo\u011funlu\u011funun artmaya ba\u015flad\u0131\u011f\u0131 Karab\xfck'te 25 Haziran 1939\u2019da belediye te\u015fkilat\u0131  kurulmu\u015ftur. 1941 y\u0131l\u0131nda Safranbolu il\xe7esine ba\u011fl\u0131 bucak olan Karab\xfck 3 Mart  1953 tarihinde 6068 say\u0131l\u0131 kanunla Zonguldak \u0130line ba\u011fl\u0131 bir il\xe7e haline  gelmi\u015ftir. Karab\xfck, 6 Haziran 1995 g\xfcn ve 22305 say\u0131l\u0131 Resmi Gazetede  yay\u0131nlanan 550 say\u0131l\u0131 Kanun H\xfckm\xfcnde Kararname ile \xc7ank\u0131r\u0131\u2019dan; Ovac\u0131k ve  Eskipazar il\xe7eleri ile Zonguldak\u2019tan; Eflani, Safranbolu ve Yenice il\xe7elerinin  birle\u015ftirilmesiyle T\xfcrkiye\u2019nin 78. \u0130li olmu\u015ftur.","Kilis Akdeniz B\xf6lgesinden G\xfcney Do\u011fu Anadolu B\xf6lgene ge\xe7i\u015f alan\u0131nda ve Suriye ile kom\u015fu bir s\u0131n\u0131r kentidir. M.\xd6. 1700 y\u0131llar\u0131nda Kilis, Hitit Devletinin \xf6nemli kentlerinden biriydi. Kilis\u2019 in Kuzey Bat\u0131s\u0131ndaki YESEMEK, Hititlerin Heykel at\xf6lyesinin bulundu\u011fu \xf6nemli bir merkezidir ki, d\xfcnyada bu t\xfcrden tek \xf6rnektir. Kilis M.\xd6.  700 ile 550 y\u0131llar\u0131 aras\u0131nda Asur, Med, Pers \u0130mparatorluklar\u0131 y\xf6netiminde kalm\u0131\u015ft\u0131r.B\xfcy\xfck \u0130skender\u2019 in Pers Devletini y\u0131kmas\u0131ndan sonra, Roma \u0130mparatorlu\u011funa ba\u011flanm\u0131\u015ft\u0131r. Bu \u0130mparatorlu\u011fun b\xf6l\xfcnmesinden M.S. 636 y\u0131l\u0131na kadar Bizans \u0130mparatorlu\u011fu\u2019 nun bir kenti olmu\u015ftur.Kilis H.z. \xd6mer zaman\u0131nda \u0130slam toplulu\u011funa kat\u0131lm\u0131\u015f 639 y\u0131l\u0131nda \xf6nemli bir Roma (Bizans) kalesi olan RAVANDA Kalesi ile birlikte sava\u015fs\u0131z al\u0131nm\u0131\u015ft\u0131r. B\xf6lgede ya\u015fayan T\xfcrkler O\u011fuzlar soyundand\u0131r. Y\xf6resel olarak bunlara T\xfcrkmen denilir. 1071 Malazgirt sava\u015f\u0131ndan sonra B\xf6lgede Sel\xe7uklu \u0130mparatorlu\u011funa ba\u011fl\u0131 bir T\xfcrk Devleti kurulmu\u015ftur. 1084\u2019 ten sonra Kils ve y\xf6resine T\xfcrk Bey ve Oymak\u2019 lar\u0131 yerle\u015ftirilmi\u015ftir.Kilis 1818 y\u0131l\u0131nda b\xfcy\xfck bir kurakl\u0131k, 1820\u2019 lerde bir deprem, 1826\u2019 da veba salg\u0131n\u0131 ge\xe7irmi\u015f, 1831\u2019 de M\u0131s\u0131rl\u0131 \u0130brahim Pa\u015fa Ermenilerle halk aras\u0131nda etkili bir sava\u015f olmu\u015f, bu arda k\u0131tl\u0131k, bula\u015f\u0131c\u0131 hastal\u0131klar, \xe7ekirge sald\u0131r\u0131s\u0131 gibi afetlerden son derece etkilenmi\u015ftir.1915 y\u0131l\u0131nda Osmanl\u0131 Devletinin yenik d\xfc\u015fmesine kar\u015f\u0131n, \xf6nce \u0130ngilizler\u2019 in, sonra Frans\u0131zlar\u2019 \u0131n istilas\u0131na u\u011fram\u0131\u015ft\u0131r. 7 Aral\u0131k 1921 y\u0131l\u0131nda D\xfc\u015fman \u0130\u015fgalinden kurtulmu\u015ftur.","\xc7ukurova ilk \xe7a\u011flardan itibaren \xe7e\u015fitli uygarl\u0131klara (Hitit, Pers, Roma) be\u015fiklik yapm\u0131\u015ft\u0131r. Co\u011frafi ve stratejik konumu itibar\u0131yla yerle\u015fmeye m\xfcsait olan Osmaniye, Do\u011fu Anadolu'nun giri\u015f kap\u0131s\u0131 durumundad\u0131r. Orta Do\u011fu \xfclkeleri ile ba\u011flant\u0131 sa\u011flayan yol \xfczerindedir. \u0130pek ticaret yolunun da bu b\xf6lgeden ge\xe7mesi b\xf6lgenin \xf6nemini art\u0131rm\u0131\u015ft\u0131r. \xd6zellikle \u0130lk \xc7a\u011flarda ge\xe7imlerini korsanl\u0131kla sa\u011flayan kavimler Nur Da\u011flar\u0131 \xfczerine yerle\u015fmi\u015flerdir. \u0130sos Liman\u0131na gelen ve Akdeniz de seyreden ticaret gemilerini soyan korsanlar Nur Da\u011flar\u0131nda bar\u0131nm\u0131\u015flard\u0131r.Anadolu'ya T\xfcrk ak\u0131nlar\u0131 Abbasi Halifesi Harun Re\u015fit zaman\u0131nda yap\u0131ld\u0131. T\xfcrklerden Hassa Ordular\u0131 kuran Harun Re\u015fit, Anadolu seferlerini Abbasi Ordular\u0131yla beraber T\xfcrk askerlerine yapt\u0131rm\u0131\u015ft\u0131r. B\xf6lgede, eski ad\u0131yla Haruniye, \u015fimdiki ad\u0131yla D\xfczi\xe7i olan il\xe7ede Harun Re\u015fit Kalesi olarak an\u0131lan bir kale h\xe2l\xe2 varl\u0131\u011f\u0131n\u0131 s\xfcrd\xfcrmektedir. Anadolu'ya gelen T\xfcrkler bu b\xf6lgeleri iklim ve co\u011frafi \u015fekil olarak ilk anayurtlar\u0131 Orta Asya\u2019ya \xe7ok benzedi\u011fini g\xf6rd\xfcler. Anadolu'da yurt edinecekleri yerleri ke\u015ffetmeye ba\u015flad\u0131lar. Devam\u0131 Wikipedia'da","D\xfczce\u2019nin tarihi, M\xd6 1390-800 y\u0131llar\u0131 aras\u0131nda h\xfck\xfcm s\xfcren Hititler'e kadar uzan\u0131r. Orhan Gazi\u2019nin komutanlar\u0131ndan Konuralp Bey\u2019in Bizans Tekfurlar\u0131 ile 1323\u2019te yapt\u0131\u011f\u0131 sava\u015flar sonucu Osmanl\u0131 topraklar\u0131na kat\u0131lan D\xfczce, 1869 y\u0131l\u0131na kadar Kastamonu Vilayeti Bolu Mutasarr\u0131fl\u0131\u011f\u0131, G\xf6yn\xfck Kasabas\u0131\u2019na ba\u011fl\u0131 bir bucak olarak tarihte yer alm\u0131\u015ft\u0131r. 1869 veya 1870 y\u0131l\u0131nda Bolu Sanca\u011f\u0131\u2019na ba\u011fl\u0131 Kaza olmu\u015ftur. 1999 y\u0131l\u0131na kadar il\xe7e olan D\xfczce 1999 G\xf6lc\xfck depremi ve 1999 D\xfczce depreminin ard\u0131ndan d\xf6nemin 57. T\xfcrkiye H\xfck\xfbmeti taraf\u0131ndan TBMM'de al\u0131nan il stat\xfcs\xfc verilme karar\u0131 ile ve 9. T\xfcrkiye cumhurba\u015fkan\u0131 S\xfcleyman Demirel'in onay\u0131 ile il stat\xfcs\xfc verilmi\u015ftir."],t.s)
